insert into parks () values    
  ("abli","Abraham Lincoln Birthplace National Historical Park","https://www.nps.gov/abli/index.htm","For over a century people from around the world have come to rural Central Kentucky to honor the humble beginnings of our 16th president, Abraham Lincoln. His early life on Kentucky's frontier shaped his character and prepared him to lead the nation through Civil War. Visit our country's first memorial to Lincoln, built with donations from young and old, and the site of his childhood home.","Hodgenville, Kentucky"),
  ("acad","Acadia National Park","https://www.nps.gov/acad/index.htm","Acadia National Park protects the natural beauty of the highest rocky headlands along the Atlantic coastline of the United States, an abundance of habitats, and a rich cultural heritage. At 4 million visits a year, it's one of the top 10 most-visited national parks in the United States. Visitors enjoy 27 miles of historic motor roads, 158 miles of hiking trails, and 45 miles of carriage roads.","Bar Harbor, Maine"),
  ("adam","Adams National Historical Park","https://www.nps.gov/adam/index.htm","From the sweet little farm at the foot of Penn’s Hill to the gentleman’s country estate at Peace field, Adams National Historical Park is the story of “heroes, statesman, philosophers … and learned women” whose ideas and actions helped to transform thirteen disparate colonies into one united nation.","Quincy, Massachusetts"),
  ("afam","African American Civil War Memorial","https://www.nps.gov/afam/index.htm","Over 200,000 African-American soldiers and sailors served in the U.S. Army and Navy during the Civil War. Their service helped to end the war and free over four million slaves. The African American Civil War Memorial honors their service and sacrifice.","Washington, D.C., Washington, D.C."),
  ("afbg","African Burial Ground National Monument","https://www.nps.gov/afbg/index.htm","African Burial Ground is the oldest and largest known excavated burial ground in North America for both free and enslaved Africans. It protects the historic role slavery played in building New York","New York City, New York"),
  ("agfo","Agate Fossil Beds National Monument","https://www.nps.gov/agfo/index.htm","In the early 1900s, paleontologists unearthed the Age of Mammals when they found full skeletons of extinct Miocene mammals in the hills of Nebraska -- species previously only known through fragments. At the same time, an age of friendship began between rancher James Cook and Chief Red Cloud of the Lakota. These two unprecedented events are preserved and protected here... at Agate Fossil Beds.","Harrison, Nebraska"),
  ("alka","Ala Kahakai National Historic Trail","https://www.nps.gov/alka/index.htm","Established in 2000 to preserve, protect and interpret traditional Native Hawaiian culture and natural resources, Ala Kahakai National Historic Trail is a 175 mile corridor encompassing a network of culturally and historically significant trails. This 'trail by the sea' traverses wahi pana (storied landscapes), ancient Hawaiian sites and over 200 ahupuaʻa (traditional land divisions). Connect now!","Hawaiian Ocean View, Hawaii"),
  ("alag","Alagnak Wild River","https://www.nps.gov/alag/index.htm","The headwaters of Alagnak Wild River lie within the rugged Aleutian Range of neighboring Katmai National Park and Preserve. Meandering west towards Bristol Bay and the Bering Sea, the Alagnak traverses the beautiful Alaska Peninsula, providing an unparalleled opportunity to experience the unique wilderness, wildlife, and cultural heritage of southwest Alaska.","Dillingham, Alaska"),
  ("anch","Alaska Public Lands","https://www.nps.gov/anch/index.htm","Alaska’s parks, forests, and refuges are rich and varied. The Alaska Public Lands Information Centers help visitors and residents to have meaningful, safe, enjoyable experiences on public lands, and encourages them to sustain the natural and cultural resources of Alaska. These centers provide trip-planning, interpretation, and education for all ages.","Anchorage, Alaska"),
  ("alca","Alcatraz Island","https://www.nps.gov/alca/index.htm","Alcatraz reveals stories of American incarceration, justice, and our common humanity. This small island was once a fort, a military prison, and a maximum security federal penitentiary. In 1969, the Indians of All Tribes occupied Alcatraz for 19 months in the name of freedom and Native American civil rights. We invite you to explore Alcatraz's complex history and natural beauty.","San Francisco, California"),
  ("aleu","Aleutian Islands World War II National Historic Area","https://www.nps.gov/aleu/index.htm","During World War II the remote Aleutian Islands, home to the Unangax̂ (Aleut) people for over 8,000 years, became a fiercely contested battleground in the Pacific. This thousand-mile-long archipelago saw invasion by Japanese forces, the occupation of two islands; a mass relocation of Unangax̂ civilians; a 15-month air war; and one of the deadliest battles in the Pacific Theater.","Dutch Harbor, Alaska"),
  ("alfl","Alibates Flint Quarries National Monument","https://www.nps.gov/alfl/index.htm","13,000 years ago, this site was well-known by mammoth hunters as a source of flint for tools. Centuries passed, but the colorful flint never lost its value or usefulness in the Texas Panhandle. Learn how important this site was to the survival, commerce and culture of the people of the High Plains.","Fritch, Texas"),
  ("alpo","Allegheny Portage Railroad National Historic Site","https://www.nps.gov/alpo/index.htm","The first railroad to circumvent the Allegheny Mountains, the Allegheny Portage Railroad was the finishing piece of the Pennsylvania Main Line Canal. 'The Portage' opened in 1834, marking the first time that there was one, direct route between Philadelphia and Pittsburgh. All things to all people, it served merchants, passengers, slaves in pursuit of freedom, and soldiers from the Mexican War.","Cresson, Pennsylvania"),
  ("amch","Amache National Historic Site","https://www.nps.gov/amch/index.htm","Amache, also known as the Granada Relocation Center, near Granada, Colorado was one of ten incarceration sites established by the War Relocation Authority during World War II to unjustly incarcerate Japanese Americans. Over 10,000 people, most American citizens, were incarcerated at Amache from 1942-1945. Amache - a place to reflect, recommit, and further the pursuit of freedom and justice.","Lamar, Colorado"),
  ("amme","American Memorial Park","https://www.nps.gov/amme/index.htm","American Memorial Park honors the American and Marianas people who gave their lives during the Marianas Campaign of World War II. At the park, memorials stand in tribute to the courage and sacrifice of the US Servicemen and Chamorro and Carolinian civilians who were killed in the battles between the United States and Japan that took place on Saipan, Tinian, and the Philippine Sea in 1944.","Saipan, Saipan"),
  ("amis","Amistad National Recreation Area","https://www.nps.gov/amis/index.htm","An oasis in the desert, Amistad National Recreation Area consists of the US portion of the International Amistad Reservoir. Amistad, whose name comes from the Spanish word meaning friendship, is best known for excellent water-based recreation, camping, hiking, rock art viewing, and its rich cultural history. Amistad is also home to a wide variety of plant and animal life above and below the water.","Cienegas Terrace, Texas"),
  ("anac","Anacostia Park","https://www.nps.gov/anac/index.htm","Welcome to Anacostia Park, your neighborhood national park in the heart of Washington, DC! Enjoy exercise along the river trail or relax by the water, Anacostia Park is a breath of fresh air and a space to unwind amid a bustling city.","Silver Hill, Maryland"),
  ("ande","Andersonville National Historic Site","https://www.nps.gov/ande/index.htm","Nearly 13,000 men died on these grounds, a site that became infamous even before the Civil War ended. Their burial grounds became Andersonville National Cemetery, where veterans continue to be buried today. This place, where tens of thousands suffered captivity so others could be free, is also home to the National Prisoner of War Museum and serves as a memorial to all American prisoners of war.","Oglethorpe, Georgia"),
  ("anjo","Andrew Johnson National Historic Site","https://www.nps.gov/anjo/index.htm","Andrew Johnson's complex presidency (1865-69) illustrates the Constitution at work following the Civil War. As the President and Congress disagreed on Reconstruction methods, the Constitution served as their guide on balance of powers, vetoes, and impeachment. In the end, it evolved as a living document with pivotal amendments on freedom, citizenship, and voting rights - topics still vital today.","Greeneville, Tennessee"),
  ("ania","Aniakchak National Monument & Preserve","https://www.nps.gov/ania/index.htm","Given its remote location and challenging weather conditions, Aniakchak is one of the most wild and least visited places in the National Park System. This landscape is a vibrant reminder of Alaska's location in the volcanically active 'Ring of Fire,' as it is home to an impressive six mile (10 km) wide, 2,500 ft (762 m) deep caldera formed during a massive volcanic eruption 3,500 years ago.","Dillingham, Alaska"),
  ("anti","Antietam National Battlefield","https://www.nps.gov/anti/index.htm","23,000 soldiers were killed, wounded or missing after twelve hours of savage combat on September 17, 1862. The Battle of Antietam ended the Confederate Army of Northern Virginia's first invasion into the North and led Abraham Lincoln to issue the preliminary Emancipation Proclamation.","Keedysville, Maryland"),
  ("apis","Apostle Islands National Lakeshore","https://www.nps.gov/apis/index.htm","Imagine that moment, being in that perfect spot as the sun rises, and everything comes into focus. A rocky shoreline suddenly reflects the world around you. Waiting for you among the water, land, forests, and history is that moment. How will the islands inspire you?","Washburn, Wisconsin"),
  ("appa","Appalachian National Scenic Trail","https://www.nps.gov/appa/index.htm","The Appalachian Trail is a 2,180+ mile long public footpath that traverses the scenic, wooded, pastoral, wild, and culturally resonant lands of the Appalachian Mountains. Conceived in 1921, built by private citizens, and completed in 1937, today the trail is managed by the National Park Service, US Forest Service, Appalachian Trail Conservancy, numerous state agencies and thousands of volunteers.","Fredericksburg, Pennsylvania"),
  ("apco","Appomattox Court House National Historical Park","https://www.nps.gov/apco/index.htm","On April 9, 1865, the surrender of the Army of Northern Virginia in the McLean House in the village of Appomattox Court House, Virginia signaled the end of the nation's largest war. Two important questions about its future were answered. Could the nation survive a civil war intact, and would that nation exist without slavery? The answer to both was yes and a new nation was born.","Appomattox, Virginia"),
  ("arch","Arches National Park","https://www.nps.gov/arch/index.htm","Discover a landscape of contrasting colors, land forms, and textures unlike any other. The park has over 2,000 natural stone arches, hundreds of soaring pinnacles, massive rock fins, and giant balanced rocks. This red-rock wonderland will amaze you with its formations, refresh you with its trails, and inspire you with its sunsets.","Moab, Utah"),
  ("arpo","Arkansas Post National Memorial","https://www.nps.gov/arpo/index.htm","Located at the confluence of two rivers, Arkansas Post has served as a gathering place for many cultures throughout human history - it represents cultural cooperation, conflict, synthesis, and diversity.","Pea Ridge, Arkansas"),
  ("arho","Arlington House, The Robert E. Lee Memorial","https://www.nps.gov/arho/index.htm","Arlington House is the nation’s memorial to Robert E. Lee. It honors him for specific reasons, including his role in promoting peace and reunion after the Civil War. In a larger sense it exists as a place of study and contemplation of the meaning of some of the most difficult aspects of American history: military service; sacrifice; citizenship; duty; loyalty; slavery and freedom.","Arlington, Virginia"),
  ("asis","Assateague Island National Seashore","https://www.nps.gov/asis/index.htm","Want to live on the edge? Visit a place recreated each day by ocean wind and waves. Life on Assateague Island has adapted to an existence on the move. Explore sandy beaches, salt marshes, maritime forests and coastal bays. Rest, relax, recreate and enjoy some time on the edge of the continent.","Chincoteague, Virginia"),
  ("azru","Aztec Ruins National Monument","https://www.nps.gov/azru/index.htm","Pueblo people describe this site as part of their migration journey. Today you can follow their ancient passageways to a distant time. Explore a 900-year old ancestral Pueblo Great House of over 400 masonry rooms. Look up and see original timbers holding up the roof. Search for the fingerprints of ancient workers in the mortar. Listen for an echo of ritual drums in the reconstructed Great Kiva.","Aztec, New Mexico"),
  ("badl","Badlands National Park","https://www.nps.gov/badl/index.htm","The rugged beauty of the Badlands draws visitors from around the world. These striking geologic deposits contain one of the world’s richest fossil beds. Ancient horses and rhinos once roamed here. The park’s 244,000 acres protect an expanse of mixed-grass prairie where bison, bighorn sheep, prairie dogs, and black-footed ferrets live today.","Porcupine, South Dakota"),
  ("bawa","Baltimore-Washington Parkway","https://www.nps.gov/bawa/index.htm","This 29-mile highway connects Baltimore, MD and Washington, D.C. The parkway has carried visitors to and from the capital city since 1954.","Greenbelt, Maryland"),
  ("band","Bandelier National Monument","https://www.nps.gov/band/index.htm","Bandelier National Monument protects over 33,000 acres of rugged but beautiful canyon and mesa country as well as evidence of a human presence here going back over 11,000 years. Petroglyphs, dwellings carved into the soft rock cliffs, and standing masonry walls pay tribute to the early days of a culture that still survives in the surrounding communities.","Los Alamos, New Mexico"),
  ("bepa","Belmont-Paul Women's Equality National Monument","https://www.nps.gov/bepa/index.htm","Home to the National Woman's Party for more than 90 years, this was the epicenter of the struggle for women's rights. From this house in the shadow of the U.S. Capitol and Supreme Court, Alice Paul and the NWP developed innovative strategies and tactics to advocate for the Equal Rights Amendment and equality for women. President Barack Obama designated the national monument on April 12, 2016.","Washington, D.C., Washington, D.C."),
  ("beol","Bent's Old Fort National Historic Site","https://www.nps.gov/beol/index.htm","Bent's Old Fort National Historic Site features a reconstructed 1840s adobe fur trading post on the mountain branch of the Santa Fe Trail where traders, trappers, travelers, and the Cheyenne and Arapaho tribes came together in peaceful terms for trade. Today, living historians recreate the sights, sounds, and smells of the past with guided tours, demonstrations and special events.","La Junta, Colorado"),
  ("bela","Bering Land Bridge National Preserve","https://www.nps.gov/bela/index.htm","Bering Land Bridge National Preserve lies at the continental crossroad that greatly influenced the distribution of life in the Western Hemisphere during the Pleistocene Epoch. It is a vital landscape for indigenous communities who depend on the land just as their ancestors did for many generations. It is a wild and ecologically healthy landscape unlike any other.","Nome, Alaska"),
  ("bibe","Big Bend National Park","https://www.nps.gov/bibe/index.htm","There is a place in Far West Texas where night skies are dark as coal and rivers carve temple-like canyons in ancient limestone. Here, at the end of the road, hundreds of bird species take refuge in a solitary mountain range surrounded by weather-beaten desert. Tenacious cactus bloom in sublime southwestern sun, and diversity of species is the best in the country. This magical place is Big Bend...","Alpine, Texas"),
  ("bicy","Big Cypress National Preserve","https://www.nps.gov/bicy/index.htm","The freshwaters of the Big Cypress Swamp, essential to the health of the neighboring Everglades, support the rich marine estuaries along Florida's southwest coast. Conserving over 729,000 acres of this vast swamp, Big Cypress National Preserve contains a mixture of tropical and temperate plant communities that are home to diverse wildlife, including the Endangered Florida panther.","Immokalee, Florida"),
  ("biho","Big Hole National Battlefield","https://www.nps.gov/biho/index.htm","On August 9, 1877 gun shots shattered a chilly dawn on a sleeping camp of Nez Perce. By the time the smoke cleared on August 10, almost 90 Nez Perce were dead along with 31 soldiers and volunteers. Big Hole National Battlefield was created to honor all who were there.","Salmon, Idaho"),
  ("biso","Big South Fork National River & Recreation Area","https://www.nps.gov/biso/index.htm","Encompassing 125,000 acres of the Cumberland Plateau, Big South Fork National River and Recreation Area protects the free-flowing Big South Fork of the Cumberland River and its tributaries. The area boasts miles of scenic gorges and sandstone bluffs, is rich with natural and historic features and has been developed to provide visitors with a wide range of outdoor recreational activities.","Oneida, Tennessee"),
  ("bith","Big Thicket National Preserve","https://www.nps.gov/bith/index.htm","Life of all types abounds in the Big Thicket. This national preserve protects the incredible diversity of life found where multiple habitats meet in southeast Texas. Hiking trails and waterways meander through nine different ecosystems, from longleaf pine forests to cypress-lined bayous. It is a place of discovery, a place to wander and explore, a place to marvel at the richness of nature.","Wildwood, Texas"),
  ("bica","Bighorn Canyon National Recreation Area","https://www.nps.gov/bica/index.htm","The vast, wild landscape of Bighorn Canyon National Recreation Area offers visitors unparalleled opportunities to immerse themselves in the natural world, and experience the wonders of this extraordinary place. With over 120,000 acres, one can find an astounding diversity in ecosystems, wildlife, and more than 10,000 years of human history to explore.","Lovell, Wyoming"),
  ("bicr","Birmingham Civil Rights National Monument","https://www.nps.gov/bicr/index.htm","In 1963, images of snarling police dogs unleashed against non-violent protesters and of children being sprayed with high-pressure hoses appeared in print and television news around the world. These dramatic scenes of violent police aggression against civil rights protesters in Birmingham, Alabama were vivid examples of segregation and racial injustice in America.","Birmingham, Alabama"),
  ("bisc","Biscayne National Park","https://www.nps.gov/bisc/index.htm","Within sight of Miami, yet worlds away, Biscayne protects a rare combination of aquamarine waters, emerald islands, and fish-bejeweled coral reefs. Evidence of 10,000 years of human history is here too; from prehistoric tribes to shipwrecks, and pineapple farmers to presidents. For many, the park is a boating, fishing, and diving destination, while others enjoy a warm breeze and peaceful scenery.","Lakes by the Bay, Florida"),
  ("blca","Black Canyon Of The Gunnison National Park","https://www.nps.gov/blca/index.htm","Big enough to be overwhelming, still intimate enough to feel the pulse of time, Black Canyon of the Gunnison National Park exposes you to some of the steepest cliffs, oldest rock, and craggiest spires in North America. With two million years to work, the Gunnison River, along with the forces of weathering, has sculpted this vertical wilderness of rock, water, and sky.","Montrose, Colorado"),
  ("blrv","Blackstone River Valley National Historical Park","https://www.nps.gov/blrv/index.htm","The Blackstone River powered America's entry into the Age of Industry. The success of Samuel Slater's cotton spinning mill in Pawtucket, RI touched off a chain reaction that changed how people worked and where they lived, and continues to reverberate across the nation to this day. Come visit and see how this revolution transformed the landscape of the Blackstone Valley and then the United States.","Pawtucket, Rhode Island"),
  ("blsc","Blackwell School National Historic Site","https://www.nps.gov/blsc/index.htm","Built in 1909, the Blackwell School served as a segregated school for the Hispanic population of Marfa, Texas, during the era of de facto segregation from 1889-1965. This site will help preserve and share stories from a time when the practice of “separate but equal” dominated education and social systems in the United States.","not available"),
  ("blri","Blue Ridge Parkway","https://www.nps.gov/blri/index.htm","A Blue Ridge Parkway experience is unlike any other: a slow-paced and relaxing drive revealing stunning long-range vistas and close-up views of the rugged mountains and pastoral landscapes of the Appalachian Highlands. The Parkway meanders for 469 miles, protecting a diversity of plants and animals, and providing opportunities for enjoying all that makes this region of the country so special.","Biltmore Forest, North Carolina"),
  ("blue","Bluestone National Scenic River","https://www.nps.gov/blue/index.htm","The Bluestone River and the rugged and ancient gorge it has carved is a richly diverse and scenic area of the southern Appalachians. Bluestone National Scenic River is preserved as a living landscape that provides an unspoiled experience for visitors and a haven for a variety of plants and animals. The park protects a 10.5-mile section of the Bluestone River in southern West Virginia.","Hinton, West Virginia"),
  ("bowa","Booker T Washington National Monument","https://www.nps.gov/bowa/index.htm","Booker T. Washington was born a slave in April 1856 on the 207-acre farm of James Burroughs. After the Civil War, Washington became the first principal of Tuskegee Normal and Industrial School. Later as an adviser, author and orator, his past would influence his philosophies as the most influential African American of his era. Come explore his birthplace.","North Shore, Virginia"),
  ("boaf","Boston African American National Historic Site","https://www.nps.gov/boaf/index.htm","Centered on the north slope of Beacon Hill, the African American community of 1800s Boston led the city and the nation in the fight against slavery and injustice. These remarkable men and women, together with their allies, were leaders in the Abolition Movement, the Underground Railroad, the Civil War, and the early struggle for equal rights and education. Banner photo credit: Ethi Al-Mahdi","Boston, Massachusetts"),
  ("boha","Boston Harbor Islands National Recreation Area","https://www.nps.gov/boha/index.htm",". . . where you can walk a Civil War-era fort, visit historic lighthouses, explore tide pools, hike lush trails, camp under the stars, or relax while fishing, picnicking or swimming-all within reach of downtown Boston. Youth programs, visitor services, research, wildlife management, and more are coordinated on the park's 34 islands and peninsulas by the Boston Harbor Islands Partnership.","Hull, Massachusetts"),
  ("bost","Boston National Historical Park","https://www.nps.gov/bost/index.htm","Discover how one city could be the Cradle of Liberty, site of the first major battle of American Revolution, and home to many who espoused that freedom can be extended to all.","Boston, Massachusetts"),
  ("brcr","Brices Cross Roads National Battlefield Site","https://www.nps.gov/brcr/index.htm","The Confederate victory at Brices Cross Roads was a significant victory for Major General Nathan Bedford Forrest, but its long term effect on the war proved costly for the Confederates. Brices Cross Roads is an excellent example of winning the battle, but losing the war.","Guntown, Mississippi"),
  ("brvb","Brown v. Board of Education National Historical Park","https://www.nps.gov/brvb/index.htm","The path to equality has been anything but smooth. It's taken courage and dedication by everyday people coming together for a common goal to carry the country toward true equality. Parents, teachers, secretaries, welders, ministers and students drove their communities, and the country along with them, toward justice in a series of often unsteady turns leading to the Brown v. Board Decision.","Topeka, Kansas"),
  ("brca","Bryce Canyon National Park","https://www.nps.gov/brca/index.htm","Hoodoos (irregular columns of rock) exist on every continent, but here is the largest concentration found anywhere on Earth. Situated along a high plateau at the top of the Grand Staircase, the park's high elevations include numerous life communities, fantastic dark skies, and geological wonders that defy description.","Panguitch, Utah"),
  ("buis","Buck Island Reef National Monument","https://www.nps.gov/buis/index.htm","Welcome to Buck Island! Before you come, please watch our 2014 Telly Award winning film 'Caribbean Gem.' Watching this will catch you up on 50+ years of National Park Service protection and civic engagement. Learn what we do every day to preserve this resource for Virgin Islanders and visitors alike. For the General Management Plan and Environmental Compliance, visit the News page.","Saint Croix, Saint Croix Island"),
  ("buff","Buffalo National River","https://www.nps.gov/buff/index.htm","Established in 1972, Buffalo National River flows freely for 135 miles and is one of the few remaining undammed rivers in the lower 48 states. Once you arrive, prepare to journey from running rapids to quiet pools while surrounded by massive bluffs as you cruise through the Ozark Mountains down to the White River.","Harrison, Arkansas"),
  ("cabr","Cabrillo National Monument","https://www.nps.gov/cabr/index.htm","Climbing out of his boat and onto shore in 1542, Juan Rodriguez Cabrillo stepped into history as the first European to set foot on what is now the West Coast of the United States. In addition to telling the story of 16th century exploration, the park is home to a wealth of cultural and natural resources. Join us and embark on your own Voyage of Exploration.","Coronado, California"),
  ("cali","California National Historic Trail","https://www.nps.gov/cali/index.htm","Follow in the footsteps of over 250,000 emigrants who traveled to the gold fields and rich farmlands of California during the 1840s and 1850s: the greatest mass migration in American history. The California National Historic Trail is over 5,000 miles long and covers portions of 10 states. Step into history along more than 1,000 miles of ruts and traces from travelers and their overland wagons.","Lander, Wyoming"),
  ("cane","Camp Nelson National Monument","https://www.nps.gov/cane/index.htm","The US Army established Camp Nelson as a fortified base and supply depot during the Civil War. It became a large recruitment and training center for African American soldiers (USCTs), and a refugee camp for their wives and children, and civilians fleeing war. enslaved people escaped to here with the hope of securing freedom and controlling their futures by aiding in the destruction of slavery.","Nicholasville, Kentucky"),
  ("cana","Canaveral National Seashore","https://www.nps.gov/cana/index.htm","Reflect on the pristine barrier island which is composed of dune, hammock, and lagoon habitat. Explore ancient Timucua shell mounds. Experience the sanctuary that is provided for thousands of species of plants and animals that call Canaveral National Seashore home.","Oak Hill, Florida"),
  ("cari","Cane River Creole National Historical Park","https://www.nps.gov/cari/index.htm","The Cane River region is home to a unique culture; the Creoles. Generations of the same families of owners and workers, enslaved and tenant, lived on these lands for over 200 years. The park tells their stories and preserves the cultural landscape of Oakland and Magnolia Plantations, two of the most intact Creole cotton plantations in the United States.","Vienna Bend, Louisiana"),
  ("cach","Canyon de Chelly National Monument","https://www.nps.gov/cach/index.htm","For nearly 5,000 years, people have lived in these canyons - longer than anyone has lived uninterrupted anywhere on the Colorado Plateau. In the place called Tsegi, their homes and images tell us their stories. Today, Dine' families make their homes, raise livestock, and farm the lands in the canyons. A place like no other, the park and Navajo Nation work together to manage the land's resources.","Tsaile, Arizona"),
  ("cany","Canyonlands National Park","https://www.nps.gov/cany/index.htm","Canyonlands invites you to explore a wilderness of countless canyons and fantastically formed buttes carved by the Colorado River and its tributaries. Rivers divide the park into four districts: Island in the Sky, The Needles, The Maze, and the rivers themselves. These areas share a primitive desert atmosphere, but each offers different opportunities for sightseeing and adventure.","Moab, Utah"),
  ("caco","Cape Cod National Seashore","https://www.nps.gov/caco/index.htm","The great Outer Beach described by Thoreau in the 1800s is protected within the national seashore. Forty miles of pristine sandy beach, marshes, ponds, and uplands support diverse species. Lighthouses, cultural landscapes, and wild cranberry bogs offer a glimpse of Cape Cod's past and continuing ways of life. Swimming beaches and walking and biking trails beckon today's visitors.","Wellfleet, Massachusetts"),
  ("caha","Cape Hatteras National Seashore","https://www.nps.gov/caha/index.htm","The sound of ocean waves, the starry night sky, or the calm of the salt marshes, you can experience it all. Shaped by the forces of water, wind, and storms these islands are ever changing. The plants, wildlife, and people who live here adapt continually. Whether you are enjoying the beach, kayaking the sound, or climbing the Cape Hatteras Lighthouse there is something for everyone to explore!","Buxton, North Carolina"),
  ("came","Cape Henry Memorial Part of Colonial National Historical Park","https://www.nps.gov/came/index.htm","English colonists first landed here in April 1607, erected a wooden cross and gave thanks for a successful crossing to a new land. In 1781, Americans could watch from these same sand dunes the largest naval battle of the Revolutionary War. Our French Allies defeated a British fleet just off this shore to set the stage for General George Washington's victory at Yorktown.","Virginia Beach, Virginia"),
  ("cakr","Cape Krusenstern National Monument","https://www.nps.gov/cakr/index.htm","North of the Arctic Circle, the monument forms 70 miles of shoreline on the Chukchi Sea. More than 114 beach ridges provide evidence of human use for 5,000 years. The Inupiat continue to use the area today. Vast wetlands provide habitat for shorebirds from as far away as South America. Hikers and boaters can see carpets of wildflowers among shrubs containing wisps of qiviut from muskoxen.","Kotzebue, Alaska"),
  ("calo","Cape Lookout National Seashore","https://www.nps.gov/calo/index.htm","A boat ride three miles off-shore brings you to the barrier islands of Cape Lookout National Seashore. Horse watching, shelling, fishing, birding, camping, lighthouse climbing, and touring historic villages--there’s something for everyone at Cape Lookout. Be sure to bring all the food, water, and supplies you need (and carry your trash out of the park) when visiting these remote beaches.","Harkers Island, North Carolina"),
  ("cahi","Capitol Hill Parks","https://www.nps.gov/cahi/index.htm","The Capitol Hill Parks include several park areas east of the U.S. Capitol. Included in this group are Folger, Lincoln, Stanton, and Marion Parks, the Eastern Market and Potomac Avenue Metro stations, and several smaller land parcels such as Seward Square, Twining Square, the Maryland Avenue Triangles, the Pennsylvania Avenue Medians, and 59 inner-city triangles and squares.","Washington, D.C., Washington, D.C."),
  ("care","Capitol Reef National Park","https://www.nps.gov/care/index.htm","Located in south-central Utah in the heart of red rock country, Capitol Reef National Park is a hidden treasure filled with cliffs, canyons, domes, and bridges in the Waterpocket Fold, a geologic monocline (a wrinkle on the earth) extending almost 100 miles.","Loa, Utah"),
  ("cajo","Captain John Smith Chesapeake National Historic Trail","https://www.nps.gov/cajo/index.htm","People first arrived in the Chesapeake Bay during the last ice age. As glaciers melted, diverse societies learned to thrive in a world of water. When Englishman Captain John Smith explored the Bay in 1608, he documented hundreds of American Indian communities. Today, sites on his map are archeological treasures and sacred sites for tribal citizens. Come join us on the shores of the Chesapeake Bay!","Annapolis, Maryland"),
  ("cavo","Capulin Volcano National Monument","https://www.nps.gov/cavo/index.htm","Part of the 8,000 square mile Raton-Clayton Volcanic Field, Capulin Volcano showcases the volcanic geology of northeastern New Mexico. The views are spectacular day or night, with views of 4 different states from the volcanic rim and one of the darkest night skies in the country. Whether it's a quick stop or a day's trip, enjoy exploring the landscape of this unique volcano!","Raton, New Mexico"),
  ("carl","Carl Sandburg Home National Historic Site","https://www.nps.gov/carl/index.htm","“I make it clear why I write as I do and why other poets write as they do. After hundreds of experiments I decided to go my own way in style and see what would happen.” Carl Sandburg's free verse style of poetry, journalism, biography, children's stories, prose writing, and social activism provided a popular voice for the American people of the twentieth century.","Flat Rock, North Carolina"),
  ("cave","Carlsbad Caverns National Park","https://www.nps.gov/cave/index.htm","High ancient sea ledges, deep rocky canyons, flowering cactus, and desert wildlife—treasures above the ground in the Chihuahuan Desert. Hidden beneath the surface are more than 119 caves—formed when sulfuric acid dissolved limestone leaving behind caverns of all sizes.","Carlsbad, New Mexico"),
  ("cawo","Carter G. Woodson Home National Historic Site","https://www.nps.gov/cawo/index.htm","Before Dr. Carter G. Woodson, there was very little accurate written history about the lives and experiences of Americans of African descent. Today a National Historic Site, Dr. Woodson’s home served as the headquarters for the Association for the Study of African American Life and History. Dr. Woodson established Negro History Week here in 1926, which we celebrate today as Black History Month.","Washington, D.C., Washington, D.C."),
  ("cagr","Casa Grande Ruins National Monument","https://www.nps.gov/cagr/index.htm","Explore the history and stories of an extended network of communities and irrigation canals. An Ancestral Sonoran Desert People's farming community and 'Great House' are preserved at Casa Grande Ruins. Whether the Casa Grande was a gathering place for the Desert People or simply a waypoint marker in an extensive system of canals and trading partners is but part of the story of the Ruins.","Coolidge, Arizona"),
  ("casa","Castillo de San Marcos National Monument","https://www.nps.gov/casa/index.htm","Built by the Spanish in St. Augustine to defend Florida and the Atlantic trade route, Castillo de San Marcos National Monument preserves the oldest masonry fortification in the continental United States and interprets more than 450 years of cultural intersections.","Saint Augustine, Florida"),
  ("cacl","Castle Clinton National Monument","https://www.nps.gov/cacl/index.htm","Located at the southern tip of Manhattan Island, Castle Clinton stands where New York City began, and represents not only the city’s growth, but the growth of a nation. Initially intended to prevent a British invasion in 1812, the fortification has transformed over the years to welcome theatergoers, immigrants, sightseers, and now, millions of visitors to New York Harbor.","New York City, New York"),
  ("camo","Castle Mountains National Monument","https://www.nps.gov/camo/index.htm","Castle Mountains represents some of the most unique elements of the Mojave Desert. Nestled between the Nevada state line and Mojave National Preserve, the nearly 21,000 acres of Castle Mountains boasts Joshua tree forests, unbroken natural landscapes, rare desert grasslands, and rich human history. This intriguing area provides serenity and solitude from nearby metropolitan areas.","Laughlin, Nevada"),
  ("cato","Catoctin Mountain Park","https://www.nps.gov/cato/index.htm","President Franklin D. Roosevelt created programs to give people a chance to rebuild their lives from the Great Depression. The Works Progress Administration and the Civilian Conservation Corps gave this land a second opportunity and through re-growth, a new role as a recreation area.","Thurmont, Maryland"),
  ("cebr","Cedar Breaks National Monument","https://www.nps.gov/cebr/index.htm","Crowning the grand staircase, Cedar Breaks sits at over 10,000 feet and looks down into a half-mile deep geologic amphitheater. Come wander among timeless bristlecone pines, stand in lush meadows of wildflower, ponder crystal-clear night skies and experience the richness of our subalpine forest.","Parowan, Utah"),
  ("cebe","Cedar Creek & Belle Grove National Historical Park","https://www.nps.gov/cebe/index.htm","The Shenandoah Valley invites you to learn about its rich heritage, from Native Americans who first shaped the land, to pioneers of this frontier; this fertile area became one of the most important wheat producing regions of the entire South. The Valley also witnessed some of the most dramatic events of the Civil War, including the Battle of Cedar Creek, a decisive October 19, 1864 Union victory.","Middletown, Virginia"),
  ("chcu","Chaco Culture National Historical Park","https://www.nps.gov/chcu/index.htm","Today the massive buildings of the Ancestral Puebloan people still testify to the organizational and engineering abilities not seen anywhere else in the American Southwest. For a deeper contact with the canyon that was central to thousands of people between 850 and 1250 A.D., come and explore Chaco through guided tours, hiking & biking trails, evening campfire talks, and night sky programs.","Crownpoint, New Mexico"),
  ("cham","Chamizal National Memorial","https://www.nps.gov/cham/index.htm","Chamizal is more than just an urban park to recreate or enjoy a quiet afternoon. These grounds are a reminder of the harmonious settlement of a 100-year boundary dispute between the United States and Mexico. We celebrate the cultures of the borderlands to promote the same mutual respect that helped to diplomatically resolve an international disagreement.","El Paso, Texas"),
  ("chis","Channel Islands National Park","https://www.nps.gov/chis/index.htm","Channel Islands National Park encompasses five remarkable islands and their ocean environment, preserving and protecting a wealth of natural and cultural resources. Isolation over thousands of years has created unique animals, plants, and archeological resources found nowhere else on Earth and helped preserve a place where visitors can experience coastal southern California as it once was.","Isla Vista, California"),
  ("chpi","Charles Pinckney National Historic Site","https://www.nps.gov/chpi/index.htm","Charles Pinckney was a principal author and signer of the United States Constitution, and went on to be a political leader in South Carolina for over 40 years. The park preserves Snee Farm, one of his plantation properties, where visitors can learn about the politician's influences on Charleston, the African people he enslaved, plantation operations, and the legacy of Pinckney's life.","Mount Pleasant, South Carolina"),
  ("chyo","Charles Young Buffalo Soldiers National Monument","https://www.nps.gov/chyo/index.htm","Throughout his life, Charles Young overcame countless obstacles in his ascent to prominence. In spite of overt racism and stifling inequality, Young rose through the military ranks to become one of the most respected leaders of his time. A well-rounded man with a steadfast devotion to duty, Young led by example and inspired a generation of new leaders.","Wilberforce, Ohio"),
  ("chat","Chattahoochee River National Recreation Area","https://www.nps.gov/chat/index.htm","Today the river valley attracts us for so many reasons. Take a solitary walk to enjoy nature’s display, raft leisurely through the rocky shoals with friends, fish the misty waters as the sun comes up, or have a picnic on a Sunday afternoon. Get Outdoors and experience your Chattahoochee River National Recreation Area as you have never done before.","Dunwoody, Georgia"),
  ("choh","Chesapeake & Ohio Canal National Historical Park","https://www.nps.gov/choh/index.htm","Preserving America's early transportation history, the C&O Canal began as a dream of passage to Western wealth. Operating for nearly 100 years the canal was a lifeline for communities along the Potomac River as coal, lumber, and agricultural products floated down the waterway to market. Today it endures as a pathway for discovering historical, natural, and recreational treasures.","Great Falls, Virginia"),
  ("cbpo","Chesapeake Bay","https://www.nps.gov/cbpo/index.htm","Over 41 million acres are connected through the waters that flow to and through Chesapeake Bay. The National Park Service strives to connect people to the opportunities and adventures throughout the watershed. Inspiring stewardship across this vast region supports recreation, business, tourism, learning, and a thriving natural resource for all to enjoy.","Annapolis, Maryland"),
  ("chch","Chickamauga & Chattanooga National Military Park","https://www.nps.gov/chch/index.htm","In 1863, Union and Confederate forces fought for control of Chattanooga, known as the 'Gateway to the Deep South.' The Confederates were victorious at nearby Chickamauga in September. However, renewed fighting in Chattanooga that November provided Union troops victory and control of the city. After the fighting, a Confederate soldier ominously wrote, 'This...is the death-knell of the Confederacy.'","Fairview, Georgia"),
  ("chic","Chickasaw National Recreation Area","https://www.nps.gov/chic/index.htm","Springs, streams, lakes - whatever its form, water is the attraction at Chickasaw National Recreation Area.","Sulphur, Oklahoma"),
  ("chir","Chiricahua National Monument","https://www.nps.gov/chir/index.htm","A 'Wonderland of Rocks' is waiting for you to explore at Chiricahua National Monument. The 8-mile paved scenic drive and 17-miles of day-use hiking trails provide opportunities to discover the beauty, natural sounds, and inhabitants of this 12,025 acre site. Visit the Faraway Ranch Historic District to discover more about the people who have called this area home.","Willcox, Arizona"),
  ("chri","Christiansted National Historic Site","https://www.nps.gov/chri/index.htm","Christiansted National Historic Site was established in 1952 as the first unit of the National Park Service in the Virgin Islands of the United States. Covering over seven acres the park tells the stories about Danish economy and ways of life, and the interactions of people in Europe, Africa, West Indies, and North America during the Danish era of occupation of the Virgin Islands (1734-1917).","Saint Croix, Saint Croix Island"),
  ("ciro","City Of Rocks National Reserve","https://www.nps.gov/ciro/index.htm","Emigrants of the California Trail describe the rocks here in vivid detail as 'a city of tall spires,” “steeple rocks,' and 'the silent city.' Today, this backcountry byway attracts rock climbers, campers, hikers, hunters, and those with the spirit of adventure. There's inspirational scenery, exceptional opportunities for geologic study, and remnants of the Old West awaiting your discovery.","Burley, Idaho"),
  ("cwdw","Civil War Defenses of Washington","https://www.nps.gov/cwdw/index.htm","On forested hills surrounding the nation's capital are the remnants of a complex system of Civil War fortifications. These strategic buttresses transformed the young capital into one of the world's most fortified cities. By 1865, 68 forts and 93 batteries armed with over 800 cannons encircled Washington, DC. Today, you can visit 17 of the original sites now managed by the National Park Service.","Takoma Park, Maryland"),
  ("clba","Clara Barton National Historic Site","https://www.nps.gov/clba/index.htm","Clara Barton dedicated her life and energies to help others in times of need - both home and abroad, in peacetime as well as during military emergencies. Glen Echo was her home the last 15 years of her life and the structure illustrates her dedication and concern for those less fortunate than herself. Guided tours: Fri, Sat, & Sun. 1, 2, 3, & 4 PM First Floor only, free. Closed Dec. 25 & Jan. 1","Cabin John, Maryland"),
  ("colo","Colonial National Historical Park","https://www.nps.gov/colo/index.htm","On May 13, 1607, Jamestown was established as the first permanent English settlement in North America. Three cultures came together – European, Virginia Indian and African–to create a new society that would eventually seek independence from Great Britain. On October 19, 1781, American and French troops defeated the British at Yorktown in the last major battle of the American Revolutionary War.","Williamsburg, Virginia"),
  ("colm","Colorado National Monument","https://www.nps.gov/colm/index.htm","Colorado National Monument preserves one of the grand landscapes of the American West. But this treasure is much more than a monument. Towering monoliths exist within a vast plateau and canyon panorama. You can experience sheer-walled, red rock canyons along the twists and turns of Rim Rock Drive, where you may spy bighorn sheep and soaring eagles.","Redlands, Colorado"),
  ("colt","Coltsville National Historical Park","https://www.nps.gov/colt/index.htm","When Samuel Colt started his Hartford factory on the banks of the Connecticut River in 1847, it followed years of mismanagement and failure. Soon, demand for Colt's revolver would change his fortunes and the Colt empire was born. Following Colt's untimely death in 1862, his wife, Elizabeth Colt, would lead the company to its legendary status, and influence Hartford for over 40 years.","Dalton, Massachusetts"),
  ("cong","Congaree National Park","https://www.nps.gov/cong/index.htm","Astonishing biodiversity exists in Congaree National Park, the largest intact expanse of old growth bottomland hardwood forest remaining in the southeastern United States. Waters from the Congaree and Wateree Rivers sweep through the floodplain, carrying nutrients and sediments that nourish and rejuvenate this ecosystem and support the growth of national and state champion trees.","Gadsden, South Carolina"),
  ("coga","Constitution Gardens","https://www.nps.gov/coga/index.htm","Officially established in 1965, National Mall and Memorial Parks actually protects some of the older parkland in the National Park System. Areas within this premier park provide visitors with ample opportunities to commemorate presidential legacies; honor the courage and sacrifice of war veterans; and celebrate the United States commitment to freedom and equality.","Washington, D.C., Washington, D.C."),
  ("coro","Coronado National Memorial","https://www.nps.gov/coro/index.htm","It was a journey of conquest filled with exploration, wonder - and cruelty. Inspired by tales of vast cities of gold, 339 European soldiers and hundreds of Aztec allies embarked on an epic journey through arid deserts and rugged mountains. They encountered rich traditions and brought new technologies. The resulting collision and combination of cultures reverberates today.","Sierra Vista Southeast, Arizona"),
  ("cowp","Cowpens National Battlefield","https://www.nps.gov/cowp/index.htm","“…our success was complete…” -- Daniel Morgan to Nathanael Greene, January 19, 1781 A pasturing area at the time of the battle, this Revolutionary War site commemorates the place where Daniel Morgan and his army turned the flanks of Banastre Tarleton's British army. This classic military tactic, known as a double envelopment, was one of only a few in history.","Mayo, South Carolina"),
  ("crla","Crater Lake National Park","https://www.nps.gov/crla/index.htm","Crater Lake inspires awe. Native Americans witnessed its formation 7,700 years ago, when a violent eruption triggered the collapse of a tall peak. Scientists marvel at its purity—fed by rain and snow, it’s the deepest lake in the USA and one of the most pristine on Earth. Artists, photographers, and sightseers gaze in wonder at its blue water and stunning setting atop the Cascade Mountain Range.","Shady Cove, Oregon"),
  ("crmo","Craters Of The Moon National Monument & Preserve","https://www.nps.gov/crmo/index.htm","Craters of the Moon is a vast ocean of lava flows with scattered islands of cinder cones and sagebrush. We invite you to explore this 'weird and scenic landscape' where yesterday's volcanic events are likely to continue tomorrow.","Arco, Idaho"),
  ("cuga","Cumberland Gap National Historical Park","https://www.nps.gov/cuga/index.htm","Cumberland Gap was the first great gateway to the west. Come follow the path of the bison, Native American, longhunter, and pioneer. Walk where 300,000 people crossed the Appalachians to settle America. Explore 85 miles of trails and 14,000 acres of wilderness. Stand in 3 states at once. Explore a cave, see Hensley Settlement, or camp under the stars. Come find your connection to Cumberland Gap.","Harrogate, Tennessee"),
  ("cuis","Cumberland Island National Seashore","https://www.nps.gov/cuis/index.htm","St Marys is the gateway to Cumberland Island, Georgia's largest and southernmost barrier island. Here pristine maritime forests, undeveloped beaches and wide marshes whisper the stories of both man and nature. Natives, missionaries, enslaved African Americans and Wealthy Industrialists all walked here. Cumberland Island is also home to over 9,800 acres of Congressionally designated Wilderness.","Kings Bay Base, Georgia"),
  ("cure","Curecanti National Recreation Area","https://www.nps.gov/cure/index.htm","Curecanti National Recreation Area is a series of three reservoirs along the once wild Gunnison River. The reservoirs that make up Curecanti today are a destination for water-based recreation high in the Rocky Mountains. Best known for salmon and trout fishing, Curecanti also offers opportunities for hiking, boating, camping, and bird watching.","Gunnison, Colorado"),
  ("cuva","Cuyahoga Valley National Park","https://www.nps.gov/cuva/index.htm","Though a short distance from the urban areas of Cleveland and Akron, Cuyahoga Valley National Park seems worlds away. The park is a refuge for native plants and wildlife, and provides routes of discovery for visitors. The winding Cuyahoga River gives way to deep forests, rolling hills, and open farmlands. Walk or ride the Towpath Trail to follow the historic route of the Ohio & Erie Canal.","Peninsula, Ohio"),
  ("cech","César E. Chávez National Monument","https://www.nps.gov/cech/index.htm","Yes, we can! Widely recognized as the most important Latino leader in the United States during the twentieth century, César E. Chávez led farm workers and supporters in the establishment of the country's first permanent agricultural union. His leadership brought sustained international attention to the plight of U.S. farm workers, and secured for them higher wages and safer working conditions","Bear Valley Springs, California"),
  ("daav","Dayton Aviation Heritage National Historical Park","https://www.nps.gov/daav/index.htm","Dayton Aviation Heritage National Historical Park exists at the heart of one of the world’s most significant, globally impactful stories: the discovery of the secrets of controllable flight. Through perseverance and determination the Wright brothers and Paul Laurence Dunbar were able to overcome obstacles in their lives and leave their respective marks on history.","Riverside, Ohio"),
  ("deso","De Soto National Memorial","https://www.nps.gov/deso/index.htm","In May 1539, Conquistador Hernando de Soto’s army of soldiers, hired mercenaries, craftsmen, and clergy made landfall in Tampa Bay. They were met with fierce resistance of indigenous people protecting their homelands. De Soto’s quest for glory and gold would be a four year, four thousand mile odyssey of intrigue, warfare, disease, and discovery that would form the history of the United States.","West Bradenton, Florida"),
  ("deva","Death Valley National Park","https://www.nps.gov/deva/index.htm","In this below-sea-level basin, steady drought and record summer heat make Death Valley a land of extremes. Yet, each extreme has a striking contrast. Towering peaks are frosted with winter snow. Rare rainstorms bring vast fields of wildflowers. Lush oases harbor tiny fish and refuge for wildlife and humans. Despite its morbid name, a great diversity of life thrives in Death Valley.","Beatty, Nevada"),
  ("dewa","Delaware Water Gap National Recreation Area","https://www.nps.gov/dewa/index.htm","Situated within the most densely populated region of the United States, Delaware Water Gap National Recreation Area provides a unique opportunity to experience tranquil landscapes, rich human history, and striking scenery along 40 miles of the longest free-flowing river east of the Mississippi. The park offers year-round recreation including hiking, paddling, fishing, and hunting.","Pocono Ranch Lands, Pennsylvania"),
  ("dena","Denali National Park & Preserve","https://www.nps.gov/dena/index.htm","Denali is six million acres of wild land, bisected by one ribbon of road. Travelers along it see the relatively low-elevation taiga forest give way to high alpine tundra and snowy mountains, culminating in North America's tallest peak, 20,310' Denali. Wild animals large and small roam un-fenced lands, living as they have for ages. Solitude, tranquility and wilderness await.","Y, Alaska"),
  ("depo","Devils Postpile National Monument","https://www.nps.gov/depo/index.htm","Established in 1911 by presidential proclamation, Devils Postpile National Monument protects and preserves the Devils Postpile formation, the 101-foot high Rainbow Falls, and pristine mountain scenery. The formation is a rare sight in the geologic world and ranks as one of the world's finest examples of columnar basalt. Its' columns tower up to 60 feet and display a striking symmetry.","Mammoth Lakes, California"),
  ("deto","Devils Tower National Monument","https://www.nps.gov/deto/index.htm","The Tower is an astounding geologic feature that protrudes out of the prairie surrounding the Black Hills. It is considered sacred by Northern Plains Indians and indigenous people. Hundreds of parallel cracks make it one of the finest crack climbing areas in North America. Devils Tower entices us to learn more, explore more and define our place in the natural and cultural world.","Sundance, Wyoming"),
  ("dino","Dinosaur National Monument","https://www.nps.gov/dino/index.htm","Dinosaurs once roamed here. Their fantastic remains are still visibly embedded in the rocks. Today, the mountains, desert, and untamed rivers flowing in deep canyons support an array of life. Petroglyphs hint at earlier cultures. Later, homesteaders and outlaws found refuge here. Whether your passion is science, adventure, history or scenery, Dinosaur offers much to explore.","Rangely, Colorado"),
  ("drto","Dry Tortugas National Park","https://www.nps.gov/drto/index.htm","Almost 70 miles (113 km) west of Key West lies the remote Dry Tortugas National Park. This 100-square mile park is mostly open water with seven small islands. Accessible only by boat or seaplane, the park is known the world over as the home of magnificent Fort Jefferson, picturesque blue waters, superlative coral reefs and marine life, and the vast assortment of bird life that frequents the area.","Key West, Florida"),
  ("ddem","Dwight D. Eisenhower Memorial","https://www.nps.gov/ddem/index.htm","The Dwight D. Eisenhower Memorial tells the story of one of America's greatest leaders of the 20th century.","Washington, D.C., Washington, D.C."),
  ("ebla","Ebey's Landing National Historical Reserve","https://www.nps.gov/ebla/index.htm","This stunning landscape on the Salish Sea, with its rich farmland and promising seaport, lured the earliest American pioneers north of the Columbia River to Ebey’s Landing. Today Ebey’s Landing National Historical Reserve preserves the historical, agricultural and cultural traditions of both Native and Euro-American – while offering spectacular opportunities for recreation.","Coupeville, Washington"),
  ("edal","Edgar Allan Poe National Historic Site","https://www.nps.gov/edal/index.htm","Described as horrifying, mystifying, and brilliant, Poe’s writing has engaged readers all over the globe. The six years Edgar Allan Poe lived in Philadelphia were his happiest and most productive. Yet Poe also struggled with bad luck, personal demons and his wife’s illness. In Poe’s humble home, reflect on the human spirit surmounting crushing obstacles, and celebrate Poe’s astonishing creativity.","Philadelphia, Pennsylvania"),
  ("efmo","Effigy Mounds National Monument","https://www.nps.gov/efmo/index.htm","The mounds preserved here are considered sacred by many Americans, especially the Monument's 20 culturally associated American Indian tribes. A visit offers opportunities to contemplate the meanings of the mounds and the people who built them. The 200 plus American Indian mounds are located in one of the most picturesque sections of the Upper Mississippi River Valley.","Prairie du Chien, Wisconsin"),
  ("eise","Eisenhower National Historic Site","https://www.nps.gov/eise/index.htm","Eisenhower National Historic Site preserves the farm of General and 34th President Dwight D. Eisenhower. Adjacent to the Gettysburg battlefield, the farm served the president and first lady as a weekend retreat and as a meeting place for world leaders. With its peaceful setting and view of South Mountain, it was a respite from Washington, DC, and a backdrop for efforts to reduce Cold War tensions.","Gettysburg, Pennsylvania"),
  ("elca","El Camino Real de Tierra Adentro National Historic Trail","https://www.nps.gov/elca/index.htm","Travel along El Camino Real de Tierra Adentro National Historic Trail to experience and learn from a complicated legacy of 300 years of conflict, cooperation, and cultural exchange between a variety of empires—European and non-European alike.","Socorro, New Mexico"),
  ("elte","El Camino Real de los Tejas National Historic Trail","https://www.nps.gov/elte/index.htm","Explore a diverse array of histories contained within El Camino Real de los Tejas’ 150-year life, including the Spanish struggle to missionize American Indian nations, the growth of cattle ranching in the Mexican period, and the movement for Texan independence and statehood.","Bastrop, Texas"),
  ("elma","El Malpais National Monument","https://www.nps.gov/elma/index.htm","The richly diverse volcanic landscape of El Malpais (el-mal-pie-EES) offers solitude, recreation, and adventure. Explore incredible geologic features such as lava flows, cinder cones, lava tube caves, and sandstone bluffs. While some may see a desolate environment, people have been adapting to and living in this extraordinary terrain for generations. Come discover the land of fire and ice!","Grants, New Mexico"),
  ("elmo","El Morro National Monument","https://www.nps.gov/elmo/index.htm","Imagine the refreshment of finding water after days of dusty travel. A reliable waterhole hidden at the base of a sandstone bluff made El Morro (the headland) a popular campsite for hundreds of years. Here, ancestral Puebloans, Spanish, and American travelers carved over 2,000 signatures, dates, messages, and petroglyphs. Make El Morro National Monument a stopping point on your travels.","Thoreau, New Mexico"),
  ("elro","Eleanor Roosevelt National Historic Site","https://www.nps.gov/elro/index.htm","Visit the home of Eleanor Roosevelt. Here, Franklin and Eleanor entertained friends, state visitors, the press, and their associates in the tranquil and relaxed atmosphere of Val-Kill. Explore the Roosevelt saga in the homes of Franklin and Eleanor Roosevelt, the exhibits at the nation’s first Presidential Library, and over a thousand acres of gardens and trails.","Haviland, New York"),
  ("elis","Ellis Island Part of Statue of Liberty National Monument","https://www.nps.gov/elis/index.htm","How far would you travel to find a better life? What if the journey took weeks under difficult conditions? If you answered 'Whatever it takes,' you echo the feelings of the 12 million immigrants who passed through these now quiet halls from 1892 to 1954. Ellis Island afforded them the opportunity to attain the American dream for themselves and their descendants. Come hear their stories.","New York City, New York"),
  ("euon","Eugene O'Neill National Historic Site","https://www.nps.gov/euon/index.htm","America's only Nobel Prize winning playwright, Eugene O'Neill, chose to live in Northern California at the height of his writing career. Isolated from the world and within the walls of his home, O'Neill wrote his final and most memorable plays; The Iceman Cometh, Long Day's Journey Into Night, and A Moon for the Misbegotten.","Alamo, California"),
  ("ever","Everglades National Park","https://www.nps.gov/ever/index.htm","Everglades National Park protects an unparalleled landscape that provides important habitat for numerous rare and endangered species like the manatee, American crocodile, and the elusive Florida panther. An international treasure as well - a World Heritage Site, International Biosphere Reserve, a Wetland of International Importance, and a specially protected area under the Cartagena Treaty.","Florida City, Florida"),
  ("feha","Federal Hall National Memorial","https://www.nps.gov/feha/index.htm","Here on Wall Street, George Washington took the oath of office as our first President, and this site was home to the first Congress, Supreme Court, and Executive Branch offices. The current structure, a Customs House, later served as part of the US Sub-Treasury. Now, the building serves as a museum and memorial to our first President and the beginnings of the United States of America.","New York City, New York"),
  ("fiis","Fire Island National Seashore","https://www.nps.gov/fiis/index.htm","Immerse yourself in an enchanting collage of coastal life and history. Rhythmic waves, high dunes, ancient maritime forests, historic landmarks and glimpses of wildlife, Fire Island has been a special place for diverse plants, animals and people for centuries. Far from the pressure of nearby big-city life, dynamic barrier island beaches offer solitude, camaraderie, and spiritual renewal.","Blue Point, New York"),
  ("fila","First Ladies National Historic Site","https://www.nps.gov/fila/index.htm","First Ladies National Historic Site consists of two properties in downtown Canton, Ohio - the home of First Lady Ida Saxton-McKinley and our Education Center. Come learn about how the position of First Lady has evolved over time to include a public role.","Canton, Ohio"),
  ("frst","First State National Historical Park","https://www.nps.gov/frst/index.htm","Famous as the First State to ratify the Constitution, Delaware was born out of a conflict among three world powers for dominance of the Delaware Valley. From this beginning, the region developed a distinct character that tolerated diversity in religion and national origin and valued independence.","Greenville, Delaware"),
  ("flni","Flight 93 National Memorial","https://www.nps.gov/flni/index.htm","On Tuesday morning, September 11, 2001, the U.S. came under attack when four commercial airliners were hijacked and used to strike targets on the ground. Nearly 3,000 people tragically lost their lives. Because of the actions of the 40 passengers and crew aboard one of the planes, Flight 93, the attack on the U.S. Capitol was thwarted.","Friedens, Pennsylvania"),
  ("flfo","Florissant Fossil Beds National Monument","https://www.nps.gov/flfo/index.htm","Beneath a grassy mountain valley in central Colorado lies one of the richest and most diverse fossil deposits in the world. Petrified redwood stumps up to 14 feet wide and thousands of detailed fossils of insects and plants reveal the story of a very different, prehistoric Colorado.","Cripple Creek, Colorado"),
  ("foth","Ford's Theatre","https://www.nps.gov/foth/index.htm","April 14, 1865. President Lincoln is assassinated at Ford’s Theatre. Discover how a nation handled grief and loss, how everyday people experienced a national tragedy, and how we have remembered a fallen leader. Today, in partnership with Ford’s Theatre Society, live dramatic productions highlight Lincoln’s love of the theatre, and the power of stories to connect us to ourselves and our history.","Washington, D.C., Washington, D.C."),
  ("fobo","Fort Bowie National Historic Site","https://www.nps.gov/fobo/index.htm","Fort Bowie witnessed almost 25 years of conflict between the Chiricahua Apache and the US Army, and remains a tangible connection to the turbulent era of the late 1800s. Explore the history of Fort Bowie and Apache Pass as you hike to the visitor center and old fort ruins. Today, this peaceful landscape stands in stark contrast to the violence that once gripped this land.","Willcox, Arizona"),
  ("foda","Fort Davis National Historic Site","https://www.nps.gov/foda/index.htm","Fort Davis is one of the best surviving examples of an Indian Wars' frontier military post in the Southwest. From 1854 to 1891, Fort Davis was strategically located to protect emigrants, mail coaches, and freight wagons on the Trans-Pecos portion of the San Antonio-El Paso Road and on the Chihuahua Trail.","Fort Davis, Texas"),
  ("fodo","Fort Donelson National Battlefield","https://www.nps.gov/fodo/index.htm","Brigadier General Ulysses S. Grant was becoming quite famous as he wrote these words following the surrender of Confederate Fort Donelson on Sunday, February 16, 1862. The Union victory at Fort Donelson elated the North, and stunned the South. Within days of the surrender, Clarksville and Nashville would fall into Union hands. Grant and his troops had created a pathway to victory for the Union.","Dover, Tennessee"),
  ("fodu","Fort Dupont Park","https://www.nps.gov/fodu/index.htm","This 376 acre wooded park was once home to an earthen fort built to protect Washington, DC, during the Civil War. Today, visitors can see the fort's earthworks and escape to the great outdoors. Activities include picnics, nature walks, biking, gardening, environmental education, music, and ranger-led programs.","Coral Hills, Maryland"),
  ("fofo","Fort Foote Park","https://www.nps.gov/fofo/index.htm","Fort Foote was constructed in 1863 atop Rozier's Bluff to strengthen the ring of fortifications that encircled Washington, D.C. Two of the Guns that protected Washington are still there along with the remains of the fort's earthworks.","Belle Haven, Virginia"),
  ("fofr","Fort Frederica National Monument","https://www.nps.gov/fofr/index.htm","Georgia's fate was decided in 1742 when Spanish and British forces clashed on St. Simons Island. Fort Frederica's troops defeated the Spanish, ensuring Georgia's future as a British colony. Today, the archeological remnants of Frederica are protected by the National Park Service.","Saint Simon Mills, Georgia"),
  ("fola","Fort Laramie National Historic Site","https://www.nps.gov/fola/index.htm","Originally established as a private fur trading fort in 1834, Fort Laramie evolved into the largest and best known military post on the Northern Plains before its abandonment in 1890. This “grand old post” witnessed the entire sweeping saga of America’s western expansion and Indian resistance to encroachment on their territories.","Guernsey, Wyoming"),
  ("fols","Fort Larned National Historic Site","https://www.nps.gov/fols/index.htm","Discover a complete and authentic army post from the 1860s -1870s! This well-preserved fort on the Santa Fe Trail shares a tumultuous history of the Indian Wars era. The sandstone constructed buildings sheltered troops who were known as the Guardians of the Santa Fe Trail.","Larned, Kansas"),
  ("foma","Fort Matanzas National Monument","https://www.nps.gov/foma/index.htm","Fort Matanzas National Monument preserves the fortified coquina watchtower, completed in 1742, which defended the southern approach to the Spanish military settlement of St. Augustine. It also protects approximately 300 acres of Florida coastal environment containing dunes, marsh, maritime forest, and associated flora and fauna, including threatened and endangered species.","Butler Beach, Florida"),
  ("fomc","Fort McHenry National Monument and Historic Shrine","https://www.nps.gov/fomc/index.htm","by the dawn's early light, a large red, white and blue banner? Whose broad stripes and bright stars... were so gallantly streaming...over Fort McHenry! The valiant defense of the fort during the Battle of Baltimore on September 13-14, 1814 inspired Francis Scott Key to write the words that became the U.S. national anthem. The fort's history holds many other stories too, from the Civil War to WWII.","Baltimore, Maryland"),
  ("fomr","Fort Monroe National Monument","https://www.nps.gov/fomr/index.htm","Fort Monroe National Monument has a diverse history spanning the American story from American Indian presence, Captain John Smith's journeys, first arrival of enslaved Africans in English North America, a safe haven for freedom seekers during the American Civil War, and a bastion of defense for the Chesapeake Bay through the 21st Century. Visit and witness the on-going preservation work in action.","East Hampton, Virginia"),
  ("fone","Fort Necessity National Battlefield","https://www.nps.gov/fone/index.htm","The battle at Fort Necessity in the summer of 1754 was the opening action of the French and Indian War. This war was a clash of British, French and American Indian cultures. It ended with the removal of French power from North America. The stage was set for the American Revolution.","Hopwood, Pennsylvania"),
  ("fopo","Fort Point National Historic Site","https://www.nps.gov/fopo/index.htm","From its vantage point overlooking the spectacular Golden Gate, Fort Point defended the San Francisco Bay following California's Gold Rush through World War II. Its beautifully arched casemates display the art of 3rd system brick masonry and interacts gracefully with the Golden Gate Bridge.","Sausalito, California"),
  ("fopu","Fort Pulaski National Monument","https://www.nps.gov/fopu/index.htm","For much of the 19th century, masonry fortifications were the United States’ main defense against overseas enemies. However, during the Civil War, new technology proved its superiority to these forts. The Union army used rifled cannon and compelled the Confederate garrison inside Fort Pulaski to surrender. The siege was a landmark experiment in the history of military science and invention.","Wilmington Island, Georgia"),
  ("fora","Fort Raleigh National Historic Site","https://www.nps.gov/fora/index.htm","Fort Raleigh National Historic Site protects and preserves known portions of England's first New World settlements from 1584 to 1590. This site also preserves the cultural heritage of the Native Americans, European Americans and African Americans who have lived on Roanoke Island.","Manteo, North Carolina"),
  ("fosc","Fort Scott National Historic Site","https://www.nps.gov/fosc/index.htm","Promises made and broken! Who deserves to be free? The fight for freedom! Soldiers fighting settlers! Each of these stories is a link in the chain of events that encircled Fort Scott from 1842-1873. All of the site's structures, its parade ground, and its tallgrass prairie bear witness to this era when the country was forged from a young republic into a united transcontinental nation.","Fort Scott, Kansas"),
  ("fosm","Fort Smith National Historic Site","https://www.nps.gov/fosm/index.htm","Explore life on the edge of frontier and Indian Territory through the stories of soldiers, the Trail of Tears, scandals, outlaws, and lawmen who pursued them. From the establishment of the first Fort Smith on December 25, 1817, to the final days of Judge Isaac C. Parker's jurisdiction over Indian Territory in 1896, Fort Smith National Historic Site preserves almost 80 years of history.","Fort Smith, Arkansas"),
  ("fost","Fort Stanwix National Monument","https://www.nps.gov/fost/index.htm","For centuries, the Oneida Carrying Place, a six mile portage connecting the Mohawk River and Wood Creek, served as a vital link for those traveling by water from the ocean to the Great Lakes. When Europeans arrived, nations fought for control of the carry, the homelands of the Six Nations Confederacy, and the rich resources of North America. In this struggle, Fort Stanwix would play a vital role.","Rome, New York"),
  ("fosu","Fort Sumter and Fort Moultrie National Historical Park","https://www.nps.gov/fosu/index.htm","Two forts stand at the entrance of Charleston Harbor. Patriots inside a palmetto log fort, later named Fort Moultrie, defeated the Royal Navy in 1776. As Charleston blazed a path towards secession to preserve slavery, construction on a new fort, Fort Sumter, proceeded. The Confederacy fired on the US garrison of Fort Sumter on April 12, 1861 opening the Civil War, which redefined American freedom.","Sullivans Island, South Carolina"),
  ("foun","Fort Union National Monument","https://www.nps.gov/foun/index.htm","Exposed to the wind, within a sweeping valley of short grass prairie, amid the swales of the Santa Fe Trail, lie the territorial-style adobe remnants of the largest 19th century military fort in the region. For forty years, 1851-1891, Fort Union functioned as an agent of political and cultural change, whether desired or not, in New Mexico and throughout the Southwest.","Mora, New Mexico"),
  ("fous","Fort Union Trading Post National Historic Site","https://www.nps.gov/fous/index.htm","Between 1828 and 1867, Fort Union was the most important fur trade post on the Upper Missouri River. Here, the Assiniboine and six other Northern Plains Tribes exchanged buffalo robes and smaller furs for goods from around the world, including cloth, guns, blankets, and beads. A bastion of peaceful coexistence, the post annually traded over 25,000 buffalo robes and $100,000 in merchandise.","Sidney, Montana"),
  ("fova","Fort Vancouver National Historic Site","https://www.nps.gov/fova/index.htm","Located on the north bank of the Columbia River, in sight of snowy mountain peaks and a vibrant urban landscape, this park has a rich cultural past. From a frontier fur trading post, to a powerful military legacy, the magic of flight, and the origin of the American Pacific Northwest, history is shared at four unique sites. Discover stories of transition, settlement, conflict, and community.","Vancouver, Washington"),
  ("fowa","Fort Washington Park","https://www.nps.gov/fowa/index.htm","Built to defend the river approach to Washington, DC, Fort Washington has stood as silent sentry for over 200 years. As technologies advanced so did Fort Washington, from the brick and stone of the 19th century to the concrete and steel of the 20th century. Joining the National Park Service in 1946, the park continues to protect the Potomac River.","Fort Washington, Maryland"),
  ("fobu","Fossil Butte National Monument","https://www.nps.gov/fobu/index.htm","Some of the world's best preserved fossils are found in the flat-topped ridges of southwestern Wyoming's cold sagebrush desert. Fossilized fishes, insects, plants, reptiles, birds, and mammals are exceptional for their abundance, variety, and detail of preservation. Most remarkable is the story they tell of ancient life in the warm, wet environment in and around a freshwater lake.","Kemmerer, Wyoming"),
  ("frde","Franklin Delano Roosevelt Memorial","https://www.nps.gov/frde/index.htm","These words by President Franklin Delano Roosevelt ushered the United States into World War II and defined what it is to be an American. Stop by this secluded memorial and begin to understand the Roosevelt legacy.","Washington, D.C., Washington, D.C."),
  ("frdo","Frederick Douglass National Historic Site","https://www.nps.gov/frdo/index.htm","Frederick Douglass spent his life fighting for justice and equality. Born into slavery in 1818, he escaped as a young man and became a leading voice in the abolitionist movement. People everywhere still find inspiration today in his tireless struggle, brilliant words, and inclusive vision of humanity. Douglass's legacy is preserved here at Cedar Hill, where he lived his last 17 years.","Hillcrest Heights, Maryland"),
  ("frla","Frederick Law Olmsted National Historic Site","https://www.nps.gov/frla/index.htm","Frederick Law Olmsted (1822-1903) is recognized as the founder of American landscape architecture and the nation's foremost parkmaker. Olmsted moved his home to suburban Boston in 1883 and established the world's first full-scale professional office for the practice of landscape design. During the next century, his sons and successors perpetuated Olmsted's design ideals, philosophy, and influence.","Brookline, Massachusetts"),
  ("frsp","Fredericksburg & Spotsylvania National Military Park","https://www.nps.gov/frsp/index.htm","Fredericksburg, Chancellorsville, Wilderness, and Spotsylvania, this is America's battleground, where the Civil War roared to its bloody climax. No place more vividly reflects the War's tragic cost in all its forms. A town bombarded and looted. Farms large and small ruined. Refugees by the thousands forced into the countryside. More than 85,000 men wounded; 15,000 killed--most in graves unknown.","Fredericksburg, Virginia"),
  ("frri","Freedom Riders National Monument","https://www.nps.gov/frri/index.htm","In 1961, a small interracial band of “Freedom Riders” challenged discriminatory laws requiring separation of the races in interstate travel. They were attacked by white segregationists, who firebombed the bus. Images of the attack appeared in hundreds of newspapers, shocking the American public and spurring the Federal Government to issue regulations banning segregation in interstate travel.","West End-Cobb Town, Alabama"),
  ("frhi","Friendship Hill National Historic Site","https://www.nps.gov/frhi/index.htm","Albert Gallatin is best remembered for his thirteen year tenure as Secretary of the Treasury during the Jefferson and Madison administrations. In that time he reduced the national debt, purchased the Louisiana Territory and funded the Lewis & Clark exploration. Gallatin's accomplishments and contributions are highlighted at Friendship Hill, his restored country estate.","Point Marion, Pennsylvania"),
  ("gaar","Gates Of The Arctic National Park & Preserve","https://www.nps.gov/gaar/index.htm","This vast landscape does not contain any roads or trails. Visitors discover intact ecosystems where people have lived with the land for thousands of years. Wild rivers meander through glacier-carved valleys, caribou migrate along age-old trails, endless summer light fades into aurora-lit night skies of winter. It remains virtually unchanged except by the forces of nature.","Nuiqsut, Alaska"),
  ("jeff","Gateway Arch National Park","https://www.nps.gov/jeff/index.htm","The Gateway Arch reflects St. Louis' role in the Westward Expansion of the United States during the nineteenth century. The park is a memorial to Thomas Jefferson's role in opening the West, to the pioneers who helped shape its history, and to Dred Scott who sued for his freedom in the Old Courthouse.","St. Louis, Missouri"),
  ("gate","Gateway National Recreation Area","https://www.nps.gov/gate/index.htm","Spanning 27,000 acres from Sandy Hook in New Jersey to Breezy Point in New York City, the park is both the gateway from the ocean into New York Harbor, and the gateway to the National Park Service for millions of visitors every year. Gateway offers green spaces and beaches alongside historic structures and cultural landscapes. Every day, Gateway is open for you to explore, envision, and enjoy!","Coney Island, New York"),
  ("gari","Gauley River National Recreation Area","https://www.nps.gov/gari/index.htm","The 25 miles of free-flowing Gauley River and the six miles of the Meadow River pass through scenic gorges and valleys containing a wide variety of natural and cultural features. The Gauley River contains several class V+ rapids, making it one of the most adventurous white water boating rivers in the east.","Ansted, West Virginia"),
  ("gegr","General Grant National Memorial","https://www.nps.gov/gegr/index.htm","The final resting place of President Ulysses S. Grant and his wife, Julia, is the largest mausoleum in North America. It testifies to a people’s gratitude for the man who ended the bloodiest conflict in American history as Commanding General of the Union Army and then, as President of the United States, strove to heal a nation after a civil war and make rights for all citizens a reality.","Edgewater, New Jersey"),
  ("gero","George Rogers Clark National Historical Park","https://www.nps.gov/gero/index.htm","The British flag would not be raised above Fort Sackville Feb. 25, 1779. At 10 a.m., the garrison surrendered to American Colonel George Rogers Clark. His American army, aided by French residents of the Illinois country, had marched through freezing floodwaters to gain this victory. The fort’s capture assured United States claims to the frontier, an area nearly as large as the original 13 states.","Vincennes, Indiana"),
  ("gewa","George Washington Birthplace National Monument","https://www.nps.gov/gewa/index.htm","George Washington Birthplace National Monument is located in the Northern Neck of Virginia. It encompasses 551 acres of the former Popes Creek Plantation, the American ancestral home of the Washington Family where George Washington was born. In addition to a Colonial Revival farm, burial ground, visitor center, and historic structures, the park also has picnic grounds and a public beach.","Colonial Beach, Virginia"),
  ("gwca","George Washington Carver National Monument","https://www.nps.gov/gwca/index.htm","The young child known as the 'Plant Doctor' tended his secret garden while observing the day-to-day operations of a 19th century farm. Nature and nurture ultimately influenced George on his quest for education to becoming a renowned agricultural scientist, educator, and humanitarian.","Duenweg, Missouri"),
  ("gwmp","George Washington Memorial Parkway","https://www.nps.gov/gwmp/index.htm","The George Washington Memorial Parkway was designed for recreational driving. It links sites that commemorate important episodes in American history and preserve habitat for local wildlife. The parkway and its associated trails provide a scenic place to play and rest in the busy Washington, DC metropolitan area.","Cabin John, Maryland"),
  ("gett","Gettysburg National Military Park","https://www.nps.gov/gett/index.htm","The Battle of Gettysburg was a turning point in the Civil War, the Union victory that ended General Robert E. Lee's second and most ambitious invasion of the North. Often referred to as the 'High Water Mark of the Rebellion', Gettysburg was the Civil War's bloodiest battle and was also the inspiration for President Abraham Lincoln's immortal 'Gettysburg Address'.","Gettysburg, Pennsylvania"),
  ("gicl","Gila Cliff Dwellings National Monument","https://www.nps.gov/gicl/index.htm","For thousands of years, groups of ancient nomads used caves above the Gila River as temporary shelter. In the late 1200s, people of the agricultural Mogollon (Southern Ancestral Pueblo) culture made it a home. They built rooms, crafted pottery and raised children in the cliff dwellings for one or two generations. By approximately 1300, the Mogollon had moved on, leaving the walls behind.","Arenas Valley, New Mexico"),
  ("glba","Glacier Bay National Park & Preserve","https://www.nps.gov/glba/index.htm","Covering 3.3 million acres of rugged mountains, dynamic glaciers, temperate rainforest, wild coastlines and deep sheltered fjords, Glacier Bay National Park is a highlight of Alaska's Inside Passage and part of a 25-million acre World Heritage Site—one of the world’s largest international protected areas. From sea to summit, Glacier Bay offers limitless opportunities for adventure and inspiration.","Haines, Alaska"),
  ("glac","Glacier National Park","https://www.nps.gov/glac/index.htm","A showcase of melting glaciers, alpine meadows, carved valleys, and spectacular lakes. With over 700 miles of trails, Glacier is a paradise for adventurous visitors seeking wilderness steeped in human history. Relive the days of old through historic chalets, lodges, and the famous Going-to-the-Sun Road.","Columbia Falls, Montana"),
  ("glca","Glen Canyon National Recreation Area","https://www.nps.gov/glca/index.htm","Encompassing over 1.25 million acres, Glen Canyon National Recreation Area offers unparalleled opportunities for water-based & backcountry recreation. The recreation area stretches for hundreds of miles from Lees Ferry in Arizona to the Orange Cliffs of southern Utah, encompassing scenic vistas, geologic wonders, and a vast panorama of human history.","Page, Arizona"),
  ("glec","Glen Echo Park","https://www.nps.gov/glec/index.htm","Glen Echo Park began in 1891 as a National Chautauqua Assembly 'to promote liberal and practical education.' By 1911, it transformed into DC's premier amusement park until it closed in 1968. Since 1971, the National Park Service has owned and operated the site and today, with the help of the Glen Echo Park Partnership for Arts and Culture, offers year-round cultural and recreational activities.","Cabin John, Maryland"),
  ("glde","Gloria Dei Church National Historic Site","https://www.nps.gov/glde/index.htm","Before Pennsylvania there was New Sweden. Discover this last historic link to a forgotten past. Visit the church's pastoral surroundings and its burial ground of patriots and ordinary citizens alike.","Camden, New Jersey"),
  ("goga","Golden Gate National Recreation Area","https://www.nps.gov/goga/index.htm","Experience a park so rich it supports 19 distinct ecosystems with over 2,000 plant and animal species. Go for a hike, enjoy a vista, have a picnic or learn about the centuries of overlapping history from California’s indigenous cultures, Spanish colonialism, the Mexican Republic, US military expansion and the growth of San Francisco. All of this and more awaits you, so get out and find your park.","Tamalpais Valley, California"),
  ("gosp","Golden Spike National Historical Park","https://www.nps.gov/gosp/index.htm","One of the greatest technological achievements of the 19th century, the completion of the first transcontinental railroad across the United States. Visitors to the park can see the location of the Last Spike Site, 1869 railroad construction features, walk or drive on the original railroad grade, and get an up close view of Victorian era replica locomotives.","Tremonton, Utah"),
  ("gois","Governors Island National Monument","https://www.nps.gov/gois/index.htm","From 1794 to 1966, the U.S. Army on Governors Island was part of the social, political, and economic tapestry of New York City. Today, the island is a vibrant summer seasonal venue of art, culture, and performance against the backdrop of two centuries of military heritage and the skyline of one of the great cities of the world. The island is open to the public. Check Alerts","New York City, New York"),
  ("grca","Grand Canyon National Park","https://www.nps.gov/grca/index.htm","Grand Canyon National Park, in Northern Arizona, encompasses 278 miles (447 km) of the Colorado River and adjacent uplands. Located on ancestral homeland of 11 Associated Tribes, Grand Canyon is one of the most spectacular examples of erosion anywhere in the world—unmatched in the incomparable vistas it offers visitors from the rim. South Rim is open. North Rim closed for winter. Daily updates >","Grand Canyon Village, Arizona"),
  ("para","Grand Canyon-Parashant National Monument","https://www.nps.gov/para/index.htm","Take a lonely and rocky two-track road in a 4x4 to the edge of the Grand Wash Cliffs. Find a stunning solitary vista deep into the Grand Canyon. Relax in the shade of ponderosas at Mount Trumbull. Touch ancient waters at Pakoon Springs in one of the driest places in the world. Parashant is remote. There are no crowds here. Be equipped to leave pavement, cell service, and the 21st century behind.","Beaver Dam, Arizona"),
  ("grpo","Grand Portage National Monument","https://www.nps.gov/grpo/index.htm","Travel into the past to discover the present. Explore the partnership of the Grand Portage Ojibwe and the North West Company during the North American fur trade and the NPS today. Follow pathways into a distant time. Experience the sights and smells of a bustling depot reconstructed in its exact location. Hear the beat of the drum echo over Gichigami - Lake Superior.","Neebing, Ontario"),
  ("grte","Grand Teton National Park","https://www.nps.gov/grte/index.htm","Rising above a scene rich with extraordinary wildlife, pristine lakes, and alpine terrain, the Teton Range stands as a monument to the people who fought to protect it. These are mountains of the imagination. Mountains that led to the creation of Grand Teton National Park where you can explore over two hundred miles of trails, float the Snake River, and enjoy the serenity of this remarkable place.","Moose Wilson Road, Wyoming"),
  ("grko","Grant-Kohrs Ranch National Historic Site","https://www.nps.gov/grko/index.htm","Wide open spaces, the hard-working cowboy, his spirited cow pony, and vast herds of cattle are among the strongest symbols of the American West. Once the headquarters of a 10 million acre cattle empire, Grant-Kohrs Ranch National Historic Site preserves these symbols and commemorates the role of cattlemen in American history.","Deer Lodge, Montana"),
  ("grba","Great Basin National Park","https://www.nps.gov/grba/index.htm","From the 13,063-foot summit of Wheeler Peak, to the sage-covered foothills, Great Basin National Park hosts a sample of the incredible diversity of the larger Great Basin region. Come and partake of the solitude of the wilderness, walk among ancient bristlecone pines, bask in the darkest of night skies, and explore mysterious subterranean passages. There's a whole lot more than just desert here!","McGill, Nevada"),
  ("greg","Great Egg Harbor River","https://www.nps.gov/greg/index.htm","The River gradually widens as it picks up the waters of 17 tributaries on its way to Great Egg Harbor and the Atlantic Ocean. Established by Congress in 1992, nearly all of this 129-mile river system rests within the Pinelands National Reserve. This National Park Service unit is unusual in that local jurisdictions continue to administer the lands.","Somers Point, New Jersey"),
  ("grfa","Great Falls Park","https://www.nps.gov/grfa/index.htm","At Great Falls, the Potomac River builds up speed and force as it falls over a series of steep, jagged rocks and flows through the narrow Mather Gorge. The Patowmack Canal offers a glimpse into the early history of this country. Great Falls Park has many opportunities to explore history and nature, all in a beautiful 800-acre park only 15 miles from the Nation's Capital.","Great Falls, Virginia"),
  ("grsa","Great Sand Dunes National Park & Preserve","https://www.nps.gov/grsa/index.htm","Open 24/7 year round! There are no limitations or reservations to visit, but there is currently limited capacity in the visitor center. The tallest dunes in North America are the centerpiece in a diverse landscape of grasslands, wetlands, forests, alpine lakes, and tundra. Stay on a moonless night to experience this International Dark Sky Park's starry skies!","Westcliffe, Colorado"),
  ("grsm","Great Smoky Mountains National Park","https://www.nps.gov/grsm/index.htm","Ridge upon ridge of forest straddles the border between North Carolina and Tennessee in Great Smoky Mountains National Park. World renowned for its diversity of plant and animal life, the beauty of its ancient mountains, and the quality of its remnants of Southern Appalachian mountain culture, this is America's most visited national park. Plan your visit today!","Gatlinburg, Tennessee"),
  ("grsp","Green Springs","https://www.nps.gov/grsp/index.htm","Green Springs National Historic Landmark District in Virginia’s Piedmont encompasses over 14,000 acres. Its landscapes and structures, privately owned today but viewable from public roads, offer a continuum of rural vernacular architecture with minimal alteration. Many of the farmsteads, often dating to the 19th century and connecting to one another visually, are preserved through easements.","Gordonsville, Virginia"),
  ("gree","Greenbelt Park","https://www.nps.gov/gree/index.htm","Camp ten miles from the Washington Monument! Greenbelt Park is located in suburban Greenbelt, Maryland just ten miles from the Washington D.C. attractions. Visit to enjoy affordable camping, peaceful surroundings in an urban forest, and National Park Service hospitality. Greenbelt Park has a 172 site campground, nine miles of trails (Trails are temporarily closed) and three picnic areas.","Berwyn Heights, Maryland"),
  ("gumo","Guadalupe Mountains National Park","https://www.nps.gov/gumo/index.htm","Come experience mountains and canyons, desert and dunes, night skies and spectacular vistas within a place unlike any other. Guadalupe Mountains National Park protects the world's most extensive Permian fossil reef, the four highest peaks in Texas, an environmentally diverse collection of flora and fauna, and the stories of lives shaped through conflict, cooperation and survival.","Carlsbad, New Mexico"),
  ("guco","Guilford Courthouse National Military Park","https://www.nps.gov/guco/index.htm","'I never saw such fighting since God made me. The Americans fought like demons.' - Lt. General Charles, Earl Cornwallis On March 15, 1781, six years into the American Revolution, General Greene and Lord Cornwallis' troops faced off at a small courthouse community. This 2.5 hour battle would change the course of the Southern Campaign of the American Revolution.","Greensboro, North Carolina"),
  ("guis","Gulf Islands National Seashore","https://www.nps.gov/guis/index.htm","Millions of visitors are drawn to the Gulf of Mexico for Gulf Islands National Seashore's emerald coast waters, magnificent white beaches, fertile marshes and historical landscapes. Come explore with us today!","Gulf Shores, Alabama"),
  ("hafo","Hagerman Fossil Beds National Monument","https://www.nps.gov/hafo/index.htm","During the Pliocene, this place looked quite different. Lush wetlands, forests, and grasslands provided excellent habitat for a variety of animals. From fascinating, now-extinct creatures like the saber-toothed cat, mastodon, and ground sloth, to more familiar animals like horses, beavers, and birds, the scientific study of Pliocene fossils is the key to Hagerman.","Wendell, Idaho"),
  ("hale","Haleakalā National Park","https://www.nps.gov/hale/index.htm","This special place vibrates with stories of ancient and modern Hawaiian culture and protects the bond between the land and its people. The park also cares for endangered species, some of which exist nowhere else. Come visit this special place - renew your spirit amid stark volcanic landscapes and sub-tropical rain forest with an unforgettable hike through the backcountry.","Wailua, Hawaii"),
  ("hagr","Hamilton Grange National Memorial","https://www.nps.gov/hagr/index.htm","Merchant’s clerk, Revolutionary War soldier, first Secretary Treasury of the United States: Alexander Hamilton’s life is memorialized at The Grange, the home he built on a country estate in uptown Manhattan. A faithful testament to early American architecture, it stands today as a tribute to its first owner’s many accomplishments.","Edgewater, New Jersey"),
  ("hamp","Hampton National Historic Site","https://www.nps.gov/hamp/index.htm","Once possibly the largest private home in America by 1790, the Hampton mansion serves as a grand example of late-Georgian architecture in America. Hampton is also the story of its people, as the estate evolved through the actions of the Ridgely family, enslaved African Americans, European indentured servants, and paid laborers within a nation struggling to define its own concept of freedom.","Hampton, Maryland"),
  ("haha","Harmony Hall","https://www.nps.gov/haha/index.htm","The 18th century Harmony Hall mansion is located on a 62.5-acre open pasture land estate along the Potomac River. This estate was purchased by the National Park Service in 1966, to preserve southern Maryland cultural heritage. Surrounded by a rich landscape, it offers visitors many chances to connect with Colonial History. The park also home to the remains of the Want Water House and canal.","Friendly, Maryland"),
  ("hafe","Harpers Ferry National Historical Park","https://www.nps.gov/hafe/index.htm","Find yourself at the confluence of history and nature. Experience John Brown's Raid, a flash point that ignited the Civil War. Find your story in the struggle for freedom, education, and civil rights at Storer College. Explore the rolling Blue Ridge mountains and rushing waters of the Shenandoah and Potomac rivers that powered industry and the nation's second armory. Find your Harpers Ferry.","Bolivar, West Virginia"),
  ("hart","Harriet Tubman National Historical Park","https://www.nps.gov/hart/index.htm","Harriet Tubman was guided by a deep faith and devotion to family, freedom, and community. After emancipating herself and members of her family, she moved them from Ontario, Canada to Fleming and Auburn, New York in 1859. Central New York was a center for progressive thought, abolition, and women’s suffrage where Tubman continued to fight for human rights and dignity until she died in 1913.","Auburn, New York"),
  ("hatu","Harriet Tubman Underground Railroad National Historical Park","https://www.nps.gov/hatu/index.htm","Harriet Tubman was a deeply spiritual woman who lived her ideals and dedicated her life to freedom. She is the Underground Railroad’s best known conductor and before the Civil War repeatedly risked her life to guide 70 enslaved people north to new lives of freedom. This new national historical park preserves the same landscapes that Tubman used to carry herself and others away from slavery.","Cambridge, Maryland"),
  ("hstr","Harry S Truman National Historic Site","https://www.nps.gov/hstr/index.htm","President Harry S Truman took America from its traditional isolationism into the age of international involvement. Despite his power, he never forgot where he came from. Today, visitors can experience the surroundings Truman knew as a young man of modest ambition through his political career and final years as a former president.","Grandview, Missouri"),
  ("havo","Hawaiʻi Volcanoes National Park","https://www.nps.gov/havo/index.htm","Hawai‘i Volcanoes National Park protects some of the most unique geological, biological, and cherished cultural landscapes in the world. Extending from sea level to 13,680 feet, the park encompasses the summits of two of the world's most active volcanoes - Kīlauea and Mauna Loa - and is a designated International Biosphere Reserve and UNESCO World Heritage Site.","Pahala, Hawaii"),
  ("heho","Herbert Hoover National Historic Site","https://www.nps.gov/heho/index.htm","Orphaned at age nine, Herbert Hoover left West Branch never to live here again. In later years, he returned to his humble birthplace to celebrate his long career of public service. A memorial landscape remains to tell his story: how community, hard work, honesty, and usefulness to others opened a world of opportunity— and the presidency of the United States— to a child of simple beginnings.","West Branch, Iowa"),
  ("jame","Historic Jamestowne Part of Colonial National Historical Park","https://www.nps.gov/jame/index.htm","Walk in the steps of Captain John Smith and Pocahontas where a successful English colonization of North America began. Despite early struggles to survive, the 1607 settlement evolved into a prosperous colony. As the colony expanded, the Virginia Indians were pushed out of their homeland. In 1619, the arrival of Africans was recorded, marking the origin of slavery in English North America.","Williamsburg, Virginia"),
  ("hofr","Home Of Franklin D Roosevelt National Historic Site","https://www.nps.gov/hofr/index.htm","Home to the 32nd and longest-serving president of the United States, Franklin D. Roosevelt returned to Hyde Park often, drawing on this place to renew his spirit during times of personal and political crisis. Explore the Roosevelt saga in the homes of Franklin and Eleanor Roosevelt, the exhibits at the nation’s first Presidential Library, and over a thousand acres of gardens and trails.","Hyde Park, New York"),
  ("home","Homestead National Historical Park","https://www.nps.gov/home/index.htm","The Homestead Act of 1862 transformed the world. Millions were invited to file claims including, families, immigrants, single women, and freed slaves. Over 10 percent of the United States was homesteaded! The land, long inhabited by American Indian cultures, changed forever. Homesteaders created settlements and farms, drove industrial advancement, and built our nation chasing the American Dream.","Beatrice, Nebraska"),
  ("hono","Hono'uli'uli National Historic Site","https://www.nps.gov/hono/index.htm","Although not yet open to the public, Hono‘uli‘uli National Historic Site will tell the history of incarceration, martial law, and the experience of prisoners of war in Hawai‘i during World War II. Hono‘uli‘uli National Historic Site will be a place to reflect on wartime experiences and recommit ourselves to the pursuit of freedom and justice.","Village Park, Hawaii"),
  ("hocu","Hopewell Culture National Historical Park","https://www.nps.gov/hocu/index.htm","Nearly 2000 years ago, American Indians built dozens of monumental mounds and earthen enclosures in southern Ohio. These earthwork complexes were ceremonial landscapes used for feasts, funerals, rituals, and rites of passage associated with an American Indian religious movement that swept over half the continent for almost 400 years. Come walk among the earthworks and experience the past.","North Fork Village, Ohio"),
  ("hofu","Hopewell Furnace National Historic Site","https://www.nps.gov/hofu/index.htm","Hopewell Furnace showcases an early American landscape of industrial operations from 1771-1883, Hopewell and other 'iron plantations' laid the foundation for the transformation of the United States into an industrial giant for the time. The park's 848 acres and historic structures illustrate the business, technology and lifestyle of our growing nation.","Birdsboro, Pennsylvania"),
  ("hobe","Horseshoe Bend National Military Park","https://www.nps.gov/hobe/index.htm","On 27 March 1814, Major General Andrew Jackson ‘s army of 3,300 men attacked Chief Menawa’s 1,000 Red Stick Creek warriors fortified in a horseshoe shaped bend of the Tallapoosa River. Over 800 Red Sticks died that day. The battle ended the Creek War, resulted in a land cession of 23,000,000 acres to the United States and created a national hero of Andrew Jackson.","Dadeville, Alabama"),
  ("hosp","Hot Springs National Park","https://www.nps.gov/hosp/index.htm","Hot Springs National Park has a rich cultural past. The grand architecture of our historic bathhouses is equally matched by the natural curiosities that have been drawing people here for hundreds of years. Ancient thermal springs, mountain views, incredible geology, forested hikes, and abundant creeks – all in the middle of town – make Hot Springs National Park a unique and beautiful destination.","Hot Springs National Park, Arkansas"),
  ("hove","Hovenweep National Monument","https://www.nps.gov/hove/index.htm","Once home to over 2,500 people, Hovenweep includes six prehistoric villages built between A.D. 1200 and 1300. Explore a variety of structures, including multistory towers perched on canyon rims and balanced on boulders. The construction and attention to detail will leave you marveling at the skill and motivation of the builders.","Towaoc, Colorado"),
  ("hutr","Hubbell Trading Post National Historic Site","https://www.nps.gov/hutr/index.htm","The squeaky wooden floor greets your entry into the oldest operating Trading Post on the Navajo Nation. When your eyes adjust to the dim light in the 'bullpen' you find you’ve just entered a mercantile. Hubbell Trading Post has been serving Ganado selling goods and Native American Art since 1878. Discover Hubbell Trading Post NHS, sheep, rugs, jewelry and so much more..","Ganado, Arizona"),
  ("iafl","Ice Age Floods National Geologic Trail","https://www.nps.gov/iafl/index.htm","At the end of the last Ice Age, 18,000 to 15,000 years ago, an ice dam in northern Idaho created Glacial Lake Missoula stretching 3,000 square miles around Missoula, Montana. The dam burst and released flood waters across Washington, down the Columbia River into Oregon before reaching the Pacific Ocean. The Ice Age Floods forever changed the lives and landscape of the Pacific Northwest.","Basin City, Washington"),
  ("iatr","Ice Age National Scenic Trail","https://www.nps.gov/iatr/index.htm","A mere 15,000 years ago during the Ice Age, much of North America lay under a huge glacier. Mammoths, saber tooth cats and cave lions roamed the earth! Some of the best evidence of this glacier is found in Wisconsin such as the state’s many lakes, river valleys, gently rolling hills, and ridges. The nearly 1,200 mile Ice Age National Scenic Trail, established in 1980, traces the glacier's edge.","Westfield, Wisconsin"),
  ("inde","Independence National Historical Park","https://www.nps.gov/inde/index.htm","The park represents the founding ideals of the nation, and preserves national and international symbols of freedom and democracy, including Independence Hall and the Liberty Bell. The Declaration of Independence and U.S. Constitution were both debated and signed inside Independence Hall, a UNESCO World Heritage Site.","Philadelphia, Pennsylvania"),
  ("indu","Indiana Dunes National Park","https://www.nps.gov/indu/index.htm","Lake Michigan's might has influenced Indiana Dunes for millennia. Wind and waves have shaped the land, leaving a rich mosaic of habitats along these 15 miles of Indiana coast. Over 50 miles of trails lead through shifting sand dunes, quiet woodlands, sunny prairies and lush wetlands. Known for its striking plant and bird diversity, it's easy to find inspiration throughout the park’s 15,000 acres.","Porter, Indiana"),
  ("isro","Isle Royale National Park","https://www.nps.gov/isro/index.htm","Explore a rugged, isolated island far from our connected communities. Isle Royale offers adventures for backpackers, hikers, boaters, paddlers, and divers. Cross Lake Superior and make a commitment: Become a part of this island, and let it become a part of you. Find peace and refuge in island wilderness – because Isle Royale, in turn, finds refuge in us. Help Isle Royale stay wild.","Thunder Bay, Ontario"),
  ("inup","Iñupiat Heritage Center","https://www.nps.gov/inup/index.htm","On the rooftop of the world, the Iñupiat Heritage Center in Barrow, Alaska, tells the story of the Iñupiat people. They have thrived for thousands of years in one of the harshest climates on Earth, hunting the bowhead, or 'Agviq.' In the 19th century, these lonely seas swarmed with commercial whalemen from New England, who also sought the bowhead for its valuable baleen and blubber.","Barrow, Alaska"),
  ("jaga","James A Garfield National Historic Site","https://www.nps.gov/jaga/index.htm","A front porch can serve many purposes. For some, it is a place to enjoy the breeze on a warm summer night. For others, a perch from which to keep eyes on what's happening in their neighborhood. In 1880, James Garfield used his front porch as a platform to greet thousands of well-wishers during his presidential campaign. Today, the porch serves as a gateway to the story of the Garfield family.","Mentor, Ohio"),
  ("jela","Jean Lafitte National Historical Park and Preserve","https://www.nps.gov/jela/index.htm","In Jean Lafitte's day, silver and gold filled a pirate's treasure chest, but today's treasures are people, places, and memories. Discover New Orleans’ rich cultural mix. Learn Cajun traditions from people who live them. Watch an alligator bask on a bayou’s bank. Walk in the footsteps of the men who fought at 1815’s Battle of New Orleans. Follow the link to discover the treasure of Jean Lafitte.","Estelle, Louisiana"),
  ("jeca","Jewel Cave National Monument","https://www.nps.gov/jeca/index.htm","Immerse yourself within the third longest cave in the world. With over 210 miles of mapped and surveyed passages, this underground wilderness appeals to human curiosity. Its splendor is revealed through fragile formations and glimpses of brilliant color. Its maze of passages lure explorers, and its scientific wealth remains a mystery. This resource is truly a jewel in the National Park Service.","Custer, South Dakota"),
  ("jica","Jimmy Carter National Historical Park","https://www.nps.gov/jica/index.htm","Few U.S. Presidents have had such close ties with where they were born and raised. The rural southern culture of Plains, Georgia, that revolves around farming, church and school, had a large influence in molding the character and in shaping the political policies of the 39th President of the United States.","Preston, Georgia"),
  ("joda","John Day Fossil Beds National Monument","https://www.nps.gov/joda/index.htm","Colorful rock formations at John Day Fossil Beds preserve a world class record of plant and animal evolution, changing climate, and past ecosystems that span over 40 million years. Exhibits and a working lab at the Thomas Condon Visitor Center as well as scenic drives and hikes at all three units allow visitors to explore the prehistoric past of Oregon and see science in action.","Fossil, Oregon"),
  ("jofi","John Fitzgerald Kennedy National Historic Site","https://www.nps.gov/jofi/index.htm","As a boy, JFK’s parents never expected he would grow up to be president. Yet in his birthplace home he learned values that inspired a life in public service. His mother, Rose Kennedy, recreated her family’s first home to share her memories of those early years with visitors. We commemorate not only his early life, but the ideas and principles he left behind.","Brookline, Massachusetts"),
  ("jomu","John Muir National Historic Site","https://www.nps.gov/jomu/index.htm","John Muir played many roles in his life, all of which helped him succeed in his role as an advocate for Nature. As America’s most famous naturalist and conservationist, Muir fought to protect the wild places he loved, places we can still visit today. Muir’s writings convinced the U.S. government to protect Yosemite, Sequoia, Grand Canyon and Mt. Rainier as national parks.","Mountain View, California"),
  ("jofl","Johnstown Flood National Memorial","https://www.nps.gov/jofl/index.htm","The South Fork dam failed on Friday, May 31, 1889 and unleashed 20,000,000 tons of water that devastated Johnstown, PA. The flood killed 2,209 people but it brought the nation and the world together to aid the 'Johnstown sufferers.' The story of the Johnstown Flood reminds us all, '...that we must leave nothing undone for the preservation and protection of our brother men.'","Salix, Pennsylvania"),
  ("jotr","Joshua Tree National Park","https://www.nps.gov/jotr/index.htm","Two distinct desert ecosystems, the Mojave and the Colorado, come together in Joshua Tree National Park. A fascinating variety of plants and animals make their homes in a land sculpted by strong winds and occasional torrents of rain. Dark night skies, a rich cultural history, and surreal geologic features add to the wonder of this vast wilderness in southern California. Come explore for yourself.","Twentynine Palms, California"),
  ("juba","Juan Bautista de Anza National Historic Trail","https://www.nps.gov/juba/index.htm","'¡Vayan Subiendo!'('Everyone mount up!') was the rousing call from Juan Bautista de Anza. In 1775-76, he led some 240 men, women, and children on an epic journey to establish the first non-Native settlement at San Francisco Bay. Today, the 1,200-mile Juan Bautista de Anza National Historic Trail connects history, culture, and outdoor recreation from Nogales, Arizona, to the San Francisco Bay Area.","March Air Force Base, California"),
  ("kala","Kalaupapa National Historical Park","https://www.nps.gov/kala/index.htm","When Hansen's disease (leprosy) was introduced to the Hawaiian Islands, King Kamehameha V banished all afflicted to the isolated Kalaupapa Peninsula on the north shore of Molokai. Since 1866, more than 8,000 people, mostly Hawaiians, have died at Kalaupapa. Once a prison, Kalaupapa is now a refuge for the few remaining residents who are cured but were forced to live their lives in isolation.","Kualapu'u, Hawaii"),
  ("kaho","Kaloko-Honokōhau National Historical Park","https://www.nps.gov/kaho/index.htm","To survive in a hot and arid environment the native Hawaiians (kanaka maoli) used ancient fishing skills, including the building of fishponds, and the knowledge of the location of precious fresh water (wai) that flows into the many brackish pools throughout the park. The spirit of the people (poe) and the knowledge of the elders (kupuna) created a tradition of respect and reverence for this area.","Kailua-Kona, Hawaii"),
  ("kaww","Katahdin Woods and Waters National Monument","https://www.nps.gov/kaww/index.htm","Spread across a wild landscape offering spectacular views of Mount Katahdin, Katahdin Woods and Waters invites discovery of its rivers, streams, woods, flora, fauna, geology, and the night skies that have attracted humans for millennia.","Patten, Maine"),
  ("katm","Katmai National Park & Preserve","https://www.nps.gov/katm/index.htm","A landscape is alive underneath our feet, filled with creatures that remind us what it is to be wild. Katmai was established in 1918 to protect the volcanically devastated region surrounding Novarupta and the Valley of Ten Thousand Smokes. Today, Katmai National Park and Preserve also protects 9,000 years of human history and important habitat for salmon and thousands of brown bears.","Kodiak Station, Alaska"),
  ("kefj","Kenai Fjords National Park","https://www.nps.gov/kefj/index.htm","At the edge of the Kenai Peninsula lies a land where the ice age lingers. Nearly 40 glaciers flow from the Harding Icefield, Kenai Fjords' crowning feature. Wildlife thrives in icy waters and lush forests around this vast expanse of ice. Sugpiaq people relied on these resources to nurture a life entwined with the sea. Today, shrinking glaciers bear witness to the effects of our changing climate.","Seward, Alaska"),
  ("keaq","Kenilworth Park & Aquatic Gardens","https://www.nps.gov/keaq/index.htm","Deep within Kenilworth lies an oasis, hidden behind trees and cattails. It's a place where beavers build their homes and turtles sleep on logs. Lotus blooms rise from the muck and lilies sit on the water. The wind dances with the dragonflies, rustling through the trees, carrying the song of the birds until it brushes across your face, fading to a whisper, saying 'come join.'","Colmar Manor, Maryland"),
  ("kemo","Kennesaw Mountain National Battlefield Park","https://www.nps.gov/kemo/index.htm","Kennesaw Mountain National Battlefield Park is a 2,965 acre National Battlefield that preserves a Civil War battleground of the Atlanta Campaign. Opposing forces maneuvered and fought here from June 19, 1864 until July 2, 1864. Although most famous as a Civil War battlefield, Kennesaw Mountain has a much richer story.","Marietta, Georgia"),
  ("kewe","Keweenaw National Historical Park","https://www.nps.gov/kewe/index.htm","From 7,000 years ago to the 1900s people mined Keweenaw copper. Native peoples made copper into tools and trade items. Investors and immigrants arrived in the 1800s in a great mineral rush, developing thriving industries and cosmopolitan communities. Though the mines have since closed, their mark is still visible on the land and people.","Dollar Bay, Michigan"),
  ("kimo","Kings Mountain National Military Park","https://www.nps.gov/kimo/index.htm","Thomas Jefferson called it 'The turn of the tide of success.' The battle of Kings Mountain, fought October 7th, 1780, was an important American victory during the Revolutionary War. The battle was the first major patriot victory to occur after the British invasion of Charleston, SC in May 1780. The park preserves the site of this important battle.","White Plains, North Carolina"),
  ("klse","Klondike Gold Rush - Seattle Unit National Historical Park","https://www.nps.gov/klse/index.htm","Seattle flourished during and after the Klondike Gold Rush. Merchants supplied people from around the world passing through this port city on their way to a remarkable adventure in the Yukon Territory of Canada. Today, the park is your gateway to learn about the Klondike Gold Rush, explore the area's public lands, and engage with the local community.","Seattle, Washington"),
  ("klgo","Klondike Gold Rush National Historical Park","https://www.nps.gov/klgo/index.htm","Headlines screamed 'Gold!' The dream of a better life catapulted thousands of people to Alaska and the Yukon Territory. Their journey shaped them, and changed the people they encountered and the north forever. Today, the park remembers the trails, boomtowns, and stories of the Klondike Gold Rush.","Haines, Alaska"),
  ("knri","Knife River Indian Villages National Historic Site","https://www.nps.gov/knri/index.htm","Earthlodge people hunted bison and other game, but were in essence farmers living in villages along the Missouri and its tributaries. The site was a major Native American trade center for hundreds of years prior to becoming an important market place for fur traders after 1750.","Stanton, North Dakota"),
  ("kova","Kobuk Valley National Park","https://www.nps.gov/kova/index.htm","Caribou, sand dunes, the Kobuk River, Onion Portage - just some of the facets of Kobuk Valley National Park. Half a million caribou migrate through, their tracks crisscrossing sculpted dunes. The Kobuk River is an ancient and current corridor for people and wildlife. For 9000 years, people came to Onion Portage to harvest caribou as they swam the river. Even today, that rich tradition continues.","Kotzebue, Alaska"),
  ("kowa","Korean War Veterans Memorial","https://www.nps.gov/kowa/index.htm","At the Korean War Veterans Memorial, 'Our nation honors her sons and daughters who answered the call to defend a country they never knew and a people they never met.'","Washington, D.C., Washington, D.C."),
  ("lyba","LBJ Memorial Grove on the Potomac","https://www.nps.gov/lyba/index.htm","From this distance the seat of national power appears pristine across the river, so President Johnson came here often when he needed to escape from the stresses of building a Great Society. After he died, his wife chose this place for his memorial. A landscape of serpentine paths, white pines, a granite monolith, and an open meadow honors his legacy of social justice and conservation legislation.","Washington, D.C., Washington, D.C."),
  ("lacl","Lake Clark National Park & Preserve","https://www.nps.gov/lacl/index.htm","Lake Clark National Park and Preserve is a land of stunning beauty. Volcanoes steam, salmon run, bears forage, and craggy mountains reflect in shimmering turquoise lakes. Here, too, local people and culture still depend on the land and water. Venture into the park to become part of the wilderness.","Anchor Point, Alaska"),
  ("lake","Lake Mead National Recreation Area","https://www.nps.gov/lake/index.htm","Swim, boat, hike, cycle, camp and fish at America’s first and largest national recreation area. With striking landscapes and brilliant blue waters, this year-round playground spreads across 1.5 million acres of mountains, canyons, valleys and two vast lakes. See the Hoover Dam from the waters of Lake Mead or Lake Mohave, or find solitude in one of the park's nine wilderness areas.","Meadview, Arizona"),
  ("lamr","Lake Meredith National Recreation Area","https://www.nps.gov/lamr/index.htm","Within the dry, windswept plains of the Texas Panhandle lies a hidden oasis, a welcoming haven where wildlife and people find relief from the dry grasslands above. Through this flat plain, the Canadian River has cut dramatic 200-foot canyons, or breaks, where humans lived 13,000 years ago. Lake Meredith occupies these hidden coves and is a haven for migratory birds and other wildlife.","Fritch, Texas"),
  ("laro","Lake Roosevelt National Recreation Area","https://www.nps.gov/laro/index.htm","The ancient geologic landscape of the upper Columbia River cradles Lake Roosevelt in walls of stone carved by massive ice age floods. Come explore the shorelines and learn the stories of American Indians, traders and trappers, settlers and dam builders who called this place home. Swim, boat, hike, camp, and fish at this hidden gem in Northeast Washington, created by the Grand Coulee Dam.","Kettle Falls, Washington"),
  ("lavo","Lassen Volcanic National Park","https://www.nps.gov/lavo/index.htm","Lassen Volcanic National Park is home to steaming fumaroles, meadows freckled with wildflowers, clear mountain lakes, and numerous volcanoes. Jagged peaks tell the story of its eruptive past while hot water continues to shape the land.","Chester, California"),
  ("labe","Lava Beds National Monument","https://www.nps.gov/labe/index.htm","Lava Beds National Monument is a land of turmoil, both geological and historical. Over the last half-million years, volcanic eruptions on the Medicine Lake shield volcano have created a rugged landscape dotted with diverse volcanic features. More than 800 caves, Native American rock art sites, historic battlefields and campsites, and a high desert wilderness experience await you!","Tulelake, California"),
  ("lecl","Lewis & Clark National Historic Trail","https://www.nps.gov/lecl/index.htm","The Lewis and Clark National Historic Trail winds nearly 4,900 miles through the homelands of more than 60 Tribal nations. It follows the historic outbound and inbound routes of the Lewis and Clark Expedition of 1803-1806 from Pittsburgh, Pennsylvania to the Pacific Ocean. Follow the trail to find the people, places, and stories that make up the complex legacy of the expedition.","Omaha, Nebraska"),
  ("lewi","Lewis and Clark National Historical Park","https://www.nps.gov/lewi/index.htm","Explore the timeless rainforests and majestic coastal vistas. Discover the rich heritage of the native people. Unfold the dramatic stories of America's most famous explorers. The park encompasses sites along the Columbia River and the Pacific Coast. Follow in the footsteps of the explorers and have an adventure in history.","Warrenton, Oregon"),
  ("libo","Lincoln Boyhood National Memorial","https://www.nps.gov/libo/index.htm","Abraham Lincoln grew from youth to manhood on this southern Indiana soil. Many character and moral traits of one of the world's most respected leaders was formed and nurtured here. Explore Lincoln's boyhood and learn about the boy who would one day become the leader of our nation.","Dale, Indiana"),
  ("liho","Lincoln Home National Historic Site","https://www.nps.gov/liho/index.htm","Abraham Lincoln believed in the ideal that everyone in America should have the opportunity to improve their economic and social condition. Lincoln’s life was the embodiment of that idea. We know him as the sixteenth president but he was also a spouse, parent, and neighbor who experienced the same hopes, dreams, and challenges of life that are still experienced by many people today.","Springfield, Illinois"),
  ("linc","Lincoln Memorial","https://www.nps.gov/linc/index.htm","'...as in the hearts of the people for whom he saved the Union, the memory of Abraham Lincoln is enshrined forever.' Beneath these words, the 16th president of the United States sits immortalized in marble as an enduring symbol of unity, strength, and wisdom.","Washington, D.C., Washington, D.C."),
  ("libi","Little Bighorn Battlefield National Monument","https://www.nps.gov/libi/index.htm","This area memorializes the US Army's 7th Cavalry and the Lakotas and Cheyennes in one of the Indian's last armed efforts to preserve their way of life. Here on June 25 and 26 of 1876, 263 soldiers, including Lt. Col. George A. Custer and attached personnel of the US Army, died fighting several thousand Lakota and Cheyenne warriors.","Crow Agency, Montana"),
  ("liri","Little River Canyon National Preserve","https://www.nps.gov/liri/index.htm","Little River is unique because it flows for most of its length atop Lookout Mountain in northeast Alabama. Forested uplands, waterfalls, canyon rims and bluffs, pools, boulders, and sandstone cliffs offer settings for a variety of recreational activities. Natural resources and cultural heritage come together to tell the story of the Preserve, a special place in the Southern Appalachians.","Fort Payne, Alabama"),
  ("chsc","Little Rock Central High School National Historic Site","https://www.nps.gov/chsc/index.htm","In 1957, Little Rock Central High School was the epicenter of confrontation and a catalyst for change as the fundamental test for the United States to enforce African American civil rights following Brown v. Board of Education. Learn how the sacrifice and struggle endured by the Little Rock Nine have provided opportunities and opened doors for those seeking equality and education around the world.","Little Rock, Arkansas"),
  ("long","Longfellow House Washington's Headquarters National Historic Site","https://www.nps.gov/long/index.htm","Longfellow House-Washington's Headquarters National Historic Site preserves the home of Henry W. Longfellow, one of the world’s foremost 19th century poets. The house also served as headquarters for General George Washington during the Siege of Boston, July 1775 - April 1776. In addition to its rich history, the site offers unique opportunities to explore 19th century literature and arts.","Cambridge, Massachusetts"),
  ("lowe","Lowell National Historical Park","https://www.nps.gov/lowe/index.htm","Discover the Continuing Revolution. Lowell’s water-powered textile mills catapulted the nation – including immigrant families and early female factory workers – into an uncertain new industrial era. Nearly 200 years later, the changes that began here still reverberate in our shifting global economy. Explore Lowell, a living monument to the dynamic human story of the Industrial Revolution.","Lowell, Massachusetts"),
  ("lode","Lower Delaware National Wild and Scenic River","https://www.nps.gov/lode/index.htm","The largest free-flowing river in the eastern United States, the Delaware River runs past forests, farmlands, and villages, and it also links some of the most densely populated regions in America. In 2000, the National Wild and Scenic River System incorporated key segments of the lower Delaware River to form this unit of the National Park System.","New Hope, Pennsylvania"),
  ("loea","Lower East Side Tenement Museum National Historic Site","https://www.nps.gov/loea/index.htm","The Tenement Museum tells the stories of working-class tenement residents, who moved to New York City from other countries and other parts of the country. Their work helped build the city and nation, and their stories help us understand our history. The museum shares these stories through guided tours of recreated tenement apartments, neighborhood walking tours, and virtual tours and programs.","New York City, New York"),
  ("lyjo","Lyndon B Johnson National Historical Park","https://www.nps.gov/lyjo/index.htm","---Lyndon Baines Johnson Lyndon B. Johnson National Historical Park tells the story of our 36th President beginning with his ancestors until his final resting place on his beloved LBJ Ranch. This entire 'circle of life' gives the visitor a unique perspective into one of America's most noteworthy citizens by providing the most complete picture of any American president.","Johnson City, Texas"),
  ("mawa","Maggie L Walker National Historic Site","https://www.nps.gov/mawa/index.htm","Maggie Lena Walker devoted her life to civil rights advancement, economic empowerment, and educational opportunities for Jim Crow-era African Americans and women. As a bank president, newspaper editor, and fraternal leader, Walker served as an inspiration of pride and progress. Today, Walker’s home is preserved as a tribute to her enduring legacy of vision, courage, and determination.","Richmond, Virginia"),
  ("maac","Maine Acadian Culture","https://www.nps.gov/maac/index.htm","Maine Acadians share beliefs and experiences tying them to a common religion, languages, and history. The St. John River, land, and family are essential to their culture. The National Park Service supports the Maine Acadian Heritage Council, an association of historical societies, cultural clubs, towns, and museums that work together to support Maine Acadian culture in the St. John Valley.","Fort Kent, Maine"),
  ("maca","Mammoth Cave National Park","https://www.nps.gov/maca/index.htm","Rolling hills, deep river valleys, and the worlds longest known cave system. Mammoth Cave National Park is home to thousands of years of human history and a rich diversity of plant and animal life, earning it the title of UNESCO World Heritage Site and International Biosphere Reserve.","Brownsville, Kentucky"),
  ("mana","Manassas National Battlefield Park","https://www.nps.gov/mana/index.htm","On July 21, 1861, two armies clashed for the first time on the fields overlooking Bull Run. Heavy fighting swept away any notion of a quick war. In August 1862, Union and Confederate armies converged for a second time on the plains of Manassas. The Confederates won a solid victory bringing them to the height of their power.","Bull Run, Virginia"),
  ("mapr","Manhattan Project National Historical Park","https://www.nps.gov/mapr/index.htm","The Manhattan Project is one of the most transformative events of the 20th century. It ushered in the nuclear age with the development of the world’s first atomic bombs. The building of atomic weapons began in 1942 in three secret communities across the nation. As World War II waned in 1945, the United States dropped the atomic bombs on Hiroshima and Nagasaki, Japan — forever changing the world.","Los Alamos, New Mexico"),
  ("manz","Manzanar National Historic Site","https://www.nps.gov/manz/index.htm","In 1942, the United States government ordered more than 110,000 men, women, and children to leave their homes and detained them in remote, military-style camps. Manzanar War Relocation Center was one of ten camps where the US government incarcerated Japanese immigrants ineligible for citizenship and Japanese American citizens during World War II.","Lone Pine, California"),
  ("mabi","Marsh - Billings - Rockefeller National Historical Park","https://www.nps.gov/mabi/index.htm","Experience wintry conditions and bracing temperatures along both groomed cross-country ski trails and natural snowshoe trails in the folded hilly landscape of the park. Reflect on the story of stewardship, of people taking care of places – sharing an enduring connection to the land - as you observe the tall trees, wildlife and experience the peacefulness of the woods.","Woodstock, Vermont"),
  ("mlkm","Martin Luther King, Jr. Memorial","https://www.nps.gov/mlkm/index.htm","Located in downtown Washington, DC, the memorial honors Martin Luther King, Jr.'s legacy and the struggle for freedom, equality, and justice. A prominent leader in the modern civil rights movement, Dr. King was a tireless advocate for racial equality, working class, and the oppressed around the world.","Washington, D.C., Washington, D.C."),
  ("malu","Martin Luther King, Jr. National Historical Park","https://www.nps.gov/malu/index.htm","A young boy grows up in a time of segregation…A dreamer is moved by destiny into leadership of the modern civil rights movement…This was Martin Luther King, Jr. Come hear his story, visit the home of his birth, and where he played as a child. Walk in his footsteps, and hear his voice in the church where he moved hearts and minds. Marvel at how he was an instrument for social change.","Atlanta, Georgia"),
  ("mava","Martin Van Buren National Historic Site","https://www.nps.gov/mava/index.htm","Today, Martin Van Buren is an obscure man, often little more than a footnote. In pre-Civil War America, however, it was impossible not to have an opinion of him. Van Buren was central to the creation of America's political parties, and to the largest crisis of his time, slavery. The above quote is from Davy Crockett, one of many Americans trying to understand the Red Fox of Kinderhook.","Kinderhook, New York"),
  ("mamc","Mary McLeod Bethune Council House National Historic Site","https://www.nps.gov/mamc/index.htm","Mary McLeod Bethune achieved her greatest recognition at the Washington, DC townhouse that is now this National Historic Site. The Council House was the first headquarters of the National Council of Negro Women (NCNW) and was Bethune’s last home in Washington, DC. From here, Bethune and the NCNW spearheaded strategies and developed programs that advanced the interests of African American women.","Washington, D.C., Washington, D.C."),
  ("memy","Medgar and Myrlie Evers Home National Monument","https://www.nps.gov/memy/index.htm","Medgar and Myrlie Evers were partners in the civil rights struggle. The assassination of Medgar Evers in the carport of their home on June 12, 1963, was the first murder of a nationally significant leader of the American Civil Rights Movement, and it became a catalyst for passage of the Civil Rights Act of 1964. Myrlie Evers continued to promote issues of racial equality and social justice.","Jackson, Mississippi"),
  ("meve","Mesa Verde National Park","https://www.nps.gov/meve/index.htm","For over 700 years, the Ancestral Pueblo people built thriving communities on the mesas and in the cliffs of Mesa Verde. Today, the park protects the rich cultural heritage of 26 Pueblos and Tribes and offers visitors a spectacular window into the past. This World Heritage Site and International Dark Sky Park is home to over a thousand species, including several that live nowhere else on earth.","Cortez, Colorado"),
  ("misp","Mill Springs Battlefield National Monument","https://www.nps.gov/misp/index.htm","The Union won a significant victory early in the Civil War at The Battle of Mill Springs. Explore the rolling fields of Kentucky where the battle took place and learn about that state's strategic importance to both sides of the fight.","Somerset, Kentucky"),
  ("miin","Minidoka National Historic Site","https://www.nps.gov/miin/index.htm","The Pearl Harbor attack intensified existing hostility towards Japanese Americans. As wartime hysteria mounted, President Roosevelt signed Executive Order 9066. Over 120,000 persons of Japanese ancestry (Nikkei) had to leave their homes, jobs, and lives behind, and were forced into one of ten prison camps spread across the nation. This is Minidoka's story.","Jerome, Idaho"),
  ("mima","Minute Man National Historical Park","https://www.nps.gov/mima/index.htm","At Minute Man National Historical Park the opening battle of the Revolution is brought to life as visitors explore the battlefields and structures associated with April 19, 1775, and witness the American revolutionary spirit through the writings of the Concord authors.","Lincoln, Massachusetts"),
  ("mimi","Minuteman Missile National Historic Site","https://www.nps.gov/mimi/index.htm","During the Cold War, a vast arsenal of nuclear missiles were placed in the Great Plains. Hidden in plain sight, for thirty years 1,000 missiles were kept on constant alert; hundreds remain today. The Minuteman Missile remains an iconic weapon in the American nuclear arsenal. It holds the power to destroy civilization, but is meant as a nuclear deterrent to maintain peace and prevent war.","Philip, South Dakota"),
  ("miss","Mississippi National River & Recreation Area","https://www.nps.gov/miss/index.htm","In the middle of a bustling urban setting, this 72 mile river park offers quiet stretches for fishing, boating and canoeing, birdwatching, bicycling, and hiking. And there are plenty of visitor centers and trails that highlight the fascinating human history of the Mississippi River. This a great place to start your exploration of this important river.","Saint Paul, Minnesota"),
  ("mnrr","Missouri National Recreational River","https://www.nps.gov/mnrr/index.htm","Imagine a 100-mile stretch of North America's longest river, a vestige of the untamed American West. The Missouri National Recreational River is where imagination meets reality. Two free flowing stretches of the Missouri make up the National Park. Relive the past by making an exploration of the wild, untamed and mighty river that continues to flow as nature intended.","Bloomfield, Nebraska"),
  ("moja","Mojave National Preserve","https://www.nps.gov/moja/index.htm","Mojave preserves a diverse mosaic of ecological habitats and a 10,000 year history of human connection with the desert. Offering extensive opportunities to experience desert landscapes, the preserve promotes understanding and appreciation for the increasingly threatened resources of the Mojave Desert. This remote preserve encourages a sense of discovery and a connection to wild places.","Sandy Valley, Nevada"),
  ("mono","Monocacy National Battlefield","https://www.nps.gov/mono/index.htm","During the summer of 1864, the Confederacy carried out a bold plan to turn the tide of the Civil War in their favor. They planned to capture Washington, DC and influence the election of 1864. On July 9, however, Federal soldiers outnumbered three to one, fought gallantly along the banks of the Monocacy River in an effort to buy time for Union reinforcement to arrive in Washington, DC.","Ballenger Creek, Maryland"),
  ("moca","Montezuma Castle National Monument","https://www.nps.gov/moca/index.htm","Established December 8, 1906, Montezuma Castle is the third National Monument dedicated to preserving Native American culture. This 20 room high-rise apartment, nestled into a towering limestone cliff, tells a story of ingenuity, survival and ultimately, prosperity in an unforgiving desert landscape.","Lake Montezuma, Arizona"),
  ("mocr","Moores Creek National Battlefield","https://www.nps.gov/mocr/index.htm","In the early morning hours of February 27, 1776, Loyalist forces charged across a partially dismantled Moores Creek Bridge. Beyond the bridge, nearly 1,000 North Carolina Patriots waited quietly with cannons and muskets poised to fire. This battle marked the last broadsword charge by Scottish Highlanders and the first significant victory for the Patriots in the American Revolution.","Burgaw, North Carolina"),
  ("mopi","Mormon Pioneer National Historic Trail","https://www.nps.gov/mopi/index.htm","Explore the Mormon Pioneer National Historic Trail across five states to see the 1,300-mile route traveled by Mormons who fled Nauvoo, Illinois, to the Great Salt Lake Valley in 1846-1847.","Ogallala, Nebraska"),
  ("morr","Morristown National Historical Park","https://www.nps.gov/morr/index.htm","Morristown National Historical Park commemorates the sites of General Washington and the Continental army’s winter encampment of December 1779 to June 1780, where they survived through what would be the coldest winter on record. The park also maintains a museum & library collection related to the encampments & George Washington, as well as items relating to pre- and post-Revolutionary America.","Bernardsville, New Jersey"),
  ("mora","Mount Rainier National Park","https://www.nps.gov/mora/index.htm","Ascending to 14,410 feet above sea level, Mount Rainier stands as an icon in the Washington landscape. An active volcano, Mount Rainier is the most glaciated peak in the contiguous U.S.A., spawning five major rivers. Subalpine wildflower meadows ring the icy volcano while ancient forest cloaks Mount Rainier’s lower slopes. Wildlife abounds in the park’s ecosystems. A lifetime of discovery awaits.","Buckley, Washington"),
  ("moru","Mount Rushmore National Memorial","https://www.nps.gov/moru/index.htm","Majestic figures of George Washington, Thomas Jefferson, Theodore Roosevelt and Abraham Lincoln, surrounded by the beauty of the Black Hills of South Dakota, tell the story of the birth, growth, development and preservation of this country. From the history of the first inhabitants to the diversity of America today, Mount Rushmore brings visitors face to face with the rich heritage we all share.","Custer, South Dakota"),
  ("muwo","Muir Woods National Monument","https://www.nps.gov/muwo/index.htm","Walk among old growth coast redwoods, cooling their roots in the fresh water of Redwood Creek and lifting their crowns to reach the sun and fog. Federally protected as a National Monument since 1908, this primeval forest is both refuge and laboratory, revealing our relationship with the living landscape. What will you discover in Muir Woods?","Mill Valley, California"),
  ("natc","Natchez National Historical Park","https://www.nps.gov/natc/index.htm","Discover the history of all the peoples of Natchez, Mississippi, from European settlement, African enslavement, the American cotton economy, to the Civil Rights struggle on the lower Mississippi River.","Natchez, Mississippi"),
  ("natt","Natchez Trace National Scenic Trail","https://www.nps.gov/natt/index.htm","The Natchez Trace National Scenic Trail is five sections of hiking trail running roughly parallel to the 444-mile long Natchez Trace Parkway scenic motor road. The foot trails total more than 60 miles and offer opportunities to explore wetlands, swamps, hardwood forest, and the history of the area. For What's Open What's Close visit www.nps.gov/natr/planyourvisit/what-is-open-what-is-closed.htm","Saltillo, Mississippi"),
  ("natr","Natchez Trace Parkway","https://www.nps.gov/natr/index.htm","The Natchez Trace Parkway is a 444-mile recreational road and scenic drive through three states. It roughly follows the 'Old Natchez Trace' a historic travel corridor used by American Indians, 'Kaintucks,' European settlers, slave traders, soldiers, and future presidents. Today, people can enjoy not only a scenic drive but also hiking, biking, horseback riding, and camping along the Parkway.","Houston, Mississippi"),
  ("nace","National Capital Parks-East","https://www.nps.gov/nace/index.htm","Welcome to National Capital Parks-East. We invite you to journey to the parks east of the Capitol of Washington, D.C. National Capital Parks-East consists of 14 park sites, parkways and statuary covering more than 8,000 acres of historic, cultural, and recreational parklands from Capitol Hill to the nearby Maryland suburbs.","Glassmanor, Maryland"),
  ("nama","National Mall and Memorial Parks","https://www.nps.gov/nama/index.htm","This is where the nation comes to remember and where history is made. As “America’s Front Yard,” the National Mall and Memorial Parks is home to many of our country’s most iconic memorials telling the story of people and events that shaped us as a nation. Each year, millions of people come to recreate, commemorate presidential legacies, honor our veterans, and make their voices heard.","Washington, D.C., Washington, D.C."),
  ("npsa","National Park of American Samoa","https://www.nps.gov/npsa/index.htm","The National Park of American Samoa welcomes you into the heart of the South Pacific, to a world of sights, sounds, and experiences that you will find in no other national park in the United States. Enjoy this unique national park and the welcoming people of American Samoa. We are here to protect its rich culture and natural resources. Come explore them with us!","Ofu, Manu'a"),
  ("npnh","National Parks of New York Harbor","https://www.nps.gov/npnh/index.htm","These 12 sites preserve more than 400 years of American history! We invite you to explore the past and investigate its relevance in our lives today. From the birth of American democracy to the evolution of commerce, harbor defense, ecology and immigration, the breadth of themes commemorated through the National Parks of New York Harbor reflect the richness and diversity of our heritage.","New York City, New York"),
  ("nabr","Natural Bridges National Monument","https://www.nps.gov/nabr/index.htm","Three majestic natural bridges invite you to ponder the power of water in a landscape usually defined by its absence. View them from an overlook, or hit the trails and experience their grandeur from below. Declared a National Monument in 1908, the bridges are named 'Kachina,' 'Owachomo' and 'Sipapu' in honor of the ancestral Puebloans who once made this place their home.","Blanding, Utah"),
  ("nava","Navajo National Monument","https://www.nps.gov/nava/index.htm","The Hopi, San Juan Southern Paiute, Zuni, and Navajo are tribes that have inhabited the canyons for centuries. Springs fed into farming land on the canyon floor and homes were built in the natural sandstone alcoves. The cliff dwellings of Betatakin, Keet Seel, and Inscription House were last physically occupied around 1300 AD but the villages have a spiritual presence that can still be felt today.","Kayenta, Arizona"),
  ("nebe","New Bedford Whaling National Historical Park","https://www.nps.gov/nebe/index.htm","'The town itself is perhaps the dearest place to live in, in all New England..nowhere in all America will you find more patrician-like houses, parks and gardens more opulent, than in New Bedford…all these brave houses and flowery gardens came from the Atlantic, Pacific, and Indian oceans. One and all, they were harpooned and dragged up hither from the bottom of the sea.' H. Melville, 'Moby-Dick'","New Bedford, Massachusetts"),
  ("neen","New England National Scenic Trail","https://www.nps.gov/neen/index.htm","From the Sound to the Summits: the New England Trail covers 215 miles from Long Island Sound across long ridges to scenic mountain summits in Connecticut and Massachusetts. The trail offers panoramic vistas and close-ups of New England’s natural and cultural landscape: traprock ridges, historic village centers, farmlands, unfragmented forests, quiet streams, steep river valleys and waterfalls.","Granby, Massachusetts"),
  ("pine","New Jersey Pinelands National Reserve","https://www.nps.gov/pine/index.htm","This is truly a special place. It's classified as a United States Biosphere Reserve and in 1978 was established by Congress as the country’s first National Reserve. It includes portions of seven southern New Jersey counties, and encompasses over one-million acres of farms, forests and wetlands. It contains 56 communities, from hamlets to suburbs, with over 700,000 permanent residents.","Magnolia, New Jersey"),
  ("jazz","New Orleans Jazz National Historical Park","https://www.nps.gov/jazz/index.htm","Only in New Orleans could there be a National Park for jazz! Drop by our visitor center at 419 Decatur Street to learn from a ranger talk, participate in a drum circle, enjoy a jazz concert, or inquire about musical events around town. There's no better place than New Orleans for a world class musical experience!","New Orleans, Louisiana"),
  ("neri","New River Gorge National Park & Preserve","https://www.nps.gov/neri/index.htm","A rugged, whitewater river flowing northward through deep canyons, the New River is among the oldest rivers on the continent. The park encompasses over 70,000 acres of land along the New River, is rich in cultural and natural history, and offers an abundance of scenic and recreational opportunities.","Stanaford, West Virginia"),
  ("nepe","Nez Perce National Historical Park","https://www.nps.gov/nepe/index.htm","Since time immemorial, the valleys, prairies, mountains, and plateaus of the inland northwest have been home to the nimíipuu (Nez Perce) people. Extremely resilient, they survived the settling of the United States and adapted to a changed world. Nez Perce National Historical Park consists of 38 places important to the history and culture of the nimíipuu. Explore these places. Learn their stories.","Kamiah, Idaho"),
  ("nico","Nicodemus National Historic Site","https://www.nps.gov/nico/index.htm","Formerly enslaved African Americans left Kentucky at the end of the of post-Civil War Reconstruction period to experience freedom in the 'Promised Land' of Kansas. Nicodemus represents the involvement of African Americans in the westward expansion and settlement of the Great Plains. It is the oldest and only remaining Black settlement west of the Mississippi River.","Hill City, Kansas"),
  ("nisi","Ninety Six National Historic Site","https://www.nps.gov/nisi/index.htm","Settlers struggled against the harsh backcountry to survive. Cherokee Indians hunted and fought to keep their land. Two towns and a trading post were formed then abandoned to the elements. And two Revolutionary War battles claimed over 100 lives. Come discover the 18th century history of South Carolina.","Ninety Six, South Carolina"),
  ("niob","Niobrara National Scenic River","https://www.nps.gov/niob/index.htm","With a little something for everyone, the Niobrara National Scenic River is a destination for crossing adventures off your bucket list. Most popular for river recreation, you can float the Niobrara River on a canoe, tube, or kayak as a beginner and have a blast. Hiking, biking, and wildlife watching keep our visitors busy. Oh! And we haven't even told you about the waterfalls yet.","Springview, Nebraska"),
  ("noat","Noatak National Preserve","https://www.nps.gov/noat/index.htm","As one of North America's largest mountain-ringed river basins with an intact ecosystem, the Noatak River environs feature some of the Arctic's finest arrays of plants and animals. The river is classified as a national wild and scenic river. It offers stunning wilderness float-trip opportunities - from deep in the Brooks Range to the tidewater of the Chukchi Sea.","Kotzebue, Alaska"),
  ("noca","North Cascades National Park","https://www.nps.gov/noca/index.htm","Less than three hours from Seattle, an alpine landscape beckons. Discover communities of life adapted to moisture in the west and recurring fire in the east. Explore jagged peaks crowned by more than 300 glaciers. Listen to cascading waters in forested valleys. Witness a landscape sensitive to the Earth's changing climate. Help steward the ecological heart of the Cascades.","Darrington, Washington"),
  ("noco","North Country National Scenic Trail","https://www.nps.gov/noco/index.htm","Come to the North Country. Trek the hills and valleys. Stand on the shores of lakes & streams from glaciers 10,000 years before. Clear-flowing water, red/gold of autumn, a fairyland of snow, open prairies, and distant horizons paint the land. Historic sites along the way tell how America settled and grew as a nation. From North Dakota to Vermont, adventure is never far away.","Ashland, Wisconsin"),
  ("obed","Obed Wild & Scenic River","https://www.nps.gov/obed/index.htm","The Obed Wild and Scenic River looks much the same today as it did when the first white settlers strolled its banks in the late 1700s. While meagerly populated due to poor farming soil, the river was a hospitable fishing and hunting area for trappers and pioneers. Today, the Obed stretches along the Cumberland Plateau and offers visitors a variety of outdoor recreational opportunities.","Wartburg, Tennessee"),
  ("ocmu","Ocmulgee Mounds National Historical Park","https://www.nps.gov/ocmu/index.htm","Welcome to Ocmulgee Mounds National Historical Park. This park is a prehistoric American Indian site, where many different American Indian cultures occupied this land for thousands of years. American Indians first came here during the Paleo-Indian Period hunting Ice Age mammals. Around 900 CE, the Mississippian Period began, and people constructed mounds for their elite, which remain here today.","Macon, Georgia"),
  ("okci","Oklahoma City National Memorial","https://www.nps.gov/okci/index.htm","The outdoor symbolic memorial is a place of quiet reflection, honoring victims, survivors, rescuers, and all who were changed forever on April 19, 1995. It encompasses the now sacred soil where the Alfred P. Murrah Federal Building once stood, capturing and preserving forever the place and events that changed the world.","Oklahoma City, Oklahoma"),
  ("olsp","Old Spanish National Historic Trail","https://www.nps.gov/olsp/index.htm","Follow the routes of mule pack trains across the Southwest on the Old Spanish National Historic Trail between Santa Fe, New Mexico, and Los Angeles, California. New Mexican traders moved locally produced merchandise across what are now six states to exchange for mules and horses.","Kanab, Utah"),
  ("olym","Olympic National Park","https://www.nps.gov/olym/index.htm","With its incredible range of precipitation and elevation, diversity is the hallmark of Olympic National Park. Encompassing nearly a million acres, the park protects a vast wilderness, thousands of years of human history, and several distinctly different ecosystems, including glacier-capped mountains, old-growth temperate rain forests, and over 70 miles of wild coastline. Come explore!","Port Angeles, Washington"),
  ("orca","Oregon Caves National Monument & Preserve","https://www.nps.gov/orca/index.htm","Deep within the Siskiyou Mountains are dark, twisting passages that await your discovery. Eons of acidic water seeping into marble rock created and decorated the wondrous “Marble Halls of Oregon.” Join a tour, get a taste of what caving is all about, and explore a mountain from the inside and out!","Williams, Oregon"),
  ("oreg","Oregon National Historic Trail","https://www.nps.gov/oreg/index.htm","Imagine yourself an emigrant headed for Oregon: would promises of lush farmlands and a new beginning lure you to leave home and walk for weeks? More than 2,000 miles of trail ruts and traces can still be seen along the Oregon National Historic Trail in six states and serve as reminders of the sacrifices, struggles, and triumphs of early American settlers.","Green River, Wyoming"),
  ("orpi","Organ Pipe Cactus National Monument","https://www.nps.gov/orpi/index.htm","Look closely. Look again. The sights and sounds of Organ Pipe Cactus National Monument, an International Biosphere Reserve, reveal a thriving community of plants and animals. Human stories echo throughout this desert preserve, chronicling thousands of years of desert living. A scenic drive, wilderness hike or a night of camping will expose you to a living desert that thrives.","Sonoyta, Sonora"),
  ("ovvi","Overmountain Victory National Historic Trail","https://www.nps.gov/ovvi/index.htm","Stretching 330 miles through four states (Virginia, Tennessee, North and South Carolina) the Overmountain Victory National Historic Trail traces the route used by patriot militia during the pivotal Kings Mountain campaign of 1780. Follow the campaign by utilizing a Commemorative Motor Route which uses existing state highways marked with the distinctive trail logo, or 87 miles of walkable pathways.","White Plains, North Carolina"),
  ("oxhi","Oxon Cove Park & Oxon Hill Farm","https://www.nps.gov/oxhi/index.htm","The diverse history of Maryland and our national heritage can be experienced at Oxon Cove Park. Through hands-on programs and other activities, you can experience farm life and how its changed over time. Explore how the park evolved from a plantation home during the War of 1812, to a hospital farm, to the park you can visit today.","Forest Heights, Maryland"),
  ("ozar","Ozark National Scenic Riverways","https://www.nps.gov/ozar/index.htm","Ozark National Scenic Riverways is the first national park area to protect a river system. The Current and Jacks Fork rivers are two of the finest floating rivers you'll find anywhere. Spring-fed, cold and clear they are a delight to canoe, swim, boat or fish. Besides these two famous rivers, the park is home to hundreds of freshwater springs, caves, trails and historic sites such as Alley Mill.","Eminence, Missouri"),
  ("pais","Padre Island National Seashore","https://www.nps.gov/pais/index.htm","Padre Island National Seashore separates the Gulf of Mexico from the Laguna Madre, one of a few hypersaline lagoons in the world. The park protects 66 miles of coastline, dunes, prairies, and wind tidal flats teeming with life. It is a safe nesting ground for the Kemp’s ridley sea turtle and a haven for over 380 bird species. It also has a rich history, including the Spanish shipwrecks of 1554.","Sarita, Texas"),
  ("paal","Palo Alto Battlefield National Historical Park","https://www.nps.gov/paal/index.htm","On May 8, 1846, United States and Mexican troops clashed on the prairie of Palo Alto. The battle was the first in a two-year long war that changed the map of North America. Palo Alto Battlefield National Historical Park preserves the site of this notable battle and provides an understanding of the causes, events, and consequences of the U.S.-Mexican War.","Los Fresnos, Texas"),
  ("pagr","Paterson Great Falls National Historical Park","https://www.nps.gov/pagr/index.htm","Cotton and silk fabrics; steam locomotives; continuous rolls of paper; airplane engines. What do these things have in common? They were all manufactured in the same place - Paterson, NJ. In 1792, Paterson was established, America's first planned industrial city, centered around the Great Falls of the Passaic River. From humble mills rose industries that changed the face of the United States.","Paterson, New Jersey"),
  ("peri","Pea Ridge National Military Park","https://www.nps.gov/peri/index.htm","On March 7-8, 1862, over 23,000 soldiers fought here to decide the fate of Missouri and was a turning point of the war in the West. The 4,300 acre battlefield honors those who fought and died on these grounds. Pea Ridge was the most pivotal Civil War battle west of the Mississippi River and is one of the most intact Civil War battlefields in the United States.","Pea Ridge, Arkansas"),
  ("valr","Pearl Harbor National Memorial","https://www.nps.gov/valr/index.htm","At the Pearl Harbor National Memorial, learn about one of the most pivotal moments in US history: the attack on Pearl Harbor, and the subsequent entry of the United States into World War II.","'Aiea, Hawaii"),
  ("peco","Pecos National Historical Park","https://www.nps.gov/peco/index.htm","Pecos is a cultural crossroads through which hunters and gatherers, traders, conquerors and explorers, immigrants, soldiers, ranchers and tourists passed. Walk the trails and imagine Pecos through the centuries. Explore sites where cultural demonstrations and traditional practices continue today - a living legacy of the people who passed this way. Welcome to Pecos, where past is present.","Pecos, New Mexico"),
  ("paav","Pennsylvania Avenue","https://www.nps.gov/paav/index.htm","A street unlike any other. It is known the world over as the heart of the Nation's Capital. America's history has marched, paraded, promenaded, and protested its way along the Avenue.","Washington, D.C., Washington, D.C."),
  ("pevi","Perry's Victory & International Peace Memorial","https://www.nps.gov/pevi/index.htm","Perry's Victory and International Peace Memorial was established to honor those who fought in the Battle of Lake Erie, during the War of 1812, and to celebrate the long-lasting peace among Great Britain, Canada and the U.S. The Memorial, a Doric column, rising 352 feet over Lake Erie is situated 5 miles from the longest undefended border in the world.","Port Clinton, Ohio"),
  ("pete","Petersburg National Battlefield","https://www.nps.gov/pete/index.htm","Nine and a half months, 70,000 casualties, the suffering of civilians, thousands of U. S. Colored Troops fighting for the freedom of their race, and the decline of Gen. Robert E. Lee's Army of No. Virginia all describe the Siege of Petersburg. It was here Gen. Ulysses S. Grant cut off all of Petersburg's supply lines ensuring the fall of Richmond on April 3, 1865. Six days later, Lee surrendered.","Matoaca, Virginia"),
  ("pefo","Petrified Forest National Park","https://www.nps.gov/pefo/index.htm","Park Hours: 8am to 5pm, MST. Don't forget that Arizona does not observe Daylight Savings. Would you like to see the park film? It is located at the park's YouTube Channel as well as the giftshop at Rainbow Forest.","Holbrook, Arizona"),
  ("petr","Petroglyph National Monument","https://www.nps.gov/petr/index.htm","Petroglyph National Monument protects one of the largest petroglyph sites in North America, featuring designs and symbols carved onto volcanic rocks by Native Americans and Spanish settlers 400 to 700 years ago. These images are a valuable record of cultural expression and hold profound spiritual significance for contemporary Native Americans and for the descendants of the early Spanish settlers.","Paradise Hills, New Mexico"),
  ("piro","Pictured Rocks National Lakeshore","https://www.nps.gov/piro/index.htm","Sandstone cliffs, beaches, waterfalls, sand dunes, inland lakes, deep forest, and wild shoreline beckon you to visit Pictured Rocks National Lakeshore. The power of Lake Superior shapes the park's coastal features and affects every ecosystem, creating a unique landscape to explore. Hiking, camping, sightseeing, and four-season outdoor opportunities abound.","Munising, Michigan"),
  ("pinn","Pinnacles National Park","https://www.nps.gov/pinn/index.htm","Some 23 million years ago multiple volcanoes erupted, flowed, and slid to form what would become Pinnacles National Park. What remains is a unique landscape. Travelers journey through chaparral, oak woodlands, and canyon bottoms. Hikers enter rare talus caves and emerge to towering rock spires teeming with life: prairie and peregrine falcons, golden eagles, and the inspiring California condor.","Soledad, California"),
  ("pisp","Pipe Spring National Monument","https://www.nps.gov/pisp/index.htm","The rich history of Pipe Spring and its flowing water comes alive as you explore the traditions of the Kaibab Paiute and the Mormon settlers through the museum, historic fort, cabins, and garden. Hike the Ridge Trail to enjoy geologic wonders, plants, and wildlife. Attend living history demonstrations and talks and be sure to visit with our amazing ranch animals!","Fredonia, Arizona"),
  ("pipe","Pipestone National Monument","https://www.nps.gov/pipe/index.htm","For countless generations, American Indians have quarried the red pipestone found at this site. These grounds are sacred to many people because the pipestone quarried here is carved into pipes used for prayer. Many believe that the pipe's smoke carries one's prayer to the Great Spirit. The traditions of quarrying and pipemaking continue here today.","Pipestone, Minnesota"),
  ("pisc","Piscataway Park","https://www.nps.gov/pisc/index.htm","Piscataway Park is home to bald eagles, beavers, deer, foxes, ospreys, and many other species. To complement the surroundings, the park has, in addition to a public fishing pier and two boardwalks over fresh water tidal wetlands, a variety of nature trails, meadows, and woodland areas. The Park is also home to National Colonial Farm.","Fort Hunt, Virginia"),
  ("pore","Point Reyes National Seashore","https://www.nps.gov/pore/index.htm","From its thunderous ocean breakers crashing against rocky headlands and expansive sand beaches to its open grasslands, brushy hillsides, and forested ridges, Point Reyes offers visitors over 1500 species of plants and animals to discover. Home to several cultures over thousands of years, the Seashore preserves a tapestry of stories and interactions of people. Point Reyes awaits your exploration.","Inverness, California"),
  ("poex","Pony Express National Historic Trail","https://www.nps.gov/poex/index.htm","It is hard to believe that young men once rode horses to carry mail from Missouri to California in the unprecedented time of only 10 days. This relay system along the Pony Express National Historic Trail in eight states was the most direct and practical means of east-west communications before the telegraph.","North Rock Springs, Wyoming"),
  ("poch","Port Chicago Naval Magazine National Memorial","https://www.nps.gov/poch/index.htm","On the evening of July 17, 1944, residents in the San Francisco east bay area were jolted awake by a massive explosion that cracked windows and lit up the night sky. At Port Chicago Naval Magazine, 320 men were instantly killed when two ships being loaded with ammunition for the Pacific theater troops blew up. It was WWII's worst home front disaster.","Bay Point, California"),
  ("pohe","Potomac Heritage National Scenic Trail","https://www.nps.gov/pohe/index.htm","The Potomac River corridor is rich in both history and recreation, offering a chance to both explore your heritage and choose your adventure along the way. Start your journey here!","Leesburg, Virginia"),
  ("popo","Poverty Point National Monument","https://www.nps.gov/popo/index.htm","Now a nearly forgotten culture, Poverty Point at its peak 3,000 years ago was part of an enormous trading network that stretched for hundreds of miles across the continent. It was - and is - also an engineering marvel, the product of five million hours of labor. Explore the culture of a highly sophisticated people who left behind one of North America’s most important archeological sites.","Monticello, Louisiana"),
  ("wicl","President William Jefferson Clinton Birthplace Home National Historic Site","https://www.nps.gov/wicl/index.htm","Named for the father who died shortly before his birth, William Jefferson Blythe III later became the 42nd President of the United States. In this place, the experiences shared with his mother & grandparents in rural Arkansas developed the broad views on race relations, social justice, and public service that defined his presidency and life after the White House. For Bill Clinton, 'Hope was home.'","Hope, Arkansas"),
  ("whho","President's Park (White House)","https://www.nps.gov/whho/index.htm","Every president except George Washington has called the White House home and has run the executive branch of the United States government from within its walls. Recognizable around the world, the White House stands as a symbol of democracy. The White House and its park grounds also serve as an iconic place for civil discourse.","Washington, D.C., Washington, D.C."),
  ("prsf","Presidio of San Francisco","https://www.nps.gov/prsf/index.htm","For 218 years, the Presidio served as an army post for three nations. World and local events, from military campaigns to World Fairs and earthquakes, left their mark. Come enjoy the history and the natural beauty of the Presidio. Explore centuries of architecture. Reflect in a national cemetery. Walk along an historic airfield, through forests or to beaches, and admire spectacular vistas.","San Francisco, California"),
  ("prwi","Prince William Forest Park","https://www.nps.gov/prwi/index.htm","Prince William Forest Park is an oasis, a respite of quiet and calm. In 1936, Chopawamsic Recreation Area opened its gates to house children's 'relief' camps during the Great Depression. Renamed Prince William Forest Park in 1948, these fragrant woods and trickling streams have welcomed generations of campers, hikers, bikers and nature lovers. Discover Northern Virginia's best kept secret!","Montclair, Virginia"),
  ("pull","Pullman National Monument","https://www.nps.gov/pull/index.htm","In a growing Chicago neighborhood, diverse people and stories intertwined. All were seeking opportunity. Some succeeded. Others were limited—by race, gender, or economic status. Their stories came together in Pullman, a planned industrial community famed for its urban design and architecture.","Dolton, Illinois"),
  ("puho","Puʻuhonua o Hōnaunau National Historical Park","https://www.nps.gov/puho/index.htm","Imagine you had just broken the sacred laws, the kapu, and the only punishment was death. Your only chance of survival is to elude your pursuers and reach the Puʻuhonua, a place of refuge. The Puʻuhonua protected the kapu breaker, defeated warriors, as well as civilians during the time of battle. No physical harm could come to those who reached the boundaries of the Puʻuhonua.","Honaunau-Napoopoo, Hawaii"),
  ("puhe","Puʻukoholā Heiau National Historic Site","https://www.nps.gov/puhe/index.htm","How many places in America can you walk in the footsteps of a king? Where else has a stranded sailor risen up to become a great chief over an entire island? Where else can you experience the culminating event of a people, foretold from centuries past? Where else can you stand on a beach and watch as sharks pass over a submerged temple? Experience all this and much more – only at Pu'ukoholā Heiau!","Waikoloa, Hawaii"),
  ("rabr","Rainbow Bridge National Monument","https://www.nps.gov/rabr/index.htm","Rainbow Bridge is one of the world's largest known natural bridges. The span has undoubtedly inspired people throughout time--from the neighboring American Indian tribes who consider Rainbow Bridge sacred, to the 85,000 people from around the world who visit it each year. Please visit Rainbow Bridge in a spirit that honors and respects the cultures to whom it is sacred.","Page, Arizona"),
  ("reer","Reconstruction Era National Historical Park","https://www.nps.gov/reer/index.htm","The Reconstruction era,1861-1900 the historic period in which the United States grappled with the question of how to integrate millions of newly freed African Americans into social, political,economic, and labor systems, was a time of significant transformation. The people, places, and events in Beaufort County, South Carolina, reflect on the most important issues of this tumultuous time period.","Port Royal, South Carolina"),
  ("redw","Redwood National and State Parks","https://www.nps.gov/redw/index.htm","Most people know Redwood as home to the tallest trees on Earth. But the Parks also protect vast prairies, oak woodlands, wild rivers, and 40 miles of rugged coastline. People have lived in this verdant landscape since time immemorial. Together, the National Park Service and California State Parks are managing and restoring these lands for the inspiration, enjoyment, and education of all.","Westhaven-Moonstone, California"),
  ("rich","Richmond National Battlefield Park","https://www.nps.gov/rich/index.htm","The center of Confederate manufacturing fueled a modern war, one of the South’s largest hospitals gave care to the sick and wounded, and armies battled on open fields and in miles of defensive earthworks. From 1861 to 1865, Richmond’s fate would determine America’s future.","Sandston, Virginia"),
  ("rigr","Rio Grande Wild & Scenic River","https://www.nps.gov/rigr/index.htm","For 196 miles, this free-flowing stretch of the Rio winds its way through desert expanses and stunning canyons of stratified rock. For the well prepared, an extended float trip provides opportunities to explore the most remote corner of Texas and experience the ultimate in solitude, self-reliance, and immersion in natural soundscapes.","Sanderson, Texas"),
  ("rira","River Raisin National Battlefield Park","https://www.nps.gov/rira/index.htm","River Raisin National Battlefield Park preserves, commemorates, and interprets the January 1813 battles of the War of 1812 and their aftermath in Monroe and Wayne counties in SE Michigan. The Battle resulted in the greatest victory for Tecumseh’s American Indian confederation and the greatest defeat for the U.S. The resulting rally cry “Remember the Raisin” spurred support for the rest of the war.","Monroe, Michigan"),
  ("rocr","Rock Creek Park","https://www.nps.gov/rocr/index.htm","Rock Creek Park is truly a gem in our nation's capital. This 1,754 acre city park was officially authorized in 1890, making it the third national park to be designated by the federal government. It offers visitors the opportunity to escape the bustle of the city and find a peaceful refuge, recreation, fresh air, majestic trees, wild animals, and thousands of years of human history.","Chevy Chase, Maryland"),
  ("romo","Rocky Mountain National Park","https://www.nps.gov/romo/index.htm","Rocky Mountain National Park's 415 square miles (265,807 acres) encompasses a spectacular range of mountain environments. From meadows found in the montane life zone to glistening alpine lakes and up to the towering mountain peaks, there is something for everyone to discover. Along the way explore over 300 miles of hiking trails and incredible wildlife viewing.","Estes Park, Colorado"),
  ("rowi","Roger Williams National Memorial","https://www.nps.gov/rowi/index.htm","Roger Williams National Memorial commemorates the life of the founder of Rhode Island and a champion of the ideal of religious freedom. Williams, banished from Massachusetts for his beliefs, founded Providence in 1636. This colony served as a refuge where all could come to worship as their conscience dictated without interference from the state.","Providence, Rhode Island"),
  ("roca","Roosevelt Campobello International Park","https://www.nps.gov/roca/index.htm","For many years, Franklin D. Roosevelt summered on Campobello Island. As an adult, he shared with his family the same active pursuits he enjoyed on the island as child. Although he visited less frequently after contracting polio, Campobello remained important to FDR. Today Roosevelt Campobello International Park serves as a memorial to FDR and a symbol of cooperation between the U.S. and Canada.","Eastport, Maine"),
  ("rori","Rosie the Riveter WWII Home Front National Historical Park","https://www.nps.gov/rori/index.htm","Explore and honor the efforts and sacrifices of American civilians on the World War II home front. Find out how they lived, worked and got along. Many faces, many stories, many truths weave a complex tapestry of myths and realities from this time of opportunity and loss.","Richmond, California"),
  ("ruca","Russell Cave National Monument","https://www.nps.gov/ruca/index.htm","Russell Cave is an archeological site with one of the most complete records of prehistoric cultures in the Southeast. In the 1950s, archeologists uncovered a large quantity of artifacts representing over 10,000 years of use in a single place. Today, Russell Cave National Monument helps bring to light many cultural developments of phenomenal human journeys.","Bridgeport, Alabama"),
  ("sahi","Sagamore Hill National Historic Site","https://www.nps.gov/sahi/index.htm","Sagamore Hill was the home of Theodore Roosevelt, 26th President of the United States, from 1885 until his death in 1919. During Roosevelt's time in office, his 'Summer White House' was the focus of international attention. Explore 83 acres of natural surroundings and historic buildings and become inspired by the legacy of one of America's most popular presidents.","Oyster Bay Cove, New York"),
  ("sagu","Saguaro National Park","https://www.nps.gov/sagu/index.htm","Tucson, Arizona is home to the nation's largest cacti. The giant saguaro is the universal symbol of the American west. These majestic plants, found only in a small portion of the United States, are protected by Saguaro National Park, to the east and west of the modern city of Tucson. Here you have a chance to see these enormous cacti, silhouetted by the beauty of a magnificent desert sunset.","Tanque Verde, Arizona"),
  ("sacr","Saint Croix Island International Historic Site","https://www.nps.gov/sacr/index.htm","The winter of 1604-1605 on Saint Croix Island was a cruel one for Pierre Dugua's French expedition. Iced in by freezing temperatures and cut off from fresh water and game, 35 of 79 men died. As spring arrived and native people traded game for bread, the health of those remaining improved. Although the expedition moved on by summer, the beginning of French presence in North America had begun.","Saint Andrews, New Brunswick"),
  ("sacn","Saint Croix National Scenic Riverway","https://www.nps.gov/sacn/index.htm","Grab your paddle and your longing for adventure and head to the St. Croix and Namekagon rivers! Together they form the St. Croix National Scenic Riverway, offering over 200 miles of clean water that glides and rushes through a forested landscape. Paddle, boat, fish, and camp among this wild and scenic beauty. Hiking and historic towns also beckon.","Siren, Wisconsin"),
  ("sapa","Saint Paul's Church National Historic Site","https://www.nps.gov/sapa/index.htm","Since 1665, Saint Paul's Church played a vital role in the colonial life of Eastchester, 20 miles north of New York City. Townspeople voted at the nearby Village Green; local militia drilled outside its doors. But the American Revolution changed everything. American, British and Hessian troops tore down the old wooden meetinghouse for firewood and used the unfinished stone chapel as a hospital.","Eastchester, New York"),
  ("saga","Saint-Gaudens National Historical Park","https://www.nps.gov/saga/index.htm","Augustus Saint-Gaudens, one of America's greatest sculptors lived here seasonally starting in 1885, and year-round 1900 until his death in 1907. Experience the park grounds, where several of Saint-Gaudens bronze sculptures are on view throughout the year, & trails wind through the woods. Learn more about the park.","Windsor, Vermont"),
  ("sama","Salem Maritime National Historic Site","https://www.nps.gov/sama/index.htm","Established on March 17, 1938 as the first National Historic Site in the United States, Salem Maritime National Historic Site consists of nine acres of land and twelve historic structures along the Salem waterfront, as well as a downtown visitor center. Located in the urban setting of Salem, the park preserves and interprets over 600 years of New England's maritime history and global connections.","Salem, Massachusetts"),
  ("sapu","Salinas Pueblo Missions National Monument","https://www.nps.gov/sapu/index.htm","Tucked away in the middle of New Mexico you’ll find Salinas Pueblo Missions National Monument. Its three distinct sites offer a glimpse into a unique time in history—a time entrenched with cultural borrowing, conflict and struggles. These sites continue to stand as reminders of the Spanish and Pueblo peoples’ early encounters and prompt exploration of today’s interactions among different people.","Estancia, New Mexico"),
  ('mall','this was some bs','https://www.whydoesthishappentome.com',"I guess their database was messed up and they had this one in their activities as a park but not in their parks, so I'm adding this here to fix that issue. I guess its an easter egg. but damn that took too long, I gotta make this longer tho so it isn't easy to find abcdefghijklmnopqrstuvwxyz ayyyy getting there.... just a bit more... I think this is good","someplace,somewhere"),
  ("sari","Salt River Bay National Historical Park and Ecological Preserve","https://www.nps.gov/sari/index.htm","Salt River Bay National Historical Park and Ecological Preserve uniquely documents the human and natural Caribbean world from the earliest indigenous settlements in the central Caribbean to their clash with seven different colonial European powers to the present day.","Saint Croix, Saint Croix Island"),
  ("saan","San Antonio Missions National Historical Park","https://www.nps.gov/saan/index.htm","Welcome to San Antonio Missions, a National Park Service site and the only UNESCO World Heritage Site in Texas. After 10,000 years, the people of South Texas were faced with drought, European diseases, and colonization. In the early 1700s, many Native people of South Texas foreswore their traditional life to become Spanish, accepting a new religion and agrarian lifestyle in hopes of survival.","China Grove, Texas"),
  ("safr","San Francisco Maritime National Historical Park","https://www.nps.gov/safr/index.htm","Located in the Fisherman's Wharf neighborhood, San Francisco Maritime National Historical Park offers visitors the sights, sounds, smells and stories of Pacific Coast maritime history. The Park includes a magnificent fleet of historic ships, a Visitor Center, Maritime Museum, Maritime Research Center, and Aquatic Park Historic District.","San Francisco, California"),
  ("sajh","San Juan Island National Historical Park","https://www.nps.gov/sajh/index.htm","San Juan Island is well known for its splendid vistas, saltwater shores, quiet woodlands, orca whales and one of the last remaining native prairies in the Puget Sound/Northern Straits region. But it was also here in 1859 that the United States and Great Britain nearly went to war over possession of the island, the crisis ignited by the death of a pig.","Friday Harbor, Washington"),
  ("saju","San Juan National Historic Site","https://www.nps.gov/saju/index.htm","San Juan National Historic Site preserves stories of great ambition and aspirations. Countries fought for control of this tiny yet strategic island for centuries. Generations of soldiers have lived and worked within the forts. Visitors today are as inspired by these stories as they are by the beauty of the architecture and the ingenuity of design and engineering of this World Heritage Site.","San Juan, San Juan"),
  ("sand","Sand Creek Massacre National Historic Site","https://www.nps.gov/sand/index.htm","On November 29th, 1864, Chiefs Black Kettle, White Antelope, Left Hand and others were encamped with around 750 Arapaho and Cheyenne people in a valley by the Big Sandy Creek. A hope for peace, brought forth by Black Kettle was in the balance. It was a tragic day where the blood of the Cheyenne and Arapaho was shed, and a painful memory for generations of Native Americans was made.","Eads, Colorado"),
  ("safe","Santa Fe National Historic Trail","https://www.nps.gov/safe/index.htm","You can almost hear the whoops and cries of 'All's set!' as trail hands hitched their oxen to freight wagons carrying cargo between western Missouri and Santa Fe, New Mexico. Follow the Santa Fe National Historic Trail through five states and you'll find adventure and evidence of past travelers who made this remarkable trip before you!","Dodge City, Kansas"),
  ("samo","Santa Monica Mountains National Recreation Area","https://www.nps.gov/samo/index.htm","The Santa Monica Mountains offer easy access to surprisingly wild places. Experience the famous beaches of Malibu or explore more than 500 miles of trails. The park abounds with historical and cultural sites, from old movie ranches to Native American centers. What will you and your family discover?","Agoura Hills, California"),
  ("sara","Saratoga National Historical Park","https://www.nps.gov/sara/index.htm","Here, in 1777, during the American War for Independence, American troops battled and beat a British invasion force, marking the first time in world history that a British Army ever surrendered. This crucial victory secured essential foreign recognition and support, instigated world-wide wars, affirmed United States independence, and changed the face of the world.","Stillwater, New York"),
  ("sair","Saugus Iron Works National Historic Site","https://www.nps.gov/sair/index.htm","In the 1600's, on the banks of the Saugus River, something extraordinary happened! Explore the place where European iron makers brought their special skills to a young Massachusetts colony. Saugus Iron Works is a twelve-acre National Historic Site that includes working waterwheels, forges, mills, a historic 17th century home, and a lush river basin.","Saugus, Massachusetts"),
  ("scbl","Scotts Bluff National Monument","https://www.nps.gov/scbl/index.htm","Towering 800 feet above the North Platte River, Scotts Bluff has served as a landmark for peoples from Native Americans to emigrants on the Oregon, California and Mormon Trails to modern travelers. Rich with geological and paleontological history as well as human history, there is much to discover while exploring the 3,000 acres of Scotts Bluff National Monument.","Terrytown, Nebraska"),
  ("semo","Selma To Montgomery National Historic Trail","https://www.nps.gov/semo/index.htm","‏‏‎Established by Congress in 1996, the Selma to Montgomery National Historic Trail commemorates the people, events, and route of the 1965 Voting Rights March in Alabama. Led by Dr. Martin Luther King Jr., Black and White non-violent supporters fought for the right to vote in Central Alabama. Today, you can connect with this history and trace the events of these marches along the 54-mile trail. ‏","Mosses, Alabama"),
  ("seki","Sequoia & Kings Canyon National Parks","https://www.nps.gov/seki/index.htm","Huge mountains, rugged foothills, deep canyons, vast caverns, and the world’s largest trees exemplify the diversity of landscapes, life, and beauty here. Explore these pages to learn about the plants and animals here and the threats they face. Our ancient giant sequoias may seem invincible, but they, too are vulnerable.","Three Rivers, California"),
  ("shen","Shenandoah National Park","https://www.nps.gov/shen/index.htm","Just 75 miles from the bustle of Washington, D.C., Shenandoah National Park is a land bursting with cascading waterfalls, spectacular vistas, fields of wildflowers, and quiet wooded hollows. With over 200,000 acres of protected lands that are haven to deer, songbirds, and black bear, there's so much to explore...and your journey begins right here!","Stanley, Virginia"),
  ("shil","Shiloh National Military Park","https://www.nps.gov/shil/index.htm","Visit the sites of the most epic struggle in the Western Theater of the Civil War. Nearly 110,000 American troops clashed in a bloody contest that resulted in 23,746 casualties; more casualties than in all of America's previous wars combined. Explore both the Shiloh and Corinth battlefields to discover the impact of this struggle on the soldiers and on the nation.","Crump, Tennessee"),
  ("sitk","Sitka National Historical Park","https://www.nps.gov/sitk/index.htm","On an island amid towering spruce and hemlock, Sitka National Historical Park preserves the site of a battle between invading Russian traders and indigenous Kiks.ádi Tlingit. Totem poles from Tlingit and Haida areas line the park’s scenic coastal trail, and the restored Russian Bishop’s House is a rare reminder of Russia’s colonial legacy in North America.","Sitka, Alaska"),
  ("slbe","Sleeping Bear Dunes National Lakeshore","https://www.nps.gov/slbe/index.htm","Miles of sand beach, bluffs that tower 450’ above Lake Michigan, lush forests, clear inland lakes, unique flora and fauna make up the natural world of Sleeping Bear Dunes. High dunes afford spectacular views across the lake. An island lighthouse, US Life-Saving Service stations, coastal villages, and picturesque farmsteads reflect the park’s rich maritime, agricultural, and recreational history.","Leland, Michigan"),
  ("spar","Springfield Armory National Historic Site","https://www.nps.gov/spar/index.htm","For nearly two centuries, the U.S. Armed Forces and American industry looked to Springfield Armory for innovative engineering and superior firearms. Springfield Armory National Historic Site commemorates the critical role of the nation’s first armory by preserving and interpreting the world's largest historic US military small arms collection, along with historic archives, buildings, and landscape","Springfield, Massachusetts"),
  ("stsp","Star-Spangled Banner National Historic Trail","https://www.nps.gov/stsp/index.htm","For three years the young United States was embroiled in the War of 1812 and the Chesapeake Bay region felt the brunt of it, choked by shipping blockades and ravaged by enemy raids. Through sites and landscapes in Virginia, the District of Columbia, and Maryland, the Trail tells the stories of the events, people, and places that led to the birth of the U.S. national anthem.","Baltimore, Maryland"),
  ("stli","Statue Of Liberty National Monument","https://www.nps.gov/stli/index.htm","'The Statue of Liberty Enlightening the World' was a gift of friendship from the people of France to the United States and is recognized as a universal symbol of freedom and democracy. The Statue of Liberty was dedicated on October 28, 1886. It was designated as a National Monument in 1924. Employees of the National Park Service have been caring for the colossal copper statue since 1933.","New York City, New York"),
  ("stge","Ste. Geneviève National Historical Park","https://www.nps.gov/stge/index.htm","Established by 1750, Ste. Geneviève was the first permanent European settlement in Missouri. Early French Canadian settlers were drawn here by the rich agricultural land known as Le Grand Champ (the Big Field). After the flood of 1785, the town relocated to its present location on higher ground approximately three miles to the northwest of its original site.","Sainte Genevieve, Missouri"),
  ("stea","Steamtown National Historic Site","https://www.nps.gov/stea/index.htm","You'd feel heat from the firebox, smell hot steam and oil; you'd hear the whistle, feel the ground vibrate, and watch as one-ton drive rods turned steel wheels. Remember the sound of 'chuff-chuff' from the smokestack? Today, you can learn the history of steam railroad transportation, and the people who built, repaired and rode, as we work to preserve a special era in America's industrial history!","Scranton, Pennsylvania"),
  ("stri","Stones River National Battlefield","https://www.nps.gov/stri/index.htm","The Battle of Stones River began on the last day of 1862 and was one of the bloodiest conflicts of the Civil War. The battle produced important military and political gains for the Union, and it changed forever the people who lived and fought here.","Murfreesboro, Tennessee"),
  ("ston","Stonewall National Monument","https://www.nps.gov/ston/index.htm","Before the 1960s, almost everything about living openly as a lesbian, gay, bisexual, transgender, or queer (LGBTQ+) person was illegal. The Stonewall Uprising on June 28, 1969 is a milestone in the quest for LGBTQ+ civil rights and provided momentum for a movement.","New York City, New York"),
  ("sucr","Sunset Crater Volcano National Monument","https://www.nps.gov/sucr/index.htm","The lava flow lies on the land like a dream, a wonderland of rock. A thousand years ago the ground was torn open and lava erupted into the sky, forever changing the landscape and the lives of the people who lived here. A thousand years later, trees and flowers grow among the rocks, and people visit the lava flow to see and remember the most recent volcanic eruption in Arizona.","Flagstaff, Arizona"),
  ("tapr","Tallgrass Prairie National Preserve","https://www.nps.gov/tapr/index.htm","Tallgrass prairie once covered 170 million acres of North America, but within a generation most of it had been transformed into farmland. Today less than 4% remains intact, mostly in the Kansas Flint Hills. Established on November 12, 1996, the preserve protects a nationally significant remnant of the once vast tallgrass prairie ecosystem. Here the tallgrass makes its last stand.","Cottonwood Falls, Kansas"),
  ("thko","Thaddeus Kosciuszko National Memorial","https://www.nps.gov/thko/index.htm","Visit the house where wounded Polish freedom fighter Thaddeus Kosciuszko lived and hear how this brilliant military engineer designed successful fortifications during the American Revolution. See the room where he received notable visitors such as Chief Little Turtle and Thomas Jefferson.","Philadelphia, Pennsylvania"),
  ("thrb","Theodore Roosevelt Birthplace National Historic Site","https://www.nps.gov/thrb/index.htm","This is the boyhood home of the first U.S. president to be born in New York City. Raised in a townhouse at 28 E. 20th St., Theodore Roosevelt would grow up to be our 26th President and become immortalized on Mount Rushmore. However, he started life as a sickly yet bright boy who exercised to improve his health and began a lifelong passion for the 'strenuous life.'","New York City, New York"),
  ("thri","Theodore Roosevelt Inaugural National Historic Site","https://www.nps.gov/thri/index.htm","As president, Theodore Roosevelt created protections for ordinary citizens, began regulation of big business, and made the US a major force in international affairs. Yet one of the most important presidencies in America's history nearly didn't happen. See the place where a brief, emotional, and improvised ceremony in Buffalo, NY brought TR into office, and forever altered the nation.","Buffalo, New York"),
  ("this","Theodore Roosevelt Island","https://www.nps.gov/this/index.htm","In the 1930s, landscape architects transformed Mason’s Island from neglected, overgrown farmland into Theodore Roosevelt Island, a memorial to America’s 26th president. They conceived a “real forest” designed to mimic the natural forest that once covered the island. Today miles of trails through wooded uplands and swampy bottomlands honor the legacy of a great outdoorsman and conservationist.","Washington, D.C., Washington, D.C."),
  ("thro","Theodore Roosevelt National Park","https://www.nps.gov/thro/index.htm","When Theodore Roosevelt came to Dakota Territory to hunt bison in 1883, he was a skinny, young, spectacled dude from New York. He could not have imagined how his adventure in this remote and unfamiliar place would forever alter the course of the nation. The rugged landscape and strenuous life that TR experienced here would help shape a conservation policy that we still benefit from today.","Medora, North Dakota"),
  ("thco","Thomas Cole National Historic Site","https://www.nps.gov/thco/index.htm","In 1825, America was still a new nation, just forming its own unique identity and traditions. Thomas Cole invented a new style of art, one that Americans could call their own. His landscape paintings launched the art movement known as the Hudson River School. His groundbreaking achievements took place here in Catskill, New York -- in the 'peaceful shades' of his beloved home, Cedar Grove.","Catskill, New York"),
  ("edis","Thomas Edison National Historical Park","https://www.nps.gov/edis/index.htm","Thomas Edison’s home and laboratory are a step back in time, when machines were run by belts and pulleys and music was played on phonographs. Where to the uninformed passerby, the buildings betray little evidence of the industries they once started. Discover where America’s greatest inventor changed our world forever.","West Orange, New Jersey"),
  ("thje","Thomas Jefferson Memorial","https://www.nps.gov/thje/index.htm","Author of the Declaration of Independence, statesman and visionary for the founding of a nation.","Washington, D.C., Washington, D.C."),
  ("thst","Thomas Stone National Historic Site","https://www.nps.gov/thst/index.htm","Choosing revolution, as Thomas Stone and many others eventually did, was not an easy or inevitable decision for most American colonists. The outcome of a war with England was far from certain and regardless of who won, the lives of the colonists would never be the same. With safety, security, family and fortune at stake, courage and personal sacrifice were tested no matter what side was chosen.","La Plata, Maryland"),
  ("tica","Timpanogos Cave National Monument","https://www.nps.gov/tica/index.htm","Cave tours are closed for the 2022 winter season. Hike your way past stunning vistas to explore a hidden underground world. Taste the thrill of caving as you twist and bend to enter beautifully decorated rooms. Learn the science behind formations and hear stories of cave exploration and preservation. Experience and discover as you go – geologic mysteries await.","Cedar Hills, Utah"),
  ("timu","Timucuan Ecological & Historic Preserve","https://www.nps.gov/timu/index.htm","Visit one of the last unspoiled coastal wetlands on the Atlantic Coast. Discover 6,000 years of human history and experience the beauty of salt marshes, coastal dunes, and hardwood hammocks. The Timucuan Preserve includes Fort Caroline and Kingsley Plantation.","Atlantic Beach, Florida"),
  ("tont","Tonto National Monument","https://www.nps.gov/tont/index.htm","The Salado Phenomena, 700 years ago, blended ideas of neighboring Native American cultures to emerge a unique and vibrant society. Tonto National Monument showcases two Salado-style cliff dwellings. Colorful pottery, woven cotton cloth, and other artifacts tell a story of people living and using resources from the northern Sonoran Desert from 1250 to 1450 CE.","Tonto Basin, Arizona"),
  ("tosy","Touro Synagogue National Historic Site","https://www.nps.gov/tosy/index.htm","Touro Synagogue, a building of exquisite beauty and design, steeped in history and ideals, and one of the most historically significant Jewish buildings in America, was designated a National Historic Site in 1946. Dedicated in 1763, it still serves an active congregation and each year greets over 30,000 visitors who come to see the magnificent interior and hear its remarkable story.","Newport, Rhode Island"),
  ("trte","Trail Of Tears National Historic Trail","https://www.nps.gov/trte/index.htm","Remember and commemorate the survival of the Cherokee people, forcefully removed from their homelands in Georgia, Alabama, and Tennessee to live in Indian Territory, now Oklahoma. They traveled by foot, horse, wagon, or steamboat in 1838-1839.","Caruthersville, Missouri"),
  ("tule","Tule Lake National Monument","https://www.nps.gov/tule/index.htm","The Tule Lake National Monument includes both the the Tule Lake Segregation Center, the largest and most controversial of the sites where Japanese Americans were incarcerated during World War II, and Camp Tulelake, which was first a Civilian Conservation Corps camp, then an additional facility to detain Japanese Americans, and finally a prisoner of war camp.","Tulelake, California"),
  ("tusk","Tule Springs Fossil Beds National Monument","https://www.nps.gov/tusk/index.htm","Over the last ~570,000 years, water has transformed the Upper Las Vegas Valley. Tule Springs Fossil Beds National Monument is an urban park that preserves the unique story of this ever-changing ecosystem.","Summerlin South, Nevada"),
  ("tuma","Tumacácori National Historical Park","https://www.nps.gov/tuma/index.htm","Tumacácori sits at a cultural crossroads in the Santa Cruz River valley. Here O’odham, Yaqui, and Apache people met and mingled with European Jesuit and Franciscan missionaries, settlers, and soldiers, sometimes in conflict and sometimes in cooperation. Follow the timeworn paths and discover stories that connect us to enduring relationships, vibrant cultures, and traditions of long ago.","Tubac, Arizona"),
  ("tupe","Tupelo National Battlefield","https://www.nps.gov/tupe/index.htm","In July, 1864, Union forces, including men from the United States Colored Troops, marched into Tupelo, Mississippi. Disorganized Confederate soldiers fought fiercely but could not overpower the federal troops. Neither side could claim a clear victory, but Union troops had succeeded in their main goal: keeping the Confederates away from Union railroads in Tennessee.","Tupelo, Mississippi"),
  ("tuai","Tuskegee Airmen National Historic Site","https://www.nps.gov/tuai/index.htm","Before the first African American military pilots became known as the 'Red Tails' they wore striped tails as they began their flight training in the Army's PT-17 Stearman bi-plane. Their flying adventure started at Moton Field, in Tuskegee, Alabama, where the Army Air Corps conducted a military test to determine if African Americans could be trained to fly combat aircraft.","Tuskegee, Alabama"),
  ("tuin","Tuskegee Institute National Historic Site","https://www.nps.gov/tuin/index.htm","In 1881, Booker T. Washington arrived in Alabama and started building Tuskegee Institute both in reputation and literally brick by brick. He recruited the best and the brightest to come and teach here including George Washington Carver who arrived in 1896. Carver’s innovations in agriculture, especially with peanuts, expanded Tuskegee’s standing throughout the country. The story continues….","Tuskegee, Alabama"),
  ("tuzi","Tuzigoot National Monument","https://www.nps.gov/tuzi/index.htm","Water flows under and through this landscape, feeding the growth of people and towns. The Verde Valley is watered by snowmelt, summer monsoons, and springs that well up from the ancient sedimentary rocks. In the heart of the valley, a thousand years ago, people began to build a little hilltop pueblo that would grow into one of the largest villages in the area.","Clarkdale, Arizona"),
  ("ulsg","Ulysses S Grant National Historic Site","https://www.nps.gov/ulsg/index.htm","Ulysses S. Grant is known as the victorious Civil War general who saved the Union and the 18th President of the United States. He first met Julia Dent, his future wife, at her family home, named White Haven. From 1854 to 1859 the Dents, Grants and an enslaved African-American workforce lived on the property.","Affton, Missouri"),
  ("upde","Upper Delaware Scenic & Recreational River","https://www.nps.gov/upde/index.htm","Canoe through rapids and quiet pools as the Delaware River winds its way through a valley of swiftly changing scenery or fish amid rolling hills and riverfront villages in one of the finest fishing rivers in the northeastern United States. The clean water of the Delaware, the last major undammed river in the eastern United States, supports a healthy ecosystem and offers tranquility and excitement.","Hawley, Pennsylvania"),
  ("vall","Valles Caldera National Preserve","https://www.nps.gov/vall/index.htm","About 1.25 million years ago, a spectacular volcanic eruption created the 13-mile wide circular depression now known as the Valles Caldera. The preserve is known for its huge mountain meadows, abundant wildlife, and meandering streams. The area also preserves the homeland of ancestral native peoples and embraces a rich ranching history.","Los Alamos, New Mexico"),
  ("vafo","Valley Forge National Historical Park","https://www.nps.gov/vafo/index.htm","Valley Forge is the encampment site of the Continental Army during the winter of 1777-1778. The park features 3,500 acres of monuments, meadows, and woodlands commemorating the sacrifices and perseverance of the Revolutionary War generation and honoring the power of people to pull together and overcome adversity during extraordinary times.","Chesterbrook, Pennsylvania"),
  ("vama","Vanderbilt Mansion National Historic Site","https://www.nps.gov/vama/index.htm","Built by of one of the first families of wealth in America. Designed by one of the nation's preeminent architects. The Vanderbilt Mansion is a home built expressly for the aristocratic lifestyle.","Hyde Park, New York"),
  ("vick","Vicksburg National Military Park","https://www.nps.gov/vick/index.htm","To Confederate President Jefferson Davis, Vicksburg was the 'nailhead that holds the South's two halves together.' President Abraham Lincoln remarked 'Vicksburg is the key' to victory, and could be the north's lifeline into the south. As the federals closed in on the Fortress City, they were met by a ring of forts with over 170 cannon. The resulting battle would determine the war's outcome.","Vicksburg, Mississippi"),
  ("vive","Vietnam Veterans Memorial","https://www.nps.gov/vive/index.htm","Honoring the men and women who served in the controversial Vietnam War, the Vietnam Veterans Memorial chronologically lists the names of 58,318 Americans who gave their lives in service to their country.","Washington, D.C., Washington, D.C."),
  ("vicr","Virgin Islands Coral Reef National Monument","https://www.nps.gov/vicr/index.htm","Virgin Islands Coral Reef National Monument includes federal submerged lands within the 3-mile belt off the island of St. John. These waters support a diverse and complex system of coral reefs and other ecosystems such as shoreline mangrove forests and seagrass beds.","Cruz Bay, Saint John Island"),
  ("viis","Virgin Islands National Park","https://www.nps.gov/viis/index.htm","Go beyond Virgin Islands National Park's stunning white-sand beaches. Hike to historic plantation sites to learn about a challenging past when sugar and enslaved labor dominated life on the island. Visit the Indigenous Taino's ancient petroglyphs. Snorkel coral reefs to discover hidden marine life. Two-thirds of the island of St. John is national park, making it a unique destination for visitors.","Cruz Bay, Saint John Island"),
  ("voya","Voyageurs National Park","https://www.nps.gov/voya/index.htm","With 218,055 acres, Voyageurs National Park is an adventure wonderland all year long full of exposed rock ridges, cliffs, wetlands, forests, streams and lakes. This is a place of transition between land and aquatic ecosystems, between southern boreal and northern hardwood forests, and between wild and developed areas. Whether you are exploring by land, water or ice there is something for everyone.","Fort Frances, Ontario"),
  ("waco","Waco Mammoth National Monument","https://www.nps.gov/waco/index.htm","Standing as tall as 14 feet and weighing 20,000 pounds, Columbian mammoths roamed across what is present-day Texas thousands of years ago. Today, the fossil specimens represent the nation's first and only recorded evidence of a nursery herd of ice age Columbian mammoths.","Waco, Texas"),
  ("waca","Walnut Canyon National Monument","https://www.nps.gov/waca/index.htm","Come gaze across curved canyon walls. Among the remarkable geological formations of the canyon itself, the former homes of ancient inhabitants are easily evident. Along the trails you can imagine life within Walnut Canyon, while visiting actual pueblos and walking in the steps of those who came before.","Flagstaff, Arizona"),
  ("wapa","War In The Pacific National Historical Park","https://www.nps.gov/wapa/index.htm","War in the Pacific National Historical Park was established to commemorate the bravery and sacrifice of those participating in the campaigns of the Pacific Theater of World War II and to conserve and interpret outstanding natural, scenic, and historic values and objects of the island of Guam.","Piti Village, Piti"),
  ("wamo","Washington Monument","https://www.nps.gov/wamo/index.htm","Built to honor George Washington, the United States' first president, the 555-foot marble obelisk towers over Washington, D.C.","Washington, D.C., Washington, D.C."),
  ("waro","Washington-Rochambeau Revolutionary Route National Historic Trail","https://www.nps.gov/waro/index.htm","In 1781, General Rochambeau’s French Army joined forces with General Washington’s Continental Army to fight the British Army in Yorktown, Virginia. With the French Navy in support, the allied armies moved hundreds of miles to become the largest troop movement of the American Revolution. The effort and cooperation between the two sides led to a victory at Yorktown and secured American independence.","Bristol, Pennsylvania"),
  ("waba","Washita Battlefield National Historic Site","https://www.nps.gov/waba/index.htm","On November 27, 1868, Lt. Colonel George Armstrong Custer led the 7th US Cavalry on a surprise dawn attack on a Cheyenne village led by Peace Chief Black Kettle. The event was an example of the tragic clash of cultures that occurred during the Great Plains Wars. It is also a place of remembrance and reflection for those who died here.","Cheyenne, Oklahoma"),
  ("wefa","Weir Farm National Historical Park","https://www.nps.gov/wefa/index.htm","Visit the home and studio of America's most beloved Impressionist, J. Alden Weir, and walk in the footsteps of generations of world-class artists. Set amidst more than 60 acres of painterly woods, fields, and waterways, you’ll soon see why Weir described his home as the 'Great Good Place.' Weir’s farm is a national legacy to American Impressionism, the creative spirit, and historic preservation.","Georgetown, Connecticut"),
  ("whis","Whiskeytown National Recreation Area","https://www.nps.gov/whis/index.htm","Whiskeytown Lake’s crystal-clear water is perhaps the most recognized feature of the park. However, water-based recreation is only a part of what the 42,000-acre Whiskeytown National Recreation Area has to offer. Visit waterfalls, hike through rugged mountains, explore California Gold Rush history, and observe post-fire ecology in action. Your national park is calling...","Shasta, California"),
  ("whsa","White Sands National Park","https://www.nps.gov/whsa/index.htm","Rising from the heart of the Tularosa Basin is one of the world's great natural wonders - the glistening white sands of New Mexico. Great wave-like dunes of gypsum sand have engulfed 275 square miles of desert, creating the world's largest gypsum dunefield. White Sands National Park preserves a major portion of this unique dunefield, along with the plants and animals that live here.","Holloman Air Force Base, New Mexico"),
  ("whmi","Whitman Mission National Historic Site","https://www.nps.gov/whmi/index.htm","The 1847 attack on the Whitmans horrified Americans and impacted the lives of the peoples of the Columbia Plateau for decades afterwards. Was killing the Whitmans justified legal retribution, an act of revenge, or some combination of both? The circumstances that surround this tragic event resonate with modern issues of cultural interaction and differing perspectives.","Garrett, Washington"),
  ("wiho","William Howard Taft National Historic Site","https://www.nps.gov/wiho/index.htm","High atop one of Cincinnati's most prominent hilltops stands the two-story Greek Revival house where William Howard Taft was born and grew up. Hard work, a good education, and an interest in civic duty are attributes that made the Taft family outstanding leaders over the years. The environment that shaped Taft's character and philosophy is highlighted on a visit to the site.","Newport, Kentucky"),
  ("wicr","Wilson's Creek National Battlefield","https://www.nps.gov/wicr/index.htm","Wilson's Creek was the first major Civil War battle fought west of the Mississippi River, and the site of the death of Nathaniel Lyon, the first Union general killed in action. The costly Southern victory on August 10, 1861, focused national attention on the war in Missouri. Wilson’s Creek NB commemorates and interprets the battle within the context of the war in the Trans-Mississippi West.","Battlefield, Missouri"),
  ("wica","Wind Cave National Park","https://www.nps.gov/wica/index.htm","Bison, elk, and other wildlife roam the rolling prairie grasslands and forested hillsides of one of America's oldest national parks. Below the remnant island of intact prairie sits Wind Cave, one of the longest and most complex caves in the world. Named for barometric winds at its entrance, this maze of passages is home to boxwork, a unique formation rarely found elsewhere.","Hot Springs, South Dakota"),
  ("wing","Wing Luke Museum Affiliated Area","https://www.nps.gov/wing/index.htm","More than a museum, the Wing is an experience. A chance to truly understand what it was - and is - to be Asian American in the Pacific Northwest. Take a guided tour of a historic hotel and learn the inside story about what makes the local Chinatown-International District unique. Visitors explore thought-provoking exhibitions of real stories, including actor and martial arts master Bruce Lee.","Seattle, Washington"),
  ("wotr","Wolf Trap National Park for the Performing Arts","https://www.nps.gov/wotr/index.htm","No matter what your age or taste in shows, you'll find something you like onstage at Wolf Trap National Park for the Performing Arts. From May through September, multiple amphitheaters in the park present performances such as musicals, dance, opera, jazz, and popular and country music. A good time to explore the beauty and history of the park without the crowds is October - April.","Wolf Trap, Virginia"),
  ("wori","Women's Rights National Historical Park","https://www.nps.gov/wori/index.htm","Women’s Rights National Historical Park tells the story of the first Women’s Rights Convention held in Seneca Falls, NY on July 19-20,1848. It is a story of struggles for civil rights, human rights, and equality, global struggles that continue today. The efforts of women’s rights leaders, abolitionists, and other 19th century reformers remind us that all people must be accepted as equals.","Seneca Falls, New York"),
  ("wwim","World War I Memorial","https://www.nps.gov/wwim/index.htm","A grateful nation honors the service, valor, courage and sacrifice of the 4.7 million American sons and daughters who served in the Great War.","Washington, D.C., Washington, D.C."),
  ("wwii","World War II Memorial","https://www.nps.gov/wwii/index.htm","Through stone architecture and bronze sculptures, the World War II Memorial recognizes the ways Americans served, honors those who fell, and recognizes the victory they achieved to restore freedom and end tyranny around the globe.","Washington, D.C., Washington, D.C."),
  ("wrst","Wrangell - St Elias National Park & Preserve","https://www.nps.gov/wrst/index.htm","Wrangell-St. Elias is a vast national park that rises from the ocean all the way up to 18,008 ft. At 13.2 million acres, the park is the same size as Yellowstone National Park, Yosemite National Park, and Switzerland combined! Within this wild landscape, people continue to live off the land as they have done for centuries. This rugged, beautiful land is filled with opportunities for adventure.","Tok, Alaska"),
  ("wrbr","Wright Brothers National Memorial","https://www.nps.gov/wrbr/index.htm","Wind, sand, and a dream of flight brought Wilbur and Orville Wright to Kitty Hawk, North Carolina where, after four years of scientific experimentation, they achieved the first successful airplane flights on December 17, 1903. With courage and perseverance, these self-taught engineers relied on teamwork and application of the scientific process. What they achieved changed our world forever.","Kill Devil Hills, North Carolina"),
  ("wupa","Wupatki National Monument","https://www.nps.gov/wupa/index.htm","Nestled between the Painted Desert and ponderosa highlands of northern Arizona Wupatki seems like an unlikely landscape for a thriving community. In the early 1100s during a time period of cooler temperatures and wetter seasons the ancestors of contemporary Pueblo communities created a bustling center of trade and culture. For Hopi people these sites represent the footprints of their ancestors.","Flagstaff, Arizona"),
  ("yell","Yellowstone National Park","https://www.nps.gov/yell/index.htm","On March 1, 1872, Yellowstone became the first national park for all to enjoy the unique hydrothermal wonders. Today, millions of people come here each year to camp, hike, and enjoy the majesty of the park.","West Yellowstone, Montana"),
  ("york","Yorktown Battlefield Part of Colonial National Historical Park","https://www.nps.gov/york/index.htm","Discover what it took for the United States to be independent as you explore the site of the last major battle of the Revolutionary War. Here at Yorktown, in the fall of 1781, General George Washington, with allied American and French forces, besieged General Charles Lord Cornwallis’s British army. On October 19, Cornwallis surrendered, effectively ending the war and ensuring independence.","Yorktown, Virginia"),
  ("yose","Yosemite National Park","https://www.nps.gov/yose/index.htm","Not just a great valley, but a shrine to human foresight, the strength of granite, the power of glaciers, the persistence of life, and the tranquility of the High Sierra. First protected in 1864, Yosemite National Park is best known for its waterfalls, but within its nearly 1,200 square miles, you can find deep valleys, grand meadows, ancient giant sequoias, a vast wilderness area, and much more.","Yosemite Valley, California"),
  ("yuho","Yucca House National Monument","https://www.nps.gov/yuho/index.htm","Yucca House National Monument preserves a large unexcavated pueblo with a stunning setting in Montezuma Valley, nestled between Mesa Verde and Ute Mountain. Since Yucca House was protected as a national monument in 1919, it has remained largely untouched, offering intrepid visitors a sense of discovery and preserving the pueblo's beauty and integrity for future generations.","Towaoc, Colorado"),
  ("yuch","Yukon - Charley Rivers National Preserve","https://www.nps.gov/yuch/index.htm","Located in Interior Alaska, Yukon-Charley Rivers offers exploration in a largely untouched landscape. Whether you float the mighty Yukon River or paddle the Charley River's whitewater, your memories will last a lifetime. Geology, cultural history, gold rush remnants, wildlife, and vast scenery will be a part of your experience. But, the strongest element will be solitude. Your adventure awaits.","Tok, Alaska"),
  ("zion","Zion National Park","https://www.nps.gov/zion/index.htm","Follow the paths where native people and pioneers walked. Gaze up at massive sandstone cliffs of cream, pink, and red that soar into a brilliant blue sky. Experience wilderness in a narrow slot canyon. Zion’s unique array of plants and animals will enchant you as you absorb the rich history of the past and enjoy the excitement of present day adventures.","LaVerkin, Utah");
