insert into campgrounds () values
    ("EA81BC45-C361-437F-89B8-5C89FB0D0F86", 29.5108900007192, -100.907309999953, "17 sites each with a covered picnic table and a BBQ grill. The sites are suitable for tents or RVs. No drinking water or hookups available.", "277 North Campground"),
  ("1241C56B-7003-4FDF-A449-29DA8BCB0A41", 35.61074664664336, -83.93318327404131, "Abrams Creek Campground - elevation 1,125 feet (343m) - is located beside beautiful Abrams Creek in a remote and secluded setting. The climate is moderate, characterized by mild winters and hot, humid summers. Flush toilets and drinking water are available. There are no hookups or showers at the campground. Hammocks are allowed over the footprint of the campsite. Limited to trees 10 inches in diameter with adequate padding around the tree and only 2 hammocks may be suspended from tree.", "Abrams Creek Campground"),
  ("ABDC6E2A-9959-4A4C-9DB6-EEF66E7C95B8", 39.67775041640082, -77.48462720159597, "Reservations Required. No Walk Ins. There are two shelters that offer the bare minimum with regard to outdoor accommodation. Available year-round, the Adirondack Shelters located near the northern most point of the park, provide a destination for true nature immersion and an alternative to drive-up camping. A moderate three-mile uphill hike over rocky and gently rolling terrain starting at Camp Round Meadow will lead you to these three-sided shelters.", "Adirondack Shelters"),
  ("4F9ED6A5-3ED1-443D-9E4C-859D7988F199", 45.315438210045016, -107.94165891102676, "- Near Fort Smith, Montana - Open All Year! - $30 per night fee - 22 RV and tent sites are located on the south shore of Afterbay lake - All sites have fire rings and picnic tables - Composting vault toilets - All sites are back in (not pull through) - All sites have electric and water - RV dump station available across the road near the Headquarters building", "Afterbay Campground"),
  ("9FAE941D-D7E8-4F36-A28F-8556628242BA", 37.3764551871, -91.5615463252, "Group campsites, located at Akers Ferry. The campground is located north of the junction of Highway KK and Highway K.", "Akers Group Campground"),
  ("6EAB2A34-0D56-4A15-99E2-E41C06B0FF86", 32.072943, -112.728093, "Primitive, four-site campground at the mouth of Alamo Canyon. No RVs, trailers or generators.", "Alamo Canyon Primitive Campground"),
  ("AB15EC6C-7761-4DFF-A4AC-38E6A9986FB7", 37.148223, -91.44976700000001, "Campground located near Alley Spring, 6 miles west of Eminence, MO on State Highway 106.", "Alley Spring Campground"),
  ("4F9E59DF-BFCB-400F-8F4E-6A5233A47324", 36.764033745775, -84.5463375728999, "Alum Ford is a primitive campground and offers six campsites with a vault toilet facility. No drinking water is located at this area. Alum Ford also has a boat ramp. There are no fees to use the ramp.", "Alum Ford Campground"),
  ("B0B25595-CE24-4E9C-B0CD-93912216F113", Null, Null, "There are no campgrounds in the park.", "American Memorial Park"),
  ("E7CC7363-9C34-42ED-B3F0-769BB39E9400", 34.0143426535482, -119.367763068282, "Primitive camping is available (seven sites; $15 per night per site; reservations required). Picnic table, food storage box, and pit toilet are provided. No water is available. Distance from landing to campground is one-half mile and includes a 157-stair climb. WARNING: Western gulls nest on Anacapa Island From April through mid-August. During this time, visitors will encounter seabird rookery conditions: guano, strong odor, constant noise, bird carcasses, and birds protecting their territory.", "Anacapa Island Campground"),
  ("3CCB0AF7-A364-4490-A788-EE00700BD108", 36.956030575674106, -111.43123626708984, "While the Antelope Point RV park is not physically within the boundaries of Glen Canyon National Recreation Area, it is adjacent to the Antelope Point Marina, restaurant, gift shop. This is an RV site only. 104 full hook-up spaces, 15 pull-through spaces. Maximum Length - 70ft. 2 RV dump stations", "Antelope Point RV Park"),
  ("03608E50-3CA0-4AEA-9E6C-146FBD6D204B", 39.421109176, -77.7488428204, "Mile 69.4 (Washington County, MD) - The campground has 20 single campsites each with a picnic table, fire ring and grill. Each campsite will accommodate up to eight campers. Pit toilets are located between campsite #6 and campsite #7 adjacent to the towpath. A second set of chemical toilets are available down the towpath. Potable water is along the towpath at pumps (may not be available during cold winter months). No vehicular traffic is allowed on the towpath and access to the campsites is by foot only.", "Antietam Creek Campground"),
  ("48F2732E-4251-4D81-875C-8E52839620B5", 48.526081043909606, -113.9818601853201, "Apgar campground is the largest campground in the park. It is situated in trees and provides tent and RV campers with shade and some privacy. Evening sunsets on Lake McDonald are only a short stroll, and you won't want to miss evening programs with a ranger at the Apgar Amphitheater. Many trails are located within a short drive of the campground. Five Group Sites are reservable in advance. Click the reservation button below for details. An advanced reservation will be required from 5/27 to 9/11, 2022.", "Apgar Campground"),
  ("18D6C184-E9BB-4590-93FF-09CE0210C13A", 37.858852, -81.09231899999997, "Located on an unmarked dirt road, off Route 41 near Prince. From Beckley, take the first left after crossing the New River. There are 11 drive-in tent and RV sites, some with partial shade.", "Army Camp"),
  ("7475825B-E844-4012-841B-0E29E05D4540", 40.39934770583215, -105.59305451637942, "Aspenglen Campground is reservation only. To book a campsite, visit Recreation.gov. Aspenglen closes for the season on Sep 28 at noon. Timed Entry Permit Reservations are in effect for RMNP. Visitors with campground reservations will use those permits as their timed entry reservations. You may enter the park on the first day of your camping reservation. Visitors who have reservations to camp at Moraine Park, Glacier Basin and Aspenglen Campgrounds will have access to the park, including Bear Lake Road.", "Aspenglen Campground"),
  ("BC707FA3-F575-4734-8E62-34689982F615", 36.4646681174428, -118.66967218847, "The campground is situated along the East Fork of the Kaweah River in a once logged sequoia grove. There are limited services at Silver City Resort, 1.7 miles (3 km) east of the campground. More extensive services can be found in Three Rivers, 23 miles (37 km) west of Atwell Mill Campground (approximately 1.5 hours away). The Atwell-Hockett Trail begins here.", "Atwell Mill Campground"),
  ("18436909-D300-44A7-BD73-553AF16E576E", 46.670375, -86.13682, "Au Sable Point East Group Campground is 0.2 miles west of the Au Sable Light Station and inland from the North Country Trail. The group campsite is surrounded by a coniferous forest. There is access to Lake Superior with a view of the Grand Sable Dunes. One shared fire ring and pit toilet. Water source is Lake Superior. Lake Superior access for kayakers.", "Au Sable East Group Backpacking Site"),
  ("F3ED602F-ECEE-4C10-9FBF-299331032221", 46.669327, -86.135215, "Au Sable Point East Campground is next to the Au Sable Point East Group Campground. Due to the dense forest, you are unable to see the neighboring campground. The six campsites are scattered throughout the trees. Shared fire ring and pit toilet. Water source is Lake Superior. Lake Superior access for kayakers", "Au Sable East Individual Backpacking Sites"),
  ("2DEFC258-0088-4E21-B429-7B7014B09060", 48.67654586358507, -113.81852507945598, "Avalanche campground in located in one of the most popular sections of Glacier National Park west of the Continental Divide. The campground accommodates tent and RV campers, however only 50 sites will accommodate vehicle lengths up to 26 feet. Bring your hiking boots and binoculars. Two popular day hikes offer spectacular scenery and glimpses of birds and wildlife that inhabit the area. Sites are on a first-come, first-serve basis.", "Avalanche"),
  ("D82D2D01-80E6-4394-BEC0-C41ECAC12798", 36.741334351, -118.967776777, "Azalea Campground is 3.5 miles (5.6 km) from the Kings Canyon entrance in the Grant Grove area. The campground is under open stands of evergreen trees. Services can be found in Grant Grove Village. Seasonal site availability varies with snow cover and demand. Dates are approximate and may change without notice: -20 sites are open from early October until mid-April -40-88 sites are open from mid-April through early May -110 sites are open from mid-May through early October.", "Azalea Campground"),
  ("43CF9CC2-4B3F-496F-9587-26F98A454217", 38.0799522999743, -75.2135101005224, "Bayside back country site", "Back Country Camping - Green Run"),
  ("8540D911-6CCA-4DD7-A515-34A3939BABFE", 38.1521378003843, -75.1727157999991, "Back Country Camping, bayside", "Back Country Camping - Little Levels"),
  ("BEAF9758-4BAB-4FE7-A6C0-7336362BDE42", 38.1432381002, -75.1883865003, "Bay side back country campsite", "Back Country Camping - Pine Tree"),
  ("FB37FF71-E7EE-4B25-8117-842784111EEC", 38.0477905997415, -75.2341248002154, "Bay side back country campsite", "Back Country Camping - Pope Bay"),
  ("B238585C-BEFC-446C-B433-F785D295873E", 38.04472, -75.23139, "Back Country Camping; ocean side", "Back Country Camping - State Line"),
  ("B9AF19E6-8B7F-482F-AFB7-E606FFD4BA4E", 38.1777120008, -75.1754320001, "Bayside back country site", "Back Country Camping - Tingles Island"),
  ("9E0AF4C5-2100-427F-AF7D-D8653FBF3FA5", 32.809869, -106.264225, "Due to rehabilitation of camping sites, backcountry camping is closed.", "Backcountry Camping"),
  ("07B94648-198D-4762-9D87-236DEC0C58BA", Null, Null, "A free backcountry permit, available at the visitor center, is required for camping outside of campgrounds. Capitol Reef offers many hiking options for serious backpackers and those who enjoy exploring remote areas. For more information on possible backpacking routes, route descriptions and maps are available on our hiking and backpacking page.", "Backcountry Camping"),
  ("AC81EBCF-B50B-420E-A286-13C67EE98B4F", 40.6961609, -72.9719285, "Under the stars, near the sound of the surf, waking to a chorus of song birds, camping on Fire Island within the Otis Pike Fire Island High Dune Wilderness can be a memorable experience. This wilderness camping experience is available by permit only. Permits are limited and issued for specific nights and number of persons within the group. A maximum length of stay is three consecutive nights. Beach camping may be available from March 15 through Labor Day.", "Backcountry Camping in the Otis Pike High Dune Wilderness"),
  ("9FA0E6D0-85F3-4388-92B1-26F408774F28", 37.77724, -105.535601, "The most popular and unique backpacking option is camping in the 30-square-mile dunefield, beyond the major dune ridgeline (about 1.5 mile hike minimum over dunes). Enjoy wide open views of the starry sky or a bright moonlit night. Designated sites are also available in the trees of the foothills, or camping is available in higher forests of Great Sand Dunes National Preserve. Reserve national park backpacking permits for the dunes or foothills through recreation.gov", "Backpacking Campsites in the Dunes or Forest"),
  ("0131994D-CB80-4736-A362-A5ECF862337B", 38.98573, -114.24331, "Baker Creek Campground contains 37 campsites. All sites are available, when the campground is open (seasons permitting), on a first-come-first-served basis. Potable water is not available.", "Baker Creek Campground"),
  ("E02FF569-7F16-4A73-B44F-2A2211C98513", 39.299834, -77.557168, "Mile 50.3 - Hiker-biker campgrounds are located along the towpath approximately every 5-7 miles. No fee or reservation required. Overnight stays are limited to one night. All sites include a chemical toilet, picnic table, grill, and drinking water. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from mid-November to mid-April each year.", "Bald Eagle Island Hiker-Biker Campsite"),
  ("E3D6E089-3B10-46E0-91C8-F7A5C7BBE409", 35.56543624633261, -83.17429877302192, "Balsam Mountain Campground - elevation 5,310 feet (1618m) - is surrounded by mountain ranges and streams. Daytime temperatures rarely exceed 70°F and may dip into the low 50's at night. RV, camper trailer, and tent sites plus flush toilets and drinking water are available. No hookups or showers and no lights in the restrooms. Hammocks are allowed over the footprint of the campsite. Limited to trees 10 inches in diameter with adequate padding around the tree and only 2 hammocks may be suspended from tree.", "Balsam Mountain Campground"),
  ("09BC0AFC-F118-44EA-B7E1-1FE0191CA77E", 36.4886610474, -84.6971229739, "The campground offers a total of 181 campsites: 96 trailer sites which offer water and electric hook-ups, 49 sites for tent camping, and two group camping loops with 19 sites in one loop and 16 sites in the other. All campsites include picnic tables, fire rings, and access to restrooms and showers. A dump station is located near the registration kiosk. There are no sewer hook-ups at individual trailer sites. The group campsites also have their own cook shelters and campfire circles.", "Bandy Creek Campground"),
  ("4EAF0F61-6361-4CAC-BB23-F93C5CF4A8E2", 45.1044128273, -108.225571084, "Barry's Landing & Trail Creek campgrounds are located on the south district near Barry's Landing, 27 miles north of Lovell, WY on HWY 37. - Open All Year - $18 per night during the summer season (Mid April through October) - 14 RV sites, 16 tent sites - Most RV sites are small for a 28 ft RV or smaller - Vault toilets only, no running water or electricity", "Barry's Landing & Trail Creek Campground"),
  ("8F8394D7-51F5-4593-9042-83BC845F0F71", 58.450780888, -135.894400288, "The National Park Service maintains a free walk-in campground in Bartlett Cove. The campground features bear-proof food caches, a fire-pit and warming shelter (with firewood provided) located in a very scenic setting along the shore, 1/4 mile south of the Bartlett Cove dock. Stays are limited to 14 days", "Bartlett Cove Campground"),
  ("6EEB6398-2024-46B2-BFA0-B2A437464B37", 45.018882, -86.102772, "The Bay Campground is the closest campground to the dock. Bring water filtration equipment because there is no source of purified drinking water. There are 25 individual sites and 3 group sites.", "Bay Campground - South Manitou Island"),
  ("700E6BD8-F6CA-4A1A-A361-CFEAF028902A", 38.207737100574306, -75.1593790997531, "Tents, trailers and recreational vehicles (no hookups). Sites have a picnic table and a fire ring. Sites are $30 per night. No generators allowed in Loop B. Reservations are required from March 15 through November 15. All sites are First Come/First Serve from November 16 through March 14.", "Bayside Drive-in Campground"),
  ("88FE257F-E2CF-45DC-858E-7DF1B92AFF4F", 36.6423697456121, -84.5243896745863, "This campground contains 23 developed campsites. Each site offers water and electricity, tables, grills, tie-outs for 4 horses, access to modern restrooms with hot showers, a dump station and access miles of horse trails. Bear Creek Horse Camp is located on Bear Creek Road off Hwy. 742, west of Stearns, Kentucky. The fee rate per night is $28.00 (half price for holders of the Interagency Access/Senior Passes).", "Bear Creek Horse Camp"),
  ("CF03117B-0727-4497-885A-0C81227D2F11", 26.183239748193, -81.247475274331, "Primitive campground with no water. Vault toilets available. Forty designated sites. Access to the Bear Island Campground is at the end of a 20-mile secondary gravel road", "Bear Island Campground"),
  ("7108D5E4-1BE3-42A7-846A-7BF3C631E8E9", 46.577012, -86.350163, "Beaver Creek Campground is on the bluff above Lake Superior and Beaver Creek in the Beaver Basin Wilderness. The six campsites are dispersed throughout the sandy grounds, shaded by pine trees. There is one communal fire ring with a view of Lake Superior. Shared pit toilet. Water source is Lake Superior and Beaver Creek. Lake Superior access for kayakers.", "Beaver Creek Individual Backpacking Sites"),
  ("D3397636-7BAA-419B-A634-9C53D6AD7E55", 47.90406144441624, -89.1743364694965, "Located in the center of Washington Harbor, near Windigo. All shelters are water facing. Boats can stay at the dock overnight. Stay Limit: 3 nights effective from 6/1 - Labor Day annually. Shelters: 3 Depth at dock (normal conditions): 2'-5' Access: Canoe/kayak/private boat", "Beaver Island Campground"),
  ("7E99AF3C-193D-4F89-8AA3-A799590CB89C", 36.938243, -111.496291, "No reservations. $14 per night. 6 designated sites. Across the highway from Wahweap South Entrance. Picnic table at each site. No hookups, dump station, or restrooms. Pack it in, pack it out. Portable toilets required. No campfires or glass containers. Three night camping limit.", "Beehives Campground"),
  ("07E7E764-4D4F-4615-ADEB-28AB6BD87471", 34.0019373491, -116.019762032, "This small (18 site) campground is at an elevation of 3,800 ft (1,158 m). First-come, first-served. Pit toilets. No water so bring plenty of your own. Belle is a great campground to see dark night skies.", "Belle Campground"),
  ("BCFEC04A-6E92-4CC5-844F-B0486E386268", 44.58183403582838, -104.70634354706146, "*Loop B Bathroom Closed* The Belle Fourche River Campground is a 2-loop, 46-site campground with 4 accessible sites and 3 tent-only group sites. Drinking water is available at water spigots and in the restrooms. Large cottonwood trees provide shade. A picnic shelter and tables are available north of the campground. This is a first come, first served campground, no reservations. There is a 14-day limit on occupancy. There are 43 pull-through sites with room for RVs up to 35'. No hookups are available.", "Belle Fourche River Campground"),
  ("4E13DA78-AC48-422A-A82B-444BF0F46C37", 48.15235177620953, -88.58598760529463, "A campground located on Belle Isle, in Belle Harbor, on the northeast end of Isle Royale National Park. Boats can use dock for overnight stays. Stay Limit: 5 nights, effective 6/1 – Labor Day. Shelters: 6 Depth at dock (normal conditions): 13’ Access: Canoe/kayak/private boat", "Belle Isle Campground"),
  ("B0B0CF0A-F97A-4DA8-AC53-B72516E0B248", 46.647014, -86.200461, "Benchmark Campground is on a sandy bluff above Lake Superior. The six campsites are sandy and open. There are social trails that lead down to Lake Superior, but it is a steep climb back to your campsite. When hiking from the west, walk through Twelvemile Beach Campground to the trailhead and day use area to connect back to the North Country Trail. Two shared fire rings and a pit toilet. Water source is Lake Superior. Lake Superior access for kayakers.", "Benchmark Individual Backpacking Sites"),
  ("2AFC7456-747A-4F35-8572-418E6E103989", 37.8245721146453, -122.526725469915, "Bicentennial Campground is the easiest to reach campground in Golden Gate, approximately 100 yards from the parking area near Battery Wallace. The campground is a great location for those wanting to camp near the city. There is a moderate short hill to climb to/from the campground from the parking area. It is downhill to the site and uphill back to the parking area.", "Bicentennial Campground"),
  ("559F6C6D-8688-4269-9578-86DE30B01674", 35.7500776458923, -83.1113810735188, "Big Creek Campground - elevation 1,700 feet (518m) - is located beside beautiful Big Creek in a remote and secluded setting. The climate is moderate, characterized by mild winters and hot, humid summers. Tent only camping, flush toilets, and drinking water are available. There are no hookups or showers at the campground. Hammocks are allowed over the footprint of the campsite. Limited to trees 10 inches in diameter with adequate padding around the tree and only 2 hammocks may be suspended from tree.", "Big Creek Campground"),
  ("75E4DC88-1332-456C-9F06-05E9F4E1CAB6", 38.5279623, -78.4369404, "Big Meadows Campground (mile 51.2) is centrally-located in Shenandoah National Park, providing easy access to many of the most popular destinations in the Park, including Big Meadows, Dark Hollow Falls, and Byrd Visitor Center. All sites include a place for a tent or RV, a fire ring, and a picnic table.", "Big Meadows Campground"),
  ("CC6D39E3-EA7C-4E86-BBD8-3847DD3CF539", 45.932131, -68.635802, "Backcountry campsite along the scenic East Branch of the Penobscot River.", "Big Seboeis Campsite"),
  ("A873A126-9BD6-4979-8FA2-9692AB909A9E", 46.0287936106, -68.7256877275, "Primitive backcountry campsite along the East Branch of the Penobscot River that is only accessible by boat.", "Big Spring Brook Campsite"),
  ("1CE97109-25B0-4A15-B4B9-3525EF22C1C5", 46.0341848574, -68.7742320868, "A beautiful cabin tucked away in the heart of the forests of Katahdin Woods and Waters National Monument along Big Spring Brook. Available for overnight stays in the winter by reservation, the hut is reached by cross-country skiing or snowshoeing. Reservations required through Recreation.gov. A great place to keep warm, find solitude, and enjoy this winter wonderland!", "Big Spring Brook Hut"),
  ("01F1984D-7345-4D6B-A6C6-D4565B7FBC57", 36.96099384748342, -90.98586951446981, "The Big Spring Campground is located near Big Spring, south of Van Buren, Missouri. Electric and non-electric sites are available at Big Spring year-round. Some sites are reservable and others are available on a first come first serve basis. Sites may be reserved at www.recreation.gov.", "Big Spring Campground"),
  ("26A77456-D7A5-4CD2-8F28-96B3679085C7", 39.492868, -77.792591, "Mile 82.7 - Hiker-biker campgrounds are located along the towpath approximately every 5-7 miles. No fee or reservation required. Overnight stays are limited to one night. All sites include a chemical toilet, picnic table, grill, and drinking water. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from mid-November to mid-April each year.", "Big Woods Hiker-Biker Campsite"),
  ("33204668-CC4F-4F22-8041-CE65C86B47F7", 48.110107730247336, -88.68562291855892, "Small campground on Birch Island, near the mouth of McCargoe Cove, on the north side of Isle Royale National Park. One individual tent site and one shelter on site. Boats can stay overnight at dock. Stay Limit: 3 nights June 1 - Labor Day annually. Shelters: 1 Depth at dock (normal conditions): 5' Access: Canoe/kayak/private boat", "Birch Island Campground"),
  ("C4CB1781-C59F-4065-AFE3-F7A327B075A2", 27.466794, -97.313693, "Bird Island Basin lies along the Laguna Madre Bay. It is open to both tent and RV camping. It has gravel sites and vault toilets. It provides access to the bay for fishing, camping, windsurfing, and kayaking. The relatively calm waters of the bay and the nearly constant breeze make Bird Island Basin one of the top windsurfing destinations in the country.", "Bird Island Basin Campground"),
  ("A1C3F421-F571-4448-B105-EA5DE06AB1AB", 45.25091802928579, -107.96260372030031, "Black Canyon is a boat-in-only campground located five lake miles from the Ok-A-Beh boat ramp. Black Canyon is currently closed (as of 8/30/22) because of aggressive bear activity due to them receiving food rewards from campers. - Open All Year - Docks in seasonally (Memorial Day - Labor Day) - 17 tent sites", "Black Canyon Campground"),
  ("BF423B82-7FE4-4101-B86D-9FE12E2315B4", 35.0486255634651, -115.382956822183, "While the campgrounds at Mid Hills and Hole-in-the-Wall accommodate a maximum of 8 people and 2 vehicles per site, the Black Canyon Equestrian & Group Campground (located across the road from Hole-in-the-Wall Information Center) is ideal for larger groups. The campsite is available to groups of 15-50 people and reservations are required. Call (760) 252-6101 to make a reservation up to 12 months in advance.", "Black Canyon Group and Equestrian Campground"),
  ("33AA5642-343E-425B-89E9-69A0918A8502", 34.07298223672509, -116.39149680312721, "This large (99 site) campground is located in the northwest corner of the park. Each campsite has a picnic table and fire ring with rest rooms and water nearby. Shopping facilities are only five miles away in the town of Yucca Valley. Campsites vary in size and can accommodate both tents and RVs. A day-use picnic area and a dump station are also available. For horse owners, a separate area is provided for camping or for staging a ride.", "Black Rock Campground"),
  ("6E127BF1-F2A9-4C59-90FA-C4BED53EA7F5", 44.30894404258141, -68.20988547018771, "Blackwoods Campground is located on the east side of Mount Desert Island, about 5 miles (8 km) south of Bar Harbor on Route 3. All sites at Blackwoods are wooded and within a 10-minute walk of the ocean. The majority of Blackwoods' sites are for small and large tents; other sites can accommodate travelers with RVs. Flush toilets, running water, and a dump station are provided, as are picnic tables and fire rings. Roads are paved.", "Blackwoods Campground"),
  ("A7E4AEDA-09DB-4E57-A6C0-615867B8A299", 35.7230720210905, -101.663841251126, "This camping area is an off-road vehicle and horseback riding area on the northwest side of the lake off FM 1913. There is no drinking water or flush toilets; vault-evaporator toilet only. Off-road use is in the creek bed ONLY. This area is surrounded with plush cottonwood and soapberry trees.", "Blue Creek"),
  ("78C8F7E4-CDD1-475C-A540-5EA8E22B1CAC", 36.6775354458249, -84.5185055731685, "Blue Heron Campground is located in the Kentucky portion of Big South Fork, 9 miles west of Stearns off Highway 742. The campground offers a total of 45 sites all with water and electric hook-ups, picnic tables, fire-rings, access to restrooms and showers and a dump station.", "Blue Heron Campground"),
  ("7B17E712-1EA9-4FE8-A8B2-B677ED81B385", 31.94825872757042, -104.87174820889072, "A wilderness use permit is required for all use of these campsites. Blue Ridge campground is surrounded by ponderosa pine and Douglas fir; wild roses and grassy areas are nearby - a beautiful location and very remote. The distance from Pine Springs trailhead: via the Tejas & Blue Ridge trails is 7.8 miles, via the Tejas, Bush Mountain & Blue Ridge trails is 8.9 miles.", "Blue Ridge Wilderness Campground"),
  ("7461D94E-67E8-4C2B-BEFF-B93174B8CE06", 35.682455887, -101.628561851, "A caprock campground, overlooking Lake Meredith. Access to shoreline is difficult. This campground is located north of the lake off FM Road 1913. These campgrounds have excellent views of the lake and offer picnic tables and shade shelters. This area is a great place to view the sunsets of the Texas Panhandle.", "Blue West Campground"),
  ("289944B3-8869-44CF-BCAC-192CA620B028", 33.8323062462, -80.8148872732, "The Bluff Campground is a hike in campground and is perfect for those looking to camp in the frontcountry yet have a more backcountry experience. This campground has 6 sites that can accommodate up to 8 campers each. Each site has a firepit and a picnic table. Restrooms are available at either the visitor center or the Longleaf Campground, and water and park information is available at the visitor center. This is a pack it in/pack it out campground.", "Bluff Campground"),
  ("3974D96D-C28E-4A4B-8CCA-4C0C4747C420", 25.5231, -80.1746, "Boca Chita campground is located on an island. The only access is by boat. No services are available. Boca Chita Key features an iconic lighthouse and an open, waterside, grassy camping area with picnic tables and grills. Toilets are available, but there are no sinks, showers or drinking water. The harbor entrance at low tide is approximately four feet deep. Pets, with the exception of service animals as defined by the ADA, are not permitted on the island or boats in the harbor.", "Boca Chita Campground"),
  ("8D97B7B6-3DB4-4355-8755-2248F20D2E30", 32.0115507156, -109.355060216, "Bonita Canyon Campground is located in a shady pine and oak grove near the riparian area of Bonita Canyon wash. It has 25 sites and with rest rooms (flush toilets), running water, picnic tables, and trash pickup. There is a group campground that can accommodate 9 to 24 people (8 tent max). Reserve campsites through Recreation.gov There are no hookups or showers. Vehicle length limit is 29 feet. Camping is limited to 14 days.", "Bonita Canyon Campground"),
  ("D0B26144-86D6-4F31-9296-4455BA0A3DDB", 36.036950329698435, -114.80191660139093, "The Boulder Beach Campground is located just minutes from Las Vegas along the Boulder Basin of Lake Mead. It’s open year-round and features large paved sites that can accommodate tents or large RVs, along with tables, fire pits and/or grills. These sites are like an oasis, because of the lush vegetation that shades nearly every campsite. There is a mix of palm trees, oleanders, mature cottonwood trees and native vegetation that also helps provide privacy between sites.", "Boulder Beach Campground (Lake Mead)"),
  ("726B4856-7914-4952-BF9F-C3D48D0E5712", 36.03752520072463, -114.8025731005672, "When you stay at the Boulder Beach Group Campground, you’ll have access to many recreation opportunities. Boulder Beach, Special Events Beach, Canoe/Kayak Beach and PWC Beach are 1-2 miles away. At these locations you can swim, kayak and jetski. If you prefer to explore the park on land, the River Mountains Loop Trail passes right by the campground. This paved trail is more than 30 miles long and leads to the Historic Railroad Trail.", "Boulder Beach Group Campground (Lake Mead)"),
  ("EED1CD77-7B8F-478E-89C3-466C44B2D047", 42.7776, -97.1481, "Primitive, Leave No Trace camping is allowed and free. Camp only in designated sites marked with brown camping signs and metal fire rings. Please call us at 605-665-0209 and leave your basic itinerary for your safety. Located along Bow Creek and the Missouri River in Cedar County about 2 miles northeast of Wynot, Nebraska. A series of gravel roads wind you to the location by car. Follow the brown Bow Creek Recreational Area directional signs to the gravel parking lot and trailhead.", "Bow Creek Primitive Camping"),
  ("03CC7ABA-0A4F-4F74-96B8-317F981E3B8E", 48.8290464956264, -114.203130379479, "Bowman Lake campground is located in the North Fork area of Glacier National Park approximately 32.5 miles from the west entrance, and 30 miles from the Canadian border. The drive to Bowman Lake is a very slow, dusty, and bumpy ride on dirt roads. Trailers are not advised. The campground is located close to the shore of Bowman Lake and camp sites are within trees for shade and some privacy. Tent campers looking for peace and quiet will enjoy Bowman Lake for it's serenity and remote location.", "Bowman Lake"),
  ("3EC422D6-D669-4C88-B906-EE5BB4DA2C21", 40.6173933269, -122.574956741, "This two site campground is found just off Brandy Creek Road, with Brandy Creek accessible a short walk away. The Brandy Creek trail, popular with hikers, mountain bikers, and horseback riders, runs next to the campground. This campsite is closed during the winter. Both sites are in partial shade and feature a bear-proof storage locker, picnic table, lamp pole, fire pit with swing-arm BBQ grill, and an ADA accessible vault toilet. Each site has a maximum occupancy of six people and two vehicles.", "Brandy Creek"),
  ("520460C8-4CDF-4642-BABF-422217A7830D", 40.61705, -122.57476, "A secluded hilltop RV site close to Brandy Creek Marina and within walking distance of Brandy Creek Beach, the Brandy Creek trail and the Davis Gulch trail. Campground is an asphalt parking lot with 15 parking sites. Only for self-contained units that have their own toilets, such as recreational vehicles, cab-over campers, pop-up tent trailers, and fifth wheels. There is no bathroom and no hookups at this campground. One main water and dump station shared by all campers.", "Brandy Creek RV"),
  ("530F6E66-6603-41A9-AC88-6E8750923E1A", 30.8945, -81.444, "Brickhill Bluff Wilderness Campsite is one of three campgrounds in Cumberland Island’s designated wilderness on the northern part of the island. The campsite is located 10.5 miles north of the Sea Camp dock. Wilderness sites have no amenities. Fires are prohibited, but camp stoves can be used for cooking. Campers should be prepared to hang all food and trash. Water is available from a pump well located in the site and must be treated. Permits are $9 a night, good for up to 6 people.", "Brickhill Bluff Wilderness Campsite"),
  ("58B9591C-4723-4049-B26C-D30C07A6FAD6", 37.6636576342436, -119.624293366359, "The Bridalveil Creek Campground is located along the Glacier Point Road near Bridalveil Creek and is surrounded by a beautiful forest of red fir and lodgepole pine. At an elevation of 7,200 feet (2,200m) the campground is located 7 miles west of Glacier Point, 9 miles east of the Wawona Road turnoff, and is approximately 45 minutes from Yosemite Valley. The spectacular views from Glacier Point are nearby, and numerous hiking trails are located along the Glacier Point Road. There are no services nearby.", "Bridalveil Creek Campground"),
  ("1A5B19B8-BF1F-4803-8D87-2D4091D59A4D", 44.534437749236, -110.436923682403, "Bridge Bay Campground—elevation 7,800 feet (2377 m)—is located near Yellowstone Lake, one of the largest, high-elevation, fresh-water lakes in North America. Campers at Bridge Bay will enjoy spectacular views of the lake and the Absaroka Range rising above the lake's eastern shore. Yellowstone National Park Lodges provides reservations for this campground.", "Bridge Bay Campground"),
  ("66473DAA-0E97-47DE-A5AD-F52B0DFF4E88", 37.984096, -81.027881, "Take Gatewood Road to the Cunard turnoff, between Oak Hill and Fayetteville. Turn, then go 1.8 miles, then follow signs to Cunard River Access. Bear right through the boat launch parking lot and continue upstream for a mile. Sites are on the left. There are four shaded walk-in sites and one drive-in site for tents only.", "Brooklyn Campground"),
  ("CE630927-F34B-4A58-BD8E-D4ED74E8EDCA", 58.5597862997626, -155.777534811051, "Brooks Camp Campground is the only developed campground in Katmai National Park and Preserve. It is located on the shore of Naknek Lake, about .3 miles (.5 km) from the Brooks Camp Visitor Center. Facilities in the campground include a food cache, gear cache, fuel storage locker, potable water, cooking shelters, fire rings, and vault toilets. The campground is also surrounded by an electric fence. Special regulations apply at Brooks Camp and in the campground.", "Brooks Camp Campground"),
  ("6BCF7F8D-71B1-4B29-A925-5DCFDD0CB38E", 36.52243302377206, -118.76410649285589, "Buckeye Flat Campground, just 7 miles (11 km) from the Ash Mountain Entrance, lies along the Middle Fork of the Kaweah River in an oak and California buckeye woodland. Campers can hear the rushing river from most sites, especially in spring and early summer. Due to high temperatures and dry conditions, fire restrictions are often in effect here. The Paradise Creek Trail departs from the campground, and the Middle Fork Trail is located nearby.", "Buckeye Flat Campground"),
  ("9607DA82-8507-4D92-A3DB-5FE81E4CD5C8", 34.4291301418, -96.9885393739, "Buckhorn Campground has four loops. Loop A is open seasonally on a first come, first served basis. There are no hookups for RVs on Loop A. Located next to Lake of the Arbuckles, Buckhorn Campground is also located near the Buckhorn Boat Launch and near the southern trailhead for the Rock Creek Multi-Use Trail.", "Buckhorn Campground Loop A"),
  ("90EF147D-A958-4C60-9414-193FC048A66C", 34.4273650843, -96.9916061826, "Buckhorn Campground has four loops. Loop B is open seasonally on a first come, first served basis. There are no hookups for RVs on Loop B. Located next to Lake of the Arbuckles, Buckhorn Campground is also located near the Buckhorn Boat Launch and near the southern trailhead for the Rock Creek Multi-Use Trail.", "Buckhorn Campground Loop B"),
  ("FFC17012-1267-43CF-B294-D56FD7F89E47", 34.4316165287372, -96.9964235623855, "Buckhorn Campground has four loops. Loop C is open year round by reservation only. Located next to Lake of the Arbuckles, Buckhorn Campground is also located near the Buckhorn Boat Launch and near the southern trailhead for the Rock Creek Multi-Use Trail.", "Buckhorn Campground Loop C"),
  ("E7B327F1-7369-40B6-BC6D-35221C41F9D6", 34.4317472227631, -96.9982420570924, "Buckhorn Campground has four loops. Loop D is open year round. Campsite on Loop D are first come, first served. Located next to Lake of the Arbuckles, Buckhorn Campground is also located near the Buckhorn Boat Launch and near the southern trailhead for the Rock Creek Multi-Use Trail.", "Buckhorn Campground Loop D"),
  ("5AA6174E-B53C-46F7-9F7B-CC275DD91CBC", 36.0715554992, -92.5555762993, "Buffalo Point Campground is the park's largest and most developed campground. It offers water and electrical hookups for RVs. Some sites at Buffalo Point are available for reservation at www.recreation.gov (1-877-444-6777) and others are first come, first serve. Flush restrooms, dump station, showers, water, and electricity are available from March 15 - November 14 when fees are charged. Fees are not charged from November 15 to March 14 when only B Loop is open with no amenities, just a vault restroom.", "Buffalo Point Campground"),
  ("DAC620D3-F276-4073-9DBF-0815C1A74BBA", 35.7248098991, -101.5901470184, "This area is located near the Bugbee community off FM 3395. Shoreline fishing is popular and there are a number of shoreline birds to view. There is no drinking water or flush toilets; vault-evaporator toilets only.", "Bugbee Canyon"),
  ("4285489C-2D25-4967-91E7-18597C645A0F", 37.5199691549143, -110.721029500387, "This campground is located in the Bullfrog developed area and is operated by Lake Powell Resorts & Marinas. 78 sites, restroom, phones, dump station, potable water station, ½ mile to laundry, store, post office, launch ramp. No reservations. Fees apply. The concessioner also operates a separate RV park with 24 sites, full hook-ups, restrooms, showers, and 1/2 mile to laundry, store, post office, launch ramp. For reservations visit www.lakepowell.com or call 800-528-6154. Fees apply.", "Bullfrog RV & Campground"),
  ("46473049-16E4-4629-A3AD-00E108D06584", 25.8931188486191, -81.2297696743782, "Primitive camping with no water. Vault toilets available. This site provides day use picnic area and backcountry access parking. The campground accommodates 15 designated RV/tent sites.", "Burns Lake"),
  ("46B56158-098F-454B-AA80-B4F167736A29", 38.073636, -81.077535, "Burnwood is located across Route 19 from Canyon Rim Visitor Center and offers group camping. This site requires a Special Use Permit. For a permit for the group campsites, contact the permits office at 304-465-6517. Permits require a minimum of 10 business days after the application has been received.", "Burnwood Group Campsite"),
  ("68B2FAB6-1857-4C5D-B025-1AA2712A7BFD", 31.9264160207, -104.876685436, "A wilderness use permit is required for all use of these campsites. A favorite of many for the exceptional vistas and western sunsets. Though the campsites at Bush Mountain are semi-protected from high winds, backpackers will find hiking on the exposed trails to reach the campground difficult during periods of high wind activity. Bush Mountain campground is 6.2 miles from Pine Springs trailhead via the Tejas and Bush Mountain trails. Five designated campsites are defined by tent pads.", "Bush Mountain Wilderness Campground"),
  ("8AA8C347-B5A7-47F2-A2D4-A37635F8E4B3", 40.5648011556304, -121.305764293073, "Butte Lake Campground is located in the NE corner of Lassen Volcanic National Park. The campground is a 45-minute drive from the Northwest Entrance and Manzanita Lake Area and is accessed via the 6-mile-long Butte Lake Road south of highway 44. This remote campground offers few amenities, but numerous recreation opportunities. Enjoy a hike up Cinder Cone or a paddle along Butte Lake's lava rock shores. Reservations are available for most sites and required for group sites and the stock corral.", "Butte Lake Campground"),
  ("9CAD260F-57A8-4814-87FA-E61D14108C81", 38.59701768873082, -77.35605254877296, "Cabin Camp 1 was the first camp in the park completed by the Civilian Conservation Corps (CCC) in the 1930's. It sleeps 205 visitors. Its dining hall and craft lodges are some of the best examples of rustic architecture in the park. Stone foundations, fireplaces and whole log supports showcase the beautiful native materials used by the CCC. The sleeping cabins in this camp host 2 to 10 campers per unit and are newer construction (circa 1980s). Some cabins in the D unit are semi wheelchair accessible.", "Cabin Camp 1 (By Reservation Only)"),
  ("CBA8D848-FB74-4492-9E5D-E1E4979A976B", 38.581375041329196, -77.4157374023348, "Cabin Camp 2 first hosted campers in 1937. The camp sleeps 149 visitors and consists of approximately 132 acres. This camp mainly contains 4 person cabins, with a few 2 and 6 person cabins mixed in here and there. The units are clustered in a circular arrangement and contain 8 cabins, a bath house, and a lodge. Each unit is in a grassy clearing that is surrounded by dense forest. The large ballfield and lake access in Camp 2 are among the best in the park. Cabin Camp 2 was listed on the National Register o", "Cabin Camp 2 (By Reservation Only)"),
  ("B26D8D06-514E-4230-A314-CF0ED2023B98", 38.56367216064515, -77.36493032549049, "Individual cabin rentals and a small group site are available in Cabin Camp 3. This forested camp was constructed by the Civilian Conservation Corps in the 1930s. It is also listed on the National Register of Historic Places. Cabin Camp 3, C Unit is made for smaller groups. C Unit has a linear layout and sleeps 76 visitors. C Unit's 10-person cabins make it one of the best in the park for group outings. The beautiful brick fireplaces in the dining hall and craft lodges give this camp a unique character.", "Cabin Camp 3 (By Reservation Only)"),
  ("67817EE3-C197-45DD-AEF0-E5E86061691B", 38.59150925969603, -77.35386082375908, "The 199 visitors who can sleep in this Cabin Camp 4 can enjoy the new roofs and windows that help ensure that these historic structures last for future generations. Cabin Camp 4 has mostly 10-person sleeping cabins. While this camp is the only one in the park without a fireplace in its dining hall, the theater building/gymnasium is the only one in the park.", "Cabin Camp 4 (By Reservation Only)"),
  ("2D5D7B26-19D2-4583-A370-86575EA22C2F", 38.57577906331334, -77.41256789301237, "Cabin Camp 5 was the last camp to be completed by the CCC and WPA. The camp offers the largest capacity (210 in summer, 104 in winter) due to the large dorm buildings and restrooms. This is also the only camp with heat, so this camp may be rented year-round. This is also the only camp to have an outdoor picnic pavilion located inside the camp. Cabin Camp 5 is set up in two units with cabins that sleeps 2 to 4 people and larger dorm buildings that sleep 24.", "Cabin Camp 5 (By Reservation Only)"),
  ("EE34E034-775B-4EB2-ABEC-F23AF045D3AB", 39.621284, -78.279305, "Mile 133.6 - No fee charged; this is a first-come first served walk in campsite. Stay is limited to one night per site, per trip. Campground has a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Cacapon Junction Hiker-Biker Campsite"),
  ("711EFDE3-F836-4A4C-B58C-D3E28386BDE4", 35.6027246468281, -83.7762927735478, "Cades Cove Campground - elevation 1713 feet (522m) - is open year round and combines the feel of primitive camping with the modern convenience of flush toilets and drinking water. Both Loop B and C are open from mid-April through the Thanksgiving weekend. During the off season (Dec-mid April) only sites C1-12 and C26-61 are open to camping by reservation only. Once B Loop closes for the season then generators will be allowed in Loop C, with restricted hours, UNTIL Loop B reopens for camping.", "Cades Cove Campground"),
  ("E4E470BE-46E5-44B6-A65A-31CFAAB939DB", 35.6038916470614, -83.7713098747745, "Cades Cove combines the feel of primitive camping with the modern convenience of flush toilets and drinking water. A camp store provides visitors with basic necessities as well as bike rentals. Events like interpretive programs in the nearby amphitheater and bicycle-only days on the loop road provide visitors with a fun and unique experience.", "Cades Cove Group Campground"),
  ("9EBA8986-2A1F-4207-82D1-F155A10BEB35", 39.271168, -77.535582, "Mile 47.6 - Hiker-biker campgrounds are located along the towpath approximately every 5-7 miles. No fee or reservation required. Overnight stays are limited to one night. All sites include a chemical toilet, picnic table, grill, and drinking water. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from mid-November to mid-April each year.", "Calico Rocks Hiker-Biker Campsite"),
  ("34A6DDB4-815E-484B-A366-6DB3024920B3", 36.1378088551872, -114.72861216150869, "When you stay at Callville Bay Campground, you can enjoy the area on land or on water. A nearby shaded picnic area has cool grass, grills, restrooms and panels explaining the history of the area. Across the street, you’ll find the trailhead to the Callville Summit Trail. This 2.7-mile moderate hike requires a short climb, but yields a spectacular view of Lake Mead, Fortification Hill, the Hemenway Valley and the River Mountains.", "Callville Bay Campground (Lake Mead)"),
  ("8131F253-D893-42FA-A162-4CDE07363AD5", 36.143263, -114.725594, "More than 550 miles of pristine shoreline. Soaring red rock cliffs. Countless bays and beaches. Get off the grid for the vacation of a lifetime at Callville Bay Resort & Marina on Lake Mead. Conveniently located within an hour of Las Vegas, Nevada, Callville Bay offers an ideal getaway perfectly complemented by infinite opportunities for adventure and entertainment. Personal watercraft and ski boat rentals are available for a fun-filled day trip, along with multiple houseboat rental options.", "Callville Bay RV Park (Lake Mead)"),
  ("8F36DEB6-298E-4214-A677-064BD457996A", 37.7420541114337, -119.602253054678, "Camp 4 is located in Yosemite Valley near the base of granite cliffs close to Yosemite Falls. Yosemite Valley is centrally located in the park and boasts some of Yosemite’s most iconic features. This campground is located at 4,000 feet (1,200 m) elevation and can be accessed from all park roads. Camp 4 is within biking and walking distance of many services in Yosemite Valley and is located near the free shuttle route. There are food and grocery services nearby at Yosemite Valley Lodge and Yosemite Village.", "Camp 4 Campground"),
  ("D378656F-72C7-4F18-A3CC-741CBEE9B394", 39.64454144059151, -77.47656473444567, "Located on the National Register of Historic Places as a Historic District, the cabin camp facility is a perfect location for organized groups to hold retreats and conferences. The camp has space for 140 people to sleep on twin beds. There are 12 cabins that sleep 10 each, one lodge that sleeps 12, and three smaller cabins.", "Camp Greentop"),
  ("9EE76DDC-80AB-4283-BCE9-F85952ED03E1", 39.6418851453505, -77.4484489543919, "Reservations Required. No Walk Ins. Camp Misty Mount is a cabin rental facility for individuals, families, or small groups. This historic cabin camp was completed in 1937 by the Works Progress Administration. The camp is surrounded by hardwood forests on the slopes of Catoctin Mountain Park. The region is part of the Blue Ridge Province and offers scenic mountain views and clear streams.", "Camp Misty Mount"),
  ("905221FE-094D-4E73-90EB-205CBCAD69AA", 39.6449169814922, -77.4876280994409, "Reservations Required. No Walk-Ins. Camp Round Meadow is a group camp featuring 4 heated dorms that sleep 30 people each (total 120). Each dorm has bathrooms with flush toilets, hot showers, and electric outlets. Cots with vinyl mattresses are provided. Campers bring bedding, toiletries, toilet paper and towels, and cleaning supplies. Brooms and mops are provided. Additional facilities include a dining hall, gymnasium, classrooms, a conference room, and a small outdoor gazebo.", "Camp Round Meadow"),
  ("8B813CCA-9522-490F-A477-1904540C69A3", 46.1249342961593, -68.801462993981, "Twelve campsites, four lean-tos and 2 huts are dispersed throughout the monument. Reservations for Haskell and Big Spring Brook Hut are required and available through Recreation.gov. All other campsites and lean-tos are currently first-come, first-serve. Reservations for those sites will be available through Recreation.gov by summer 2022.", "Camping and Huts"),
  ("77D2C8BE-94A4-4550-9823-7183C50F4803", 28.92700096310608, -80.82460296672082, "Natural and spoil island campsites provide a variety of access and capacity options to those visitors who have their own boat, canoe or kayak. Please see the attached map for location and site numbers/names. Reservations and a permit are required for island campsites. Canoe rentals are available for sites one through five. Canoes are reserved by calling (386) 428-3384 extension zero, after you have made your camping reservation. Sites 6-14 may only be reached with a personal boat, canoe or kayak.", "Canaveral National Seashore Backcountry Island Camping"),
  ("8C42E6D8-1819-46F3-A363-3C8107A1AFAC", 44.7353837489, -110.487912383, "Canyon Campground—elevation 7,900 feet (2408 m)—lies in a lodgepole pine forest at Canyon Village, south of the Washburn range and near the breath-taking Grand Canyon of the Yellowstone River. Canyon Village offers stores, restaurants, and lodging. Nearby hikes include Cascade Lake, Mount Washburn, and the Canyon Rim trails. Yellowstone National Park Lodges provides reservations for this campground.", "Canyon Campground"),
  ("ECDA4D3D-F3B7-4ED3-ABEA-9FDE0839E053", 59.6075624, -135.3246672, "The Canyon City campground provides a nice place to take a break from hiking, with several tables and two warming shelters. This backcountry campground is at mi 7.7 (km 12.5). The campground is located just half a mile from the historic Canyon City townsite where hikers can see artifacts leftover from the gold rush days including the large metal tram boiler. In order to camp overnight along the Chilkoot Trail on the U.S. side you must purchase a backcountry permit from the Chilkoot Trail Center in Skagway.", "Canyon City"),
  ("85543439-6134-478E-8593-36D96471F5E6", Null, Null, "Canyon View Campground is open during the Summer Season from May through September, with 13 sites including 3 large group camping sites. Camping is free.", "Canyon View Campground"),
  ("3851B132-FEA2-45BD-9F47-CE177AC59489", 36.787192938, -118.665449308, "Canyon View campground is located on Highway 180, 0.25 miles (400 m) from Cedar Grove Village. This group-only campground is situated on the floor of the canyon along the South Fork of the Kings River. It was named for it's excellent views of Kings Canyon's granite cliffs. This campground is for medium and large groups. Food and showers available at Cedar Grove Village.", "Canyon View Campground"),
  ("C250A435-A020-4A92-A14F-1F9737B25F45", 35.235775, -75.53911, "Cape Point Campground with 202 sites is located southwest of the Cape Hatteras Lighthouse, and within walking distance of the Atlantic Ocean and Cape Hatteras (also known as Cape Point) itself. Open April 7-Nov. 27, 2023. Campsite reservations are limited to same-day reservations only. Campsites must be booked via recreation.gov.", "Cape Point Campground"),
  ("BD44D68E-2EAA-456B-842C-75136B035CB1", 48.094571206998936, -88.57220404720897, "Caribou Island Campground is located on the very western tip of West Caribou Island, in Rock Harbor Channel, on the northeast end of Isle Royale National Park. Boats can dock overnight. Stay Limit: 3 nights effective from June 1 – Labor Day. Shelters: 2 Depth at dock (normal conditions): 10’ Access: Canoe/kayak/private boat", "Caribou Island Campground"),
  ("1FEBD642-4DE4-49FD-9DF1-3EF8E499AC03", 35.9835736001, -93.0401838004, "Carver is a first come, first serve campground in the upper district of the park. It has 8 tent only sites with potable water, but no electrical amenities. A vault restroom is available. This is a pack in/pack out facility with no trash service.", "Carver Campground"),
  ("8B71E7E6-5EF0-49D8-8E33-2578A64A6DD5", 35.631185945507, -83.08554127280615, "Cataloochee Campground - elevation 2,600 feet (792m) - located in historic Cataloochee Valley, is surrounded by mountain ranges and pristine streams characterized by mild winters and hot, humid summers. It offers traditional camping with the convenience of flush toilets and drinking water. There are no hookups or showers. Hammocks are allowed over the footprint of the campsite. Limited to trees 10 inches in diameter with adequate padding around the tree and only 2 hammocks may be suspended from tree.", "Cataloochee Campground"),
  ("CE2A760B-8A8F-4083-9E6F-3DB38B313145", 42.1142851019, -123.431699655, "Sleep under the boughs of an old growth forest beside Cave Creek. This campground is located 15 miles up Highway 46 from Cave Junction and just four miles from the cave entrance. The campground has fire rings, water and vault toilets. The spaces are too small for large RVs or trailers and no pull through sites. The campground offers 17 sites available on a first-come, first-serve basis. Maximum vehicle length: 20 feet.", "Cave Creek Campground"),
  ("DF24E937-0AA1-4E65-84A8-3F2458EFD1C5", 35.79584, -101.24451, "This small cove lies between Fritch Fortress and Sanford-Yake campgrounds. The area features beach camping with no individual campsites. This campground can become soft during rainy conditions. Please drive with caution when leaving paved roads. There are restrooms with potable water and flush toilets in the parking lot.", "Cedar Canyon Campground"),
  ("92F73FF4-10AB-45D0-915E-AC0A063420E2", 43.744154, -101.950161, "Located near the Ben Reifel Visitor Center, the Cedar Pass Campground has 96 level sites with scenic views of the badlands formations. This campground offers flush toilets and coin operated showers in the summertime.", "Cedar Pass Campground"),
  ("4AFE2D11-908E-489B-B8A0-A2222AE752A3", 34.5049201966, -96.9672378028, "Central Campground consists of ten group sites. It is located near downtown Sulphur.", "Central Campground"),
  ("3D7C58EB-7354-4212-98E7-CCD7C13BC98F", 46.546925, -86.440929, "Chapel Beach Campground sits on the sand bluff above Chapel Beach and Lake Superior. Chapel Beach is a popular day use area, so the six sites here offer less isolation than other backcountry campgrounds. Shared pit toilet. Water source is Chapel Creek and Lake Superior. Lake Superior access for kayakers. NO CAMPFIRES.", "Chapel Individual Backpacking Sites"),
  ("3E73BA85-7545-4A30-9ACD-A9E3C073DB2A", 35.6918602938, -101.642234005, "This remote and primitive area is located near Blue West. It is tucked in the Blue Creek embankment, which provides protection from prevailing winds. There is no drinking water or flush toilets; vault-evaporator only. There are picnic tables available.", "Chimney Hollow Campground"),
  ("ECF46E27-F335-4766-9140-56A8D2AAC209", 48.02936725450616, -88.6510379097632, "Chippewa Harbor Campground is located in Chippewa Harbor, on the south shore of Isle Royale National Park. Trail access is via the Indian Portage Trail. Boats can stay overnight at dock. Stay Limit: 3 nights from June 1 – Labor Day annually. Shelters: 4 Depth at dock (normal conditions): 7’ Access: Foot/canoe/kayak/private boat", "Chippewa Harbor Campground"),
  ("B9D70C3C-FCA6-4E10-A654-8D0D2B38CAA7", 39.102158, -77.473011, "Mile 30.5 - Hiker-biker campgrounds are located along the towpath approximately every 5-7 miles. No fee or reservation required. Overnight stays are limited to one night. All sites include a chemical toilet, picnic table, grill, and drinking water. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Chisel Branch Hiker-Biker Campsite"),
  ("127199AC-A753-4B49-B3FF-1F8484B61CBE", 29.275900792177, -103.302285692397, "The Chisos Basin Campground is nestled in an open woodland within a scenic mountain basin. Campers enjoy the iconic views of Casa Grande and Emory Peak. The sunset through the nearby 'Window' is a Big Bend highlight. Some of the park's most popular trails begin nearby. Elevation is 5,400 feet. RESERVATIONS REQUIRED. Trailers over 20 feet and RV's over 24 feet are not recommended due to the narrow, winding road to the Basin and small campsites.", "Chisos Basin Campground"),
  ("5529F57E-216A-47FB-B513-067410887BC0", 38.5587614251363, -77.4069097323804, "Chopawamsic Backcountry Area (tents only) is an 8-site, hike-in/hike-out, backcountry campground. No pets, no alcohol, no open campfires, no live bait in the reservoir allowed. Four campers per site only. Campers must pitch tents within 30 feet of the site marker. No reservations are possible. Campers receive a permit on a first-come, first-serve basis. There is no charge for the back-country permit, but campers must pay the park entrance fee or possess a valid park pass. Vehicles must be parked in lot.", "Chopawamsic Backcountry Area"),
  ("B6981A2D-2C0B-47DF-B7F8-67A25A35D24A", 38.4442894775407, -107.555231428248, "Cimarron Campground is located 20 miles east of Montrose on U.S. Highway 50 at the site of a historic narrow gauge railroad town. All types of camping from tents to medium sized RVs can be accommodated at Cimarron. All sites are first-come first-served, and the campground rarely fills. Railroad exhibits are adjacent to the campground, and Crystal Reservoir near Morrow Point Dam is approximately 1.5 miles away. Elevation: 6895 feet", "Cimarron Campground"),
  ("14084144-35CA-4862-96D8-72364E4A638B", 34.1112789977, -118.926525539, "Circle X Ranch Group Campground is the only campground the National Park Service operates in the Santa Monica Mountains. Visit recreation.gov to make reservations for this 10 person minimum group camp.", "Circle X Ranch Campground - CLOSED"),
  ("849C892E-19ED-4539-8591-CF2D1670D380", 42.067203, -113.701382, "Camping in City of Rocks is a great way to enjoy being out in nature. Relax beneath the cool shade of aspen, juniper, mountain mahogany, or pine. Spend the night surrounded by impressive granite formations and starry skies. There are 64 standard campsites and 3 group sites to choose from with easy access to climbing, hiking trails, and vistas.", "City of Rocks Campground"),
  ("E9451131-5026-4E61-B72E-F385A0C6AC48", 46.48567, -86.556577, "Cliffs Group Campground is one mile east of Cliffs Campground. It lies high above Lake Superior and inland from the North Country Trail. You will not be able to see the lake from the campground in the summer. There are spots along the North Country Trail near the campground to get a glimpse of Grand Island and Lake Superior. One shared fired ring and pit toilet. Visitors must bring water. NO ACCESS TO WATER.", "Cliffs Group Backpacking Site"),
  ("B9D839A2-7500-4CFC-9EB7-1A1C8F7B7425", 46.473431, -86.570456, "Cliffs Campground rests high above Lake Superior inland from the North Country Trail. The three campsites are in an open area with little cover between sites. During the summer months when the foliage is at its peak, you cannot see Lake Superior from the campground. There are places along the trail to sneak a peek of Grand Island and the lake. One shared fired ring and pit toilet. Visitors must bring water. NO ACCESS TO WATER.", "Cliffs Individual Backpacking Sites"),
  ("79EC784A-70FD-4C73-BD0E-C5D0C96F4F57", 48.2971109735789, -118.14685853302, "Cloverleaf is a small, walk-in only campground near Gifford. Tent sites are tucked into the pines with lake shore access. This campground is great for those wanting a more rugged, primitive camping experience with standard amenities like water and pit toilets. Although small, Cloverleaf Campground is not as popular as other campgrounds and doesn’t often fill.", "Cloverleaf Campground"),
  ("6EBE4D11-5079-45B7-BDA5-84280A8EE7DF", 38.0171728059185, -122.854375340707, "Coast Campground is nestled within a small coastal valley with easy access to the beach and tidepools. The beach is within 220 yards of the campground and tidepools are located ~720 yards to the southeast. One may access Coast Campground by foot, bicycle, or horse; not by boat, auto, or RV. The shortest approach on solid ground is via the 1.8-mile slightly uphill hike on the Laguna and Fire Lane Trails, starting at the Laguna Trailhead just east of the hostel. There are 12 regular sites and two group sites.", "Coast Campground"),
  ("70748762-AEEB-4057-82DD-B0509183305A", 34.5013484424, -96.9584441793, "Cold Springs Campground is open seasonally for the summer. It opens no later than Memorial Day Weekend and closes no earlier than Labor Day Weekend. Rebuilt in the 1930s to its current configuration, it does not accommodate most RVs, though small pop-up or teardrop trailers may fit in the parking spaces at some campsites.", "Cold Springs Campground"),
  ("E43BEB8F-1EE3-4CDD-88EB-ED8262628F95", 36.45130196165861, -118.61241063028547, "Nestled among amid aspen trees and conifers, the campground is located near the Mineral King Ranger Station, 26 miles (42 km) - 1.5 hours drive time - from the Highway 198 junction in Three Rivers. There are 31 regular sites and 9 walk-in sites (located approximately 100-200 yards walking distance from parking area, depending on site). There are limited services at Silver City Resort, 2.5 miles (4 km) west of the campground. Trails to alpine lakes and mountain passes begin nearby.", "Cold Springs Campground"),
  ("1410EA4F-FA47-40E0-9C51-B7C012EFD228", 48.691, -121.101, "Colonial Creek North Campground is a remote, yet bustling campground nestled in old growth forest. Located on the north side of State Route 20 near mile marker 130, there are 41 campsites that are surrounded by forest and located on Diablo Lake. Recreational opportunities include a fully accessible fishing pier and boat launch on Diablo Lake, as well as hiking opportunities for various abilities on Thunder Creek and Thunder Knob trails.", "Colonial Creek North Campground"),
  ("24D589C4-88AF-4BFA-8A02-1FF9E8134B04", 48.687, -121.094, "Colonial Creek South Campground is a remote, yet bustling campground nestled in old growth forest on the south side of State Route 20 near mile marker 130.Ten walk-in, tent-only sites are available first-come, first-served in the winter. Sites may be difficult to access in winter. Reservations required late May to September. Recreational opportunities include a fully accessible fishing pier and boat launch on Diablo Lake, as well as hiking opportunities on Thunder Creek and Thunder Knob trails.", "Colonial Creek South Campground"),
  ("3DC83C15-25CE-488E-816B-64FEBB1F79FF", 36.86618866356771, -111.58668629578499, "No reservations. Along the fifteen mile stretch of the Colorado River between Glen Canyon Dam and Lees Ferry, there are five primitive beaches set aside for camping, marked with signs, on a first-come, first-served basis. Camping is permitted in these areas only, as they are provided with toilets and fire pits. These sites can only be accessed by small vessel. All campsites are located well above the river and require a short walk from your boat.", "Colorado River Primitive Camping Between Glen Canyon Dam and Lees Ferry"),
  ("35B51EB0-EB3E-4C41-9753-2C97CFDDAD93", 43.9074780505115, -110.641378983075, "This large campground is in a lodgepole pine forest near Colter Bay Village. While not on the shores of Jackson Lake, a short stroll leads to a spectacular view of Mount Moran and the northern Teton Range. Colter Bay Village has many facilities including a visitor center, restaurants, stores, cabins, and marina. Shower and laundry services are available for additional fee. Departing from the nearby Hermitage Point Trailhead, hikers traverse forests and sagebrush meadows enjoying the Teton landscape.", "Colter Bay Campground"),
  ("2E829940-0ECC-49A7-85FB-F0AE8D45EBA0", 43.905642, -110.641324, "This RV Park provides full hookups for campers in the park. It is in a lodgepole pine forest near Colter Bay Village. While not on the shores of Jackson Lake, a short stroll leads to a spectacular view of Mount Moran and the northern Teton Range. Colter Bay Village has many facilities including a visitor center, restaurants, stores, cabins, a marina. Shower and laundry services are available for additional fee.", "Colter Bay RV Park"),
  ("DF1FBE98-BC80-4770-84A3-F207D1F8A27A", 43.904150265109244, -110.63494741916656, "The Colter Bay Tent Village at Colter Bay Village is set amidst towering lodgepole pines just a short, picturesque stroll away from Jackson Lake. The Tent Village includes 66 tent cabins, and is open from mid-May to early-September. As with all campgrounds in the park, the Colter Bay Tent Village is very popular and tends to fill up quickly. Visitors are strongly encouraged to plan and book early.", "Colter Bay Tent Village"),
  ("B3B0C4BD-BB79-40AA-B678-B953294BB9A3", 35.7545448462525, -83.20925027349114, "Cosby Campground - elevation 2,460 feet (750m) - is tucked in the mountains under a canopy of cool shade. This campground creates a peaceful and secluded environment for visitors, offering the best the park has to offer. Mountain ranges and a pristine river are the backdrop for your camping adventure in Cosby. Cosby provides a moderate climate, characterized by mild winters and hot, humid summers. Cosby Campground offers campsites for tents as well as RVs.", "Cosby Campground"),
  ("9B5A7B2B-E147-429F-B52F-EDBF1B48EBB0", 33.7448801298196, -115.812829874374, "The Cottonwood Campground is reservations only during the busy season (September-May) and has 62 sites, potable water and flush toilets. The Campground is near the Cottonwood Visitor Center in the southeast part of the park. The closest metropolitan area is Indio about 30 miles away.", "Cottonwood Campground"),
  ("A9F2297C-AFF2-48EA-BD2A-2BBE35BDE306", 46.949934505, -103.531268589, "Cottonwood Campground lies inside the park, about 5 miles from Medora, ND. It is the South Unit's only campground. Half the sites are by reservation at recreation.gov while all remaining sites are first come, first served. Most sites are suitable for tents and RVs (no hookups). Cottonwood Campground fills to capacity each afternoon, mid-May through mid-September.", "Cottonwood Campground"),
  ("D7143083-B16F-45C0-8493-E717CEDA7C3B", 29.13678040347906, -103.52251396165582, "Cottonwood Campground is a quiet oasis in the western corner of Big Bend National Park. Reservations are required. Conveniently located between the Castolon Historic District, the scenic Santa Elena Canyon and the tail end of the Ross Maxwell Scenic Drive, this small, 22-site campground is one of the least-known and quiet campgrounds in the park. There is one group campsite and 21 individual sites. This is a remote campground in a remote park. It is dry camping, no hook-ups, and no generators are permitted.", "Cottonwood Campground"),
  ("B6682425-0D1C-4646-846F-1C0E248CBCFA", 35.487755719796056, -114.69503347257717, "Cottonwood Campground is located near Searchlight, Nevada, along Lake Mohave. It’s open year-round and features paved sites that can accommodate tents or RVs, along with tables, fire pits and/or grills. Restrooms and water spigots are located throughout the campsite. Temperatures usually surpass 100F (37C) degrees June-August. In May and September, daytime highs are around 90F (32C). October-April, temperatures are much cooler. Lows can dip to freezing temps December-February. The area averages 4 inch", "Cottonwood Cove Campground (Lake Mohave)"),
  ("7260C786-CEE8-46B2-9C76-DC0828B7E468", 35.49080255042127, -114.68835234952485, "Cottonwood Cove Resort & Marina at Lake Mohave is a premier destination for houseboat rentals, watercraft rentals, camping and includes a spacious rv park. We are conveniently located on the Colorado River and just a short drive from Laughlin, Nevada. Our resort and marina have lakeside accommodations, a full-service rv park, nearby campground facilities and a variety of boat rentals. Visit us at Lake Mohave and experience the getaway of a lifetime.", "Cottonwood Cove RV Park (Lake Mead)"),
  ("9D67A3A2-CFAB-45A1-8E9E-5A19DE56137F", 46.767606803, -121.792370845, "Cougar Rock Campground is located on the south side of the park, on the road between Longmire and Paradise. It is in a steep valley with the Nisqually River across the main road. Thick forest extends through the whole campground providing privacy for campsites. Access to the Wonderland trail is across the road with waterfalls a moderate hike away. Less than 15 minutes of driving can take you to the trails and facilities at Longmire or Paradise.", "Cougar Rock Campground"),
  ("894E2817-C7C9-48DA-BABF-3C1679567835", 46.56088, -86.395902, "Coves Group Campground is three miles east of Chapel Beach. You are still up on the cliff line, but have started your descent towards Twelvemile Beach. Hike east on the North Country Trail about a quarter mile to find a trail to a small cove and beach on Lake Superior; this is where you have access to water. One shared fire ring and pit toilet. No access for kayakers due to 1/4 mile portage.", "Coves Group Backpacking Site"),
  ("A451A935-35BF-4391-96E5-B9C8D492FCFE", 46.568171, -86.372254, "Coves Campground is inland from the North Country Trail, hidden behind the pine trees and ferns. There are two entry points to the campground. The campground trail leads through the forest where you will find five campsites and two designated metal communal fire rings. There is Lake Superior and beach access from the bluff along the North Country Trail. Water source is Lake Superior. Shared pit toilet. Lake Superior access for kayakers.", "Coves Individual Backpacking Sites"),
  ("B7FFF416-1181-4457-931B-6F9920C0EFE7", 35.815386045639634, -82.14556897298166, "A hidden parkway gem, Crabtree Falls Campground offers quiet serenity. It’s a magical place when mist hangs in the air, coyotes and deer stroll through, and barred owls call out. Crabtree Falls, a 70’ waterfall, is accessible from the campground. Named for the crabapple trees which once dotted the countryside, the meadows in Crabtree Falls Recreation Area speak of the area’s history as a farming community. Bursting with wildflowers in spring, the meadows abut hardwood forests and thickets of rhododendrons.", "Crabtree Falls Campground"),
  ("B1396AAB-EA01-4A6C-B45E-A9BBA51A89A1", 37.7497960831966, -119.800258983341, "The Crane Flat Campground is located along the Big Oak Flat Road, just west of Crane Flat, about 30 minutes northwest of Yosemite Valley, at 6,200 ft (1,900 m) elevation. There is a gas station and minimal convenience items located nearby at Crane Flat. Trailheads for both the Merced Grove and Tuolumne Grove of Giant Sequoias are located within a short drive of the campground.", "Crane Flat Campground"),
  ("4A67F766-D8C0-451B-86AD-CD7DD878EB80", 40.6422, -122.6710333, "The Crystal Creek campground offers two secluded sites along Crystal Creek and is a short drive away from both Crystal Creek falls and the James K. Carr trail to Whiskeytown Falls. This campsite is closed during the winter. A fairly steep dirt road accesses the campsites. Both sites are well shaded and feature a bear-proof storage locker, picnic table, lamp pole, fire pit with swing-arm BBQ grill, with a shared ADA accessible vault toilet. Each site has a maximum occupancy of six people and two vehicles.", "Crystal Creek"),
  ("6D44AAC6-2A52-416E-8087-6202B8AD52BB", 36.7453277426348, -118.962958133454, "Crystal Springs campground is located 4 miles (6 km) from Kings Canyon Park entrance in the Grant Grove area. The campground is situated under open stands of evergreen trees at an elevation of 6,500 feet (1,980 m). Services can be found in Grant Grove Village.", "Crystal Springs Campground"),
  ("4FA8CCF3-5D38-41C0-A77F-06ADCB37BA53", 39.562141, -77.853069, "Mile 95.2 - No fee charged; this is a first-come first served walk in campsite. Stay is limited to one night per site, per trip. Campground has a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Cumberland Valley Hiker-Biker Campsite"),
  ("4624D185-108D-460F-9331-5EC95512BEC7", 48.6059915912156, -113.376949654401, "The Cut Bank campground is located on the east side of Glacier National Park and provides a sense of peace and quiet that may not be found in larger campgrounds within the park. The campground is accessed by a 5 mile dirt road off of highway 89. The Campground is located among trees, providing shade and privacy for tent campers. RVs are not recommended due to the nature of the road and campground layout. Trailheads are near the campground for day hiking use or extended trips in the backcountry.", "Cut Bank"),
  ("70336B82-9090-4BFA-8D3D-47BDC91F4542", 44.89615, -86.02006, "The rustic D.H. Day Campground is located in the northern district of the Sleeping Bear Dunes National Lakeshore, on the lower peninsula of Michigan. This beautifully wooded campground is one of the most popular in northern Michigan, with easy access to the Dune Climb, the Pierce Stocking Scenic Drive, and museums and the historic village of Glen Haven. and is located only 2 miles from the restaurants and shops of beautiful downtown Glen Arbor.", "D. H. Day Campground"),
  ("FD182876-4CAF-4630-8E88-0B710A434AE4", 44.89615, -86.02006, "The D.H. Day Group Campground offers more rustic camping. You will find dirt roads, vault toilets, and ready access to the Lake Michigan beach. There are no electric hook-ups or showers. The campground is located in the northern part of the park mid-way between Glen Haven and Glen Arbor.", "D. H. Day Campground Group Campground"),
  ("808BBAC7-F662-47F6-B2BC-2BEF78B73A69", 48.09208065079491, -88.59622128173942, "Isle Royale's largest campground is located at Daisy Farm, in Rock Harbor Channel, off of the Rock Harbor Trail, Daisy Farm Trail, and Mount Ojibway Trail. Boats can stay overnight at dock. Ranger Station staffed seasonally. Stay Limit: 3 nights from June 1 – Labor Day annually. Shelters: 16 Depth at dock (normal conditions): 9’. Access: Foot/canoe/kayak/private boat", "Daisy Farm Campground"),
  ("E33743CA-5B4A-4DC6-84D8-BCA4984BFE67", 30.397808, -88.795595, "Gulf Islands National Seashore's Davis Bayou Campground offers tent and recreational vehicle camping experiences in a wooded area next to Davis Bayou in Mississippi", "Davis Bayou Campground"),
  ("A7C0F001-EDB5-4832-BB9A-5DF82A4EC57A", 45.2651648, -108.0028519, "This small boat in only campground is located at Dayboard 9, approximately 9 miles south of Okabeh Marina. During the summer season (Memorial Day - Labor Day) this location features a courtesy dock and floating comfort station. The primitive gravel campsites include picnic tables, bear boxes, and fire pits.", "Dayboard 9 Campground"),
  ("2266A16D-7440-4B19-840A-B8B570FFF31F", 35.46031234620795, -83.43466297423731, "Deep Creek Campground - elevation 1,800 feet (549m) - is located next to one of the park's most popular creeks. The camp offers 92 individual sites, all with grills, tables and campfire rings, perfect for a meal or a late-night s'mores session. Hookups and showers are not provided, but flush toilets and drinking water are available. Whether blanketed in bright spring wildflowers or vivid fall colors, the scenery at Deep Creek never disappoints.", "Deep Creek Campground"),
  ("522A398C-D05C-4F67-B1E4-E4F8DF7ED18D", 40.4464807631, -108.513304134, "Deerlodge Park Campground is located 53 miles (85 km) east of the Canyon Visitor Center. It is located on the Yampa River at the boat ramp at the head of Yampa Canyon. It has seven shady sites suitable for tents. The sites have tables and fire pits. There is drinking water and vault toilets available seasonally, but no showers. Deerlodge Park Campground is open year-round, but winter access can be very difficult due to snow. When the Yampa River exceeds an 18,000 cfs flow rate, the campground will flood.", "Deerlodge Park Campground"),
  ("889D3F1F-C595-40D2-B66B-5DA52128DB6A", 36.03893681571232, -111.82260877399585, "At the East Entrance to the park, Desert View Campground offers a peaceful setting with 49 campsites. Sites accommodate tents or smaller RV’s, or vehicles with small travel trailers (30 ft. total length). Campsites available by reservation only at www.recreation.gov, and can be made up to 6 months in advance between Saturday April 15, through the night of Sunday October 15, 2023. Make reservations online or by phone (877-444-6777). It is possible to make same day call-in and/or online reservations.", "Desert View Campground (Reservations Required)"),
  ("F41195B6-57A5-43FA-9509-CE4AE75FFA95", 39.622156, -78.411328, "Mile 144.5 - No fee charged; this is a first-come first served walk in campsite. Stay is limited to one night per site, per trip. Campground has a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Devils Alley Hiker-Biker Campsite"),
  ("FE998695-1CD4-42C2-A57C-0B8B257BBE09", 38.7773329174, -109.588799042, "Camp among slickrock outcroppings at Devils Garden Campground, 18 miles from the park entrance. You can reserve standard campsites up to 6 months in advance for stays March 1-October 31. All sites are usually reserved months in advance. Between November 1 and February 28, sites are first-come, first-served. Facilities include drinking water, picnic tables, grills, and both pit-style and flush toilets.", "Devils Garden Campground"),
  ("DC29D4FD-0E76-41AF-8A2E-74FA3626C3EF", 41.2110633, -74.8736983995, "Dingmans Campground is a 136-site rustic campground located in Dingmans Ferry, Pennsylvania. Dingmans Campground offers a variety of settings with campsites along the river, forest campsites, as well as RV, water, and electric campsites. Group campsites for 20 to 40 people available. Camping is available from April until October most years. Telephone 570-828-1551 for details.", "Dingmans Campground"),
  ("C46D4DBB-5B16-4F5A-BBFA-34C350639B98", 31.9948983481, -104.832847248, "Dog Canyon is a two-hour drive from the Pine Springs area. The Dog Canyon Campground sits at 6,300 feet in elevation and has 9 tent and 4 RV sites. There is one group site at Dog Canyon that can be reserved for a group of 10-20 individuals. Campground amenities include drinking water and flush toilets (there are NO hookups, dump stations or showers). Only cooking stoves are permitted; charcoal, wood fires, and propane firepits are not permitted.", "Dog Canyon Campground"),
  ("E2472655-E82D-4C38-A9B6-0C374BEE7828", 36.6361712129834, -118.808502647521, "Ten miles (16 km) from the Giant Forest, Dorst Creek Campground rests under open stands of evergreen trees at an elevation of 6,800 feet (2,073 m). This centrally-located campground is well situated for those exploring both parks. In the summer, catch the Sequoia Shuttle from the campground for easy travel to Lodgepole and Giant Forest. The trail to the Muir Grove of giant sequoias begins here.", "Dorst Creek Campground"),
  ("85AB5EC6-9BBC-4369-9CFA-A51A6D4498A0", 47.7373029, -123.1647009, "Perfect for secluded tent camping. The access road is washed out 6.5 miles from the campground and it is not vehicle accessible.", "Dosewallips Campground (Walk-In Only)"),
  ("298C9FE2-25B3-4A60-BE23-76E43A703FC5", 36.42949264609475, -81.15577587281024, "Doughton Park Campground is nestled in a landscape of mountains and open meadows. Explore the history of early settlers, enjoy spectacular shows of flame azalea and rhododendron, stretch your legs on area hiking trails, and view wildlife such as white-tailed deer, raccoons, red and gray foxes, and bobcats. Originally known as The Bluffs, this area is now part of the 7000-acre Doughton Park, named in honor of Congressman Robert Doughton, a long-time advocate and supporter of the Blue Ridge Parkway.", "Doughton Park Campground"),
  ("AC12C7C9-38CD-4F10-828D-8C903F1C7926", 32.227981, -110.606875, "- 4,800 feet elevation - 3 campsites (6 people max per site)", "Douglas Spring"),
  ("4C4E2EBD-9A3D-4E59-A7D8-1E68EB5EA501", 40.6253167, -122.5807, "Dry Creek Group Campground includes two large campsites. Each site is primitive and may be reserved for groups of up to 50 people (20 people minimum). The campsites are located within oak woodland on a peninsula surrounded on three sides by Whiskeytown Lake. The primitive campground is located near Brandy Creek Marina.", "Dry Creek Group Campground"),
  ("1D41C0D1-7DA9-44AE-8692-12A63255B0D6", 38.4841144836276, -107.188437346818, "Dry Gulch Campground is located 17 miles west of Gunnison just north of U.S. Highway 50. The campground is shaded by large cottonwood trees and can accommodate tents or medium sized RVs. All sites are first-come first-served. A horse corral is available. Elevation: 7560 feet", "Dry Gulch Campground"),
  ("C1388F86-68A9-4C1C-85C2-193CD4BD3EE1", 44.0277948996318, -68.6535293990644, "Duck Harbor Campground is located on Isle au Haut, a rugged island off the coast of Stonington, Maine. This campground has five sites with lean-to shelters and is a great launch point for paddling excursions. Remote and inaccessible to automobiles, Isle au Haut is linked to the mainland by mailboat.", "Duck Harbor Campground"),
  ("6AAEA981-168E-4F68-AABC-5140D75F05F4", 39.006544, -114.215989, "No overnight camping allowed. Dump Station is for dumping garbage and RV sewage.", "Dump Station"),
  ("665A07F7-CD99-401A-8674-4C65AC41954C", 41.68266002966044, -87.00171411037445, "The Dunbar Group Site holds up to 30 people and is located less than 500 feet from the beach. The site overlooks the Great Marsh and Lake Michigan. Parking and restrooms are located in the Dunbar Beach parking lot, 400 feet from the site.", "Dunbar Group Site"),
  ("0DFCB514-30BF-4FFE-B944-65FC6F41D214", 48.150633110830206, -88.52247086940037, "Duncan Bay Campground is located on the west end of Duncan Bay, on the northeast end of Isle Royale National Park. Boats can stay overnight at dock. Stay Limit: 3 nights from June 2 – Labor Day annually. Shelters: 2 Depth at dock (normal conditions): 6’ Access: Canoe/kayak/private boat", "Duncan Bay Campground"),
  ("3950A5D1-88F1-4727-857F-91473917C23F", 48.169312119814265, -88.47796476335344, "Duncan Narrows Campground is located in the narrows of Duncan Bay on the northeast end of Isle Royale National Park. Boats can stay overnight at dock. Stay Limit: 3 nights from June 1 – Labor Day annually. Shelters: 2 Depth at dock (normal conditions): 6’. Access: Canoe/kayak/private boat", "Duncan Narrows Campground"),
  ("79E68F95-541A-49F8-8CC3-97C07A59670E", 38.2341, -78.7216, "Dundo Group Campground (mile 83.7) is a small, beautiful campground located in the southern part of Shenandoah National Park that offers group campsites, only. The Appalachian Trail passes through the campground. All sites include fire rings and picnic tables.", "Dundo Group Campground"),
  ("B526C74A-2287-48D2-A480-F4FD2F832CE5", 41.671966000578976, -86.9837859988566, "Campground consists of two loops containing 66 camp-sites (53 conventional drive-in sites and 13 walk/carry-in sites). Four sites are wheelchair accessible (numbers 15, 30, 41 and 55). Each loop has modern restrooms and hot/cold showers. Some sites have limited recreational vehicle length. Convenience stores and a gas station are located 1/4 mile north of the campground at the intersection of U.S. Highway 12 and Broadway Ave. in the town of Beverly Shores. Campground closed during winter, Nov 2 - Mar 31.", "Dunewood Campground"),
  ("DFE57C24-C7F4-4F2D-87B7-54A81D20D2E4", 59.5072499, -135.3504976, "The Dyea Campground is located 9 miles from Skagway. Nestled in the trees along the banks of the Taiya River with limited amenities, the Dyea Campground is a restful place from busy town. The campground is within a short drive or bike ride of the historic townsite of Dyea and a half mile from the Chilkoot Trailhead. The campground is monitored by National Park Service rangers and is open when free of snow.", "Dyea Campground"),
  ("4C757AF8-2F39-49A8-A624-F63EB7F5BA90", 48.073437514172, -88.69425862129464, "An inland campground located on the east end of Chickenbone Lake, off of the East Chickenbone Trail. No boater access. Canoe/kayak access using 1.2 mile portage from McCargoe Cove or 0.2 mile portage from Lake Livermore. Be aware that the campground is not on the shoreline - West Chickenbone Campground is more accessible for watercraft. Stay Limit: 2 nights from June 1 – Labor Day annually. Access: Foot/canoe/kayak", "East Chickenbone Campground"),
  ("B9E356D7-B123-45F9-961B-F6AAE98FD6E0", 38.484167, -107.188333, "East Elk Creek is a group campsite that can accommodate a total of 50 people. The site is located 16.5 miles west of Gunnison just north of U.S. Highway 50. The campsites are located under large Cottonwood trees and space is available for tents or RVs. Elevation: 7535 feet", "East Elk Creek Group Campground"),
  ("C7040322-AF55-456C-A03B-5EF85E48E83B", 38.527059599536, -107.64948401793, "The East Portal Campground is located within Curecanti National Recreation Area, but is adjacent to and only accessible from Black Canyon of the Gunnison National Park, which has a $30 entrance fee. The campground is located at the bottom of the canyon, along the Gunnison River. It is a small campground shaded by box elder trees. East Portal is closed in winter, when the Bureau of Reclamation closes the East Portal Road. Elevation: 6526 feet", "East Portal Campground"),
  ("FB7ECE1E-C9F6-4841-B52A-071DFBD4FAFC", 38.526896, -107.649306, "The East Portal Campground is located within Curecanti National Recreation Area, but is adjacent to and only accessible from Black Canyon of the Gunnison National Park, where the entrance fee is $30. The campground is located at the bottom of the canyon, along the Gunnison River. It is a small campground shaded by box elder trees. East Portal is closed in winter, when the Bureau of Reclamation closes the East Portal Road. Elevation: 6526 feet", "East Portal Campground"),
  ("FBCE7DA5-896A-4A5B-939E-4AEACC63CC76", 36.30813734081407, -114.4368978637836, "Our Echo Bay Park is a fisherman’s and boater’s paradise. Located on the north end of Lake Mead, this secluded park offers a variety of outdoor activities. Close to the “must-see” wonder of the Valley of Fire State Park and the ruins of the historic town of St. Thomas, visitors have an array of hiking and sightseeing opportunities. The large RV sites provide room for your boat, and the free on-site launch ramp are ideal for boaters.", "Echo Bay Campground (Lake Mead)"),
  ("5B501930-E3AB-4CB2-A5F7-9605E922A025", 36.310075538623266, -114.43199832188293, "Echo Bay Park is a fisherman’s and boater’s paradise. Located on the north end of Lake Mead, this secluded park offers a variety of outdoor activities. Close to the “must-see” wonder of the Valley of Fire State Park and the ruins of the historic town of St. Thomas, visitors have an array of hiking and sightseeing opportunities. The large RV sites provide room for your boat, and the free on-site launch ramp are ideal for boaters. Enjoy camping at the Echo Bay RV Village! Whether you stay a night or a mon", "Echo Bay RV Park (Lake Mead)"),
  ("32C0E210-8389-49F0-BFDF-B434678FCFEE", 40.5208668444, -108.993230693, "Situated along the Green River at the base of towering cliffs, the Echo Park Campground provides a unique camping experience in Dinosaur National Monument. Steamboat Rock dominates the view. Fremont petroglyphs are located on the canyon walls. Bighorn sheep and mule deer frequently roam through the campground. Unimproved hiking trails lead to the confluence of the Green and Yampa Rivers or to views of the Mitten Park Fault. The campground is located 38 miles (61 km) north of the Canyon Visitor Center.", "Echo Park Campground"),
  ("DEAF023E-A2A4-4656-BB05-FC71582BE67D", 35.0368936454882, -108.33681211762, "El Morro National Monument operates a nine-site campground year-round. First come-first served. Each site has a graveled tent pad, picnic table and ground grill for fires. During the warmer months, water is available at spigots that are centrally located along the campground loop road. Once the overnight low's begin to reach freezing temperatures, water is turned off for the season. There are no hookups for RVs. The length limit on all motor homes is 27 feet overall. One site, #5, is handicapped accessible.", "El Morro Campground"),
  ("B2E3FA84-A72E-4193-95E9-A53557BBDCF5", 38.4674202781, -107.172066844, "Elk Creek Campground is located 16 miles west of Gunnison on U.S. Highway 50 on the shore of Blue Mesa Reservoir. We recommend making reservations prior to coming to Curecanti because cell service and first-come, first-served sites may be unavailable. Reservations may be made on recreation.gov from mid-May to mid-September. All types of camping from tents to large RVs can be accommodated. Very few sites have trees. This is the only campground with electricity (Loop D only) at Curecanti. Elevation: 7540 feet", "Elk Creek Campground"),
  ("46F315CE-1A6C-4600-BDE0-98D044A55172", 43.56547071700004, -103.48823452199997, "This 62-site campground is open year round. Sites can be reserved at www.recreation.gov late May through September, and are first-come, first-served at all other times. Two sites are handicap-accessible. Flush toilets and drinking water are available late May through September. Fees are half-price when water is not available. Payment is by credit or debit card only. Two group campsites are also available through www.recreation.gov. Ranger programs are offered nightly in the amphitheater during the summer.", "Elk Mountain Campground"),
  ("1734D80A-77AA-4392-A53B-36206595BDCC", 41.3598248532, -124.029432767, "Located in the heart of Prairie Creek Redwoods State Park.", "Elk Prairie Campgound"),
  ("63D37502-C1A6-44B7-A2C3-C4F784C03318", 35.65875714556928, -83.5827404743859, "Elkmont Campground - elevation 2,150 feet (655m) - is the closest frontcountry camping area to Sugarlands Visitor Center in the North District of the park. The climate is characterized by mild winters and hot, humid summers. Mountain ranges and a pristine river are the backdrop for your Elkmont adventure. Elkmont Campground offers camping for both tents and RVs, with 220 sites total.", "Elkmont Campground"),
  ("1B42DF20-EB0E-4F6A-8094-BCF63BA6B54F", 35.6596758456, -83.5863818735, "These sites offers an ideal setting for group camping excursions and outdoor enthusiasts of all kinds.", "Elkmont Group Campground"),
  ("D5A0E41F-CF3C-4669-B774-C71AE16199A1", 25.4535845128, -80.1958850931, "Elliott Key campground is located on an island. The only access is by boat. Elliott Key features waterside and partially forested camping areas, picnic tables, and grills. Restrooms with sinks and cold water showers are available. A mile-long loop hiking trail starts near the campground. Another walking trail, the infamous 'Spite Highway' runs approximately six miles down the center of the island. At low tide, the depth of the entrance to the marina is approximately 2 1/2 feet.", "Elliott Key Campground"),
  ("F448D6D4-AA8F-48BA-B5B8-FEC826541394", 36.4965230407409, -117.227734796205, "First come / first served tent only campground with no additional fee. Located next to CA 190 at 2100' feet in elevation. Emigrant campground overlooks the Cottonwood Mountains which is a part of the Panamint Range. This is a small campground with 10 sites southwest of Stovepipe Wells Ranger Station. A building with flush toilets is 270 feet down a dirt trail just outside of the campground.", "Emigrant Campground"),
  ("74277392-66F4-4FEB-B95B-A9FD2B6D4258", 36.0713269988, -93.2149368998, "Erbie Campground is a first come, first serve campground. Erbie has 14 drive in camp sites, 2 walk in tent only sites, and 5 group sites. There are no electrical amenities, flush restrooms, or water available.", "Erbie Campground"),
  ("E8A7594F-7F0C-4E5D-8465-2C4A4A055855", 45.9083960065, -68.6795909867, "Hike or bike approximately 2.2 miles from the Wassataquoik Gate to the Esker Campsite, located on the bank of Wassataquoik Stream.", "Esker Campsite"),
  ("7E6E57BE-02ED-4440-AE5C-1BD6A8DE82C1", 37.112, -117.6809, "Remote campground at the base of Eureka Dunes (the tallest sand dunes in California and home to several endemic plant species). This campground is located at 2,880ft and is only accessible to high-clearance vehicles. Please drive only on existing roads and tread lightly on the dunes to protect this fragile and unique environment.", "Eureka Dunes Campground (Primitive)"),
  ("41D2DEC1-F454-45FD-9239-B0E91C665BE7", 48.69881814742667, -118.01765146027128, "Currently closed for shoreline repair work: Evans Campground runs lengthwise along the lakeshore. One end is capped with the group sites and the boat launch. The other end is a Day Use Area with a covered picnic area and swim beach. The campground is busy in the summer and tends to fill on the weekends.", "Evans Campground"),
  ("1036CB25-3FAD-48EA-A264-E197016C6D77", 48.701517, -118.018959, "Currently closed for shoreline repairs: The Evans Group site is located in a clearing on one end of Evans Campground. The site holds a maximum of 25 people, with ample space for RV parking and/or tents. Clusters of pine trees provide shade. The boat launch is located nearby and a Day Use Area with covered picnic area and swim beach caps the other end of the campground. The campground itself is busy and may fill on the weekends.", "Evans Group Site"),
  ("CA193220-AEAD-4170-BBD3-1275AE5770DD", 39.616979, -78.73259, "Mile 180.1 - No fee charged; this is a first-come first served walk in campsite. Stay is limited to one night per site, per trip. Campground has a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Evitts Creek Hiker-Biker Campsite"),
  ("5F2A45B9-4C98-4710-B06B-30D23ACF5E79", 60.1909682429161, -149.618120247669, "Exit Glacier has a 12-site, walk-in, tent-campground. Sites are available on a first-come, first-served basis. There are no reservations or camping fees. There is a fourteen-day stay limit. The campground frequently fills by early evening in July and August. A central food storage, cooking and dining shelter is provided. Cooking and/or storing food in campsites is prohibited. There is a pump for drinking water and pit toilets are available. Pets are not permitted in campsites.", "Exit Glacier Campground"),
  ("F15D3521-C877-4DA6-BE0A-E78B83D39AC7", 48.0700799992, -123.918138409, "Neighboring Lake Crescent, Fairholme includes lakeside campsites and a nearby boat launch.", "Fairholme Campground"),
  ("D8A2C986-6DAD-48A9-8A0D-93133EE7C4C5", 47.84857314451423, -89.18297185832984, "Feldtmann Lake Campground is located on the shoreline of Feldtmann Lake, off the Feldtmann Lake and Feldtmann Ridge Trails, on the southwest end of Isle Royale National Park. This is an inland campground. Stay Limit: 2 nights from June 1 – Labor Day annually. Access: Foot", "Feldtmann Lake Campground"),
  ("7918FDCD-28B1-4A0B-AD5A-86EAAB88CFB6", 39.6253030493, -78.3855986458, "Mile 140 (Allegany County, MD) - The campground has nine single drive-in campsites. There is one group site available that does not have direct vehicle access. The group site can accommodate 30 people. Each single will accommodate up to eight people. Single campsites have a picnic table, fire ring and grill. Pit toilets are located between campsite #3 and campsite #4 along the dead end circle. Hand pump water is available from April 15 - October 31. No motor vehicle traffic is allowed on the towpath.", "Fifteenmile Creek Campground"),
  ("3CD41217-24F5-4D7B-B34A-436506EEC448", 59.575423, -135.3348773, "Finnegan's Camp is the first backcountry campground 5mi (8m) on the Chilkoot Trail. It is located near the Taiya River. On clear days you can see the Irene glacier, a hanging glacier, across the river from the campground. In order to camp overnight along the Chilkoot Trail on the U.S. side you must purchase a backcountry permit from the Chilkoot Trail Center in Skagway.", "Finnegan's Point"),
  ("D3D02CD0-A5DB-430B-A1FC-B498FD1890E0", 48.5501313183584, -113.982962737138, "Fish Creek is the second largest campground in the park. Fish Creek is one of three campgrounds in the park that take reservations. Sites within the campground are surrounded by trees and provide shade and some privacy to both tent and RV campers. Some sites, though not directly on the shore of Lake McDonald, offer filtered views of the lake.", "Fish Creek"),
  ("64ABF507-2DCD-4FE4-90B9-F2C5636D4B52", 44.5647552489551, -110.369472282319, "Fishing Bridge RV Park—elevation 7,800 feet (2377 m)—is located near the Yellowstone River where it exits Yellowstone Lake on its way toward the Grand Canyon of the Yellowstone. Only campground in Yellowstone to offer water, sewer, and electrical hookups. Because grizzly bears frequent the area, no tents or tent campers are allowed. Yellowstone National Park Lodges provides reservations for this campground.", "Fishing Bridge RV Park"),
  ("4F5128AD-453F-4B40-91F0-388FD662D110", 25.137212, -80.938773, "The Flamingo campground is one of two drive-in campgrounds accessible from the Homestead entrance of the park. It offers solar-heated showers, two dump stations, picnic tables, grills, and an amphitheater for seasonal Ranger programs. Flamingo has several hiking trails and canoe trails, and opportunities for saltwater fishing are plentiful. Check at the visitor center for a daily schedule of Ranger guided programs.", "Flamingo Campground"),
  ("C2D30818-1C74-4284-9DBA-C689A6977BC0", 48.1568610743654, -122.67400959303, "Washington State Parks operates two campgrounds in the Reserve. You can find information and reservations at http://www.parks.wa.gov/. Reservations are strongly recommended, especially during the summer months.", "Fort Casey State Park"),
  ("B1C748D9-1239-4E42-A61E-3387E02AEDA5", 48.0036881003, -89.8283403008, "Two backcountry campsites, accessible to hikers and canoeists, are located at the Pigeon River (Canada/U.S. border) end of Grand Portage National Monument. Each campsite is limited to nine people. Camping permits are required and issued by the park. A permit system allows campers to reserve a campsite in advance. Allow a minimum of two weeks in advance for permit processing.", "Fort Charlotte Backcountry Campgrounds"),
  ("2E0F6571-F19E-4AE9-98AC-6AC486B48B7C", 35.6474198892006, -101.628934056876, "Washington State Parks operates two campgrounds in the Reserve. You can find information and reservations at http://www.parks.wa.gov/. Reservations are strongly recommended, especially during the summer months.", "Fort Ebey State Park"),
  ("18921332-CD30-4B8B-8CD7-08CAA365919E", 30.32320834796311, -87.27597277606765, "The Fort Pickens Campground is one of the top ten busiest campgrounds in all of the 420+ national parks and sites. Available all year round it provides access to white sandy beaches and trails, including the Florida National Scenic Trail. The campground office is located in a historic white building located halfway down Fort Pickens Areas on Fort Pickens Road. Hours 9 a.m. to 5 p.m. Remember to bring supplies, the nearest store is at least 15 miles away from the campground outside of the park.", "Fort Pickens Campground"),
  ("05011267-F78C-4A27-B956-6F82230C7BBE", 47.91057783564893, -118.3059186711921, "Fort Spokane Campground is part of a large recreation complex with the Fort Spokane visitor center, day use area, and boat launch within walking distance. The campground itself sprawls among towering pines, with plenty of space for RVs and walk-in sites for tent campers. Fort Spokane is a popular campground conveniently located near the visitor center and nearby gas stations and stores. The back loops of the campground will open May 4, 2022 due to dead tree removal.", "Fort Spokane Campground"),
  ("D512733D-28A8-4CF6-BA19-2D5A7DAAB45B", 47.908742, -118.311859, "The Fort Spokane Group Sites are part of a large recreation complex with the Fort Spokane visitor center, day use area, and boat launch within walking distance. The group sites are separated from the individual-site campground by the boat launch. The Fort Spokane area is a popular, and often busy, part of the park.", "Fort Spokane Group Sites"),
  ("6838ABBE-4A61-4668-9D33-FE56AD77D7E4", 40.599998, -74.054771, "The Fort Wadsworth Campground is currently closed.", "Fort Wadsworth Campsite"),
  ("66DA0C26-4D6E-4C02-AA89-794655DF2C38", 31.8995224439952, -104.799849430182, "The Frijole Horse Corral Group Campsite is the only facility for horse users on the east side of the park. The visitor horse corrals and campsites may be reserved up to six months in advance of the visit. This camping area is immediately adjacent Highway 62/180 on the Frijole Ranch access road. Due to proximity to both the highway and the access road, this site has little privacy and is subject to road noise. The Frijole Horse Corral has a capacity of 10 animals.", "Frijole Horse Corral Campground"),
  ("5A68AFB0-A5CD-4892-9222-880AF77B37BE", 35.237075, -75.603357, "Frisco Campground with 127 sites is located west of the Cape Hatteras Lighthouse near the village of Frisco, North Carolina. The campground is tucked between the sand dunes and shrub thicket. A public boardwalk allows easy ocean access for campers, and public bathhouses, grills, and picnic tables are available. Open April 7-Nov. 27, 2023.", "Frisco Campground"),
  ("12BCF9B8-3B58-4787-97E7-99D7D1EFA719", 35.6817457818143, -101.598311253546, "A caprock campground, overlooking Lake Meredith located on Fritch Fortress Road. Open for boaters, campers, swimmers, and other approved water activities. Picnic tables, shade shelters, and grills are available. There is a restroom with potable water, showers, and flush toilets. Pull-through parking is available.", "Fritch Fortress"),
  ("B1B4EA86-DDA9-416A-9E7B-D718DF3C3233", 38.2825607383, -111.248097934, "The 71 site Fruita campground is the only developed campground in the park, offering picnic tables, fire rings, restrooms, water and a dump station. A $25 nightly fee is charged. It is open year-round. From March through October, campsites are able to be reserved on www.recreation.gov. From November through February, campsites are filled on a first-come, first-served basis.", "Fruita Campground"),
  ("2DCEC434-825E-46B0-AF59-21BE27A849A1", 36.4630684020062, -116.86882600627, "Located near Furnace Creek Visitor Center, Furnace Creek Campground is the only NPS campground in the park that accepts reservations and has sites with full hookups as well as dry RV and tent sites. Reservations can be made up to 6 months in advance for camping dates between 10/15 and 4/15; the remainder of the year the campground is first-come-first-serve. This is the most popular campground in the park and reservations are strongly recommended.", "Furnace Creek Campground"),
  ("7FB9E93F-7F2B-4967-862E-BB2B24722B14", 24.6270109567431, -82.8734064423241, "Garden Key, home to Fort Jefferson, has a primitive campground only a short walk from public dock and piers. Individual sites can accommodate up to three 2-person tents (6 persons max per-site) on a first-come, first served basis. In the event a regular campsite is unavailable, an overflow area will be made available. Upon arrival all overnight visitors will be provided a place to camp. For parties of 10 or more, a group campsite is available through our website.", "Garden Key Campground"),
  ("C37B6AA5-24C5-4982-9058-8BBEA3E07DE3", 40.7249234842, -108.887824372, "Gates of Lodore Campground is located on the Green River at the boat ramp at the head of Lodore Canyon. The campground is 106 miles (171 km) north of the Canyon Visitor Center. The campground is popular with river rafters who often stay here before launching on the Green River. There are 19 sites, some with shade. The sites have tables and fire pits. During the summer, there is running water and vault toilets, but no showers. The campsites can accommodate tents and RVs (but there are no hook-ups).", "Gates of Lodore Campground"),
  ("5B7FB84F-E9EB-448D-B721-9176B8B4B11A", 38.3844578817442, -107.242874927003, "Gateview Campground is located in a deep, narrow canyon at the extreme south end of the Lake Fork Arm of Blue Mesa Reservoir. Take CO Highway 149 7 miles west of Powderhorn, then 6 miles north on the gravel Blue Mesa Cutoff Road. All sites are first-come first-served. Gateview is best suited for tent camping. Due to the narrow gravel road, even small RVs or pop-up trailers are not recommended. Elevation: 7538 feet", "Gateview Campground"),
  ("EDF9CACD-CA15-478C-830B-581FB3A18BDE", 26.2238175484, -81.2677556747, "This is a primitive campground, which contains nine campsites. No water. Vault toilets are available. This campground is accessible only by permitted off-road vehicles, biking or hiking.", "Gator Head"),
  ("5DA9B21A-60C6-4B73-B115-D9273354A6C9", 38.2143903541, -80.8888515178, "The National Park Service offers primitive camping at Gauley Tailwaters, located just below Summersville Dam. From Route 19 at Mt. Nebo, take Route 129 west across the dam, then turn left at the river access sign. Bear right through the parking lot to the campsites. There are 18 drive-in sites for tents and RVs.", "Gauley Tailwaters"),
  ("F45274CB-22BB-46A9-91FF-F83EF7CC45E8", 48.2858575736509, -118.142799633773, "Gifford campground stretches along the lakeshore, giving almost every campsite a sweeping view of Lake Roosevelt and shoreline access. Towering pines provide ample shade. Gifford has a boat launch and dock, a dump station, and a fish cleaning station. A group site provides space and privacy for larger parties. Gifford Campground is conveniently located along WA 25 next to the Gifford Ferry.", "Gifford Campground"),
  ("D55642DE-EA9F-4B67-85AE-0A85556616E6", 48.288223, -118.143881, "The Gifford group site is located in a clearing on one end of Gifford Campground. The site holds a maximum of 50 people, with ample space for RV parking and/or tents. Clusters of pines provide shade. The boat launch with parking is located at the other end of the campground. The campground itself is busy and may fill on the weekends.", "Gifford Group Site"),
  ("6715A7CC-280C-4093-85D3-492004C2DB48", 40.32980715336969, -105.59562927944023, "Glacier Basin Campground is located on Bear Lake Road. It is a reservation only campground. To reserve, visit Recreation.gov. Glacier Basin Campground is closed for the 2022 season.", "Glacier Basin Campground"),
  ("C838E1A7-6558-4F7B-8F2D-FE51D9DC333D", 37.829446, -81.013398, "Located at the end of Glade Creek Road, off Route 41 near Prince. Coming from Beckley, Glade Creek Road is a well-marked right hand turn before crossing the New River. Follow Glade Creek Road for six miles to the campground. There are six walk-in tent sites and five drive-in sites for tents or small-medium RVs. There is one accessible site.", "Glade Creek Campground"),
  ("68E04D73-F0F7-490C-B9B9-E95A03564825", 37.9893107086396, -122.788487927921, "Glen Campground is located deep within a wooded valley protected from ocean breezes. The closest beach is 2.5-miles away. One may access Glen Camp by foot or bicycle; not by horse, boat, auto, or RV. The shortest route to Glen Camp is via a 4.6-mile hike from the Bear Valley Trailhead. To ride a bicycle to Glen Camp start at the Five Brooks Trailhead for a 6.3-mile bike ride. No groups (parties of seven or more), horses, or pack animals are allowed. There are 12 regular (e.g., one- to six-person) sites.", "Glen Campground"),
  ("09141625-F881-4441-AF5E-B0FAA9887D4F", 42.765746, -97.066858, "Two designated tent camping only areas. The first (southern) campground area is in the process of being established. The second (northern) is targeted to be established in 2022. Primitive camping is allowed anywhere on the Island, with the exception of the established hunting season after Labor Day to January when camping is restricted to the two designated camping areas. Please email or call (605-665-0209) for a back country use permit issued by the Park's HQ Office.", "Goat Island Primitive Camping"),
  ("2D58DB61-4744-4A49-8012-A1C53FD6E3BE", 41.3822173891, -124.069882187, "Located on the coast within Prairie Creek Redwoods State Park - in the southern part of the parks. Access is on with a narrow, dirt road. Recreational vehicles and trailers are not advised.", "Gold Bluffs Beach Campground"),
  ("9D6E5F9A-BB88-4170-A3B4-87F303AA0836", 48.673, -121.267, "Goodell Creek Campground is situated in lush, old growth forest on the banks of the Skagit River. Campsites are suitable for tents and small RVs. First-come, first-served during the winter; summer reservations can be made up to 6 months in advance. Nearby recreational opportunities include a raft/kayak launch on the Skagit River and fishing on the Skagit and its tributaries.", "Goodell Creek Campground"),
  ("43B0C61B-D068-48EB-9AD9-F06A0DE250BE", 48.716, -121.152, "Gorge Lake Campground is located on the bank of Gorge Lake, next to the cascading Stetattle Creek and is a primitive camp with no water. First-come, first-served during the winter. Summer reservations can be made up to 6 months in advance. Nearby recreational opportunities include a boat launch on Gorge Lake, fishing, and hiking trails.", "Gorge Lake Campground"),
  ("FFA388BF-3129-4FC4-80ED-D163E8199587", 29.47907637, -101.028863217, "Governors Landing is the only campground in the park with potable water available. This campsite has access to some of the most popular swimming areas in the park as well.", "Governors Landing Campground"),
  ("4A23813E-3190-4E4F-8272-0001F57A049C", 47.88249028850224, -89.21635637438078, "Grace Island Campground is located on Grace Island, outside of Washington Harbor, on the southwest end of Isle Royale National Park. Boats can dock overnight. Stay Limit: 3 nights from June 1 – Labor Day annually. Shelters: 2 Depth at dock (normal conditions): 2’ - 4’ Access: Canoe/kayak/private boat", "Grace Island Campground"),
  ("6929599F-D083-481C-A5A9-D551EC31CAA3", 46.057785, -68.748256, "A backcountry lean-to along the International Appalachian Trail and Grand Pitch Portage.", "Grand Pitch Lean-to"),
  ("356C56D3-A5F9-4B57-8781-37B19C0F9393", 46.64323548207715, -86.0319734881054, "Grand Sable Lake on the park's east end has one boat-in backcountry campsite. Campers must provide their own boat and launch at the Grand Sable Lake boat launch. The campground is 1/2 mile south of the boat launch along the east shore. One fire ring and pit toilet. Water source is Grand Sable Lake. Ideal for kayakers and canoers.", "Grand Sable Lake Boat-In Site"),
  ("1487B254-91D2-4BA2-BC19-FF6FA7BB18A7", 37.857116, -81.051906, "Located on Glade Creek Road, off Route 41 near Prince. Coming from Beckley, Glade Creek Road is a well-marked right hand turn just before crossing the New River. Follow the gravel Glade Creek for one mile, then turn let down a short winding road to the campground. There are 10 wooded sites for tents and small-medium sized RVs, 6 walk-in tents sites, and 2 accessible sites (with handicapped permit displayed) by the river.", "Grandview Sandbar"),
  ("E8EB610A-8BBA-490F-BC39-CBCB28909F20", 44.3942533493729, -110.563444983232, "Grant Campground—elevation 7,800 feet (2377 m)—is located in Grant Village, just off the Grand Loop Road at the south end of Yellowstone Lake. It is one of the larger campgrounds in the park. Group and wheel-chair accessible sites are available. Nearby there are stores, a restaurant, gas station, visitor center, and boat ramp. Yellowstone National Park Lodges provides reservations for this campground.", "Grant Village Campground"),
  ("59EF188B-482C-4E9F-BD9B-414411DB6727", 45.31804610741141, -107.94067157826737, "- Near Fort Smith, Montana - Open All Year! - $18 per night fee (50% off with Senior Pass) - 14 RV and tent sites are located on the north shore of Afterbay lake - RV sites are back in (not pull through) - All sites are handicapped accessible, have fire rings, and picnic tables - Vault toilets are accessible - There are no RV hookups - Trash cans available seasonally (May-Oct) - RV dump station and drinking water available across Afterbay lake near the Headquarters building and Afterbay Campground", "Grapevine Campground"),
  ("812CF898-9225-4E23-9937-85FB14490F36", 32.183854, -110.592818, "- 5,300 feet elevation - 3 campsites (6 people max per site)", "Grass Shack"),
  ("2EA47E1B-6EA8-476D-A491-376F850EF923", 47.573831087, -123.576795443, "Located in the Quinault Rain Forest, relax near a serene stream at Graves Creek Campground.", "Graves Creek Campground"),
  ("19323FC8-387C-4F88-870A-BDE13D3E5447", 34.76055561111111, -76.41222219444445, "Great Island Cabin Camp offers 23 rustic, wooden beachfront cabins with porches for individuals and families or small groups of up to 12 people. Cabins range in size from 288 to 960 sq ft., and Cabin 2 is accessible. All cabins are wired for generator use, needed to power electricity. Guests must provide their own generators, no larger than 5,500 watts or equipped with a GFI.", "Great Island Cabin Camp"),
  ("7CB72719-D7D0-49B9-B3AF-D71316CAB9B4", 42.8633666, -97.412217, "Green Island has five primitive tent campsites with fire rings. Two isolated tent sites on the east side of the island & three adjacent sites on the west side. Fires allowed only in designated fire rings. Island access is by boat only. Please visit the Camping page for rules and regulations. Primitive, Leave No Trace camping is allowed and free. Camp only in designated sites marked with brown camping signs and metal fire rings. Please call us at 605-665-0209 and leave your basic itinerary for your safety.", "Green Island Primitive Camping"),
  ("0AD1C4E8-ED05-426E-8332-EA369022B8C5", 40.4209774724, -109.243175668, "The Green River Campground is located along the banks of the Green River in a grove of cottonwood trees at an elevation of 4795 (4162 feet). The highly eroded Split Mountain towers to the north of the campground. The famous dinosaur quarry, where you can see 150 million year old dinosaur bones still encased in rock is approximately 5 miles (8 km) from the campground. Nearby is the Split Mountain Boat Ramp where river rafters come off the Green River after trips through Dinosaur National Monument's canyons.", "Green River Campground"),
  ("7F7BBB8F-3E23-4B9F-8EA7-DB17EE88FDE8", 38.97908, -76.89841, "The park features a 172 site campground and is open year round. The campground is known for its affordability, safety, peaceful surroundings, and National Park Service hospitality. Campers must pay for sites via the online reservation system.", "Greenbelt Park Campground"),
  ("27D0E27F-2644-42D0-952B-EE41A0AD5E83", 38.99115, -114.219121, "For visitors to Great Basin National Park, Grey Cliffs Campground is an ideal place to setup and start exploring. Experience the solitude of the desert, the smell of sagebrush after a thunderstorm, the darkest of night skies, and the beauty of Lehman Caves.", "Grey Cliffs Campground"),
  ("F79BD2D4-B5CE-4405-99F4-AF59DD1913A6", 43.6159078257903, -110.665883983664, "The park's largest campground is in the southeast part of the park, closest to the town of Jackson. Sagebrush and grasses cover the campground as cottonwoods and blue spruce rise above. The Gros Ventre River is a short stroll away. Some sites offer views of the Grand Teton and Blacktail Butte. Wildlife including bison, moose and mule deer frequent the area.", "Gros Ventre Campground"),
  ("6FCC4CC5-0D5A-479D-A5E8-D987207F9E84", 43.4727778, -113.5669444, "Nestled behind Sunset Cinder Cone about .75 miles up a gravel road on the north side of U.S. Highway 20/26/93...a great spot for group camping!", "Group Campground"),
  ("6A989D7D-8AA1-432E-A915-337BB2B45E4C", 38.2789, -111.2514, "The Group Campsite is a secluded site located near the Fruita Campground and can accommodate a maximum of 40 people. It may be reserved through www.recreation.gov up to one year in advance. The Fruita Group Campsite is open from mid-April to mid-October. It is closed every Tuesday and Wednesday nights for maintenance. The nightly rate is $125.", "Group Campsite"),
  ("EAA68679-D1DF-4327-AA61-7B1293EA17E5", 31.8934963936164, -104.851581112569, "A wilderness use permit is required for all use of these campsites. This primitive campground is located on the Guadalupe Peak trail, 3.1 miles from the Pine Springs trailhead, and 1 mile below the Peak. The elevation gain from the trailhead to the campsites is 2,200 feet. The campground is on a small knoll and only minimally protected from high winds. Five designated campsites are defined by tent pads. These sites are exposed and high winds are common.", "Guadalupe Peak Wilderness Campground"),
  ("B09710B2-3D0B-47B0-B15E-ABAFC4243F75", 34.52436309933005, -93.03604779926388, "Camping at Gulpha Gorge Campground costs $34 per night for all sites. All sites have full hookups: 30 and 50 amp electric, water and sewer connections. Sites are not pull-through. Each campsite has a picnic table, pedestal grill, and water. Camping in Gulpha Gorge Campground is limited to a total of 14 consecutive days and a cumulative total of 30 days in any calendar year. Each 14 day consecutive stay must be followed by a minimum of a 7 day break.", "Gulpha Gorge Campground"),
  ("34728A7E-796D-4834-949A-4E960CC945C1", 32.358663, -86.452365, "Campground near Montgomery, Al", "Gunter Hill Campground"),
  ("D9E5422D-1BC9-436A-9695-857D7CE64FD5", 34.4556834317, -97.0496858383, "Guy Sandy Campground is open seasonally for the summer. It opens no later than Memorial Day Weekend and closes no earlier than Labor Day Weekend. It is located on the western shore of Lake of the Arbuckles. This primitive campground offers basic amenities only. RVs are permitted, but no hookups are available. Communal water spigots and pit toilets are available. Each campsite has a picnic table and fire ring with a grill.", "Guy Sandy Campground"),
  ("13D9E8A8-CF13-4AC4-9482-81AFC6ADBAF6", 48.5606608808908, -118.151804154105, "Haag Cove is a quiet, isolated campground on Lake Roosevelt’s west side. Sites are spread out along the shoreline in an open area with scattered pine trees. The open setting does not allow for much privacy between sites, but provides sweeping views of the lake to most campers. The campground is typically quiet, though it may fill on holidays and weekends. There is not a boat launch or courtesy dock.", "Haag Cove Campground"),
  ("2279D883-668A-490A-A794-2060011B8960", 37.4577993989406, -110.71820138441, "With Halls Crossing RV Park & Campground, you're just steps from food, fun, and the Village Store. It's easy to get to Halls Crossing. Simply ride the ferry located at Bullfrog Marina and Halls Crossing, it's just a short ride away. Stop by the Village Store to check-in - and don't forget to pick up food and beverages while you are there.", "Halls Crossing RV & Campground"),
  ("D1770365-E6B3-45F2-8029-13E6F75DF232", 32.154022, -110.518452, "- 6,200 feet elevation - 3 campsites (6 people max per site)", "Happy Valley Saddle"),
  ("95C99A7D-D423-4F04-967D-B22EEC464C56", 35.6478560545659, -101.628983197957, "This campground is located outside of Fritch at the end of Lakeview Drive off Hwy. 136. The area features both designated sites and open meadow camping. Harbor Bay also features two new trails, which are the Harbor Bay and South Turkey Creek Trails. Picnic tables, shade shelters, and grills are available. No drinking water or flush toilets; vault-evaporator toilets. A beautiful area for water activities, hiking, biking, and birding.", "Harbor Bay Campground"),
  ("55555B90-B545-4045-BB65-1FBB696E4515", 48.3468, -120.7137, "Harlequin Campground is located near Stehekin in Lake Chelan National Recreation Area, 4.5 miles up the Stehekin Valley Rd from Stehekin Landing and 0.5 miles from the public airstrip. All sites are walk-in sites though some have limited parking. First-come, first-served during the winter; summer reservations can be made up to 6 months in advance through www.recreation.gov or by calling 1-877-444-6777. Stehekin is a remote community with limited facilities and is only accessible by foot, boat, or plane.", "Harlequin Campground"),
  ("3A459D88-DF35-41D2-AE2F-2D0829B4BE08", 46.073046, -68.768473, "Backcountry campsite along the banks of Haskell Deadwater and the Haskell Rock Pitch Portage.", "Haskell Campsite"),
  ("95AFF7B7-E0DE-4872-A58E-9E4179AD5474", 46.079623645522545, -68.77007902706657, "Rustic cabin with wood stove that can be reserved by groups of up to 8 people. Available for overnight stays in the winter by reservation, the hut is reached by cross-country skiing or snowshoeing. Reservations required through Recreation.gov.", "Haskell Hut"),
  ("374DF57A-1323-4107-B5B2-5C31633CEB80", 48.02113448367796, -88.85081644657868, "Hatchet Lake Campground is located on Hatchet Lake off of the Hatchet Lake Trail. This campground is located near the center of the island. Stay Limit: 2 nights from June 1 – Labor Day annually. Access: Foot", "Hatchet Lake Campground"),
  ("CF4FCDE0-60FD-42DE-9A64-816E3601A562", 37.8541575376106, -122.520646072328, "Hawk Campground is the most remote campground and is located above Tennessee Valley and offers sweeping views of the Marin Headlands. The site is a 2.5 mile uphill hike from the Tennessee Valley Trailhead parking lot, or a 3.5 mile uphill hike from the Miwok Trailhead. There are 3 sites that can accommodate 4 people each. Maximum stay is three nights per year.", "Hawk Campground"),
  ("42969E1F-9F45-4417-9493-A068CE39E500", 47.815164484753, -118.324951949107, "Hawk Creek Campground is tucked back from the lake on Hawk Creek. The campground is popular, but small enough to feel private and secluded. A small waterfall adds ambiance to this beautiful and unique campground. Hawk Creek is close to Fort Spokane Visitor Center, but far enough away to avoid the hustle and bustle. A courtesy dock provides access to Lake Roosevelt.", "Hawk Creek Campground"),
  ("59C82327-07CE-4C77-BEB3-29BDABA8A60F", 47.93386908337534, -88.93999432938057, "Hay Bay Campground is located in Hay Bay on the south shore of Isle Royale National Park. Boats can overnight at dock. Stay Limit: 3 nights from June 1 – Labor Day annually. Depth at dock (normal conditions): 3’-7’. Access: Canoe/kayak/private boat", "Hay Bay Campground"),
  ("0FAC4543-542C-4B14-9930-27EA43E2E842", 37.8607851159, -122.546454477, "Haypress Campground is nestled within the coastal scrub of Tennessee Valley, near Mill Valley. The hike to this campground is 0.7 miles from the Tennessee Valley Trail head parking lot, and is an ideal campground for first-time backpackers. Haypress campers often enjoy hiking to Tennessee Beach, where they can admire its dramatic geology and colorful sand.", "Haypress Campground"),
  ("C015D3D1-180D-408C-88AB-B73EAEA89E10", 44.1058980602854, -110.671020215965, "This campground has facilities for both tent campers and RVs. Located within the John D. Rockefeller, Jr. Memorial Parkway, Flagg Ranch is only two miles south of Yellowstone and five miles north of Grand Teton. Wilderness surrounds the Headwaters development. The upper reaches of the Snake River flow through meadows mixed with open conifer forest. The campground offers 34 tent sites, 97 full-hookup and pull-through RV sites, and 40 Camper Cabins.", "Headwaters Campground"),
  ("C4C0ACBD-0AE4-4970-9C6A-E75A0153050D", 48.0362664284, -123.429967329, "Surrounded by old growth forest, Heart O' the Hills offers summer ranger programs and great family fun", "Heart O' the Hills Campground"),
  ("CD6FC82F-A9B7-46EA-A6A4-2FD69E7E017D", 30.8327, -81.4514, "Hickory Hill is one of three campgrounds in Cumberland Island’s designated wilderness on the northern part of the island. The campsite is located 5.5 miles north of the Sea Camp dock. Wilderness sites have no amenities. Fires are prohibited, but camp stoves can be used for cooking. Campers should be prepared to hang all food and trash. Water is available from a nearby well and must be treated. Permits are $9 a night, good for up to 6 people.", "Hickory Hill Wilderness Campsite"),
  ("8271D39A-48E1-4693-B3E2-2DBE4C3511D2", 34.0171884429, -116.162736958, "The Hidden Valley Campground has 44 sites, pit toilets and no water. The campground is located along park boulevard and is surrounded by large boulders and Joshua Trees. All sites at Hidden Valley Campground are first-come, first-served. Camping fees must be pre-paid at an entrance station.", "Hidden Valley Campground"),
  ("53B78B5A-F056-47DB-B254-13C2EDEC8094", 37.87686, -110.381007, "Hite is a remote Ranger District located at the top of Lake Powell, adjacent to the confluence of the Colorado and Dirty Devil Rivers. Primitive camping is available in various spots. They offer developed camping for tents and RVs.", "Hite Outpost Adventure Center - Closed until further notice"),
  ("3BE59EF8-1327-4B0F-B4ED-AFE4C6085DEE", 37.864131, -110.399782, "Designated primitive camping areas that are accessible by vehicle and sometimes by vessel as well. First-come first served, no reservations. No designated sites. No potable water. When pit toilets are unavailable, campers must bring portable toilets for use and proper disposal into the sewer system. Quiet hours 10pm-6am. $12 per night.", "Hite Primitive (Dirty Devil, Farley, White Canyon) camping"),
  ("8D89A88A-5E90-449B-B4FA-78026CF14D70", 37.7998824480597, -119.867033107265, "Hodgdon Meadow Campground is conveniently located along the Big Oak Flat Road at the Big Oak Flat Entrance. At an elevation of 4,900 feet (1,219 m), the campground is located along the western edge of the park, 25 miles and approximately 45 minutes from Yosemite Valley. There is a gas station and minimal convenience items located nearby at Crane Flat. Trailheads for both the Merced Grove and Tuolumne Grove of Giant Sequoias are located within a short drive of the campground.", "Hodgdon Meadow Campground"),
  ("B4D16CA6-183B-492C-BDEA-A41DA6349EDD", 47.8583524952499, -123.935540122439, "Surround yourself with moss and ancient trees in this temperate rain forest. Hoh campground offers summer ranger programs and some riverside campsites along the Hoh River. Reservations in summer, first come first served the rest of the year.", "Hoh Campground"),
  ("91F6D1D1-70F5-44EE-9930-4003ECC52A22", 35.0460238204, -115.393565162, "At 4,400 feet in elevation, Hole-in-the-Wall Campground is surrounded by sculptured volcanic rock walls and makes a great basecamp for hikers. Thirty-five campsites accommodate RVs and tents; two walk-in sites are also available.", "Hole-in-the-Wall Campground"),
  ("2BB05B85-183A-49D2-B9B6-612A7BBF3793", 36.6376, -117.5738, "Extremely remote campsite at 3,785ft of elevation, accessible only by high-clearance vehicles with all-terrain tires. Access from Saline Valley Road requires navigating Lippincott Pass and should only be attempted by experienced 4-wheel drivers. There are no approved toilet facilities at this location and no water available. Pack in all that you need, pack out all that you bring.", "Homestake Campground (Primitive)"),
  ("22C22378-2697-4D14-B5F7-E8BAD9B7033D", 40.57611111, -122.531388889, "Horse Camp is specifically for camping with horses. The open area allow ease of parking for horse trailers. Several trails are accessible from this campground. Both sites are in partial shade and feature bear-proof storage lockers, picnic tables, a lamp pole, fire pit with swing-arm BBQ grill, and a shared ADA accessible vault toilet. Each site has a maximum occupancy of 10 people and 3 vehicles. Potable water available from a spigot most the year. No corrals, tie posts/rails, or water troughs onsite.", "Horse Camp"),
  ("27EBFE30-BE1A-4511-9244-CF83F67E3085", 38.19282100055179, -75.1574710003365, "Campground accessible for horses and riders to camp overnight", "Horse camping"),
  ("96423246-D213-41C2-860C-34DF71149E34", 39.06938, -77.398038, "Mile 26.1 - Hiker-biker campgrounds are located along the towpath approximately every 5-7 miles. No fee or reservation required. Overnight stays are limited to one night. All sites include a chemical toilet, picnic table, grill, and drinking water. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Horsepen Branch Hiker-Biker Campsite"),
  ("13B7970B-039E-415E-900A-E1E1A2C7B032", 44.96, -108.26, "- Located near Lovell, WY - Open All Year - All sites include fire pit and picnic table. - 68 RV and tent sites - 28 sites have water and electrical hook-ups. The water is only available at these sites Memorial Day to Labor Day. The electricity remain on year round. - 3 pull through sites - Modern Restrooms, RV dump station and drinking water are available - Swim beach and picnic less than 1 mile hike from the campground - Horseshoe Bend Marina and boat docks less than 1 mile hike from the campground", "Horseshoe Bend Campground"),
  ("80B2AD5E-92D0-4BF8-90C4-92349E09338E", 39.486903, -77.774341, "Mile 79.2 - Hiker-biker campgrounds are located along the towpath approximately every 5-7 miles. No fee or reservation required. Overnight stays are limited to one night. All sites include a chemical toilet, picnic table, grill, and drinking water. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from mid-November to mid-April each year.", "Horseshoe Bend Hiker-Biker Campsite"),
  ("75216514-60C2-4262-9107-35122A9194AC", 20.768155, -156.237592, "Hosmer Grove lies in the cloud belt of Haleakalā, just below the 7,000 foot level (2134m) in the Summit District. Be prepared for rain and cold weather. Nighttime temperatures can drop into the to near freezing (0°C); daytime highs average 50-65°F (10-18°C). The campground has picnic tables, barbeque grills, drinking water, and pit toilets. Overnight stays are limited to three (3) nights total for all Park areas in a thirty day period.", "Hosmer Grove Campground"),
  ("8F0F105B-48D2-41FE-9B50-CB1A1B1952AB", 37.2016901005, -86.2377215005, "The Houchin Ferry Campground lies next to the Green River at the former location of the Houchin Ferry. This campground is operated year-round and is located 15 miles from the Visitor Center and two miles east of Brownsville, KY. For campers who like it simple, these 12 tent-only campsites afford a quiet visit with drive-up access.", "Houchin Ferry Campground"),
  ("5F2991D3-8D31-4DF0-9E00-5351349391AF", 37.3832032699, -109.070815001, "A 31-site campground near the visitor center is open year-round, first-come, first-served. The campground is designed for tent camping, though a few sites will accommodate RVs up to 36 feet long. Groups are limited to eight people and two vehicles. Sites include tent pads, fire rings and picnic tables with shade structures; there are no hookups available. One campsite is wheelchair-accessible but is not designed for tent camping.", "Hovenweep Campground"),
  ("AD024FB6-EE7E-4DC0-A151-5A09F7A35B02", 48.9871, -121.0711, "Hozomeen Campground is located at the north end of Ross Lake and is open from late May through October. There is no camping fee, and all sites are first-come, first-served. Facilities include boat launches, pit toilets, potable water, picnic tables and fire grates. Guests must pack-out all trash. Campsites located in the Upper Loop are closed until further notice due to hazard trees.", "Hozomeen Campground"),
  ("129ADE5E-5C43-4F6F-85E3-2F69DC82217D", 39.34152, -77.75747000000001, "Mile 62.0 - Hiker-biker campgrounds are located along the towpath approximately every 5-7 miles. No fee or reservation required. Overnight stays are limited to one night. All sites include a chemical toilet, picnic table, grill, and drinking water. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from mid-November to mid-April each year.", "Huckleberry Hill Hiker-Biker Campsite"),
  ("12DB0F9A-5D56-4117-B66A-A66C6A1C2E33", 47.934272022481146, -89.17647822364461, "Huginnin Cove Campground is located at Huginnin Cove, on the north shore of Isle Royale National Park, off of the West and East Huginnin Cove Trails. Stay Limit: 3 consecutive nights from June 1 – Labor Day annually. Access: Foot/canoe/kayak access. No dock available for boats.", "Huginnin Cove Campground"),
  ("0D61BB7D-56EC-4B90-870B-C54B4B23F627", 48.1255472978347, -118.231331985386, "Hunters Campground is part of a larger recreation complex with a boat launch and Day Use Area. Campsites are tucked among the pines in a centrally-located loop with an easy walk to the beach area. Group sites offer privacy and beach access for larger parties. Hunters Campground is very popular and often busy in the summer.", "Hunters Campground"),
  ("4F237B6C-D314-4A2C-ADBF-1A86D0DCC98A", 48.12544, -118.230877, "The Hunters Group sites are part of a larger recreation complex with a boat launch and Day Use Area. The group sites are tucked among the pines on one side of the swim beach. An individual-site campground is located nearby. Hunters Campground is very popular and often busy in the summer.", "Hunters Group Sites"),
  ("06069540-A17B-448D-BFE2-4F84CF26ABC1", 46.663953, -86.1661587, "There are two loops: 11 campsites in the lower loop and ten in the upper loop. Both loops include one disabled- accessible campsite. Several campsites are designated as generator-free. Because the turning radius and some parking site lengths are limited within this campground, we recommend single vehicles no more than 36 feet and vehicle/trailer combined length no more than 42 feet use this campground. The campground is open by reservation only, mid-May through mid-October. Leashed pets allowed.", "Hurricane River Campground"),
  ("3B299906-24BA-44F3-A0BA-A054245F7615", 63.60969751677842, -149.583358087987, "Igloo Creek Campground will be closed in 2023. The campground is at mile 35 on the Park Road. It offers 7 sites, making it the smallest in Denali (along with Sanctuary River Campground, which also has 7 sites). Igloo is tent-only—you will not find any RVs or other vehicles in this campground. It is accessible only by camper bus. The bus stop is a short walk from the campsites (less than 50 yards).", "Igloo Creek"),
  ("E456A79A-B17D-4D7C-8866-C3FFE9290283", 34.0934671523033, -116.158853563898, "Indian Cove Campground is located off of Highway 62, thirteen miles east of Joshua Tree Village and ten miles west of Twentynine Palms on the north side of the Wonderland of Rocks. Indian Cove Road dead-ends at this secluded area. Indian Cove has 101 campsites, including thirteen group campsites. Between Memorial Day and Labor Day it is 39 reservable sites. There are vault toilets but no water at the campsites. Water is available at the small ranger station roughly two miles north of the campground.", "Indian Cove Campground"),
  ("31A8FCDE-C07A-465F-BABA-0AD338ED9938", 44.887023247756964, -110.73606858357869, "CLOSED FOR 2022. Located about eight miles south of Mammoth Hot Springs on the road to Norris, Indian Creek Campground—elevation 7,300 feet (2225 m)—sits near the base of the Gallatin Mountains and offers breathtaking views of Electric Peak. The area offers easy access to fishing and hiking. The campground is away from the main road and provides a quieter, more primitive, experience than many other locations. This is a reservable campground run by the National Park Service.", "Indian Creek Campground"),
  ("AF40345B-C2EC-4ED5-8E47-BD195FE6972E", 39.233516, -77.462711, "Mile 42.5 - Hiker-biker campgrounds are located along the towpath approximately every 5-7 miles. No fee or reservation required. Overnight stays are limited to one night. All sites include a chemical toilet, picnic table, grill, and drinking water. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from mid-November to mid-April each year.", "Indian Flats Hiker-Biker Campsite"),
  ("EAA2FD98-4F5D-4533-B65A-A11F73AA4494", 41.7174707355158, -121.504144731988, "Lava Beds has one campground, Indian Well Campground, located 1/2 mile (0.8 km) from the Visitor Center and cave loop. There are 43 sites available on a first-come, first serve basis. Sites can accommodate tents, pickup campers, small trailers and motor homes up to 30 feet. Note: not all sites can accommodate motor homes.", "Indian Well Campground"),
  ("2133A176-466F-4A3E-8B74-AF4AC2E1B2AA", 39.626697, -78.358666, "Mile 139.2 - No fee charged. First come, first served. Stay is limited to one night per site, per trip. Campground has a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Indigo Neck Hiker-Biker Campsite"),
  ("A8605BC4-C81C-4F67-8AC3-FC14363304C3", 48.0337769036068, -88.72265854573033, "Intermediate Lake Campground is located on the shoreline of Intermediate Lake. Intermediate Lake can be accessed via a .6 mile portage from Lake Richie or a .4 mile portage from Siskiwit Lake. Stay Limit: 2 nights effective June 1 – Labor Day annually. Access: Canoe/kayak, no private boat access.", "Intermediate Lake Campground"),
  ("1B582C8D-FD73-4E42-8EBE-8E4C00DC7535", 39.58747900000001, -78.73558400000002, "Mile 175.3 - No fee charged; this is a first-come first served walk in campsite. Stay is limited to one night per site, per trip. Campground has a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Irons Mountain Hiker-Biker Campsite"),
  ("A7F66044-BE85-43D4-8BCF-7475CF00018E", 47.93022395196004, -89.03997478443017, "Island Mine Campground is located .5 miles south from the junction of the Greenstone and Island Mine Trails, on the Island Mine Trail. This inland campground offers no canoe/kayak/boat access. Little Siskiwit River runs south of the campground, where water can usually be obtained for filtering, unless it is dried up. Check with a Visitor Center for current water status. Stay Limit: 3 nights effective June 1 – Labor Day annually. Access: Foot", "Island Mine Campground"),
  ("26404A2A-AB76-4A51-9707-39D0E6E3368D", 38.3832733696, -109.888258333, "Island in the Sky Campground (Willow Flat) has 12 sites, first-come, first-served. The campground is open year-round. The spectacular Green River Overlook is nearby. Nightly camping fee is $15 per site. Sites fill quickly spring through fall. There are toilets, picnic tables, and fire rings in the campground. There is no water at the campground. You can get drinking water outside the visitor center spring through fall.", "Island in the Sky (Willow Flat) Campground"),
  ("A2B6DE41-CD49-4109-9EB4-AA32B6A82568", 41.7957264763, -124.086447444, "Located 9 miles east of Crescent City. The northernmost of the four campgrounds in the parks. $35 fee. Discounts with different national and state passes. 86 sites. Flush toilets and showers. No electric, no water or sewer hookups. Dump station available.", "Jedediah Smith Campground"),
  ("CC65EA50-831C-4C71-ABD1-3C32D780E4D4", 33.4171640485, -89.2673709764, "Jeff Busby Campground at milepost 193.1, midway on the Parkway, includes an 18-site campground, picnic tables, restrooms, trails, exhibits and an overlook atop Little Mountain. Campground sites are on a first come first served basis, no reservations. Pull-through and back-in sites are available. Campgrounds are typically busiest during the spring and fall, especially during holiday weekends. There is no fee for camping. There is a 14 day stay limit.", "Jeff Busby Campground, Milepost 193.1"),
  ("5A3B6615-6E41-47CD-A13A-A717684296E5", 43.7552631986, -110.719393468, "This small campground is a few hundred yards from the east shore of Jenny Lake. The campground straddles a glacial moraine covered with an open forest of lodgepole pine, subalpine fir and Douglas fir. Across the lake, Teewinot Mountain, Cascade Canyon and Mount St. John dominate the landscape. No trailers, campers, or generators are allowed. Vehicles cannot be over 8 feet high or 14 feet long. Maximum per site is two tents, one vehicle, and six guests for up to 7 nights.", "Jenny Lake Campground"),
  ("F626FF38-1C87-48C9-81F2-D13B8FFBEB8A", 47.9198995489921, -118.582833386076, "Jones Bay is one of Lake Roosevelt’s smaller, more rustic campgrounds. The campground is mostly gravel and packed dirt, with not much vegetation, on the lake shore. It can be reached by boat and has a boat launch and dock. Jones Bay can be also be reached by car, but may be difficult to find.", "Jones Bay Campground"),
  ("B89F33B9-4FDD-49EE-8FA4-BF2AB74AFFB5", 39.60919199999999, -77.85283, "Mile 101.2 - There is no driving access to this campsite. No fee charged. First come, first served. Stay is limited to one night per site, per trip. Campground has a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Jordan Junction Hiker-Biker Campsite"),
  ("04662D80-18F0-4E2C-8C6A-461E244DB0A7", 36.1203493459, -81.7652698731, "Julian Price Campground sits beside Price Lake, a pristine body of water that sparkles against the backdrop of rolling mountains. The surrounding forest offers a colorful assortment of wildflowers in the spring and vivid orange and red foliage in the fall. Canoes can be rented at the lake, and a dock offers opportunities for fishing. Area hiking trails include Price Lake, Boone Fork, Green Knob, and Tanawha trails. Campers may see bears, grouse, turkeys, owls, hawks and more.", "Julian Price Park Campground"),
  ("6742B85D-65DA-447C-95C2-80E110AA5E6A", 33.9907564455, -116.059251838, "There are 124 individual/family sites in Jumbo Rocks Campground. Reservations are required during the busy season, September to May. The campground is centrally located and offers great views of rock formations.", "Jumbo Rocks Campground"),
  ("4A56E4A8-59E9-4766-9E89-677CF4B1C88D", 32.182818, -110.644513, "- 6,000 elevation - 3 campsites (6 people max per site)", "Juniper Basin"),
  ("77017AF3-91BF-4166-BE1E-F17D903294ED", 47.5952474630001, -103.333156762, "Juniper Campground is 5 miles from Hwy 85 and is the only campground in the park's North Unit. All sites are open to tent camping and most can also be used by vehicles/RVs (no hookups). All regular sites are first come, first served. Juniper Campground is trending to fill to capacity by late afternoon and definitely fills to capacity on holiday weekends. The group site is by reservation only at recreation.gov. See the RESERVATIONS section below.", "Juniper Campground"),
  ("B4212C55-8FAB-495E-9A12-DE6D57EB91D4", 35.7953381873139, -106.279045430928, "3 loops, 52 site campground near the entrance to the monument. 2 sites for small groups up to 20 people. No reservations. First come, first serve except for the 2 group sites.", "Juniper Family Campground"),
  ("EE0BEF31-3C7D-4249-A131-156D31114388", 40.4496486561308, -121.296461605835, "The Juniper Lake Campground is located on the east shore of Juniper Lake via a 13-mile paved/gravel road. All single campsites are first-come, first-served only. Reservations are required for the two group sites and one stock corral. Drinking water is not available.", "Juniper Lake Campground"),
  ("F8DFAB23-EFE0-4F31-98D0-CD5A871596A9", 47.6127053601112, -124.375074131062, "Oceanside camp at Kalaloch with some sites overlooking the Pacific Ocean. Online reservations accepted for peak season. Check recreation.gov for current season dates. All sites are first-come, first-served in off season.", "Kalaloch Campround"),
  ("BE7AB8F1-8ED2-40DA-A2DB-B4C7F7EC3531", 48.6783241500684, -118.117008793336, "Kamloops Island is a small, shady campground at the mouth of the Kettle River. The main hub of campsites is tucked into the vegetation at the top and can fit tents and RVs. A cluster of walk-in tent sites is spread out in a grove of pines. Many campsites offer views of the river, lake, and surrounding landscape. There is a courtesy dock, but no boat launch.", "Kamloops Island Campground"),
  ("5867E623-661C-49E1-ADC1-DFACA828D8F0", 45.9204007640828, -68.7628803658878, "The closest backcountry site at 0.4 miles from the Barnard Mountain Trailhead / Southern Terminus of the International Appalachian Trail and the Loop Road. This is a Lean-to site only.", "Katahdin Brook Lean-to"),
  ("3A9DB923-A81D-49F3-83F3-F26ABB6F8E28", 35.223175690624814, -114.55677723796998, "With views of the lake and within walking distance of the marina, swim beach, dining and retail store, campsites at Katherine Landing feature a wide array of amenities including concrete picnic tables, fire rings with cooking grills, modern restrooms, showers, with laundry facilities close by. Wi-fi access through Access Parks is available. Campsites at Katherine Landing offer guests a scenic, affordable basecamp for adventures on and around beautiful Lake Mohave.", "Katherine Landing Campground (Lake Mohave)"),
  ("B00EBE13-43A0-4456-BFAD-D7C35A0B469B", 35.22234390934542, -114.56200692629523, "The Katherine Landing RV campsites come complete with water, sewer and electrical hook-ups. All spaces have the option of household current, 30 amp, or 50 amp power. Laundry, restroom and shower facilities are available on site. All spaces are back-in with the largest space accommodating a 40′ RV. For a Lake Mohave camping adventure in the comfort of your own rig, the RV campsites at Katherine Landing offer all the connections you need!", "Katherine Landing RV Park (Lake Mohave)"),
  ("3D4EA3B5-B5B3-42B5-94C8-35A39D6A2893", 62.52982, -143.258776, "Located on the Nabesna Road, this free camping area is the only National Park Service campground in Wrangell-St. Elias National Park. It has 10 designated campsites, each with a picnic table and a fire ring. There are two vault toilets. Each site can accommodate a small to medium RV or other vehicles. It is free and open year-round on a first-come, first-served basis, but is not plowed during the winter so campsites may not be accessible. Reservations are not taken and are not required.", "Kendesnii Campground"),
  ("E6B4725F-B2C0-4E4B-BD4C-D15EC8CF6212", 48.601517648676904, -118.12357127064581, "Kettle Falls is a large, fairly wooded campground on the lake shore. All sites are open to tent campers, vehicles, and RVs. The campground is adjacent to Kettle Falls Marina (with boat launch and space for trailer parking) and nearby to Kettle Falls Day Use Area. The area is fairly well-trafficked and busy, but offers all the conveniences and amenities of nearby town of Kettle Falls.", "Kettle Falls Campground"),
  ("476252BB-E411-46A7-BC5C-77CCE0281781", 48.7159308743606, -118.122687332665, "Kettle River is a shady campground on the banks of the Kettle River. Most of the sites are on the shoreline and have beautiful views of the Kettle River and surrounding landscape. Kettle River does not have a boat launch but does have a courtesy dock. This campground is a great place for birding, with a variety of waterfowl and raptors seen in the area. Kettle River Campground is typically quiet and doesn’t often fill.", "Kettle River Campground"),
  ("A610C577-66D8-4544-9F6F-62FF55803C8F", 39.45920199999999, -77.796583, "Mile 75.2 - Hiker-biker campgrounds are located along the towpath approximately every 5-7 miles. No fee or reservation required. Overnight stays are limited to one night. All sites include a chemical toilet, picnic table, grill, and drinking water. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from mid-November to mid-April each year.", "Killiansburg Cave Hiker-Biker Campsite"),
  ("BCE824F6-C326-4753-9D3D-916A93A690ED", 48.9357452088272, -114.345930032059, "Kintla Lake campground is Glacier National Park's most remote frontcountry and car camping campground. It is located in the upper most northwest section of the park known as the North Fork, approximately 40 miles from the west entrance. Access is via a rough dirt road. Trailers not advised. Due to it's remote location, the campground is very quiet and is very rarely filled, offering tent campers a sense of solitude. The campground sits on Kintla Lake.", "Kintla Lake"),
  ("E432BD79-E5A8-4989-8F03-ADF9683A95A2", 37.8279021174, -122.490393465, "Kirby Cove is the most popular campground in the Marin Headlands, with spectacular views of San Francisco and the Golden Gate. Enjoy a wooded setting, seclusion and protected campsites which were recently restored for all to enjoy. Campsites are available for use only by prior reservation but anyone can walk down the road to enjoy the vistas and picnic on the bluffs or beach.", "Kirby Cove Campground"),
  ("A859E76B-FA23-43CE-8BED-904FB4D41B60", 19.3436666463, -155.274076368, "Kulanaokuaiki is located off Hilina Pali Road at 3,200 feet (975 m), there are nine walk-in campsites with picnic tables. There is an accessible vault toilet; however, no water is available and campfires are not permitted. Use fueled camping stoves only. This campground is subject to closure when the area is dry and during times of high fire risk. No dogs or pets are allowed at this campground to protect endangered nene.", "Kulanaokuaiki"),
  ("0B860B12-04E9-46DB-A1C3-E7FBA8B1A3DE", 36.0557786001, -93.2807538999, "Kyles Landing Campground is a first come, first serve campground located between Jasper, AR and Ponca, AR.. Kyles Landing has 33 tent only sites with no electrical amenities, but flush restrooms and water are available from March 15 through November 14.", "Kyles Landing"),
  ("D24D8C58-DF08-4A80-BC5F-531E6F086A1B", 20.659705, -156.044492, "The Kīpahulu campground is about 1/8 mile (.2km) south of the Kīpahulu Visitor Center. It overlooks ocean cliffs and is a short walk from 'Ohe'o Gulch. The campground has picnic tables, BBQ grills, and pit toilets. No water is available at Kīpahulu Campground; However, drinking water is available at the Kīpahulu Visitor Center restrooms. There are two general stores in the nearby town of Hāna (10 miles [16km] away) where you can purchase water and basic food supplies.", "Kīpahulu Campground"),
  ("D8737D28-750B-4C8D-9E0D-78F327C77CBB", 38.4548253084593, -107.326981170259, "The campground is located 27 miles west of Gunnison on CO Highway 92 near the intersection with U.S. Highway 50 on the shore of Blue Mesa Reservoir. We recommend making reservations at recreation.gov prior to coming to Curecanti because cell service and first-come, first-served sites may be unavailable. Reservations may be made on recreation.gov from mid-May to mid-September. Tents and large RVs can be accommodated. The campground is paved except for the tent walk-in sites. Elevation: 7580 feet", "Lake Fork Campground"),
  ("C838D310-D10F-4670-91C8-E375C0F294F4", 36.03503, -114.800453, "Lake Mead's Boulder Beach area offers many things to see and do. Whether you’d rather go sightseeing, tour Hoover Dam, go shopping, visit historic Boulder City or try your luck in Las Vegas, Lake Mead RV Village at Boulder Beach is conveniently located to a variety of attractions. There’s a lot going on around Lake Mead RV Village, so set up camp and discover this diverse and historically significant area, while enjoying your stay on the shores of Lake Mead.", "Lake Mead RV Village (Lake Mead)"),
  ("5B9B3451-F0DD-4BD3-9EB7-7AEF691285DD", 48.05134221029036, -88.68736051726773, "Lake Richie Campground is located on the north shore of Lake Richie, off of the Indian Portage Trail. Canoe/kayak access from .6 mile portage from Intermediate Lake, 2.0 mile portage from Moskey Basin, 1.2 miles portage from Chippewa Harbor, and .6 mile portage from Lake LeSage. Paddlers may want to consider staying at Lake Richie Canoe Campground. Stay Limit: 2 nights from June 1 – Labor Day annually. Access: Foot/canoe/kayak. No private boat access.", "Lake Richie Campground"),
  ("56BEF8CE-2E4F-467E-B548-3B8DB0E28C92", 48.04382454287261, -88.70018995569336, "Lake Richie Canoe Campground is located on the north shore of Lake Richie. Canoe/kayak access via the .6 mile portage from Intermediate Lake, the 1.2 mile portage from Chippewa Harbor, the 2.0 mile portage from Moskey Basin, and the .6 mile portage from Lake LeSage. Stay Limit: 2 nights effective from June 1st – Labor Day annually. Access: Canoe/kayak. No private boat access.", "Lake Richie Canoe Campground"),
  ("BCBF894F-DF97-4EAE-804B-CAF0E4237A8B", 48.007628545489816, -88.7070852277252, "Lake Whittlesey Campground is located on the north shore of Lake Whittlesey. Consecutive night stay limit is two nights. Three individual tent sites are available. No boat access. Canoe/kayak access via .6 mile portage from Wood Lake and .6 mile portage from Chippewa Harbor. Stay Limit: 3 nights effective June 1 – Labor Day annually. Access: Canoe/kayak, no private boat or trail access.", "Lake Whittlesey Campground"),
  ("A8B8F6C0-8C37-4293-8A52-A332FE879B00", 48.3079, -120.6544, "Located at the head of Lake Chelan, Lakeview Campground is a five minute walk from the boat dock at Stehekin Landing. All sites are walk-in sites for small to medium-sized tents. First-come, first-served during the winter; summer reservations can be made up to 6 months in advance through www.recreation.gov or by calling 1-877-444-6777. Stehekin is a remote community with limited facilities and is only accessible by foot, boat, or plane.", "Lakeview Campground"),
  ("1617F7AB-6DAA-4571-AD88-DCFBC7AC6DC5", 48.14490683133697, -88.55767854958867, "Lane Cove Campground is located in Lane Cove, on the north shore of Isle Royale National Park, off of the Lane Cove Trail. The Lane Cove Trail can be accessed via the Greenstone Ridge Trail. Stay Limit: 1 night effective June 1 – September 17 annually Access: Foot/canoe/kayak. No boat access.", "Lane Cove Campground"),
  ("2358E196-5E36-4A03-842F-C2C6FE81EFFD", 36.12784458588996, -114.87256967216257, "Las Vegas Bay Campground is located just minutes from Las Vegas on the western edge of the park and has lush vegetation that shades nearly every campsite. There is a mix of palm trees, oleanders, mature cottonwood trees and native vegetation that also helps provide privacy between sites. Wildlife in the area includes many species of birds and lizards along with antelope squirrels and the occasional coyote.", "Las Vegas Bay Campground (Lake Mead)"),
  ("655E8DDE-9586-447E-B531-A93B31EEE1A0", 43.46070030861083, -113.55913194531865, "The Lava Flow Campground is a 42-site campground accessible by automobile from May through November. All sites are available on a first-come, first-served basis. Some sites will accommodate large RVs, but no hookups are available.", "Lava Flow Campground"),
  ("B30A5B7D-0343-4E47-97E3-CBBAC4700D6B", 37.3838790934259, -113.032845693121, "This campground is typically open May through September, as weather allows. Situated at 7890 feet above sea level, it is off the Kolob Terrace Road, 25 miles (45 minutes) north of the town of Virgin. It takes approximately one hour and 20 minutes to drive to the campground from the South Entrance of Zion Canyon. There are 6 primitive campsites available for reservations. The campground has pit toilets and trash cans, but no water. Vehicles longer than 19 feet are not permitted.", "Lava Point Campground"),
  ("047E1B9A-FF2B-4BD0-B98A-65ED0857639C", 36.8593470173641, -111.606274705221, "No reservations. $20 per site/per night. 54 designated sites. No hookups. RV dump station. Grills provided, no open fires. Quiet time 10pm-6am. Modern bathroom/comfort station, potable water available, launch ramp 2 miles. Gas and supply store at Marble Canyon, about 5 miles away.", "Lees Ferry Campground"),
  ("0477F54F-BBA5-4418-96C9-262FD30FEFC3", 39.6519276443, -78.2401552013, "Mile 129.9 - There is no driving access to this campsite. No fee charged. First come, first served. Stay is limited to one night per site, per trip. Campground has a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Leopards Mill Hiker-Biker Campsite"),
  ("86643A75-55AF-4A7F-ADD1-DE35E379BB7F", 44.282205650024956, -110.62798728261384, "Lewis Lake Campground—elevation 7,800 ft (2377 m)—is about eight miles from the South Entrance and a short walk from the southeast shore of Lewis Lake. A boat ramp is located near the campground information and registration area. Canoes, kayaks, and motor boats are allowed on Lewis Lake. Boat permits and an aquatic invasive species inspection performed by park staff are required. This is a reservable campground run by the National Park Service.", "Lewis Lake Campground"),
  ("BAC9E60C-2FD0-479D-B676-1EB623EDAE60", 38.43556, -78.478096, "Lewis Mountain (mile 57.5), the smallest campground in Shenandoah National Park, appeals to those who want a little more privacy while still staying within a close distance to many of the most popular destinations in the Park, including Big Meadows (7 miles away).", "Lewis Mountain Campground"),
  ("29887D47-54ED-4C49-A7FB-B49AB60DCCE4", 39.650293999999995, -78.04877600000002, "Mile 116.0 - No fee charged. Stay is limited to one night per site, per trip. All sites have a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Licking Creek Hiker-Biker Campsite"),
  ("C32CB41B-1C35-454B-B9FD-AE3F71EEBDC8", 35.9671524465, -81.9326240728, "Surrounded by pine forest and within hiking distance of Linville Gorge, Linville Falls Campground is ideal for family camping. The campground is central to many area attractions including the Linville Falls waterfall and fishing in the stocked Linville River. Linville Gorge is a designated Wilderness area with 11,786 acres of rolling hills and thick forest. The Gorge surrounds Linville River, which is located 1,400 feet below the ridge, creating “The Grand Canyon of North Carolina.”", "Linville Falls Campground"),
  ("A63DE856-B573-4F34-A8AC-8F2BE146C442", 46.5575, -86.3638, "Little Beaver Lake Campground has 8 campsites on a beautiful inland lake. One campsite is disabled- accessible. Single unit vehicles in excess of 36 feet and vehicle/trailer combined units in excess of 42 feet are prohibited at Little Beaver because of the small campsites and the narrow, twisting, hilly access road. Pets are NOT allowed at this campground. The campground is open by reservation only, mid-May through mid-October. Closed the rest of the year.", "Little Beaver Lake Campground"),
  ("FBDC47A8-40CD-4BE7-B588-7DD0D89ADF82", 39.68477600000001, -78.11312500000001, "Mile 120.4 - No fee charged. Stay is limited to one night per site, per trip. All sites have a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Little Pool Hiker-Biker Campsite"),
  ("5FEBB647-6237-4F47-B304-95C564E66B3D", 48.020255955459476, -88.92666555449784, "Little Todd Campground is located in Little Todd, on the north shore of Isle Royale National Park, off of the Minong Ridge Trail. Stay Limit: 2 nights effective June 1 – Labor Day annually. Access: Foot/canoe/kayak. No boat access.", "Little Todd Campground"),
  ("E0080EF8-EB48-4573-A23C-A7CDD2B75F76", 44.0034692521, -110.688659309, "This rustic campground is in a remote part of Grand Teton National Park. The campground is 11 miles south of Yellowstone and eight miles north of Colter Bay Village providing easy access to both parks. The campsites are in a spruce and fir forest on the shores of Jackson Lake. One mile across the lake is the northern portion of the Teton Range including Webb Canyon, Owl and Ranger peaks. Looking south, the expanse of the Teton Range towers over Jackson Lake.", "Lizard Creek Campground"),
  ("E5093CF2-87B9-4099-840B-56BF12701918", 48.592901, -118.114979, "The Locust Grove Group sites are located at the townsite of Old Kettle Falls, near Kettle Falls Campground and Kettle Falls Day Use Area. There are two sites with a capacity for 50 people and 75 people, respectively. A nature trail leads to Kettle Falls Campground and Kettle Falls Day Use Area with swim beach. Locust Grove Group sites are spacious and set apart from the hustle and bustle of the Kettle Falls Campground area.", "Locust Grove Group Sites"),
  ("F727B83F-B8CB-49AC-A0EC-76DFAB6140FE", 36.6057726327463, -118.72688304333, "This large, popular campground is on the Marble Fork of the Kaweah River within easy walking distance of Lodgepole Village. Many campsites are surrounded by lodgepole pines. At an elevation of 6,700 ft (2,042 m), the campground can be snowy in spring and fall. Lodgepole Village offers a visitor center, market, shower, and laundry facilities. In summer, ride the free Sequoia Shuttle. Many nearby trails are located here.", "Lodgepole Campground"),
  ("BFBDA380-305A-4821-BB62-C72A939C78FC", 38.246415, -78.670701, "Loft Mountain (mile 79.5), the largest campground in the park, sits atop Big Flat Mountain in the southern part of Shenandoah National Park, with outstanding views to east and west. Two waterfalls and the trails into the Big Run Wilderness area are nearby.", "Loft Mountain Campground"),
  ("4CA589A7-8776-4E8E-BFB7-E5D1EF2E65E8", 48.6984547613409, -114.191655603626, "The Logging Creek Campground is one of the smaller campgrounds in Glacier and is located on the west side of the park, south of Polebridge. Access is via the Inside North Fork Road, a dusty narrow winding road. Caution is advised when traveling this road and RVs are not recommended. Once there, campers will find a small primitive campground with all the solitude one could want. The trailhead to Logging Lake is nearby and the easy hike to the lake is a great family day hike.", "Logging Creek"),
  ("BF0E7B53-5990-4465-8242-172A24A0083A", 37.016159934, -111.540346568, "No reservations. $14 per vehicle/per night in addition to entry fees. Primitive camping is on a sandy beach or in dunes. No designated campsites. Open fires permitted, must be within four foot squared area. Quiet time 10pm-6am. 4 micro flush toilets, 6 vault toilets, 1 comfort station/wheelchair accessible, outdoor cold shower, Off Road Vehicle area, dump station, potable water (seasonal), and day use area. No launch ramp.", "Lone Rock Beach Primitive Camping Area"),
  ("AE149158-1191-4835-8457-E6E899F5EA48", 25.3979002291, -80.6569697813, "Long Pine Key campground is open seasonally November-May. It is one of two frontcountry camping options run by the “Flamingo Adventures'' concession. Reservations are available for RV’s and tents along with first come first serve sites. If sites are booked, more camping may be available further down the Main Park Road in Flamingo.", "Long Pine Key Campground"),
  ("457CE0AF-DC49-4203-8647-55410C7B9FE1", 33.8357177464607, -80.8273976732926, "The Longleaf Campground offers walk up campsites for visitors wishing to camp in the frontcountry of Congaree. Campers may park and walk to their site. All campsites have a firepit and picnic table, and the campground has two vault toilets. 10 sites are for individuals or small groups of up to 8 people, while 4 sites are designated for larger groups from 9 to 24 people. The campground is a short drive from the visitor center, where running water is available, as well as park information.", "Longleaf Campground"),
  ("F7CE47A2-A770-449F-8085-0DF17DD432EB", 40.27479364272779, -105.55770432202075, "Longs Peak Campground is located about 20 minutes south of Estes Park on Hwy 7. This small, tents-only campground is forested and at a fairly high elevation of 9500 feet (3000 m). Longs Peak Campground is only open during the summer season. Longs Peak Campground is closed for the 2022 season. This campground has vault toilets and does not have any water. Campers must bring their own drinking water when camping at Longs Peak Campground.", "Longs Peak Campground"),
  ("406AC787-B7E7-4DE6-AB62-ABDCD4D358FA", 35.63690474693128, -83.93614247447806, "Look Rock Campground - elevation ~3,000 feet (914m) - is located along the beautiful Foothills Parkway West between Walland, Tennessee and Chilhowee Lake. Flush toilets and drinking water are available. Ten sites offer electric and water hookups. No shower facilities are located in the campground. Hammocks are allowed over the footprint of the campsite, limited to trees at least 10 inches in diameter with adequate padding around the tree. Only 2 hammocks may be suspended from a single tree.", "Look Rock Campground"),
  ("71D71180-EFB3-4888-8B2C-5474107CC139", 42.8797493937, -122.038711217, "CLOSED ALL YEAR 2022 Lost Creek Campground is managed by the National Park Service. It usually opens in early July and closes in mid-October, depending on weather and other factors. It is for tent campers only--NO RVs, buses, trailers, or vans and truck with toilets. Registration is self-serve on the day of arrival. No advance registration is available. The campground fills by mid-afternoon. The only means of knowing site availability is upon arrival at the campground.", "Lost Creek Campground, elevation 6,000 feet (1,829 meters)"),
  ("864E3CD2-E953-4811-8DB0-07BB2544F6D2", 40.5618411426837, -121.517718845844, "Lost Creek Group Campground contains only group campsites. All sites are reservation-only. The campground is located five miles south of Manzanita Lake on the park highway. The campground offers easy access to Manzanita Lake, Devastated, and Summit Lake Areas.", "Lost Creek Group Campground"),
  ("9FF275B6-E645-4860-A614-19463177E32B", 48.67657475935347, -121.27136454780918, "Lower Goodell Group Campground is a convenient campground on the banks of Goodell Creek. Each group site has tent pads, a pavilion with picnic tables, and a fire grate. Maximum capacity is 50 people (20 vehicles) per site. Lower Goodell sites can accommodate RV's. Vault toilets and garbage service provided is provided. There are no hook-ups or potable water.", "Lower Goodell Creek Group Campground"),
  ("EAAFABA8-59A2-4CBD-8F9F-89C7C2B1FF8D", 39.01737, -114.23798, "Among the lush green vegetation which hugs Lehman Creek, you'll secure your tent or park your RV within earshot of clear mountain water which has tumbled 3000 vertical feet from the lakes and snowfields of the high Snake Range. Naturally landscaped with red-barked water birch, aspen and white fir a stroll through this sky island ecosystem provides for great bird-watching or a cooling dip in the stream while placing you just minutes from spectacular Lehman Caves.", "Lower Lehman Campground"),
  ("4C3C4954-FA9C-4C58-B6CF-E66054E1F0EF", 37.7394658916, -119.566313767, "Lower Pines is located along the Merced River in Yosemite Valley. Yosemite Valley is centrally located in the park and boasts some of Yosemite’s most iconic features. This campground is located at 4,000 feet (1,219 m) elevation and can be accessed from all park roads. Lower Pines is within biking and walking distance of many services and trailheads in Yosemite Valley and is located on the free shuttle route. There are food and grocery services nearby at Curry Village and Yosemite Village.", "Lower Pines Campground"),
  ("CDA8256A-9CBB-4965-95FC-E3BDA19D1DF9", 33.229944, -108.25757, "Lower Scorpion Campground provides primitive camping opportunities within walking distance of the West Fork of the Gila River. The campground is located less than one mile from the Gila Cliff Dwellings National Monument just off NM State Highway 15. Drinking water is available, and tables and grills are provided at select sites. Vault toilets are available on site. Camping is free of charge and first-come, first-served. This campground does not support RVs or Camper Vans.", "Lower Scorpion Campground"),
  ("16DA32CA-C0E9-4AF2-A6BD-39AD52887B80", 45.253281, -92.760328, "19, primitive, Leave No Trace campsites are located on this reach from below Highway 8 down to the Boom Site Landing near Stillwater, Minnesota. An annual camping permit is required to camp. The District also consists of Minnesota and Wisconsin state park properties with campgrounds.", "Lower St. Croix District"),
  ("C4863E55-CDB6-4BE8-9E1B-4AE5AE18962D", 46.557203, -86.344702, "Lowney Creek Group Campground is one mile from Little Beaver Lake Campground and 2.5 miles inland from Lake Superior. Lowney Creek Group Campground is in the Beaver Basin Wilderness. The trail to the campground follows the Beaver Lake shoreline. Water source is Beaver Lake. One shared fire ring and NO toilet. Water access to this campground is via Little Beaver Lake, then Beaver Lake.", "Lowney Creek Group Backpacking Site"),
  ("44BCA8F4-F3F0-469E-9F2C-5B76A9978677", 46.558462, -86.33977, "Lowney Creek Campground is 1.5 miles from Little Beaver Lake Campground and three miles inland from Lake Superior. Lowney Creek Campground is in the Beaver Basin Wilderness. The four sites are in a meadow scattered with big trees on the south shore of Beaver Lake. Lowney Creek is on the east side of the campground. One shared fire ring and NO toilet. Water source is Lowney Creek and Beaver Lake. Water access to the campground is via Little Beaver Lake, then Beaver Lake.", "Lowney Creek Individual Backpacking Sites"),
  ("14A6565A-E77A-45D7-9F6D-67BF3FEA2251", 45.908436, -68.613925, "Walk-to campsites near the East Branch of the Penobscot River.", "Lunksoos Campsites"),
  ("C6AE22BE-6AE8-4D98-BF0D-48F24D7C8B98", 45.9569815730881, -68.7016996665859, "A rugged lean-to site within the heart of the backcountry of Katahdin Woods & Waters National Monument.", "Lunksoos Mountain Lean-To"),
  ("66DFF49B-F1DC-49BB-A3CF-9F007330450D", 44.6454215492, -110.861302682, "Madison Campground—elevation 6,800 feet (2073 m)—sits about 14 miles east from the town of West Yellowstone and 16 miles north of Old Faithful. Nearby, the Gibbon and Firehole rivers join to form the Madison River. In early summer, meadows teem with wildflowers and bison. In September and October, you can often hear bugling elk. Yellowstone National Park Lodges provides reservations for this campground.", "Madison Campground"),
  ("C56C81F5-BF2C-481C-A63E-FFAB374F5664", 36.23, -117.068377, "First come / first served primitive campground with no additional fee located in a Pinyon Pine and Juniper forest at 8,200' elevation. Great views down into Death Valley. Located near the Telescope Peak trailhead. Dirt road access requires high-clearance vehicles, often 4x4 required.", "Mahogany Flat Campground (Primitive)"),
  ("4DAAC939-A3E4-4CDA-AEE6-2C6B5B7BF499", 27.43023, -97.296189, "Malaquite Campground is open to tents and RVs. It is right next to the beach and has paved parking, designated sites, restrooms, cold water showers, and picnic tables. Some sites have grills and shade structures. No hookups. A black/gray water dumping station and potable water station are on the road entering the campground. Those with a paid site in the campground can pitch a tent either at the site or on the beach in front of the campground. This campground is first-come, first-served (no reservations).", "Malaquite Campground"),
  ("F8782C74-5524-40BD-9FFE-1B2FB984136B", 47.98524426035943, -88.80722670151698, "Malone Bay Campground is located in Malone Bay, on the south shore of Isle Royale National Park, off of the Ishpeming Trail. Boats can overnight at dock. A ranger station, information station, and dock can be found just further east of the campground. The ranger station is not always staffed. Stay Limit: 3 nights effective June 1 – Labor Day annually. Shelters: 5 Depth at dock (normal conditions): 3’-6’. Access: Foot/canoe/kayak/private boat", "Malone Bay Campground"),
  ("5B664E0A-C138-40B1-BAD2-17E27200DFD9", 44.97360954829384, -110.69323158293622, "CLOSED ALL OF 2022 The only campground in the park open year-round, Mammoth Campground—elevation 6,200 feet (1890 m)—is located five miles south of the park's North Entrance. Scattered juniper and Douglas fir trees provide shade during hot summer months. The campground is close to fishing, hiking, and the Mammoth Hot Springs. Great wildlife viewing opportunities abound with elk and bison occasionally passing through the campground. This is a reservable campground 4/1–10/15 run by the National Park Service.", "Mammoth Campground"),
  ("B637FEC0-7F4B-4A54-BD13-7EBE26DDEF19", 37.1821894000506, -86.09704310043361, "The Mammoth Cave Campground is ideal for visitors seeking an authentic national park experience while still having easy access to amenities, cave tours, and other park activities. This developed campground is located within ¼ mile from the visitor center and contains 111 campsites with a mixture of tent only sites, group sites, tent or RV sites, and accessible sites. Rangers on duty in the campground kiosk are happy to provide information to make your stay a special adventure.", "Mammoth Cave Campground"),
  ("593D7585-DD7B-43C6-88E3-73FAB6299D0B", 32.207386, -110.554542, "- 8,000 feet elevation - 6 campsites (max 6 people per site) - water available year-round", "Manning Camp"),
  ("E6C99AFB-B842-4840-BD72-A4C028E0C06F", 48.7964957236, -113.677619731, "The campground at Many Glacier is one of the most popular campgrounds in Glacier National Park. The campground is situated within trees for tent and RV campers, though there are only 13 sites that can accommodate vehicle lengths up to 35 feet in length. Bring your binoculars, as there are opportunities to view wildlife like bighorn sheep, moose, and bears. Many Glacier also provides access to some of the best day hikes in the park.", "Many Glacier"),
  ("D62E0AD6-E402-4D82-B250-236876F667A3", 40.5278515681602, -121.563186589946, "Manzanita Lake Campground is located one mile east of the Manzanita Lake Entrance and is the largest campground in the park. This popular campground is ideal for families, RVs, and trailers. Located adjacent to Manzanita Lake, campers can enjoy swimming, fishing, kayaking, and hiking. This campground is open the longest except for the year-round Southwest Walk-in Campground. The campground includes rustic camping cabins and group campsites, both of which are available by reservation only.", "Manzanita Lake Campground"),
  ("2EE3B5DE-9EC1-4AB0-AB15-F807746F722C", 37.204205, -86.136092, "Maple Springs Group Campground lies on the park's north side, six miles from the visitor center and three miles north of Green River Ferry. This campground offers more secluded sites ideal for larger groups of campers and their horse companions. All sites have electric and water hookups for RVs. This campground is a natural launching-point for forays along the more than 70 miles of backcountry trails in Mammoth Cave National Park.", "Maple Springs Group Campground"),
  ("C8186F5C-7EC1-4DCE-A261-02C2C3FEDDFA", 39.179557999999986, -77.492708, "Mile 38.2 - Hiker-biker campgrounds are located along the towpath approximately every 5-7 miles. No fee or reservation required. Overnight stays are limited to one night. All sites include a chemical toilet, picnic table, grill, and drinking water. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from mid-November to mid-April each year.", "Marble Quarry Hiker-Biker Campsite"),
  ("15655876-DFFA-4A3A-8EA8-FE4F4F0F0559", 48.6687321922, -118.057368267, "Marcus Island Campground is tucked into the trees on the lake shore. The campground is heavily shaded and, in the summer, has shoreline on three sides. The main access road is single lane and winding, but campers flock to this shaded area in summer. A boat launch with parking is available before reaching the campground.", "Marcus Island Campground"),
  ("B9CCD51F-22E2-45C1-A3E4-F352999558FF", 31.9811711479, -104.876854149, "A wilderness use permit is required for all use of these campsites. From Dog Canyon, hikers travel through grassy areas then cross Manzanita Ridge to view West Dog Canyon before descending to an elevation equivalent to the starting point. Not frequently used; pay attention to the trail and rock cairns marking the way. The campground is in pinion and juniper, shaded and protected from the wind. The distance from Dog Canyon is 3.7 miles.", "Marcus Wilderness Campground"),
  ("4A67D2E9-712F-445A-80F8-330CB66FFDCE", 38.97679701853521, -77.21484911273555, "Mile 11.5 (Montgomery County, MD) - The campground has six group campsites; all will accommodate up to 30 campers at each site. Each campsite has a picnic table and a fire ring. Portable toilets and potable water are located a short walk up the towpath and across the footbridge (water may not be available during cold winter months). No vehicle traffic is allowed on the towpath and access to the campsites is by foot only. Carderock Recreation Area or Anglers are the two closest parking areas.", "Marsden Tract Group Campground"),
  ("0CBEC1FE-AEED-4AA7-BE9F-7A25E9EB602B", 46.6468043665, -86.0956764204, "Masse Homestead Group Campground is to the west of the regular campground. It too is at the base of the dunes in a thick forest canopy. One shared fire ring and NO toilet. Visitors must bring water. NO ACCESS TO WATER.", "Masse Homestead Group Backpacking Site"),
  ("FFC19C0E-A862-4F84-A269-BBE89791789F", 46.647693, -86.090932, "Masse Homestead Campground is at the base of the dunes (south side) and sheltered due to the thick forest canopy. The three campsites are close together at the base of the dunes. One shared fire ring and NO toilet. Visitors must bring water. NO ACCESS TO WATER.", "Masse Homestead Individual Backpacking Sites"),
  ("CBEBF627-E888-45E6-9E8C-6EA6AE9A1B2D", 36.04918080776177, -112.11849726539117, "Mather Campground is located in Grand Canyon Village on the South Rim of Grand Canyon National Park. There are 327 sites. Each includes a campfire ring/cooking grate, picnic table, parking space and room for up to six people, three tents, and two vehicles. There are flush toilets and drinking water throughout the campground. No hookups are available, however there is a free dump station. Most RV spaces are pull-through. Pine loop is a tent-only area where generators are not permitted.", "Mather Campground - South Rim"),
  ("C4944EF0-E744-47F8-ACEB-F6283723AFCA", 38.763144, -78.296388, "Mathews Arm Campground (mile 22.1) is the nearest campground for those entering Shenandoah National Park from Front Royal, in the northern section of the Park. All sites include a place for a tent or RV, a fire ring, and picnic table. Elkwallow Wayside, with camping supplies and food service, is two miles away.", "Mathews Arm Campground"),
  ("739CE881-991F-42CE-885B-3F0410D82ED5", 36.0394860005, -92.635645801, "Maumee South Campground is a large campground in the lower district of the Buffalo River. There are no amenities at Maumee South. There are no designated sites. A vault restroom is available. Fees are not charged at Maumee South.", "Maumee South"),
  ("ADCAAE21-0B87-4379-A710-73E70566AA92", 42.86862146054785, -122.1677826463598, "Mazama Campground is open only in summer. It typically opens in June and closes in late September. The exact opening and closing dates are determined each year by the snow level in the camp sites, safety issues, and other factors. Mazama Campground is nestled in an old-growth forest at 6,000 feet (1,829 m) in elevation. There are 214 sites each with a picnic table, fire ring, and bear-resistant food locker. The concessioner, Crater Lake Hospitality, manages the campground. For more details go reservations.", "Mazama Campground"),
  ("91B3E7C5-3AEE-44DF-B806-3A9468D334C9", 35.529449, -101.759431, "These areas are located south of the lake off of State Highway 136. There are large cottonwood trees that provide shade. The Mullinaw Creek area features the expanded Mullinaw Trails System . This trail system is open to hiking, biking, and horseback riding. NO OFF ROAD VEHICLES ALLOWED. No drinking water or flush toilets; vault-evaporator toilets only. Picnic tables, shade shelters, and grills. Horse corrals are located at Mullinaw Campground. The dirt roads can become impassable after rain.", "McBride Canyon and Mullinaw Creek Campgrounds"),
  ("9D2E311B-C207-4DCF-94B3-DE542132D2C3", 48.08719604689656, -88.70934934701029, "McCargoe Cove Campground is located in McCargoe Cove, on the north shore of Isle Royale National Park, off of the Indian Portage and East Chickenbone Trails. Boats can overnight at dock. Canoe/kayak access from Lake Superior or 1.2 mile portage from Chickenbone Lake. Stay Limit: 3 nights effective from June 1 – Labor Day annually. Shelters: 6 Depth at dock (normal conditions): 7’. Access: Foot/canoe/kayak/private boat", "McCargoe Cove Campground"),
  ("A93DCCB5-EE82-4091-9744-387D1649C0C0", 31.9743477327, -104.808226914, "A wilderness use permit is required for all use of these campsites. Travel through the beautiful McKittrick Canyon before beginning the very steep climb up to the ridge. From McKittrick Canyon trailhead, the distance is 7.6 miles, with the elevation gain (significant for quite some distance) of over 2700 feet. If you'd like to visit this beautiful ridge without quite the workout, begin instead at Dog Canyon.", "McKittrick Ridge Wilderness Campground"),
  ("14751579-DBB7-4045-8558-93B39B25E616", 39.8210049992, -77.2461709993, "For scouting and organized youth groups that visit Gettysburg National Military Park, we offer McMillan Woods Youth Campground, located in the park on West Confederate Avenue. The campground is open from mid-April through the end of October every year. Any organized youth group with adequate adult supervision (minimum of one adult for every 10 youths) is welcome to use the camping area. Camping here is by reservation only and camp sites are reserved on a first come, first served basis.", "McMillan Woods Youth Campground"),
  ("C70FF8AC-BE33-4C34-B4E4-F144C6D60275", 39.60923039149862, -77.96663983689507, "Mile 110.4 (Washington County, MD) - The campground has 12 single drive-in campsites. Each single accommodates up to eight people. Single campsites have a picnic table, fire ring and grill. There is one group site available with space for two vehicles and a small trailer or support vehicle less than 20 ft. Group site can accommodate 30 people and has four picnic tables with grill and fire pit. Pit toilets and accessible portable toilets are available. Hand pump water is available April 15 - November 1.", "Mccoys Ferry Campground"),
  ("10EE7534-B7D7-4A2A-B8A2-AAE5628429F9", 37.79667, -80.92009, "Meadow Creek Campground is a primitive campground located along the New River about one mile down the road from Sandstone Visitor Center. Exit Interstate 64 at exit 139 and drive north past Sandstone Visitor Center towards Meadow Creek. In about 1.5 miles turn left and cross the railroad tracks. Bear right and follow the road into the campground. This campground is for tent camping only. (The railroad track crossing can be dangerous for RVs and longer vehicles.)", "Meadow Creek Campground"),
  ("0E90E11A-C131-4AEA-AADD-C14042C04B23", 37.803519, -105.495654, "Roadside camping is permitted at 21 campsites in Great Sand Dunes National Preserve beginning 5.2 miles from where the road begins near Piñon Flats Campground. These designated sites are free of charge and first-come, first-served. All 21 sites fill on summer weekends. Passable only in the warmer months and only with high-clearance 4-wheel drive vehicles. This road crosses areas of deep sand, traverses Medano Creek nine times, and passes through excellent habitat for bighorn sheep.", "Medano Pass Primitive Road Campsites"),
  ("59D597C2-D37E-41A8-AEBA-FA0D219280D4", 45.1101806592348, -108.20431158086, "Medicine Creek campground is a boat-in or hike-in only campground. It is approximately 3 miles north of Barry's Landing by land or water. - Open All Year - Lake level affects the proximity of the boat mooring to campsites", "Medicine Creek Campground"),
  ("E525405F-CD51-455B-BB8A-375D58C6636E", 35.5224918473591, -87.4556851746386, "The Meriwether Lewis Campground at milepost 385.9, on the northern end of the Parkway, has 32 sites. All sites are free and available on a first-come, first served basis. They do not offer electricity, showers, or dump stations. Drinkable water and flush toilets are available on site. Enjoy the Meriwether Lewis site which includes hiking trails, a section of Old Trace, exhibits and picnic areas.", "Meriwether Lewis Campground, Milepost 385.9"),
  ("65BC7988-F9D6-475A-9FD7-C3E0E0C66C06", 48.18459316327891, -88.42965712508789, "Merritt Lane Campground is located in Merritt Lane on the northeast end of Isle Royale National Park. Boats can overnight at dock. Stay Limit: 3 nights from June 1 – Labor Day annually. Shelters: 1 Depth at dock (normal conditions): 8’ Access: Canoe/kayak/private boat.", "Merritt Lane Campground"),
  ("75B2EF77-B8A3-4FAB-8E68-B4C9D7894F68", 31.9526879019085, -104.847984983904, "A wilderness use permit is required for all use of these campsites. This campground is near several trails leading in different directions, making it an excellent choice for a 'base camp' while exploring the high country. (Listen for wild turkeys off in the distance.) Mescalero is situated in ponderosa pine and brush, and is on a slope overlooking a small drainage. Located on the Tejas trail, Mescalero is 6.2 miles from Pine Springs trailhead or 4.7 miles from Dog Canyon.", "Mescalero Wilderness Campground"),
  ("B60A752C-4A67-4A7F-806F-2876DF00243E", 36.9632819819, -117.367825604, "First come / first served campground at an elevation of 1,800 feet, located 2 miles off of the Scotty’s Castle Road below Grapevine Canyon. It is a great base camp for your adventures in the northern parts of Death ValIey National Park. It is surrounded by desert mountains and geological features. Each site has a fire grate and picnic table. There are no hook-ups available. Fee is paid at the automatic pay station at the front of the campground.", "Mesquite Spring Campground"),
  ("90B166B3-6065-41B2-9190-9F5AF76D9D8D", 35.1314809174233, -115.435625021846, "The Hackberry Fire swept through the Mid Hills area in June 2005, burning much of the vegetation. About half of the 26 campsites were left unburned, however, and remain surrounded by pinyon pine and juniper trees. At 5,600 feet in elevation, Mid Hills is much cooler than the desert floor below. The access road is unpaved and somewhat steep, and is therefore not recommended for large motorhomes or trailers. Water is not available at Mid Hills Campground.", "Mid-Hills Campground"),
  ("8D116916-7528-4629-B983-99F5D19C4668", 45.773341, -92.781074, "57, primitive, Leave No Trace campsites are located on the St. Croix River from Riverside Landing to Highway 8 at St. Croix Falls - Taylors Falls. All sites are free. No permit required. Camp only in designated sites marked with brown camping sign and metal fire ring. Sites are available first-come, first-served.", "Middle St. Croix"),
  ("4C753B83-8E55-4969-A918-7CF37BEBEF34", 25.851926, -80.989444, "This campground offers electric hookups for RV sites, dump station, flush toilets, and water. Each RV campsite has its own picnic table and hibachi style grill. Covered picnic areas are located around the lake for day use.", "Midway Campground"),
  ("6656707B-F876-4334-9150-730DC35BAC97", 41.7027241694, -124.097784631, "Located in Del Norte Coast Redwoods State Park. This is 6.7 miles south of Crescent City. Campsites are surrounded by maple, alder and second-growth redwood trees.", "Mill Creek Campground"),
  ("60569FBD-2B27-45BD-9FF7-68722E5BF02D", 25.7564496482, -80.9305981752, "Primitive camping with no water. Vault toilets are available. Eleven sites available. Access to the Mitchell Landing Campground is along a secondary gravel road.", "Mitchell's Landing"),
  ("D7BA07C5-8453-4E03-A178-2C20AB591360", 41.0350164989291, -75.0010072013237, "Primitive group campsites in a wooded setting adjacent to the Appalachian National Scenic Trail in New Jersey; Drinking water available; Call 603-466-2727 for additional information regarding lodge or cabin rentals.", "Mohican Outdoor Center"),
  ("AC717D5E-F55A-4539-AC8E-4B4C5009ABBB", 25.8684663476, -81.1131314752, "Monument Lake campground offers restrooms, drinking water and designated 26 RV and 10 tent sites. NO HOOKUPS for electricity, sewer or water are available at this campground.", "Monument Lake"),
  ("1F9A5CA2-8D09-4444-ABD6-532B22C404B7", 47.9168610105267, -124.60593738701, "Situated in a coastal forest, some sites offer views views of the Quillayute River. Mora is located two miles from Rialto Beach.", "Mora Campground"),
  ("97A7C642-B9C6-463B-8FAC-B9480FE5503A", 36.7852162631223, -118.661056803223, "Just 0.75 miles ( 1.2 km) from Cedar Grove Village, Moraine Campground rests in the heart of King Canyon. It is located along the South Fork of the Kings River under stands of evergreen trees at an elevation of 4,600 feet (1,400 m). Visit Cedar Grove Village for services such as showers and food.", "Moraine Campground"),
  ("D322E1E9-8058-4C42-80A3-9FBC82583190", 40.36066149616986, -105.60006623223796, "Moraine Park Campground is located on the east side of RMNP. During the winter, this is a first-come, first-served campground and only B-Loop is open. Water and the dump station are closed. Vault toilets are open. There is a year-round water spigot located on the building across from the Moraine Park Ranger Station. MPCG will be closed from late May 2023 to early summer 2024 for construction. For details, visit the park's website at www.nps.gov/romo.", "Moraine Park Campground"),
  ("D00BE92E-B246-4C6E-8CDD-77F437678AF2", 37.3014992738134, -108.417912473544, "Morefield Campground is located just four miles from the park entrance. The 267 campsites are located within a high grassy canyon filled with Gambel oak, native flowers, deer, and wild turkeys. A camp store offers registration, food, and camp supplies. Firewood, gasoline, showers, a coin-operated laundromat, and a kennel are located nearby. Each site has a picnic table, gravel tent pad, and fire pit/BBQ grill. The campground is managed by park concessioner Aramark and is open between spring and fall.", "Morefield Campground"),
  ("AC9D778B-7792-420B-A55A-6E1AA558042F", 48.06298074914441, -88.64516328280524, "Moskey Basin Campground is located in Moskey Basin at the west end of Rock Harbor Channel, off of the Indian Portage and Rock Harbor Trails. Boats can overnight at dock. Canoe/kayak access from Rock Harbor Channel or via 2.0 mile portage from Lake Richie. Stay Limit: 3 nights from June 1 – Labor Day annually. Shelters: 6 Depth at dock (normal conditions): 8’. Access: Foot/canoe/kayak/private boat", "Moskey Basin Campground"),
  ("F4C0B48E-944E-42FC-9E18-D579786BBC93", 46.5226013349, -86.4938020699, "Mosquito River Group Campground is on the west side of Mosquito River just a few steps away from the North Country Trail. There is a bluff near the campsite overlooking Lake Superior, which provides easy access to Mosquito Beach and the river. Shared pit toilet. Water source is Mosquito River and Lake Superior. Lake Superior access for kayakers. NO CAMPFIRES.", "Mosquito River Group Backpacking Site"),
  ("38CA8E50-5BB0-4592-9992-0600AD177834", 46.527061, -86.492008, "Mosquito River Campground is on the east side of the Mosquito River high above the lake. Depending upon which of the five campsites you choose, you can hear the waves crashing on the cliffs or the Mosquito River flowing into Lake Superior. Shared pit toilet. Water source is Mosquito River and Lake Superior. Lake Superior access for kayakers. NO CAMPFIRES.", "Mosquito River Individual Backpacking Sites"),
  ("1B9BB56F-9FF5-4AD4-B966-F3B7310AED49", 35.40286804539159, -82.75691997303858, "Mount Pisgah Campground is located in the mountains of western North Carolina at an elevation of 4,980 feet, and offers moderate to cool temperatures during camping seasons. Mount Pisgah is part of the Appalachian Mountain Range, an area of the country with scenery that never disappoints, whether blanketed in wildflowers in the spring or a bursting with orange, yellow and red hues in the fall. Several popular hiking trails, ranging from moderate to difficult, are easily accessible from the campground.", "Mount Pisgah"),
  ("7FDEE7A6-EB52-43E9-A4D8-193545AB5207", 60.3093333056, 154.177, "The Priest Rock Cabin sits on the north shore of Lake Clark, approximately eight miles north of Port Alsworth. The cabin is perched above a small creek that runs into the lake. It commands a sublime view of Lake Clark's upper reaches, backed by mountains rising to 6,000 feet. It's an ideal place for kayaking, boating, fishing and wildlife viewing.", "NPS Priest Rock Public Use Cabin"),
  ("7BBD3378-FC3C-46E4-9DF8-2F2AFFA92C2E", 45.905263, -91.815991, "67, primitive, Leave No Trace camp sites are located on the Namekagon River from Namekagon Dam to the confluence of the St Croix River and on the St. Croix River from Gordon Dam to Riverside Landing. All sites are free. No permit required. Camp only in designated sites marked with brown camping sign and metal fire ring. Sites are available first-come, first-served.", "Namekagon District"),
  ("3D8B7A3D-BC50-4270-8CD1-631D13A15C62", 37.60921843789215, -109.98419312147183, "Camp in solitude among the juniper trees at Natural Bridges campground. The campground is conveniently located next to the visitor center off the main park road. Campsites are first-come, first-served and open year-round. Each site has a fire grill, picnic table, and tent pad, but no running water, electricity, or hookups.", "Natural Bridges Campground"),
  ("F1D0E963-7D3A-4CDF-A5CC-1759D8994679", 30.3689892485485, -87.1423119758788, "This area is available reservation throughout the year for organized youth groups comprised primarily of young people under the age of 18. This group camping area is located near Gulf Breeze, Florida and has direct access to Pensacola Bay for water recreation. The campsite features restrooms, outdoor showers, a picnic shelter, and campfire ring. The Naval Live Oaks Area has over 7.5 miles of trails for campers to explore.", "Naval Live Oaks Youth Group Camping"),
  ("C772BBDA-274E-40A2-B213-3C7B8127E6A7", 48.671, -121.261, "Newhalem Campground is a comfortable facility close to the town of Newhalem, Washington, and the Skagit River. It is surrounded by forests that that can be explored through the area's many hiking trails. The campground has individual campsites as well as two group sites. It is private and secluded, yet the town, a visitor center and other amenities are only a short walk away.", "Newhalem Creek Campground"),
  ("6B63B182-983C-41D9-82F7-F879170A3517", 44.73784854861962, -110.69361508287096, "CLOSED ALL OF 2022. This campground–elevation 7,500 feet (2,286 m)–is located near a large open meadow, which provides opportunity for wildlife viewing. Bison frequently walk through the campground. Most sites are shaded by lodgepole pine. The Museum of the National Park Ranger is a quick walk from the campground, as are Norris Geyser Basin Museum and Norris Geyser Basin--the hottest and most changeable thermal area in Yellowstone. This is a reservable campground run by the National Park Service.", "Norris Campground"),
  ("17B8A379-66C5-4225-8EE3-2D3CB3CF0CA4", 37.638096, -112.167922, "Located across the road from the Visitor Center and is comprised of 100 sites in 4 loops; A, B, C, D. Loops A & B are for RV campers. Loops C & D are for tent campers (tents are permitted in all loops). There are no sewer, water or electrical hook-ups available. A dump station is available in summer months near North Campground; use is included with campsite fee. Potable water is available near the dump station. North Campground is close to the Visitor Center, General Store, and Fairyland Loop/Rim Trail.", "North Campground"),
  ("8EB31DC6-1B15-4036-87CA-F97589FC77DD", 47.98085044383097, -88.99386540717819, "North Desor Campground is located on the north side of Lake Desor off of the Minong Ridge Trail. There is no boat/canoe/kayak access. Stay Limit: 2 nights from June 1 – Labor Day Access: Foot", "North Desor Campground"),
  ("FFD42463-76E6-4540-898A-0A70A8A8F747", 47.5698520216, -123.650803296, "Surrounded by temperate rain forest, this small and remote campground is a great spot for campers seeking solitude.", "North Fork Campground"),
  ("BF1EF0FB-866C-41EC-AE20-39C588D6250A", 48.7864756738437, -118.003288633079, "North Gorge is a small, but popular, campground at the northeast edge of the park. A few sites are large enough for an RV, but most are built for tent camping. The campground is set in a grove of pines on the edge of the lake. A boat launch and dock are on the north or right side of the main loop. In the summer, North Gorge is busy on the weekends.", "North Gorge Campground"),
  ("E9D964EF-67FA-4F51-8ECC-56FD621F7AD7", 39.610663, -77.959636, "Mile 110.0 - No fee charged. Stay is limited to one night per site, per trip. All sites have a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "North Mountain Hiker-Biker Campsite"),
  ("BDF9737C-DD6E-457F-9ADC-501B07851F77", 37.7404163398378, -119.565030847118, "North Pines is located along the Merced River in Yosemite Valley. Yosemite Valley is centrally located in the park and boasts some of Yosemite’s most iconic features. This campground is located at 4,000 feet (1,219 m) elevation and can be accessed from all park roads. North Pines is within biking and walking distance of many services and trailheads in Yosemite Valley and is located on the free shuttle route. There are food and grocery services nearby at Curry Village and Yosemite Village.", "North Pines Campground"),
  ("FCA57A5F-BC58-44D8-83BD-EDC0FC9CCB17", 38.58518332872675, -107.70942777084946, "The North Rim campground is remote and has 13 sites dispersed among pinyon and juniper trees. Sites available on a first-come, first-served basis. The last 7 miles of the North Rim Road and the campground road are unpaved. Services are very limited. To protect vegetation and forest resources, please use designated tent pads and do not tie, hang, or attach anything to trees. This campground fills quickly during the summer, especially on weekends. Maximum combined length of RV, car and/or trailer is 22 feet.", "North Rim Campground"),
  ("E6979811-AC94-41A2-BD7A-8C17B8D0111D", 36.208690159698094, -112.05997437790796, "The North Rim Campground, open seasonally from May 15, through October 15, is located on the North Rim of Grand Canyon National Park in northern Arizona. The canyon's rustic and less populated North Rim is home to abundant wildlife, hiking trails, and unparalleled views of one of the Seven Natural Wonders of the World. The facility is at an elevation of 8,200 ft., with pleasant summer temperatures and frequent afternoon thunderstorms.", "North Rim Campground"),
  ("46225547-072D-45AA-9261-558B27D92DB4", 19.4253736529641, -155.295878745916, "Nāmakanipaio Campground is located 31.5 miles south of Hilo on Highway-11 at 4,000' elevation. It is a large, open grassy area with tall eucalyptus and 'ōhi'a trees. This campground has restrooms, water, picnic tables and barbecue pits. Campfires are permitted in the barbeque pits only. If there are more than 2 people in your party, you can expand to 4 people per site with another tent. Maximum stay is 7 days.", "Nāmakanipaio"),
  ("33D32CEA-A00E-4225-B3C0-E769A7DDCDFD", 40.6505313284, -122.591370849, "This RV campsite is suitable for visitors who plan to spend the majority of their time on the lake boating or want to be near a Oak Bottom boat launch and beach. A park entry fee pass is also required in addition to a camping permit.", "Oak Bottom RV"),
  ("5E78B8BD-F020-406E-88B9-FC67AA04E663", 40.650528, -122.5825, "Oak Bottom Campground is the only campground within the boundaries of Whiskeytown NRA that are located on the shores of Whiskeytown Lake. The campground is operated by a concessionaire and is open year-round. 92 sites available, there is one ADA accessible site. Seasonal coin operated showers are available within walking distance at Oak Bottom Beach.", "Oak Bottom Tent Campground"),
  ("1D88A5D2-1AC6-4B07-9295-E666F1736B95", 38.6004202182, -77.4160990166, "Oak Ridge Campground is a 100-site campground with bathrooms, grills and picnic tables, and drive-up campsites. Leashed pets are welcome. Both tents and RVs are welcome, though there are no hook-ups for RVs and maximum RV length is 32'. Reservations are required for all campsites. Make a reservation on www.Recreation.gov. The campground is closed December 1 and re-opens on March 1.", "Oak Ridge Campground"),
  ("EB7177AD-9252-4CAD-B85D-08D9BE25AA25", 38.20161059949485, -75.15386509969085, "Tents, trailers and recreational vehicles (no hookups). Sites have a picnic table and a fire ring. Sites are $30 per night. Reservations are required from March 15 through November 15. All sites are First Come/First Serve from November 16 through March 14.", "Oceanside Drive-in Campground"),
  ("27416013-2F23-4D0A-86FA-42FC24D7A03E", 38.20377, -75.1524, "Organized clubs and affiliated groups must use group campsites. Tent-only sites, located 100-200 feet from centralized parking area. Sites have a picnic table and fire ring with grill. Group campsites can be reserved year round, up to 6 months in advance at $50 per night per site. 7 minimum - 25 maximum campers per site.", "Oceanside Group Campground"),
  ("B9B39C25-D4C1-47AE-B02A-AC0E6CB93DCB", 38.1948063, -75.1564668, "Tent only sites. Sites have a picnic table and a fire ring. Sites are $30 per night. Walk-in sites are open March 15 - November 15 and reservations are required. Reservations may be made at recreation.gov", "Oceanside Walk-in campground"),
  ("E8C25071-8A67-42F8-8160-66BF81E8C450", 35.136234, -75.902467, "Ocracoke Campground with 136 sites is located east of the village of Ocracoke, North Carolina on the island of Ocracoke. The campground offers grills, flush toilets, drinking water, cold showers, and is pet-friendly. The soil is sandy, so tent-campers will need extra-long tent stakes. RVs under 40 feet are welcome at this campground. There's no electricity, but there is a nearby dump station. There is no shade at the campground. Mosquitoes are common, and insect spray is recommended. Open year round.", "Ocracoke Campground"),
  ("EE30401B-4172-4BBA-91AE-B63EAE532367", 46.73599667059602, -121.56684815883636, "Ohanapecosh Campground is tucked in the forest along the banks of the Ohanapecosh River at an elevation of 1,914 feet. It is located in the southeast corner of the park along State Route 123. Under the tall trees, the campsites are relatively private. Trails that begin at the campground lead to Silver Falls and the Grove of the Patriarchs. Stop by the Ohanapecosh Visitor Center for information and exhibits.", "Ohanapecosh Campground"),
  ("D02FA068-BF79-4A17-8621-533DFE01DDF0", 39.51593300000001, -77.860112, "Mile 90.9 - No fee charged. Stay is limited to one night per site, per trip. All sites have a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Opequon Junction Hiker-Biker Campsite"),
  ("C2BA0A25-CF73-48EB-8B4C-29E16D6E52B5", 35.80027781, -75.545, "Oregon Inlet Campground has 107 sites and is open year round. Camping on a barrier island provides a chance to take in the power and nature of this special place. Listen to the breaking ocean waves while staring up at the night sky filled with stars. Walk along the sandy beaches during the day and share stories with friends at night. RV hookups are available at select sites. Running water and flush toilets are throughout the campground.", "Oregon Inlet Campground"),
  ("AACB05F2-F5E2-47CF-8D26-EE42B70DF978", 37.5756939454, -79.3374360711, "As Otter Creek descends to the James River, the Blue Ridge Parkway dips to its lowest elevation, only 649 feet above sea level. This area's abundant water and warmer temperatures support plant and animal communities that are unlike those found at other areas on the Parkway. A short walk along the Trail of Trees or a hike along the clear, cool waters of Otter Creek will give ample proof that there is more to the Blue Ridge Parkway than mountain-top vistas.", "Otter Creek"),
  ("90965E82-9EC7-4D1E-A5FA-4AE939B549B5", 39.6596869874, -77.4866425571, "Reservations Required. No Walk-Ins. Owens Creek Campground offers family camping in a wooded setting. There are 50 sites, 3 are ADA accessible. Maximum trailer length is 22 feet. One vehicle is permitted per site. A picnic table and fire ring are provided at each site. There are 2 comfort stations and hot showers, but there are no hook-ups. Firewood is available, with a donation suggested. Use of alcohol is prohibited. Pets allowed and must leashed and tended to at all time.", "Owens Creek Campground"),
  ("5CEA9F21-8CBB-4B5D-AB2F-7D6FC31AE52E", 36.0640098001, -93.1598566994, "Ozark Campground is a first come, first serve campground near Jasper, AR. Ozark has 31 drive in and tent sites with no electrical amenities, but flush restrooms and water are available from March 15 through November 14.", "Ozark Campground"),
  ("24D983CD-F853-49B3-A368-25DC3832F628", 48.1532400873933, -124.667693189397, "Adjacent to Lake Ozette, this small campground is great for those that enjoy lakeside camping and water activities", "Ozette Campground"),
  ("AB0F4BC2-8EFF-4138-94F3-98F3F910FDE2", 32.591452, -86.99976, "https://www.alapark.com/parks/paul-grist-state-park", "Paul Grist State Park"),
  ("18876B25-BB2B-4507-B2F6-0949C995BCED", 39.54423610033746, -78.46148084682035, "Mile 156 (Allegany County, MD) - There are 10 single campsites, each has a picnic table, fire ring and grill. Each site can accommodate eight people. If there is a larger group, reserve two sites next to each other. Portable toilets are available. Hamp pump water is available from April 15-November 1.", "Paw Paw Tunnel Campground"),
  ("9D607267-5063-463F-8487-DF928F788339", 37.443384745, -79.6049784725, "The campground is nestled at the base of two mountains in the rolling hills of Virginia. Nearby Abbott Lake is well-stocked with small mouth bass and bluegill. A stream winds through the campground, creating a tranquil backdrop for your camping trip. Hikers may choose to climb a mountain or stroll on a flat, lakeside trail. Wildlife such as deer and wild turkey are spotted daily at the Peaks of Otter Campground.", "Peaks of Otter Campground"),
  ("FB8D1AFA-AD1F-48F1-AFF4-B649857B6D61", 44.9169813491583, -110.11380838335742, "CLOSED FOR 2022. Pebble Creek Campground—elevation 6,900 feet (2103 m)—lies against the dramatic backdrop of the Absaroka Mountains near the park's Northeast Entrance and offers a more isolated camping experience. Day hiking opportunities are available nearby. Soda Butte Creek offers fishing opportunities and there are outstanding wildlife viewing opportunities throughout Lamar Valley. This is a reservable campground run by the National Park Service.", "Pebble Creek Campground"),
  ("15CB8D4F-5780-4293-95DE-153674F84667", 40.5857833, -122.5518167, "Sited along Clear Creek, the Peltier Bridge campground offers 9 sites and access to numerous trails. All sites offer a bear-proof storage locker, picnic table, lamp pole, fire pit with swing-arm BBQ grill, and shared access to two ADA-accessible vault toilets.", "Peltier Bridge"),
  ("CC016A4C-E0FA-4042-A148-5A1AA75E5AAD", 48.1245169558947, -88.65218294378656, "Pickerel Cove Campground is located in Pickerel Cove on the north shore of Isle Royale National Park. Canoe/kayak access from Pickerel Cove or via .1 mile portage from Lake Superior. Stay Limit: 2 nights from June 1 – Labor Day annually. Access: Canoe/kayak. No dock for boats.", "Pickerel Cove Campground"),
  ("7CB28D9D-073D-4493-9D2C-CA3004484378", 39.53895800000001, -78.650428, "Mile 169.1 - No fee charged. First come, first served. Stay is limited to one night per site, per trip. Campground has a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Pigmans Ferry Hiker-Biker Campsite"),
  ("1A2D2E59-3F76-493A-86AA-8CCCDD8C47D2", 46.586272, -86.328552, "Pine Bluff sites are on a sandy bluff above Lake Superior just off the North Country Trail. The five campsites are on a sandy open area covered in ferns with pine trees scattered throughout the area. Access the beach and Lake Superior from a trail on the bluff at the entrance to the campground.", "Pine Bluff Individual Backpacking Sites"),
  ("4356D077-AE68-4822-B67E-3CF48A8BBDDB", 31.8952617307, -104.826340693, "The Pine Springs Campground has 20 tent and 13 RV sites available. All campsites are reservable through recreation.gov. Individual campsite cost is $20 per night, per site. There are 2 group sites for groups of 10-20 people. Campground amenities include drinking water and toilets (NO hookups, dump stations or showers). - Only cooking stoves are permitted; charcoal, wood fires, and propane firepits are prohibited.", "Pine Springs Campground"),
  ("0A45C29D-7CE3-455D-BA28-1C982B68F5A6", 31.9185398240834, -104.845801986861, "A wilderness use permit is required for all use of these campsites. Pine Top is the backcountry campground in closest proximity to the Bowl, and offers excellent views of the park's highest peaks. Pine Top is an excellent choice for a single night backpack trip. It is 3.9 miles from Pine Springs trailhead via the Tejas and Bush Mountain trails. Elevation gain is 2300 feet. Though secluded in trees, Pine Top is susceptible to high winds & lightning. Eight designated campsites are defined by tent pads.", "Pine Top Wilderness Campground"),
  ("63A57214-A247-405D-ACBD-254D56A1FDE7", 25.7615555478, -80.9180630747, "This campground is for group camping only. Four sites available to accommodate eight tents at 15 people each.There is no water or restroom facilities. Access to the Pinecrest Campground is along a secondary gravel road.", "Pinecrest"),
  ("F5482EE1-0DC2-473D-AB4E-A6132ECFEF2D", 26.216331047905975, -81.29514337546641, "This is a primitive campground, containing nine campsites. No water. Vault toilets are available. Pink Jeep can be accessed by off-road vehicle, hiking or biking. Backcountry permits are required for all, off-road vehicle permits are required for off-road vehicles.", "Pink Jeep"),
  ("B55ABE9A-E5AF-4A4E-AACE-7299165831F5", 36.4898445958, -121.148968014, "Pinnacles Campground is run by Pinnacles Recreation Company. The campground offers tent and group camping, tent cabins, and RV sites. Each tent and group site has a picnic table and fire ring. Most RV sites have electrical hookups and share community tables and barbecue pits. Some tent cabins have electricity. Each tent cabin sleeps up to four people. To make reservations please visit recreation.gov. For questions and concerns call (831) 200-1722.", "Pinnacles Campground"),
  ("F3D4A32A-B2CA-4E38-B049-C90164E4540A", 37.7449368560859, -105.504703076291, "Piñon Flats is a National Park Service campground located one mile north of the Visitor Center, open April through October. All sites are by reservation on recreation.gov. Individual sites can be reserved up to 6 months in advance, and group sites can be reserved up to 1 year in advance.", "Piñon Flats Campground"),
  ("64C7EA2F-FCB4-47A3-A19E-D6ED6EADF6F6", 44.71551, -86.119114, "Platte River Campground is open year-round and offers a wide variety of camping styles. You can find back-in and pull-through sites for RV's, including electrical hookups; but it also offers beautiful tent sites, walk-in sites for the slightly more adventurous, and group sites (hike-in, tents only) accommodating up to 25 people. There is even a nearby backcountry campground for those who enjoy a great backpacking experience, but don't have the time to head for the Manitou Islands.", "Platte River Campground"),
  ("625ECC9F-CC94-4173-9F41-6B6C72A0EB1A", 59.6385221, -135.2937064, "Pleasant Camp is located near the Taiya River 10.7mi (17.3km) from the trailhead. It is just after a relatively large elevation gain coming from Canyon City (hiking south to north) and often a 'pleasant' spot to spend some time. Pleasant Camp is the trail's least used campground and offers hikers a tranquil evening. However, if you are hiking over the pass directly from Pleasant Camp, prepare for a very long, next day traversing the Golden Stairs. You must purchase a backcountry permit for this campground.", "Pleasant Camp"),
  ("49F2E692-7A04-488E-BEED-C4C0E195B1E2", 35.516667, -102.78333, "There are four camping areas in this region of the recreation area. These campgrounds are located on the southwest side of the lake off FM 1913. This area is a favorite for hiking, horseback riding, birding, and wildlife watching. Devil's Canyon Trail is a good trail for beginner to experienced horseback riders. This area is covered with cottonwood trees. There is no drinking water or flush toilets; vault-evaporator toilets only. Picnic tables, shade shelters, and grills are available.", "Plum Creek Campgrounds"),
  ("1827DF3F-1EC6-4A91-9A57-8BD6CEE2039B", 37.6103850583356, -112.830926692645, "Point Supreme Campground is surrounded by meadows of wildflowers in the summer! At 10,000 feet elevation, it is a comfortable place to camp during the hotter summer months. The Point Supreme Campground has 25 campsites and accommodates both tents and RVs. Camping is available from mid-June to mid-September. Note that the campground opening and closing dates may be vary & are subject to favorable weather.", "Point Supreme Campground"),
  ("87AC7E6E-5020-4E63-ADC1-90BA6D3F73CE", 46.0633204470942, -68.7548784505108, "A rustic backcountry campsite overlooking the majestic Pond Pitch and wild East Branch of the Penobscot River.", "Pond Pitch Campsite"),
  ("344FA89E-5F8A-49FC-A1E2-7F584B355393", 35.83308336, -106.356646064, "Ponderosa group campground is open year round, with water available May - October only. Site is available by reservation only.", "Ponderosa"),
  ("0F440585-6E8F-4D63-AC22-92312953FB5E", 38.5257080480139, -107.314899399111, "Ponderosa Campground is located at the northwest end of the Soap Creek Arm of Blue Mesa Reservoir. From U.S. Highway 50, follow CO Highway 92 1/2 mile past Blue Mesa Dam to Soap Creek Road. Proceed 7 miles north on the gravel Soap Creek Road. Tents and medium sized RVs can be accommodated at Ponderosa. All sites are first-come first-served. Elevation: 7880 feet Note: During dry conditions, the first 7 miles of Soap Creek Road are passable to trailers and RVs. Rain can make the Soap Creek Road impassable.", "Ponderosa Campground"),
  ("761D857A-D5D4-4FAE-8E66-952DE2052224", 39.6558291260591, -77.47561993940099, "Reservations Required. No Walk-Ins. Poplar Grove is open to adult supervised organized youth groups whose members are under age 18. There are 3 sites within Poplar Grove. Each site accommodates up to 25 persons. Groups share pit toilets and a pavilion. Each site has picnic tables, grills and a fire circle.", "Poplar Grove Youth Group Tent Campground"),
  ("37A2C529-C63B-42B4-8AE1-DC0611B34690", 45.046024, -86.116205, "The Popple Campground is the furthest from the dock (about 3.5 miles), so you are likely to have fewer people camping there. The campground is close to the beach on the northern tip of the island. Bring water filtration equipment since there is no source of purified drinking water. There are 7 individual sites", "Popple Campground - South Manitou Island"),
  ("E725A627-101C-486D-92CE-D4798A742BB1", 47.8945931616, -118.175135367, "Porcupine Bay Campground and Boat Launch includes 20 campsites, seasonal flush facilities, and fish cleaning station, swim beach, and boat launch. The campground is tucked up into the shaded pines against the wall of the coulee, with beautiful views of the lake.", "Porcupine Bay Campground"),
  ("AFD1869B-19F1-4C47-9B9B-75A6625C7A6D", 37.8082397641, -119.565691823, "Porcupine Flat Campground is located off the Tioga Road about 30 minutes west of Tuolumne Meadows and over an hour from Yosemite Valley. RVs and Trailers are not recommended for the narrow roads in this more primitive campground. At an elevation of 8,100 feet (2,500 m) elevation, the campground is near Porcupine Creek, which is the only water source (must be filtered, treated, or boiled). The Porcupine Creek Trailhead is nearby. There are no visitor services close to the campground.", "Porcupine Flat Campground"),
  ("5EAA1F18-E950-4FE7-83D5-2D00F4471177", 46.497249, -86.530046, "Potato Patch Campground is inland from the North Country Trail. Follow a trail through an open field with the sounds of a waterfall at your back. The fire ring is at the entrance to the campground. Follow the trail to the right to reach each of the three sites. Within the campground, the view of Grand Island and Lake Superior is blocked during the summer by the birch and maple leaves. One shared fire ring and pit toilet. Visitors must bring water. NO ACCESS TO WATER.", "Potato Patch Individual Backpacking Sites"),
  ("9F588F02-DC9B-4573-B868-1A0B600BA1F3", 39.53094000000004, -78.58897499999999, "Mile 164.8 - No fee charged. First come, first served. Stay is limited to one night per site, per trip. Campground has a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Potomac Forks Hiker-Biker Campsite"),
  ("191F3831-AC51-41B2-8BAB-92A4D1BC7685", 36.5165078377, -118.800835364, "Just 4 miles (6.4km) past Ash Entrance Station, the campground sits at 2,100 ft (640 m) elevation along the Middle Fork of the Kaweah River under an open stand of oaks. Hot and dry weather in the foothills often require fire restrictions in the summer. In the winter, the campground is usually snow-free. Marble Falls Trail, which begins at the back of the campground, is closed due to impacts from the KNP Complex Fire.", "Potwisha Campground"),
  ("6C955DB8-0800-422C-8198-F6E1DC7BA46C", 32.3336736, -86.7701881, "Alabama River Lakes Corp of Engineers", "Prairie Creek"),
  ("36C60550-B5BE-4D8D-AFA3-F87E545CA54A", 38.4746, -111.3673, "It is located approximately halfway on the Cathedral Valley Loop Road. About 36 miles (57.9 km) from the visitor center, this primitive, no-fee campground has 6 sites, each with a picnic table and fire grate. There is a pit toilet, but no water available. The campground is open year-round; however, visitors should check road conditions with the Capitol Reef Visitor Center prior to planning an overnight stay. The campground is at ~7,000 feet (2,133 m) in elevation, No reservations; first-come, first-served.", "Primitive campsites at Cathedral Campground"),
  ("B59E5DFB-3738-4986-96AD-648FE6A34ABE", 38.0073, -111.0846, "It is located approximately 23 miles (37.0 km) south of Utah State Highway 24 on the Notom-Bullfrog Road and is at 5,500 feet (1,676 m) in elevation. This primitive, no-fee campground has five sites, each with a picnic table and fire grate. There is also a pit toilet, but no water is available. The campground is open year-round, but visitors should check with the Capitol Reef Visitor Center for road conditions prior to planning an overnight stay. No reservations; first-come, first-served.", "Primitive campsites at Cedar Mesa Campground"),
  ("1B6C3E06-37FE-4725-A042-8FE3ECBAB2CD", 38.603929, -77.350905, "The Prince William Forest Park RV Campground is a concessionaire-operated campground with full hook-ups. The campground boasts pull through sites, a pool and laundry facility. It is Virginia's closest RV camping to Washington, D.C. There are several tents-only sites. Open year-round.", "Prince William Forest RV Campground"),
  ("81DE0EE8-2328-4F98-A59D-CF41B00BC6BD", 37.3394667448, -91.4653730395, "Pulltite Campground is located north of Round Spring, at the end of EE Highway off State Highway 19 in Shannon County.", "Pulltite Campground"),
  ("37E012F8-43AE-4145-A8F1-BFA6BBD7332E", 48.3131, -120.6581, "Located at the head of Lake Chelan, Purple Point Campground is a ten minute walk from the boat dock at Stehekin Landing. All sites are walk-in sites for small to medium-sized tents. First-come, first-served during the winter; summer reservations can be made up to 6 months in advance through www.recreation.gov or by calling 1-877-444-6777. Stehekin is a remote community with limited facilities and is only accessible by foot, boat, or plane.", "Purple Point Campground"),
  ("B1D9FE14-0809-4759-BD6D-03B98FEAA7F1", 39.535244000000006, -78.46414900000002, "Mile 156.9 - No fee charged. Stay is limited to one night per site, per trip. All sites have a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Purslane Run Hiker-Biker Campsite"),
  ("2EB16A75-677B-4AF6-9237-A6285BE18962", 48.7226099101101, -114.224273295349, "Quartz Creek campground is the smallest campground in Glacier National Park and remains in primitive status all season. It is located on the west side of the park in the North Fork area and is accessed by the Inside North Fork Road, a rough, dusty, dirt road with many blind curves and few pullouts. Trailers are not advised. Tent campers will enjoy a wilderness experience at the campground.", "Quartz Creek"),
  ("E4F0BEC0-D410-41AA-902D-41A539DEA564", 47.6259946274311, -124.017776901915, "Relax in this secluded campground near the Queets River. This campground is only accessible from the Upper Queets River Road due to a past mudslide", "Queets Campground"),
  ("7AFE0D29-866B-4025-A403-3BCE20E4CF32", 40.4956930727, -109.174431587, "Rainbow Park Campground is 28 miles (45 km) from the Quarry Visitor Center in the Utah portion of the monument. It is located on a dirt road that is impassable when wet. The campground sits beside the Green River near the Rainbow Park Boat Ramp at the head of Split Mountain Canyon. Rainbow Park Campground is open year-round, but there is no winter maintenance on the unpaved road.", "Rainbow Park Campground"),
  ("4D753D24-3797-45AA-976C-8419EA35B585", 38.4793732438395, -107.231989784489, "Red Creek Campground is located 19 miles west of Gunnison just north of U.S. Highway 50. There are 2 sites - 1 individual site and 1 group site. The individual site is first-come first-served, and the group site is reservation only. RVs longer than 22 feet are not recommended due to a lack of space to turn around. Elevation: 7542 feet", "Red Creek Campground"),
  ("D182E1F7-4066-45D4-AB4F-9C7E3F9E509C", 63.733359835872776, -148.8940189729629, "Riley Creek is a fairly wooded campground, with some screening between sites whenever possible. Most of the campground sites are open to either tent campers or vehicles / RVs. The proximity of Highway 3 means there is occasional traffic noise, but also means campers have all the conveniences and amenities of the park entrance area, and businesses outside the park, close at hand. Trails leading from the campground connect to the Denali Visitor Center, which is the central hub of trails in the entrance area.", "Riley Creek"),
  ("2940AF6F-D2F2-4AEE-91E3-1D0DDDA7B84B", 29.1801945038, -102.955634488, "Set in a grove of cottonwoods and acacia trees, the Rio Grande Village Campground is located near the Rio Grande. Elevation: 1,850 feet. Paved roads connect each campsite, and grassy areas separate each site. Flush toilets, running water, picnic tables, grills, and some overhead shelters. Dump station nearby. Campers enjoy birdwatching, hiking, exploring. A camp store with showers and a park visitor center are nearby.", "Rio Grande Village Campground"),
  ("6134A1E6-4A8B-473E-9FA5-7DAEEAA3FD14", 29.1831689600897, -102.963812137708, "Open, paved lot with grassy, tree-lined edges. Adjacent to the Rio Grande Village camp store. This campground, operated by Forever Resorts, has the only full hook-ups in the park. 25-site RV park (full hook-ups—water, electrical, and 3-inch sewer connection). All sites are back-in only. Tents are NOT permitted. Operated by the park's concessioner, Forever Resorts. Periodically, a few sites may not be available for a 40' or longer RVs due to the size of the parking lot and orientation of the spaces.", "Rio Grande Village RV"),
  ("02A81AB4-ECCC-4FA1-9A62-1769B1D3850C", 48.6945321731, -113.522684368, "Rising Sun Campground is located just west of St. Mary and halfway along St. Mary Lake. Campers at Rising Sun will enjoy beautiful sunrises in the morning with Red Eagle Mountain as a backdrop, and the campground serves as a convenient base camp to many day hikes located east of Logan Pass. Some sites are open, allowing for cool breezes throughout the day, while others are located among trees, accommodating those seeking some shade and privacy.", "Rising Sun"),
  ("0B61F802-F8D6-46D0-9A2C-708177036C95", 41.0961180995224, -74.9666324999088, "Five (5) Primitive group campsites for parties of up to 15 people per site, in an open area with some trees next to and above the river; drinking water available; minimum of five people required to reserve site. Parking available for up to six vehicles per site.", "Rivers Bend Group Campground"),
  ("C44D4A8E-8C95-4360-BEC8-0C53C6BA4D35", 36.06963726622717, -84.66287612915039, "The Rock Creek Campground, located adjacent to the Nemo area of the Obed Wild & Scenic River, offers 11 spots for campers. A $10 per night fee is charged and reservations are required. You may obtain your reservation by visiting www.recreation.gov and searching for 'Rock Creek Campground - TN'. Reservations are site-specific. The campground has grills and primitive toilet facilities, but no running water.", "Rock Creek Campground"),
  ("9E82C5FE-EB28-41E1-B522-BD593426BE2C", 34.4957176633711, -96.9877970977965, "Located along Rock Creek and near Veterans Lake, this wooded campground is open year round, though some sites within it close seasonally. Built with small travel trailers in mind, this campground is good for primitive camping. No hook ups are available.", "Rock Creek Campground"),
  ("98A4D3E0-4207-4FAC-9B55-FB9942E063FF", 48.14543517120799, -88.48932435367544, "Rock Harbor Campground is located in Rock Harbor on the northeast end of Isle Royale, off of the Rock Harbor and Tobin Harbor Trails. Additional fees for boats to stay overnight at marina. Stay Limit: 1 night from June 1 – September 15 annually. Shelters: 9 Depth at dock (normal conditions): 3’-12’. Access: Foot/canoe/kayak/private boat", "Rock Harbor Campground"),
  ("0158C072-F1F3-4904-98F2-9994BF2F116A", 36.8129880454, -80.349391372, "Located in the Rocky Knob Recreation area, surrounded by 4,000 acres of forest, the campground is ideal for a traditional camping experience. The site offers easy access to the Rock Castle Gorge Trail, a 10.8-mile loop trail ranging in elevation from 1,700 to 3,572 feet. Rock Castle Gorge, a 1,500-foot ravine carved by the waters of Rock Castle Creek, is the focal point of this trail, offering hikers breathtaking scenery.", "Rocky Knob Campground"),
  ("0B3A9971-2BAE-444E-85C1-095D72B7E65F", 32.0874311492369, -90.7988400773636, "Rocky Springs Campground at milepost 54.8 on the southern end of the Parkway, includes a 22-site campground, picnic tables, restrooms, a section of the Old Natchez Trace, self-guiding walking trails through the old town site and the spring. Campground sites are on a first come first served basis, no reservations. Pull-through and back-in sites are available. Campgrounds are typically the busiest during the spring and fall, especially during holiday weekends.", "Rocky Springs Campground, Milepost 54.8"),
  ("2DD0D227-A228-41ED-A2FF-E52FFB3434EB", 35.3647, -101.24451, "This campground consists of ispersed camping along the Canadian River in one of the park's ORV-use areas. ORV operators must have state of Texas Off-Highway Vehicle decal and wear DOT-approved safety gear.", "Rosita Flats"),
  ("5D9FE77F-9C30-4B0C-A0F6-CD60E86B38FB", 29.573599, -100.97746, "The Rough Canyon Campground is a small campground located on the Devils River.", "Rough Canyon Camground"),
  ("C5E40A77-D82E-4B36-8E69-444ED825F332", 37.2795173, -91.4068743, "Round Spring Campground is located near Round Spring, approximately 12 miles north of Eminence on State Highway 19.", "Round Spring Campground"),
  ("A2C6CBD3-2490-40A8-853F-808EFD9C8B0D", 47.0069444, -103.5055556, "Roundup is the park's only camping facility in which horses are permitted. This private campsite is located 12 miles from Medora, ND in the park's South Unit. It is reserved by one group at a time; space is not be shared among different parties. Reservations for Roundup begin each season on the first business day in March at 8:00 am MST. See the RESERVATIONS section below. Roundup can accommodate up to 20 people and 20 horses or 30 people if camping without horses.", "Roundup Group Horse Camp"),
  ("150AF6E6-881A-4420-B535-7B31E3905549", 36.1227472999, -92.5504511998, "Rush Campground is a first come, first serve campground in the lower district of the park. Rush has 12 tent only sites with no electrical amenities and no flush restrooms. Drinking water is available when fees are collected March 15 - November 14. It is free to camp at Rush in the winter. All sites are limited to 6 people per site and each site is $16 per night. This is a pack in/pack out facility, trash collection is not available.", "Rush Campground"),
  ("F08972F9-3943-4003-8499-B0B2EA41A1C7", 33.9830583394153, -116.154390354172, "Ryan Campground has 31 campsites. All campsites are reservation only. The campground is centrally located in the park and is adjacent to the California Riding and Hiking Trail. There are 4 designated equestrian sites and reservations are required. For more equestrian campsites, see Black Rock Campground. There is no water available at Ryan Campground. There are 3 bicycle sites available at $5 per night, with no more than 3 tents and 3 people per campsite.", "Ryan Campground"),
  ("B64B25ED-E087-4E45-BCF7-52A7D494CB18", 39.10560328979322, -108.73257527355514, "Saddlehorn Campground is 4 miles from the west (Fruita) entrance. It is located in an area of pinyon pine and Utah juniper trees, and is within walking distance to the visitor center. Sites cost $22 a night plus entry fee to Monument. Loop A is open year round. Reservations can be made for A and B loops from mid-March through October on recreation.gov. There are flush toilets, but no hookups or dump station. Each site has a picnic table and charcoal grill, no wood fires allowed. RV length limit is 40 feet.", "Saddlehorn Campground"),
  ("2925BA89-CCF3-440F-B987-105578F89025", 43.893146, -102.414254, "Sage Creek Campground is a primitive campground. There is no charge to stay here and camping is available on a first come first serve basis. The campground rarely fills to capacity.", "Sage Creek Campground"),
  ("8E2A7F5B-FD6E-4367-B2E8-CA5C41758EED", 36.8056, -117.7738, "This is a clothing-optional hot spring area approximately 35 miles from the nearest paved road. A high-clearance vehicle and all-terrain tires are necessary to access this campground and road/weather conditions may necessitate 4-wheel drive. This campground is located at 1,375ft, but requires navigating either North Pass at 7,300ft or South Pass at 5,997ft and may be inaccessible due to winter conditions.", "Saline Valley Campground (Primitive)"),
  ("02998E8A-00C5-4873-A437-A0DD07B4F758", 34.0407937961, -120.349462009, "Primitive camping is available (nine sites; $15 per night per site; reservations required). Wind shelter, picnic table, food storage box, and pit toilet are provided. No water is available. Distance from landing to campground is one mile up a steep canyon (400 ft. climb).", "San Miguel Island Campground"),
  ("225E6D27-6AA8-42EE-AE4E-E6C85DE8A8C9", 29.467931458828826, -100.95264780457677, "30 sites suitable for tents or RVs and 5 tent-only sites. No drinking water or hookups available. Campground is accessed via a 1¼ mile graded gravel road. Each site costs $6/night.", "San Pedro Campground"),
  ("1FCF67D3-6986-494F-8031-CE45E1B33796", 63.72255876395471, -149.47374843040546, "Open in summer only (May 20 to mid-September). Sanctuary River is a heavily wooded campground, with screening between most sites. The immediate area is brushy, but nearby mountains offer chances to hike directly from the campground and gain elevation, with views of Denali to the south possible on clear days, after some strenuous up-hill hiking. Sanctuary is tent-only—you will not find any RVs or other vehicles in this campground. It is accessible only by camper bus.", "Sanctuary River"),
  ("5C7C13D2-AF27-47FD-96BE-3800E9D60162", 45.8627572635709, -68.6745398700671, "Located approximately 10 miles from the intersection of Route 11 and Swift Brook Rd. Contains 3 sites.", "Sandbank Stream Campground"),
  ("44ECF5C9-C37D-478C-89A7-0A2ED81162B3", 40.4500495, -73.9950964, "20 tent campsites are available at Sandy Hook for seasonal camping. The season typically runs from mid April through late October.", "Sandy Hook Camp Ground"),
  ("41B38315-53CC-489C-B69D-11DA7878E491", 35.413937, -101.333084, "A caprock campground, overlooking Lake Meredith. 10 RV sites with electric and water hookups available. Reservations can be made by calling 806-865-3131. Picnic tables, shade shelters, and grills are available. Restrooms with potable water, showers, and flush toilets are available. Pull-through parking available.", "Sanford Yake Campground"),
  ("9AF9B28F-F268-4833-9DB5-C7657918720B", 33.4800017206, -119.029461163, "Primitive camping is available (seven sites; $15 per night per site; reservations required). Picnic table, food storage box, and pit toilet are provided. No water is available. Distance from landing to campground is one-quarter mile and includes a steep climb.", "Santa Barbara Island Campground"),
  ("6DAE08E9-80F7-4112-8957-F19B964DAC4E", 34.0110749692, -119.66034054, "The Santa Cruz Island Del Norte Backcountry Campground is currently the only backcountry campground on Santa Cruz Island. The hike to the campground is 3.5 miles from Prisoners Harbor and 12 miles from Scorpion Anchorage. It has four primitive campsites (four persons per site) and users must camp within these designated sites.Reservations are required ($15 per night-per site). A picnic table, food storage box, and pit-style toilet are provided (campers must bring their own toilet paper).", "Santa Cruz Island Del Norte Backcountry Campground"),
  ("574C1E8C-3085-4B3C-A3BE-B24F73B0C685", 34.0480064918, -119.56112541, "Primitive camping is available (25 individual sites at $15 per night-per site and 6 group sites at $40 per night-per site; reservations required). Picnic table, food storage box, potable water, and pit toilet are provided. Distance from landing to campground is one-half mile.", "Santa Cruz Island Scorpion Canyon Campground"),
  ("CC099758-3DE8-4E5A-9C52-892D0F79755F", 33.885295509365314, -120.11494221408148, "Backcountry camping on Santa Rosa Island is currently limited to certain beaches between August 15th and December 31st. Hiking is along the beach and rugged, unsigned (and sometimes unmaintained) dirt roads. The closest beach for camping is 8 miles from the boat/plane drop-off location. Reservations are required ($10 per night-per site). No services are provided.This is primitive, dispersed, backcountry camping. Visitors must backpack to all locations and carry all of their own gear, food and water.", "Santa Rosa Island Backcountry Beach Camping"),
  ("413E7820-D6FA-4C05-933A-FC3E3D6282DC", 33.9918639133255, -120.047413236541, "Primitive camping is available (15 sites; $15 per night per site; reservations required). Wind shelter, picnic table, food storage box, toilet, and potable water are provided. Distance from landing to campground is 1.5 miles from the pier and .25 miles from the airstrip.", "Santa Rosa Island Campground"),
  ("13674F30-F2B4-4254-BD42-036039834FA0", 63.7153041825, -149.261655331, "Open in summer only (May 20 to mid-September). Savage River campground is located at Mile 13 on the Denali Park Road. It sits in a spruce forest, with moderate screening between sites. On clear days, Denali can be seen from a short walk below the campground.", "Savage River"),
  ("B2B52195-15AB-4E9E-B441-0694F4193585", 44.3800630004, -68.0665938, "Schoodic Woods Campground is the newest campground in the park and located 1.5 miles (2.5 km) southeast of Winter Harbor on the Schoodic Peninsula. It is approximately 60-70 minutes from Bar Harbor and other areas of Mount Desert Island.", "Schoodic Woods Campground"),
  ("81E44F0C-24B0-4B53-B526-9F66E46E7299", 30.7636395998859, -81.4637252995094, "Sea Camp Campground is located a half mile from the Sea Camp dock. All sites are walk-to, tent sites and campers are responsible for transporting all gear. Carts can be used. There are flush toilets, drinking water, cold showers, and a dish washing sink. Each site has a fire ring with grill, picnic table and food storage. It is common for this campground to fill up. Permits are $22 a night for individual sites good for up to 6 people. Group sites are $40 a night good for up to 20 people.", "Sea Camp Campground"),
  ("B530C7AD-249F-4632-B78F-3CE8C9F3DBDA", 44.2415646998274, -68.3051438998646, "Seawall Campground is located on the west side of Mount Desert Island about 4 miles (6 km) south of Southwest Harbor. The campground is approximately 18 miles from Bar Harbor. All sites at Seawall are within a short walking distance of the coastline.", "Seawall Campground"),
  ("3322DBC8-A9D9-4C2A-9F79-67AA12670789", 36.7903277233654, -118.672036191053, "This campground is located on Highway 180, is next to Cedar Grove Visitor Center, and is 0.25 miles (400 m) from Cedar Grove Village. The campground is situated in the canyon along the South Fork of the Kings River under open stands of evergreen trees. Services at Cedar Grove Village include food and showers.", "Sentinel Campground"),
  ("C72EDEA2-FA0E-422B-A32A-440F6C48937B", 46.61946398113322, -86.25810096766202, "Sevenmile Creek Group Campground is on the east side of Sevenmile Creek. The North Country Trail guides you over a foot bridge, through the woods and opens up into the group site. It is a wide-open area with access to Lake Superior. One shared fire ring and NO toilet. Water source is Sevenmile Creek and Lake Superior. Lake Superior access for kayakers.", "Sevenmile Creek Group Backpacking Site"),
  ("4C464BE7-AA33-4E3F-BBF8-C731A4BC35D6", 46.619268, -86.258742, "Sevenmile Creek Campground is on the west bank of Sevenmile Creek. The North Country Trail wanders through the campground and past the communal fire ring. The sites are separated by trees, which offer a bit of privacy. Three of the five sites are along the creek. Lake Superior access is on the east side of the creek through the Sevenmile Creek Group Campground. NO toilet. Water source is Sevenmile Creek and Lake Superior. Lake Superior access for kayakers.", "Sevenmile Creek Individual Backpacking Sites"),
  ("9DC67D93-1C46-4A11-99F1-7F66DDC9F78E", 59.6590711, -135.2678594, "Sheep Camp is the last campground on the U.S. side of the trail before (at 13mi, 20.9km). As a result it is a popular campsite in the peak summer months and can be fully booked. Sheep Camp is the location of the National Park Service backcountry ranger station. Each evening a ranger will do a presentation in the campground providing an update on current trail conditions, tips for the trail, and some history of the area. You must purchase a permit to stay at this campground at the Trail Center in Skagway.", "Sheep Camp"),
  ("82A719D5-346C-476E-A819-F10D3363E351", 40.599876224, -122.594808442, "Sheep Camp is nestled in the mixed oak/pine/fir woodlands with nearby access to numerous trails and is a great launching point for treks up the 6,199' Shasta Bally, the highest point in Whiskeytown National Recreation Area. This campsite is closed during the winter. All sites are in partial shade and feature a bear-proof storage locker, picnic table, lamp pole, fire pit with swing-arm BBQ grill, with a shared ADA accessible vault toilet. Each site has a maximum occupancy of six people and two vehicles.", "Sheep Camp"),
  ("E7668917-5D14-4C03-9516-26E3D5A51C38", 36.7921370625, -118.680596692, "Sheep Creek Campground is located on Highway 180, 0.25 miles (400 m) from Cedar Grove Village. The campground is situated on the floor of the canyon beside the confluence of the South Fork of the Kings River and Sheep Creek. Services can be found in Cedar Grove Village.", "Sheep Creek Campground"),
  ("760FD8AD-0493-43CE-8D6F-C58438BD8212", 34.0000909432, -116.120500649, "Sheep Pass Group Campground has 6 group campsites and is centrally located within Joshua Tree National Park and is easily accessible to hiking trails and rock climbing routes. All campsites are by reservation only. It is one of three group campgrounds in the park. Towering rock formations and uniquely-shaped Joshua trees surround the facility. There is no water available in the campground.", "Sheep Pass Group Campground"),
  ("7398124D-9099-4D3B-9B90-EA82EE919960", 31.8887274040177, -104.887056599334, "A wilderness use permit is required for all use of these campsites. If you enjoy arid Chihuahuan desert or you find yourself fascinated by the geology of the Guadalupes, consider a backpack trip to this remote location. Though it is 9.0 miles from Pine Springs trailhead, the elevation gain is much less significant than many of the other trails—though it's by no means flat. Do make sure you are prepared for sun, wind, and weather exposure. The trail is not protected by trees along the way.", "Shumard Canyon Wilderness Campground"),
  ("67AC9C0C-E0E8-406F-88D2-EF0BD3FC471D", 43.8414780508, -110.613486984, "This campground is in an open lodgepole pine forest near the Signal Mountain Lodge. Some sites lie just above Jackson Lake, and other sites are a short walk from the lake. Enjoy spectacular views of Mount Moran and the northern Teton Range. The campground accepts both tents and smaller RVs (up to 30 feet total length). The developed area offers a wide variety of services and amenities including lodging, restaurants, showers, laundry, and marina. Maximum stay is 14 nights.", "Signal Mountain Campground"),
  ("5FEDA142-5FE2-4F88-92A4-951C1C78EEBE", 47.890444970478676, -88.99876148310005, "Siskiwit Bay Campground is located in Siskiwit Bay on the southwest end of Isle Royale National Park, off of the Island Mine and Feldtmann Ridge Trails. Boats can overnight at dock. Stay Limit: 3 nights from June 1 to Labor Day annually. Shelters: 2 Depth at dock (normal conditions): 2’-6’. Access: Foot/canoe/kayak/private boat", "Siskiwit Bay Campground"),
  ("8F3F1AE3-1B25-4E83-9662-C76E3EF0A06A", 38.0399151096, -122.82882744, "Sky Campground is located on the western side of Mount Wittenberg at an elevation of 1025 feet. In clear weather, it has a sweeping view of Point Reyes, Drakes Bay, and the Pacific Ocean. It is a steep 4-mile hike down to the beach. One may access Sky Campground by foot, bicycle, or horse; not by boat, auto, or RV. The easiest and shortest approach is a 1.4-mile moderate uphill hike or bicycle ride from the Sky Trailhead (elevation 680 feet) via Sky Trail. There are 11 regular sites and one group site.", "Sky Campground"),
  ("827FE6FC-C9A3-4543-93A5-F3150E009DDF", 44.94884664880159, -110.30687918305057, "CLOSED FOR 2022. Near some of the best wildlife watching opportunities in the park. Located at the end of a two mile dirt road, this campground is best suited for tents and small RVs. There are plenty of hiking and fishing opportunities in the area, including the Slough Creek Trail which begins nearby. Nighttime offers a quiet, unimpeded view of the stars and the possibility of hearing wolves howl. Elevation: 6,250 ft (1905 m). This is a reservable campground run by the National Park Service.", "Slough Creek Campground"),
  ("5EC50DAF-A871-466C-80B6-9729BDBF090B", 35.55645004606256, -83.31162547281389, "Smokemont Campground - elevation 2,200 feet (671m) - offers 141 sites in a forested area. Whether blanketed in bright spring wildflowers or vivid fall colors, the scenery at Smokemont never disappoints. Characterized by mild winters and hot, humid summers, Smokemont Campground offers an unforgettable outdoor experience with campsites for both tents and RVs.", "Smokemont Campground"),
  ("30033AFC-D90E-4B30-BDFC-6495D2B9CB64", 35.5598078457, -83.3128015734, "Mountain ranges and pristine streams and rivers are the backdrop for your camping adventure in Smokemont. Whether blanketed in spring wildflowers or vivid fall colors, the scenery at Smokemont never disappoints. At 2,200 feet, Smokemont provides a moderate climate, characterized by mild winters and hot, humid summers. Smokemont Campground offers an unforgettable outdoor experience with campsites for tents as well as RVs.", "Smokemont Group Campground"),
  ("5541512A-EAA8-472F-9B88-2435CCD0087F", 42.0755503036454, -113.651634013004, "There are 38 campsites available, 9 of which are pull-through. Sites 11 and 24 are designated ADA accessible. A separate loop with 6 sites accommodates equestrian campers. - water service May-September - 30 amp electrical hook-ups - fire-ring/ground grill - picnic table - partial shade There are flush toilets and showers open May-September and a vault toilet open year-round at the equestrian trail head. An RV dump station is provided near the campground entrance.", "Smoky Mountain Campground"),
  ("A512F2E3-3925-43C5-9743-6B2A9B782DDA", 48.7337074263939, -118.060418094258, "Snag Cove is a small, fairly isolated campground located on the western side of Lake Roosevelt. Eight out of the nine sites are on the lake shore and all sites are open to tents and RVs. A boat launch with trailer parking and courtesy dock frames one side of the campground. Because of its size and popularity, Snag Cove often fills in the summer.", "Snag Cove Campground"),
  ("36B920F7-7D13-4D94-9129-E9701FE02DFB", 38.925381, -114.251512, "Make yourself at home in the Snake Creek Campsites along the Snake Creek River, located on the south-eastern side of the park. These sites are nestled among Aspen groves and at the base of impressive limestone cliffs. Sites to choose from include, Monkey Rock, Squirrel Springs, Pinnacles, Eagle Peak. The Shoshone and Johnson Lake trail sites are a short 0.5 mile hike from the parking lot at the end of the Snake Creek Road.", "Snake Creek Primitive Campgrounds"),
  ("CFA62A52-1B27-4211-803E-07FFD2CBF0B8", 39.57169900000001, -78.45321300000002, "Mile 154.1 - No fee charged. Stay is limited to one night per site, per trip. All sites have a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Sorrel Ridge Hiker-Biker Campsite"),
  ("061815D1-A285-4DF5-9079-32F6B4990CF5", 47.5660233967878, -124.361387859395, "Positioned on a bluff overlooking the Pacific Ocean, South Beach offers panoramic ocean views and beach access.", "South Beach Campground"),
  ("BC2D51FF-DE4E-407C-86B3-3470BE11BBAF", 37.203742599284524, -112.98419155753885, "South Campground is located near the Zion Canyon Visitor Center, ½ mile from the South Entrance at Springdale, Utah. Tent, dry RV, and group campsites are available by reservation from March through October. All sites include a place for a tent or RV, a picnic table, and a fire ring. Reservations may be made 14 days in advance of your stay. Reservations are needed because the campground is full nearly every night during the reservation season.", "South Campground"),
  ("AF84F9D4-0115-4F06-9D20-8108F2CF44E2", 34.76055561111111, -76.41222219444445, "Dispersed camping along the ocean beach of this 20 mile long barrier island -- this is backcountry-style camping -- all camping is done directly on the ocean beach, there are no camp sites. This area is reached only by ferry. Both tent camping and vehicle camping is allowed. Vehicles -- 4x4 highly recommended -- must be able to drive on the soft sand of the beach and the sand trail behind the dunes known as the 'back road'. There are no hard surfaces on the island. Practice Leave No Trace principles.", "South Core Banks -- Beach camping"),
  ("E8221D31-0B2B-4606-9061-1F91794AD45A", 36.3499844275717, -118.765469823923, "This small, primitive campground is situated in a remote area of the foothills on the South Fork of the Kaweah River at the transition from oaks to evergreens. Two trails leave from a trailhead nearby: the Garfield Grove and Ladybug trails. Other park features are over an hour's drive away. There is no potable water here. Trailers and RVs are not permitted.", "South Fork Campground"),
  ("E39D6E00-78C0-445C-BBDB-EF9D9CD25BE2", 47.970686098959334, -88.97153792382892, "South Lake Desor Campground is located inland on the south side of Lake Desor off of the Greenstone Ridge Trail. There is no canoe/kayak/boat access. Stay Limit: 2 nights effective from June 1 – Labor Day. Access: Foot", "South Lake Desor Campground"),
  ("1E5A64AC-1AA7-43EA-88DB-87DCE1DA6C11", 38.54381032355281, -107.689424061934, "The South Rim Campground is located one mile from the South Rim Visitor Center. Reservations may be made on recreation.gov for mid May to mid September, and it is first-come, first served after that. Sites are fairly close together, and are partially shaded by gambel oak and serviceberry bushes. Only Loop B offers 20 and 30 amp electric hookups. During the warm season, drinking water is available, but there are no showers or dish cleaning stations.", "South Rim Campground"),
  ("2FBEED6C-9CD6-4DBE-A532-5F73F4B4A361", 40.4366004217, -121.532640953, "The Southwest Walk-in Campground is located on the east side of the Kohm Yah-mah-nee Visitor Center parking area. A short walk along a paved walkway provides easy access to each site. When snow is on the ground (approximately Nov-May), the location of the Southwest Campground changes to an over-the-snow area south of the Kohm Yah-mah-nee Visitor Center parking area. Winter camping registration is located at the fee booth located south of the parking area.", "Southwest Walk-In Campground"),
  ("8E2351CD-649C-41C3-B1EA-5EDE58F33CDD", 40.4405279561, -109.252312611, "The Split Mountain Group Campground is located along the banks of the Green River at an elevation of 4800 feet (1463 m) near the foot of Split Mountain. The campground is 5 miles (8 km) from the dinosaur quarry, where you can see 150 million year old dinosaur bones encased in the rock. Beside the campground is the Split Mountain Boat Ramp where rafters and boaters come off the Green River. During the off season, when the Green River Campground is closed, the Split Mountain Campground is open to all campers.", "Split Mountain Group Campground"),
  ("2ABC98CE-A9E8-438C-8BDA-2935B0224BB4", 48.605617416126826, -113.88541339633849, "Beginning in summer 2022, a reservation will be needed to camp at Sprague Creek Campground. Sprague Creek is a small campground located on the northeast shore of Lake McDonald, just off Going-to-the-Sun Road. Towed units and RVs exceeding 21 feet are not permitted in this campground. The campground is located within trees, providing shade during warm summers. Some sites near the shore have unobstructed views of Lake McDonald.", "Sprague Creek Campground"),
  ("94A86C9F-730D-42C1-BAD9-DCA321B9E3E2", 47.933040826786495, -118.94004952739897, "Spring Canyon Campground stair-steps down the hillside to Lake Roosevelt, offering sweeping views of the lake and surrounding landscape. The open desert environment also means little shade and extremely hot temperatures in the summer. Spring Canyon is conveniently located near the towns of Grand Coulee and Coulee Dam, as well as the Grand Coulee Dam. The campground offers a Day Use Area, group sites, and a nearby boat launch.", "Spring Canyon Campground"),
  ("45092D7D-C58F-41C1-BD94-FB0CAA127E53", 47.934625, -118.94087, "The Spring Canyon group sites are located at the base of Spring Canyon Campground, offering sweeping views of the lake and surrounding landscape. The open desert landscape also means little shade and extremely hot temperatures in the summer. Spring Canyon has two group sites and each can hold up to 25 people. Spring Canyon is conveniently located near the town of Grand Coulee and the Grand Coulee Dam.", "Spring Canyon Group Sites"),
  ("517BA74F-FFC6-4B85-AF59-0DF4FBF65899", 36.0299778999, -92.5844677011, "Spring Creek Campground is a first come, first serve campground near Harriet, AR. Spring Creek has 12 tent only sites with no electrical amenities, no flush restrooms, and no water.", "Spring Creek Campground"),
  ("4A654434-3AE1-449D-BD18-DD1C98688685", 39.564844337461764, -78.71788171349304, "Mile 173.3 (Allegany County, MD) - Spring Gap Campground offers 12 single drive-in campsites and two drive-in group sites. Campsites 1, 2, 8, 11 and 13 can fit a single vehicle (i.e., car/pickup/van). Campsites 3-7, 12, 14 can fit a small 20 ft. or less RV/trailer/pop-up. Single sites can accommodate up to eight people. Each single has a picnic table, fire pit and grill. Campsites 9 and 10 are group sites capable of holding 30 people each. The group site has room for two vehicles.", "Spring Gap Campground"),
  ("8FFC1412-19CB-4AE7-9860-2BBC36799440", 32.204179, -110.532126, "- 7,400 - 3 campsites (6 people max per site)", "Spud Rock Spring"),
  ("BB3E9361-0E41-4CF7-ADCC-AA19234877FD", 29.550551582208, -101.020437230493, "6 sites suitable for tents or RVs. No drinking water or hookups available.", "Spur 406 Campground"),
  ("E4607DC5-8154-4BE3-989D-66FAE589B686", 48.7516790329555, -113.44240520291879, "St. Mary campground is the largest campground on the east side of Glacier National Park and is open year round. Activities such as interpretive programs, book sales, and shuttle service tours are located at the nearby St. Mary Visitor Center. St. Mary is one of the campgrounds in the park that take reservations for part of the summer. Though shade may be sparse, aspen trees grace St. Mary campground with soothing sounds from spring and summer breezes, and colorful splashes of yellow late in the season.", "St. Mary"),
  ("454AA69A-21A7-4825-8240-C47CE1422934", 30.80667, -81.45139, "Stafford Beach Campground requires a three and a half mile hike from Sea Camp. All sites are walk-to, tent sites and campers are responsible for transporting all gear. Carts of any kind or wheeled coolers cannot be used to haul gear. The site has flush toilets, cold showers, and water spigots with potable water. The sites include fire rings with grills. Food storage lockers (bear boxes) are available. Sites are $12 a night, good for up to 6 people.", "Stafford Beach Campground"),
  ("B4603AC8-E7B9-46B2-B717-A8C8183562F8", 46.0872701025, -68.7779046814, "A primitive campsite located near the portage trail for Stair Falls. The campsite can be reached by a 2-mile hike from Haskell Gate or by paddling down the East Branch Penobscot River.", "Stair Falls Campsite"),
  ("368E0896-3B0D-4331-8882-5FBABBEF7739", 47.5153731343, -123.32966806, "Camp near the Skokomish River and enjoy old-growth forest at Staircase. Summer ranger programs and riverside campsites available.", "Staircase Campground"),
  ("694F54CD-F504-4E78-AE02-27FB53F2A48E", 37.498985, -110.699117, "Designated primitive camping areas that are accessible by vehicle and sometimes by vessel as well. First-come first served, no reservations. No designated sites. No potable water. When pit toilets are unavailable, campers must bring portable toilets for use and proper disposal into the sewer system.", "Stanton Creek Primitive Camping Area"),
  ("C8AA0A50-B50A-44C4-8535-84277F7160DA", 36.5458497459104, -84.6352172739667, "This campground contains 24 developed campsites. Each site offers water and electricity, tables, grills, tie-outs for 4 horses, access to modern restrooms with hot showers, a dump station and access miles of horse trails. Station Camp Campground is located on station Camp Road approximately 4.5 miles from the intersection of Coopertown Road and Leatherwood Road . The fee rate per night is $28.00 (half price for holders of the Interagency Access/Senior Passes).", "Station Camp Campground"),
  ("3EA23346-5C4D-4E01-A4E0-748033E92446", 36.0400288995, -93.3463188996, "Steel Creek has 26 tent only sites and 14 sites for campers with horses/stock animals (six people and four stock animals allowed per site). Tent sites 1 -13 and horse sites 27 - 32 are available for reservation at www.recreation.gov or by calling 1-877-444-6777. Reservations can be made 5 days to six months in advance. There are no electrical amenities or water hookups, but flush restrooms and water spigots are available from March 15 through November 14.", "Steel Creek Campground"),
  ("103C0AB5-429C-4AF9-AEC1-B645228FD967", 38.4869233764467, -107.09112479954, "The campground is located 12 miles west of Gunnison on U.S. Highway 50 on the shore of Blue Mesa Reservoir. Tents to large RVs can be accommodated. The 53 sites are surrounded by sage and rabbitbrush. There is no natural shade. We recommend making reservations at recreation.gov (mid-May to mid-Sept) because cell service and first-come, first-served sites may be unavailable. Only Loop B is first-come, first-served. Elevation: 7540 feet", "Stevens Creek Campground"),
  ("010134D2-1B0F-4A1E-85FF-53137A8996CF", 39.583598999999985, -78.397693, "Mile 149.4 - No fee charged. Stay is limited to one night per site, per trip. All sites have a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Stickpile Hill Hiker-Biker Campsite"),
  ("A8E8F0C6-9CF3-4E0A-AD89-A8C23990B1E2", 37.933636, -81.06380000000001, "Located off Route 25 near Thurmond. This campground features 6 walk-in and 1 vehicle site. The Stone Cliff Trailhead also starts at the campground.", "Stone Cliff"),
  ("F3361651-FFA0-4671-B15E-FF496B65EA98", 36.60788587502186, -117.14811604212173, "Open seasonally starting October 15th at noon. First come, first served campground located at sea level. The Stovepipe Wells campground has views of Death Valley proper and of the Mesquite Flat Sand Dunes. It is adjacent to the Stovepipe Wells general store, ranger station, and a privately operated RV park. Fee is paid at the pay station at the front of the campground.", "Stovepipe Wells Campground"),
  ("E641DC39-3D00-4AFB-8E7E-EFDFE9433AB5", 40.4946207961, -121.424949424, "Summit Lake North Campground is located on the north side of Summit Lake at about the middle point of the 30-mile park highway. The campground includes loop A and B. Additional campsites are located in three loops on the south side of the lake in Summit Lake South Campground. A picnic area is located on the shore and features a swimming area, picnic tables, and day use parking.", "Summit Lake North Campground"),
  ("D7B03A9E-7B8F-4515-9F1A-B315CB260FC5", 40.4904121913623, -121.424648255834, "Summit Lake South Campground is located on the south side of Summit Lake at about the middle point of the 30-mile park highway. The campground contains loops C, D, and E (tents only). Additional campsites are located in two loops on the north side of the lake in Summit Lake North Campground.", "Summit Lake South Campground"),
  ("1C8ED3AF-8ABC-478A-A5AB-C8BB7098431E", 36.45884381173803, -116.86381852830158, "Open seasonally starting October 24th at noon. First come, first served, large campground that rarely fills. This location has little to no vegetation and is comprised of desert gravels. Car and tent camping is permitted however each site DOES NOT offer a firegrate or picnic table. Campfires are not allowed in Sunset except at a few designated public areas within the campground. Fee is paid at the pay station in the campground.", "Sunset Campground"),
  ("99CA90B7-E669-41EE-8744-2BBF8215C2A8", 37.6222868282, -112.174839007, "Located west of Sunset Point, approximately 1.5 miles south of the Bryce Canyon Visitor Center, and is comprised of 99 sites in 3 loops; Loop A is primarily for RVs; Loops B & C are tent-only. There are no sewer, water or electrical hook-ups available. A dump station is available in summer months near North Campground; use is included with campsite fee. Potable water is available near the dump station. Sunset Campground is close to Sunset Point and has a shuttle stop at its entrance.", "Sunset Campground"),
  ("21432CAA-2722-40B3-A56B-C7F90A8F1467", 36.7373684358, -118.965180289, "Sunset Campground is located 3 miles (5 km) from Kings Canyon Park entrance. The campground is located near Grant Grove Village in an open stand of evergreens. Services can be found in Grant Grove Village. A park amphitheater is located here and occasionally offers park programs.", "Sunset Campground"),
  ("D60009AE-31AB-4905-B182-6F5D6D11742D", 36.6756921508332, -110.542683230592, "Sunset View Campground has 31 sites and open all year round.", "Sunset View Campground"),
  ("55615849-4767-4B24-81BA-F9D651BDDE7F", 39.03100200000001, -77.244579, "Mile 16.6 - No fee charged. Stay is limited to one night per site, per trip. All sites have a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Swains Lock Hiker-Biker Campsite"),
  ("88397D32-BCEE-494E-8305-3BB22143019B", 37.7517175326, -119.736234028, "Tamarack Flat Campground is located off the Tioga Road just east of Crane Flat. The campground is approximately 20 miles (45 minutes) from Yosemite Valley and is tucked away in the forest 3 miles off Tioga Road. RVs and Trailers are not recommended for this harder to access, and more primitive campground. At an elevation of 6,300 feet (1,900 m) elevation, the campground is near Tamarack Creek, which is the only water source (must be filtered, treated, or boiled). There is a gas station nearby at Crane Flat.", "Tamarack Flat Campground"),
  ("A3196D33-288F-4484-A075-33B8D2695937", 31.9368597503931, -104.850488488205, "A wilderness use permit is required for all use of these campsites. The extra distance to the Tejas Wilderness Campground is worth the time for those who wish to stay in a more densely forested surrounding. The tall trees provide deep shade in the morning and late afternoon and protection from high winds aloft. Centrally located, the Tejas campground is 5.5 miles from Pine Springs trailhead or 6.2 miles from Dog Canyon.", "Tejas Wilderness Campground"),
  ("6C239EBB-CDA7-4D9E-8AE0-D31446911917", 63.6704983524783, -149.580973783265, "Open in summer only (May 20 to mid-September). Though nearly all private vehicles must turn around at mile 15, Savage River, Tek campers are an exception to that rule. If you wish, you may drive your vehicle / RV to Tek. The trade-off is that you must make, at minimum, a three-night stay, and your vehicle must stay in your campsite for the duration of your stay, while you use transit buses to sightsee. Tent campers using the park bus system to reach Tek are not subject to the 3-night minimum stay.", "Teklanika River"),
  ("3A3A571D-14D7-4939-91A2-026756CFC2A7", 36.03031828993541, -114.32485227007857, "Enjoy the Temple Bar area by land or water. Hike through the desert along the Temple View Trail to observe the crystal blue waters of Lake Mead and the natural temple that changes colors throughout the day. Launch your own boat or rent one from the marina. You can also dine at the seasonal cafe, or grab a variety of snacks, drinks and charcoal from the store.", "Temple Bar Campground (Lake Mead)"),
  ("D746FA26-C749-405F-856B-07F482EF7CC2", 36.03413715620238, -114.32279284224819, "Just 75 miles away from Las Vegas, Temple Bar Marina is located in the Temple Basin on the Arizona side of eastern Lake Mead. It’s the closest marina for Arizonans who want to get away from the more populated Boulder Basin area of Lake Mead. The RV Park at Temple Bar Marina is a perfect location for enjoying the lake and all its recreational activities.", "Temple Bar RV Park (Lake Mead)"),
  ("5730203B-95D6-4866-91EE-09D3B2107D1B", 36.458898938475265, -116.8526669453492, "Open seasonally starting October 15th at noon. First come, first served campground located in the hills above Furnace Creek. Great views and some trees. No generators allowed. Each site has a firegrate and picnic table. Fee is paid at pay station at the front of the campground.", "Texas Springs Campground"),
  ("81FD44D4-DA33-4E58-A317-3CAA2573EBD8", 37.902, -81.032211, "Thayer has 4 walk-in sites upstream from the Slater Creek Crossing. Alcohol is prohibited. Take Route 25 from Glen Jean for six miles towards Thurmond. Turn right at the intersection just before the bridge across the river and continue towards Stone Cliff. At Stone Cliff, cross the New River bridge and continue upstream on Route 25 (which becomes unpaved at this point) towards Thayer. At Thayer Church, turn downhill off Route 25 to the bottom. Cross the railroad tracks and turn left towards the campground.", "Thayer Campground"),
  ("C06B2E84-8426-4696-A511-18B171465F1B", 37.022068, -76.298918, "With 47 campsites, 22 with full hookups, the Colonies RV and Travel Park is a great place to experience all Fort Monroe and the surrounding area have to offer. Amenities include a country store, clubhouse with kitchen, game room, and TV room.", "The Colonies RV and Travel Park"),
  ("73BA2645-DCEB-49C6-B3B6-7056FC1FD734", 38.1464920023084, -109.801330606314, "The Needles Campground has 26 individual sites, plus 3 group sites in different locations around The Needles district. Nightly camping fee for an individual site is $20. You can reserve some individual sites spring through fall. Other times of the year, individual sites are first-come, first-served. You can also reserve group sites for nights between mid-March and mid-November. There are toilets, picnic tables, and fire rings in the campground.", "The Needles Campground"),
  ("EC2CFFFC-1EF2-4D95-B812-699AEB0DBEF5", 34.4595338826992, -97.0192284846189, "The Point Campground is open year round. It has a combination of sites with and without RV hook-ups. The Upper Loop is available by reservation only. The Lower Loop is first come, first served. Located near the shor of Lake of the Arbuckles and The Point Boat Launch.", "The Point Campground"),
  ("DF55B96A-D2A8-4DF7-8D54-75BD36C266E2", 36.236917, -117.072172, "First come / first served primitive, forested campground with no additional fee located at 7,400' elevation. Accessible to high clearance vehicles (no longer than 25'), and 4x4 may be necessary.", "Thorndike Campground (Primitive)"),
  ("1E8F227A-243A-4171-A9CC-8320471896C2", 48.12385213393805, -88.52961948526877, "Three Mile Campground is located on Rock Harbor Channel off of the Rock Harbor and Mount Franklin Trails. Boats can overnight at dock. Stay Limit: 1 night effective June 1 – September 17 annually Shelters: 8 Depth at dock (normal conditions): 9’ Access: Foot/canoe/kayak/private boat", "Three Mile Campground"),
  ("F7965B87-3035-49D4-B55A-D55D6CAD0C93", 40.379225136469785, -105.85275135737629, "Timber Creek Campground is the only campground on the west side of the park. Located at 8900 feet (3000 m) along the Colorado River about eight miles north of the Grand Lake entrance to Rocky Mountain National Park. Timber Creek Campground is a reservation only campground. To book a campsite, visit www.recreation.gov. Timber Creek Campground is a seasonal campground and will close for the 2022 season on September 28 at noon.", "Timber Creek Campground"),
  ("7EAD356B-38CC-48FC-8139-8729BC4CC5F1", 48.05080649877427, -88.82111715996166, "Todd Harbor Campground is located in Todd Harbor on the north shore of Isle Royale National Park, off of the Minong Ridge Trail. Boats can overnight at dock. Stay Limit: 3 nights from June 1 – Labor Day annually. Shelters: 1 Depth at dock (normal conditions): 2’. Access: Foot/canoe/kayak/private boat", "Todd Harbor Campground"),
  ("18007353-02EB-4352-A8A3-08E39A1A5D8F", 38.163318, -122.915392, "Tomales Bay boat-in camping is allowed on west-side National Park beaches north of Tomales Bay State Park's northern border (i.e., north of Indian Beach and Duck Cove). These beaches are tidally influenced and generally are small sandy coves backed against steep cliffs. Campers on Tomales Bay beaches must arrive by boat and may not hike, bike, or ride horses to the beaches. Twenty permits are available each day—9 for parties of 1 to 6 people, 8 for parties of 7 to 14, and 3 for parties of 15 to 25.", "Tomales Bay Boat-in Camping"),
  ("124FB583-CC05-4366-9644-EDA43BF6B75B", 48.12939102951485, -88.5032933491924, "Tookers Island Campground is located on Tookers Island in Rock Harbor Channel. Boats can overnight at dock. Stay Limit: 3 nights from June 1 – Labor Day annually. Shelters: 2 Depth at dock (normal conditions): 7’ Access: Canoe/kayak/private boat", "Tookers Island Campground"),
  ("6CB8E14E-8C58-414A-A764-CB117EB34B8C", 44.8895498483, -110.389475883, "Tower Fall Campground—elevation 6,600 feet (2012 m)—is located on the north side of the steep, winding, road to Dunraven Pass. The campground is near the Tower General Store and Tower Fall. The Lamar Valley, with spectacular wildlife viewing opportunities, is located nearby as are several hiking trails. Roosevelt Lodge, a short drive from the campground, offers dining and horseback riding. This is a reservable campground run by the National Park Service.", "Tower Fall Campground"),
  ("93F1B7C1-041B-4F7B-8E75-D0C35CA6CAE2", 39.52446099999999, -78.538643, "Mile 162.1 - No fee charged. Stay is limited to one night per site, per trip. All sites have a chemical toilet, water, a picnic table, and grill. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from November 15 to April 15 each year.", "Town Creek Hiker-Biker Campsite"),
  ("DF0F45FB-FEE4-47A9-ACD4-63E3DC9BF9DA", 36.052812, -112.115001, "Trailer Village is the only in-park RV campground with full hookups (sewage, water, and electrical with 30 amp and 50 amp sites available) Open year-round, Trailer Village features paved pull-through sites which can accommodate vehicles up to 50 feet long. Trailer Village is operated by Delaware North. Reservations can be made up to 13 months in advance. If visiting during the busy season (May through October) making reservations 1 year in advance is recommend. Visit their website to make reservations.", "Trailer Village RV Park - South Rim"),
  ("DF092FA4-F3AB-4BC7-91B3-DB65FB71114B", 46.5876435919, -86.3154888155, "Trappers Lake Group Campground is a little over a mile inland from the North Country Trail and 0.2 miles east of Trappers Lake Campground. It is on the north shore of Trappers Lake in the Beaver Basin Wilderness. One shared fire ring and pit toilet. Water source is Trappers Lake. This is a hike-in campground only; kayakers cannot access this campground.", "Trappers Lake Group Backpacking Site"),
  ("B1FD9610-9535-46B7-901A-5B230DBAC3E5", 46.586517, -86.316522, "Trappers Lake Campground is in the heart of the Beaver Basin Wilderness. The five campsites are on the north shore of Trappers Lake. This campground is a quiet hideaway located about one mile inland from the North Country Trail. One shared fire ring and pit toilet. Water source is Trappers Lake. This is a hike-in campground only; kayakers cannot access this campground.", "Trappers Lake Individual Backpacking Sites"),
  ("793AAB2C-885E-44F7-A0A1-D64B37291338", 37.8744752916, -119.353650884, "Tuolumne Meadows Campground is Yosemite’s largest, and is located along the Tioga Road, with some areas located close to the Tuolumne River. At 8,000 feet (2,600 m) this campground is open seasonally and has wonderful summer access to many hikes, lakes, and prominent viewpoints. The campground is located approximately 1 hour and 30 minutes from Yosemite Valley but a small store, grill, and post office are located nearby in Tuolumne Meadows.", "Tuolumne Meadows Campground"),
  ("456366E0-A589-4C3A-8468-15CAAC114C0B", 38.581601403, -77.372747344, "Turkey Run Ridge Group Campground (tents only) is designed for groups of people. Families and individuals are encouraged to use Oak Ridge Campground instead. Turkey Run is a 9-site campground with restrooms (no showers), grated fire pits, and picnic tables. Three sites hold a maximum of 40 people. Six sites hold a maximum of 25 people. Parking is available. Alcohol and pets prohibited at Turkey Run Ridge Group Campground. You can reserve your spot at on www.recreation.gov or call 877-444-6777.", "Turkey Run Ridge Group Campground"),
  ("6003817A-3C71-4406-A59E-ECB38F3AE724", 39.13928799999999, -77.51567299999999, "Mile 34.4 - Hiker-biker campgrounds are located along the towpath approximately every 5-7 miles. No fee or reservation required. Overnight stays are limited to one night. All sites include a chemical toilet, picnic table, grill, and drinking water. Please Note: Potable water may not be available at each campsite. Water is treated with iodine. Please plan to have water purification tablets with you. Water is turned off from mid-November to mid-April each year.", "Turtle Run Hiker-Biker Campsite"),
  ("8F9F7BD4-CA1C-42DB-948A-B3CABF750037", 46.6408, -86.21583, "The campground's 36 sites are located on a high sandy plateau above Twelvemile Beach on Lake Superior. Some sites have a lake view. There are two disabled-accessible campsites. Generator use is prohibited in the campground's west loop. There are three sets of stairs to the beach. The North Country National Scenic Trail treks through the campground. The 2-mile White Birch Nature Trail begins and ends here. The campground is open by reservation only, mid-May through mid-October. Leashed pets allowed.", "Twelvemile Beach Campground"),
  ("8DF34653-E2E5-4716-A58E-8856AC14C242", 31.9406810816067, -112.810941742389, "Twin Peaks Campground is the main, developed campground at Organ Pipe Cactus National Monument, located 1.5 miles from the Kris Eggle Visitor Center and Highway 85. Twin Peaks Campground has 34 tent-only sites and 174 sites for RVs. Several sites can accommodate RVs up to 45 feet in length. Restrooms have running water and a few have solar showers. Hookups for electricity, water, or sewer are not available. A dump station, with potable water is located past the last row of campsites.", "Twin Peaks Campground"),
  ("3A770067-D79E-413F-AF38-D879707B79B6", 48.492114971, -113.36407124, "Two Medicine is approximately 13 miles from East Glacier. Sites are on a first-come, first-serve basis. Sites within the campground at are generally shaded by trees, and offer some privacy from other campers. Boat tours and Red Bus tours can be found at Two Medicine. There are numerous day hiking opportunities available, including a handicap accessible trail to Running Eagle Falls. The campground remains open in late-September for primitive camping with no running water or flush toilets.", "Two Medicine"),
  ("0EDCA7B8-76C4-4D1B-8B8A-F9549DCC256D", 37.189929, -91.276297, "Two Rivers Campground is located at the confluence of the Jacks Fork and Current Rivers, at the end of V Highway off State Highway 106 in Shannon County, MO.", "Two Rivers Campground"),
  ("DC5B8982-C3B5-40A4-B5C1-BE320C39F637", 35.9868835993, -92.7595278001, "Tyler Bend Campground is a developed campground in the middle district of the park. It has 28 drive-in sites, 10 walk-in sites, 5 group sites and a pavilion. The campground has flush restrooms, showers, dump station, potable water, but no electrical amenities. Reservations are available at www.recreation.gov (1-877-444-6777) for some sites. Fees are charged March 15 through November 14. It is free to camp November 15 through March 14, but limited amenities are available during that time.", "Tyler Bend Campground"),
  ("EFA96348-96DA-4AC5-AED7-78C4F84C6512", 46.113820001804086, -68.79790999965547, "Walk-in campsite along the East Branch of the Penobscot River.", "Upper East Branch Campsite"),
  ("F872CA6C-B7FA-405C-BDB6-81D75972C9F2", 48.683276868130136, -121.27077652544762, "Upper Goodell Group Campground is a convenient campground on the banks of Goodell Creek. The group site has tent pads, a pavilion with picnic tables, and a fire grate. Maximum capacity is 30 people (10 vehicles). Upper Goodell cannot accommodate RV's. Vault toilets and garbage service is provided. There are no hook-ups or potable water.", "Upper Goodell Creek Group Campsite"),
  ("BE18116D-35DF-4187-8B8C-D86810C17899", 39.0136, -114.24776, "Whether you prefer the rich smell of summer mahogany riding air currents blended with the vanilla of ponderosa pine, or the sound of a clear mountain stream babbling beneath a symphony of swaying white fir, you won't regret your stay at Upper Lehman Campground. At 7500 feet in elevation and 3 miles up the Wheeler Peak Scenic Drive a stay at Upper Lehman is just a brief cruise from high alpine trails that will take you into the heart of the Snake Range.", "Upper Lehman Campground"),
  ("9D5B57D0-793A-4C2B-B620-5B561EDFC031", 37.7384294727, -119.564411225, "Upper Pines is located near the Merced River in Yosemite Valley. Yosemite Valley is centrally located in the park and boasts some of Yosemite’s most iconic features. This large campground is located at 4,000 feet (1,219 m) elevation and can be accessed from all park roads. Upper Pines is within biking and walking distance of many services and trailheads in Yosemite Valley and is located on the free shuttle route. There are food and grocery services nearby at Curry Village and Yosemite Village.", "Upper Pines Campground"),
  ("3AD1C657-F432-4C3E-9409-5F0FB6A4E8BD", 33.2304987885, -108.260995929, "Upper Scorpion Campground provides primitive camping opportunities within walking distance of the West Fork of the Gila River. The campground is located less than one mile from the Gila Cliff Dwellings National Monument just off NM State Highway 15. Drinking water is available, and tables and grills are provided at select sites. Vault toilets are available on site. Camping is free of charge and first-come, first-served. This campground does not support RVs or Camper Vans.", "Upper Scorpion Campground"),
  ("023C3AE0-CA2D-42B0-8F0A-A3106336BFAA", 41.1156191003, -74.9637757011, "Currently Closed Primitive group campsites in an open area with some trees next to the river; drinking water available; minimum of five people required to reserve site. Only Site One is handicap accessible.", "Valley View Group Campground"),
  ("CD57926C-D569-489B-8A4B-F528D026DE75", 45.1281213, -85.9775979, "The small Village Campground contains eight first-come, first-served designated campsites, two fire rings and one outhouse. There is a limit of two tents and four people per site. Fires are permitted in the community fire rings at the Village Campground.", "Village Campground - North Manitou Island"),
  ("97FC7F59-6472-4AB6-A411-A7E6874680BD", 36.9967066553, -111.499386112, "112 dry campsites (no hook-ups), 90 full hook-ups, and 6 group camping sites. Facilities include restrooms, laundry, showers, store, phones, dump station and potable water. The amphitheater, picnic area and swim beach are nearby. To make reservations for full hook-ups, group or dry camping please visit www.lakepowell.com or call 800-528-6154. The Wahweap camping store is 928-645-1059. Fees vary.", "Wahweap Campground & RV Park"),
  ("4072160F-820D-48BC-9E1A-84B9012F1288", 37.84525, -80.98518, "This is the only campground in the park that is not along the river. It is located on a ridgetop. From Beckley, take Highway 41 to McCreery, cross the river, and continue towards Danese. Turn right onto Backus Mountain Road, drive approximately 1 1/2 miles and turn right at the gravel road (SR 22/7). The campground is on your right approximately 1/2 mile off Backus Road. There are 8 drive-in sites for tents or small RVs.", "War Ridge/Backus Mountain Campground"),
  ("690C7677-FD55-430A-BB36-85410822EB5F", 40.4428300456, -121.394565261, "The campground is located one mile north of Warner Valley Ranger Station via a gravel road and 17 miles north of Chester. Not recommended for trailers. Numerous trailheads are located nearby.", "Warner Valley Campground"),
  ("06226BC6-9AD8-40D8-A9B0-35997490B33D", 47.91621695055476, -89.15457402986016, "Washington Creek Campground is located along Washington Creek near Windigo on the southwest end of Isle Royale, off of the Feldtmann Lake, Minong, and Greenstone Ridge Trails. The Windigo Visitor Center, Windigo Store, and Windigo Comfort Station are all accessible from the campground. Boats can stay at Windigo Dock (average depth at dock 4'-20') or stay and walk .3 miles to campground. Stay Limit: 3 nights from June 1 – September 17 annually Shelters: 10 Access: Foot/canoe/kayak/private boat", "Washington Creek Campground"),
  ("2F950808-AEC8-4AF4-9B87-50BF4C1299BA", 45.9329028831785, -68.7146921403937, "A beautiful primitive backcountry campsite next to Katahdin Brook along the International Appalachian Trail. The campsite is near the Wassataquoik Lean-to and is 0.9 miles from the trailhead at Wassataquoik Gate or 1.4 miles from the Barnard Mountain Trailhead.", "Wassataquoik Campsite"),
  ("6865D5F5-853C-4A07-9CF4-FC9467F37F85", 45.9328416267, -68.7155631045, "A rustic backcountry Lean-to along the International Appalachian Trail near the Wassataquoik Stream. The site is 0.9 miles from the Wassataquoik Gate or 1.4 miles from the Barnard Mountain Trailhead.", "Wassataquoik Lean-to"),
  ("9B6BFDE9-F02F-473C-8826-9531A937758F", 40.6909163, -72.9866, "The family campground at Watch Hill provides a camping experience like no other.", "Watch Hill Family Campground"),
  ("2DEDB733-BCA8-41FF-8E0C-3E676DE620DF", 37.1975852245451, -112.987306895859, "Watchman Campground is located next to the Zion Canyon Visitor Center, ¼ mile away from the South Entrance in Springdale, Utah. Tent and electric campsites are available year-round and group campsites are available from March through November. All sites include a place for a tent or RV, a picnic table, and access to a fire ring. All campsites in Watchman Campground require reservations year-round. Reservations may be made six (6) months in advance.", "Watchman Campground"),
  ("F7CA3802-BD31-4C93-9C3C-A4097B955EE6", 37.5447206588165, -119.672746461794, "The Wawona Campground is located along the South Fork Merced River close to historic Wawona. At an elevation of 4,000 feet (1,219 m), the campground is located in the southern end of the park, 27 miles and approximately 45 minutes from Yosemite Valley. The majestic Mariposa Grove of Giant Sequoias is just a short drive away and the Pioneer History Center is in nearby Wawona where you can see some of the park’s oldest structures. Wawona offers a visitor center and a market.", "Wawona Campground"),
  ("7D57A961-B5E9-4312-9519-21898097AD02", 45.003301, -86.110347, "The Weather Station Campground overlooks Lake Michigan from the bluffs on the south side of the island. Camp sites are well secluded from each other and have fire pits for open fires. Follow the wooded trail past the lighthouse about 1.3 miles to the campground. Bring water filtration equipment since there is no source of purified drinking water. There are 20 individual sites and 3 group sites.", "Weather Station Campground - South Manitou Island"),
  ("A0363A97-D1E8-46F8-A75E-3DF8BC93DC39", 48.063272054903905, -88.72467586394845, "West Chickenbone Campground is located on the west end of Chickenbone Lake, off of the Indian Portage Trail This inland campground has no boater access. Canoe/kayak access from the 1.2 mile portage from McCargoe Cove or the 0.2 mile portage from Lake Livermore. Stay Limit: 2 nights from June 1 – Labor Day annually. Access: Foot/canoe/kayak", "West Chickenbone Campground"),
  ("8EB5A87A-535B-4EDE-8475-AC63B225B1A7", 39.01091, -114.3044, "Located at 9500 Wheeler Peak campground offer a great experience camping at high elevation. Nestled in aspen groves in the shadow of Wheeler Peak templates can be cold even during the summer. Potable water is not available.", "Wheeler Peak Campground"),
  ("35E0D115-7743-49C8-9D9D-3A347BCF41CB", 44.737174, -86.08701, "This camp has 6 sites and is located about 2 miles from the Trail's End Road trailhead on the Platte Plains hiking trail south of Empire just off of M-22 and is about 1/2 mile from the Lake Michigan shore where you can obtain fresh water. There is no well water at White Pine, so if you use water from Lake Michigan, it must be treated before drinking it.", "White Pine Backcountry Campground"),
  ("B491535B-8883-4684-8E34-228E49D01A5C", 46.9024098268932, -121.641814850334, "Located on the eastern side of the park below Sunrise, White River campground takes its name from the river flowing beside it. Tucked into a steep canyon, curves can be tight. When open for the summer, it is always first-come, first-serve. The Wonderland trail runs through the campground on its way up to Sunrise or Summerland.", "White River Campground"),
  ("753ADCCD-0ABC-4D9A-B5E4-BB37572F196E", 39.67753999999999, -78.20979399999999, "Mile 126.4 - There is no driving access to this campsite. There is no fee charged. First come, first served. Stay is limited to one site per night per trip.", "White Rock Hiker-Biker Campsite"),
  ("F825CA55-5923-48FE-B11D-CD55B5F53B88", 33.985738, -116.0166743, "Located off Pinto Basin Road in the northern end of the park, White Tank Campground is nestled among immense granite boulders. All campsites are first-come, first-served. RVs and trailers may not exceed a combined maximum length of 25 feet. There is no water available, bring plenty. White Tank has excellent night sky viewing and is located near the darkest section of the park.", "White Tank Campground"),
  ("2B396150-CB50-4013-AAF2-B862D4FA4823", 37.8703497149, -119.64834666, "White Wolf Campground is located off the Tioga Road between Tuolumne Meadows and Crane Flat, approximately an hour from Yosemite Valley at 8,000 feet (2,400 m). The campground is tucked into the forest about a mile from Tioga Road near White Wolf Lodge. Trailheads nearby lead to Lukens and Harden Lakes and the area is popular for those accessing other wilderness destinations. Minimal services may be available at White Wolf Lodge (if open). There are no other visitor services close to the campground.", "White Wolf Campground"),
  ("938474DC-C66E-4577-A107-0628E0C8E4C0", 37.9701531069231, -122.79068822647832, "Wildcat Campground is located in an open meadow on a bluff overlooking the ocean with a short walk to the beach. One may access Wildcat Campground by foot, bicycle, or horse; not by boat, auto, or RV. It is a 6.3-mile hike from Bear Valley Trailhead or a 5.5-mile hike from the Palomarin Trailhead. The only bicycling route is via a strenuous 6.7-mile ride along the Stewart Trail from the Five Brooks Trailhead. There are five regular (1- to 6-person) sites and three group (7- to 25-person) sites.", "Wildcat Campground"),
  ("833AF1FD-97F4-4CBF-AB54-5963E5A91382", 20.717921296462112, -156.14203614585165, "Located on the island of Maui, Haleakalā National Park maintains three wilderness cabins for visitor use-- Hōlua, Palikū, and Kapalaoa. All cabins are accessible only by trail from the summit area and require you to hike a minimum of 3.7 mi (5.9 km).", "Wilderness Cabins"),
  ("60A9F911-9C8C-4B0E-91F0-DA9803B46794", 31.99784003435671, -104.77031431515502, "A wilderness use permit is required for all use of these campsites. An interesting hike along the Permian Reef trail meanders up 2,000 feet to Wilderness Ridge where the sudden transition from rock to trees is refreshing. Once on top, the trail is level through forested and open areas and takes you to the edge of the escarpment where the view is outstanding. Wilderness Ridge campground is in the trees, and worth the extra distance to save the resource from unnecessary damage.", "Wilderness Ridge Wilderness Campground"),
  ("87CACD0F-E22C-4DED-9CA5-B6E1F08857CE", Null, Null, "This 160 site campground is located approximately 3 miles from the park visitor center off of Highway 58 in Virginia. 20, 30 and 50 amp electrical hookups are available at 41 of the sites. Hot showers and potable water are located in the comfort stations. Camping rigs up to 50 feet can be accomodated. Sites are accessed through paved loop roads. Most of the sites require backing in with the exception of one pull through site. Campsites are available on a first-come, first-serve basis", "Wilderness Road Campground"),
  ("23161602-35FD-4E07-BD8C-8AF7012423A0", 20.73951720216006, -156.2186197874393, "There are two primitive wilderness tent areas which are accessible only by trail, Hōlua and Palikū.", "Wilderness Tent Sites"),
  ("322E9FDF-A46A-4C15-A726-99DA7113764A", 36.2658396358283, -117.188544129679, "First come / first served campground with no additional fee high in the Panamint Mountains. Located at an elevation of 4100 ft / 1250 meters. No hook-ups available. Generators allowed 7am - 7pm. This area is prone to high winds. Sites are dirt and gravel surrounded by Mesquite bushes and rolling hills.", "Wildrose Campground"),
  ("2CDFC89A-7CC5-4601-97BF-E8F86EB9E3C1", 35.87336335576787, -114.6521633431546, "Willow Beach Campground offers 9 tent campground sites and is located just 30 minutes from Boulder City and 45 minutes from the Las Vegas strip. With its unique location, the park offers scenic views of the Colorado River, Black Canyon, as well as the mountain and desert landscapes in the distance. Enjoy a variety of water activities on Lake Mead and Lake Mohave, hike on the many trails in the recreation area, tour the Hoover Dam, or head to Las Vegas for some nightlife entertainment.", "Willow Beach Campground (Lake Mohave)"),
  ("E8C3E388-D8B0-49DD-B44D-EAFA3009A380", 35.87336335576787, -114.65216334315461, "Willow Beach RV Park is your full-service RV Park and tent campground located just 30 minutes from Boulder City and 45 minutes from the Las Vegas strip. With its unique location, the park offers scenic views of the Colorado River, Black Canyon, as well as the mountain and desert landscapes in the distance. Enjoy a variety of water activities on Lake Mead and Lake Mohave, hike on the many trails in the recreation area, tour the Hoover Dam, or head to Las Vegas for some nightlife entertainment.", "Willow Beach RV Park"),
  ("D4F65C49-97B3-46B3-93DD-3B13430C2608", 63.45398217678673, -150.86162174852063, "Wonder Lake Campground is closed through 2024. Wonder Lake Campground is at mile 85 on the Denali Park Road. It offers 28 tent-only sites. It is the closest campground to Denali. Though separated by nearly 26 miles, the sheer size of the mountain makes it loom impressively over Wonder Lake Campground. Cloudy skies can obscure views, and mosquitoes can be fierce, but Wonder Lake on a clear day offers views that will last a lifetime. Bear-proof food lockers are available throughout the campground.", "Wonder Lake"),
  ("A1EAF11C-75D8-484B-8BB2-985F61951BAD", 48.00853512034862, -88.73960933467993, "Wood Lake Campground is located inland on the north shore of Wood Lake. Wood Lake can be accessed via a .6 mile portage from Lake Whittlesey or from Siskiwit Lake. Stay Limit: 2 nights from June 1 – Labor Day annually. Access: Canoe/kayak. No private boat access.", "Wood Lake Campground"),
  ("B94FE8B9-2EF1-4464-A2E1-5803C9AE7648", 35.9703114997, -92.8805197992, "Woolum Campground is a large open field at the Woolum access to the Buffalo River near St. Joe AR. There are no amenities at Woolum. There are no designated sites. A vault toilet is available. Fees are not charged at Woolum. Woolum serves as overflow when Tyler Bend campground is full.", "Woolum"),
  ("CCDC908D-4B98-46C9-83BB-AFE6EF2E9869", 30.8492, -81.4478, "Yankee Paradise is one of three campgrounds in Cumberland Island’s designated wilderness on the northern part of the island. The campsite is located 7.5 miles north of the Sea Camp dock. Wilderness sites have no amenities. Fires are prohibited, but camp stoves can be used for cooking. Campers should be prepared to hang all food and trash. Water is available from a nearby well and must be treated. Permits are $9 a night, good for up to 6 people.", "Yankee Paradise Wilderness Campsite"),
  ("025AFF52-097D-4754-8952-5A554386CE62", 37.82629400382813, -119.59833337699251, "Yosemite Creek Campground is located nearly 5 miles off the Tioga Road (via a rough road) 26 miles west of Tuolumne Meadows, and a little over an hour from Yosemite Valley. Located in the forest at 7,700 feet (2,300 m) many campsites are close to Yosemite Creek, which is the only water source (must be filtered, treated, or boiled). RVs and Trailers are not recommended for this harder to access, and more primitive campground. There are no visitor services close to the campground.", "Yosemite Creek Campground");
